(72784, 'koKR', '코발트 전당 지원', '코발트 전당에 있는 벤티와 대화해야 합니다.', '$n 님, 때마침 잘 오셨어요.\n\n혹시 코발트 전당이라고 들어보셨습니까? 한때 제 동족 상당수가 살았던 멋진 장소죠.\n\n그런데 분리된 불길이 우리 동족을 몰아내고 대신 들어앉았습니다. \n\n잘하면 탈환할 수 있지 않을까 하는 바람이 있었는데, 얼마 전 들어온 정보를 보면 패색이 짙은 모양입니다. \n\n가서 지원해 주실 수 있겠습니까? 코발트 전당에서 벤티를 만나 보세요.', '', '', '', '', '', '코발트 전당에 있는 벤티와 대화해야 합니다.', 47187),
(72783, 'koKR', '주문 제작', '수석 사무원 밈지 스프래즐록을 찾아가 주문 제작에 관해 대화해야 합니다.', '티탄 장치에 꽤 근사한 물건이 들어 있었군요. 이제 이리 내놓으시죠!\n\n장난이에요! 애초에 전 그거 쓰는 법도 모르는걸요.\n\n밈지 스프래즐록 님하고 얘기해 보세요. \"주문 제작\"이라고 사람들에게 일거리를 알선해주는 장소를 마련했더라고요.\n\n재료를 올려 놓으면 다른 누가 가져가서 물건을 만들어 준다, 이 말씀이죠. \n\n간단하지 않나요? 얼른 가서 말씀 나눠 보세요! 제가 보냈다고 말하면 돼요.', '', '', '', '', '', '', 47187),
(72773, 'koKR', '창의성 학습', '발드라켄에서 그레이직 코블핑거를 만나야 합니다.', '발드라켄에 일련의 고블린 무리가 나타나 어느 버려진 티탄 장치를 조사하고 있습니다.\n\n솔직히 말해 심한 소란을 일으키고 있죠. 몇몇 주민들은 고블린의 조사가 큰 해악을 끼칠까 봐 염려하고 있습니다.\n\n고블린들 만나 조사에 돌파구를 찾아봐 주실 수 있겠습니까? 발드라켄 주민들도 고맙게 생각할 겁니다.\n\n물론 도시를 부수지 않고요.', '', '', '', '', '', '발드라켄에서 그레이직 코블핑거를 만나야 합니다.', 47187),
