(72729, 'koKR', '위대한 뿔두꺼비', '온아라 평야의 위대한 뿔두꺼비에게 녹슨 섬의 동전을 가져가야 합니다.', '<용의 섬에서 별안간 특이하게 생긴 동전을 낚았습니다.\n\n강태공 연합 동료에게 전해 들은 풍문으로는 온아라 평야에 그런 물품을 수집하는 존재가 있다고 합니다.>', '', '', '', '', '', '', 47187),
(72728, 'koKR', '세상이 기다린다', '용의 섬에서 전역 퀘스트 10개를 완료해야 합니다.', '진정한 강함의 증거가 뭔지 아십니까? 용의 섬 공동체를 돕는 겁니다!\n\n문제는 산더미처럼 쌓여 있어요. 주민들을 도와 용사님의 강함을 보여주세요!', '', '', '', '', '', '', 47187),
(72709, 'koKR', '보물사냥 후원', '분류학자 제이크스에게서 고고학자의 유물 일지를 구매해야 합니다.', '<자신의 보급품 배낭을 빠르게 뒤적여 그린 지 얼마 안 된 지도를 꺼내는 분류학자 제이크스>\n\n얼마 전 원정대 고고학자가 잃어버린 유물과 관련해 새로 알아낸 사실을 보고했어요. 이 지역에 있는 걸로 추정된다더군요.\n\n고고학자의 다음 원정에 보급품을 지원해 주시면 이 지도를 드릴게요. 인근 보물의 위치가 기록되어 있는 지도예요.', '', '', '', '', '', '', 47187),
(72708, 'koKR', '용의 섬 보급품', '날개쉼터 대사관에 있는 분류학자 제이크스에게 용의 섬 보급품 가방을 전달해야 합니다.', '<아무래도 원시용이 지독하게 불행한 용비늘 원정대원에게서 이 보급품 배낭을 강탈한 모양입니다.\n\n날개쉼터 대사관에 있는 분류학자 제이크스에게 전달하면 알아서 처리할 것입니다.>', '', '', '', '', '', '날개쉼터 대사관에 있는 분류학자 제이크스에게 용의 섬 보급품 가방을 전달해야 합니다.', 47187),
