(72686, 'koKR', '용솟음치는 폭풍', '정령 폭풍에서 정령의 힘이 깃든 생명체를 처치하고 넘치는 정기를 수집해야 합니다.', '$n 님, 원시술사들이 용의 섬 전역에 매서운 정령 폭풍을 일으켰습니다.\n\n폭풍이 몰아칠 때 안에 진입해 정기가 깃든 생명체를 처치해 주십시오. \n\n죽은 적의 시체에서 넘치는 정기를 얻을 수 있을 겁니다. 강한 적일수록 더 많이 얻을 수 있다는 걸 명심하시길.\n\n원시술사들의 정기가 아무런 견제 없이 타락을 흩뿌리게 두어선 안 됩니다.', '', '', '', '', '', '', 47187),
