(72648, 'koKR', '생명의 불꽃: 하늘빛 평원', '전쟁 모드 중 하늘빛 평원에서 생명의 불꽃 $1oa개를 수집해야 합니다.', '밀려드는 파도가 하늘빛 평원에 생명의 은총을 가져왔습니다.\n\n친구와 가족, 맛있는 음식, 새로운 이야기의 시간이 돌아왔습니다.', '', '', '', '', '', '발드라켄에서 야전감독관 엠버라스와 대화해야 합니다.', 47187),
