(72585, 'koKR', '공개 안내', '각 주요 진영 중심지인 용비늘 기지, 마루카이, 이스카라, 발드라켄에서 안내 퀘스트를 완료해야 합니다.', '용의 섬이 용사님께 큰 은혜를 입었습니다. \n\n용사님의 공헌에 감사하며 어엿한 공동체의 일원으로 받아들이고 싶어 하는 이들이 많습니다. 각 집단을 만나 안내를 받고 특기를 알아보세요. \n\n용사님이 용의 섬에 큰 힘이 되어준 것처럼, 이곳의 수많은 이들이 보답으로 큰 힘이 되어줄 수 있을 겁니다!', '', '', '', '', '', '', 47187),
(72584, 'koKR', '나만의 낚시 그물', '하구 낚시 구멍에 낚시 그물을 설치해야 합니다.', '그물을 사용해 보고 싶으세요? 깨어나는 해안 남쪽에 있는 강 하구로 가보세요. 물고기가 많은 자리를 찾아 설치하면 됩니다. 분명 좋은 지점이 있을걸요.', '', '', '', '', '', '', 47187),
(72560, 'koKR', '등반', '', '', '', '', '', '', '', '', 47187),
(72525, 'koKR', '기본 분류 장비', '원정대 표준 보급품을 사용해 분류 장비를 연구해야 합니다.', '원정대 분류학자라면 사진기 한 대쯤은 있어야 해요!\n\n특별한 이름을 붙여줘야 한다는 법은 없지만, 그래도 권장하고 싶네요. 그게 또 색다른 묘미거든요.\n\n아무튼 길잡이 제브가 필요한 준비물을 챙겨줄 거예요.\n\n준비성이 얼마나 철저한지 없는 게 없다니까요. 대단한 양반이에요!', '', '', '', '', '', '', 47187),
(72524, 'koKR', '기본 등반 장비', '원정대 표준 보급품을 사용해 등반 장비를 연구해야 합니다.', '<옆에 있는 보급품을 가리키는 길잡이 제브>\n\n저 바깥에서 살아 남으려면 보급품이 필요할 거예요.\n\n등반에 필요한 물건을 챙겨드리죠.', '', '', '', '', '', '', 47187),
(72519, 'koKR', '시공간의 2인조', '아즈메로스에서 이터누스와 크로미에게 시간 수정을 사용해 시간 속으로 빠져들지 않도록 방지해야 합니다.', '그렇군... 시간과 가능성 사이로 추락하고 있는 거였어. \n\n서둘러라. 시간의 길을 살펴 둘을 받아낼 수 있는 지점을 새로 찾아두었다. 조금... 독특한 감이 있지만, 세상의 기묘함에 정신이 팔려선 아니 된다. 크로노르무의 운명이 네 손에 달렸다.', '', '', '', '', '', '현재에 있는 노즈도르무에게 가야 합니다.', 47187),
(72512, 'koKR', '속삭이는 산들바람', '온아라의 보금자리에 있는 온아라에게 다가가야 합니다.', '<고돌로토가 의아한 듯 고개를 까딱이더니 당신을 보고 고개를 끄덕입니다. 그리고 마침내 시선을 마주칩니다. 긴 정적이 흐른 후, 고돌로토가 하늘을 올려다보는가 싶더니... 마루카이 바로 옆 산으로 고개를 돌립니다. 온아라의 보금자리로 가보라는 것 같습니다.>', '', '', '', '', '', '온아라의 보금자리에 있는 온아라에게 다가가야 합니다.', 47187),
(72488, 'koKR', '탈드라서스 고급 경주로 순회', '탈드라서스의 모든 고급 경주로를 비행해야 합니다.', '탈드라서스의 봉우리와 계곡으로 다시 한번 날아가라. 경주로가 기다린다! \n\n내 청동용 동료들을 찾아 고급 경주로를 통과하고, 용의 섬 경주를 완주하는 거다!', '', '', '', '', '', '', 47187),
(72487, 'koKR', '탈드라서스 경주로 순회', '탈드라서스의 모든 경주로를 비행해야 합니다.', '탈드라서스. 위상의 권좌가 위치한 거점이자, 용족의 유구한 역사가 살아 숨 쉬는 곳이지. \n\n드높은 고원과 가파른 협곡이 가득해 비행하고 싶은 마음이 샘솟기도 하지!\n\n늘 그렇듯 내 청동용 동료들이 탈드라서스에 경주로를 만들어 두었다. 탐험 중에 찾거든 도전해 보거라. \n\n용의 섬 경주를 완전히 완료해보는 건 어떻겠나?', '', '', '', '', '', '', 47187),
(72486, 'koKR', '하늘빛 평원 고급 경주로 순회', '하늘빛 평원의 모든 고급 경주로를 비행해야 합니다.', '하늘빛 평원의 고급 경주로는 용 조련술 실력을 한 차원 끌어올릴 목적으로 설계됐다. \n\n다만... 추락하지 않게만 조심하도록.\n\n준비되면 내 청동용 동료들을 찾아라. 경주에 도전하는 거다!', '', '', '', '', '', '', 47187),
(72485, 'koKR', '하늘빛 평원 경주로 순회', '하늘빛 평원의 모든 경주로를 비행해야 합니다.', '하늘빛 평원 경주로는 색다른 경험을 선사하지. 높은 봉우리, 눈 덮인 평원, 오밀조밀한 숲은 흥미로운 장애물로 부족함이 없다. 난이도도 상당하고 말이야!\n\n하늘빛 평원에 가거든 내 청동용 동료들을 찾아 경주에 도전해 보도록!', '', '', '', '', '', '', 47187),
(72484, 'koKR', '온아라 평야 고급 경주로 순회', '온아라 평야의 모든 고급 경주로를 비행해야 합니다.', '고급 경주로는 높은 난이도를 염두에 두고 구성됐지만, 네 실력이라면 아무것도 아닐 거다!\n\n내 청동용 동료들이 온아라 평야에 고급 경주로를 마련해 두었다. 장애물 몇 가지와 깜짝 요소를 추가했지. 최고 기록 경신에 도전해 보거라!\n\n행운을 빌지!', '', '', '', '', '', '', 47187),
(72483, 'koKR', '온아라 평야 경주로 순회', '온아라 평야의 모든 경주로를 비행해야 합니다.', '아, 온아라 평야라. 탁 트인 개활지, 몰아치는 돌풍, 끝없는 풍경... 그리고 더 많은 경주로들까지!\n\n깨어나는 해안처럼 내 청동용 동료들을 찾거든 경주로에 관해 물어보도록.', '', '', '', '', '', '', 47187),
(72482, 'koKR', '깨어나는 해안 고급 경주로 순회', '깨어나는 해안의 모든 고급 경주로를 비행해야 합니다.', '용의 섬 전역의 기본 경주로를 통과해 실력을 증명했으니, 이번에는 새로운 도전에 임하지 않겠나?\n\n고급 경주로 대다수는 표준 경주로와 비슷하지만, 비행 경로에 변화를 주거나 장애물을 추가해 실력을 시험하도록 만들어졌다.\n\n깨어나는 해안 경주로부터 시작하도록 하지!', '', '', '', '', '', '', 47187),
(72481, 'koKR', '깨어나는 해안 경주로 순회', '깨어나는 해안의 각 경주로를 비행해야 합니다.', '용 조련술의 진정한 재미가 어디서 나오는 줄 아느냐? 바로 경주다!\n\n내 청동용 동료들이 용의 섬 전역에 경주로를 만들어 두었다. 다채롭고 역동적인 경관이 앞에 있는데, 이걸 쾌속의 속도로 탐험하지 않으면 그거야말로 섭리에 어긋나는 것이지.\n\n깨어나는 해안에서 경주로를 찾거든 한번 도전해보지 않겠느냐?', '', '', '', '', '', '', 47187),
(72456, 'koKR', '신뢰의 고서', '흑요석 계보를 회수한 후 래시온 및 사벨리안의 병참장교에게 전달해야 합니다.', '흑요석 성채 위쪽 성루는 확보했지만, 안뜰엔 여전히 자라딘 병력이 활보하고 있습니다. 거긴 더없이 소중한 역사 기록이 가득하단 말입니다! 검은용군단의 계보에 대한 문서를 하나라도 확보하려면 서둘러야 합니다.\n\n래시온과 사벨리안 양쪽이 모두 원하는 정보이니, 원하는 쪽에 서적을 가져가면 환심을 살 수 있을 겁니다.\n\n성채의 무너진 탑에 회수할 만한 게 남았을 겁니다.', '', '', '', '', '', '', 47187),
(72448, 'koKR', '유산 확보', '흑요석 성채 또는 잿가루 수렁에서 희귀한 적 2마리를 처치해야 합니다.', '어떻게 해서 여기까지 왔는데, 이제 와서 성채를 잃을 수는 없다! \n\n불행하게도 새 위협이 나타났으니, 네게 상대를 맡기고 싶구나. \n\n일대를 장악하고, 가장 강한 적 둘을 찾아 제거해라.', '', '', '', '', '', '', 47187),
(72447, 'koKR', '최대의 위협', '흑요석 성채 또는 잿가루 수렁에서 희귀한 적 2마리를 처치해야 합니다.', '강력한 자라딘을 비롯한 무리가 흑요석 성채와 내 용군단의 안위를 위협하더구나.\n\n두고 볼 수만은 없다. \n\n일대를 장악하고, 가장 강한 적 둘을 찾아 제거해라.', '', '', '', '', '', '', 47187),
(72435, 'koKR', '안내: 이스카라', '귀중한 물품을 취급하는 몇몇 상인을 살펴봐야 합니다.', '이스카라에 오신 것을 환영합니다, 친구. \n\n담쟁이가죽 골짜기 사건 덕분에 벌써 당신 소문이 자자합니다. 이미 만나본 사람도 많으시겠지만, 아직 인사 나누고 거래를 틀 사람도 많이 남아 있습니다. \n\n잠시 이스카라를 둘러보면서 좋은 사람들을 만나보시기를 바랍니다. 저희는 서로를 돌봐주는 공동체이니, 당신이 주시는 만큼 저희도 많은 것을 드릴 수 있으리라 생각합니다.', '', '', '', '', '', '', 47187),
(72434, 'koKR', '루비 생명의 제단 윤환로', '루비 생명의 제단 윤환로 경주를 완료해야 합니다.', '어떤 경주는 나중에 더 크고 참가할 수 있대요. \n\n하지만 다른 사람 경주를 보는 건 되겠죠? 제가 볼 수 있게 경주에 나가주세요!', '', '', '', '', '', '루비 생명의 제단 윤환로 경주를 완료해야 합니다.', 47187),
(72429, 'koKR', '안내: 마루카이', '마루카이 영예의 수호자와 영예 병참장교를 만나야 합니다.', '<산소크 칸의 손짓에 따라 말하는 오키르>\n\n마루크 민족은 외부인을 배척하지 않는다. 하지만 우리의 아군이 될 자라면 제 능력을 증명해야 한다. 여러 부족을 만나 문제를 돕다 보면 너를 지지하는 목소리도 퍼질 것이다.\n\n언덕에 있는 크루탈 하층으로 가서 카남 마트라의 딸을 찾으면 우리 사람들 사이에 네 평판을 확인할 수 있다. 가서 인사를 나눠라.', '', '', '', '', '', '', 47187),
(72428, 'koKR', '비축꾼 용뿔두꺼비', '용의 섬의 용뿔두꺼비에게서 신랄한 보석 20개를 입수한 후 용비늘 원정대의 노클린 쿼크코일에게 가져가야 합니다.', '용의 섬에 서식하는 용뿔두꺼비가 보석이나 장신구처럼 반짝이는 물건에 사족을 못 쓴다는 건 공공연한 비밀이죠. 사실 저도 용뿔두꺼비가 엄청나게 희귀한 보석을 배설한 걸 본 적 있을 정도고요!\n\n음, 썩 유쾌한 일은 아니지만... 용뿔두꺼비는 귀중품을 수집할 뿐만 아니라 섭취하는 기질도 있는 듯하더군요.', '', '', '', '', '', '', 47187),
(72427, 'koKR', '살아 움직이는 주입물', '용의 섬의 덩굴손에게서 쐐기 나뭇잎 13개를 입수한 후 마루크 켄타우로스 더렐에게 가져가야 합니다.', '오늘 요청은 간단하다.\n\n연금술사들이 쓸 재료가 부족하다. 특히 까다로운 혼합물을 만드는 데 필요한 물건이지. 약초 자체는 귀하기 쉬운 편이야. 공격성을 띠는 식물을 찾아 표본을 채취하면 된다. 감당할 수 있겠나?', '', '', '', '', '', '', 47187),
(72423, 'koKR', '폭풍을 견디다', '용의 섬의 노쿠드 켄타우로스에게서 뇌우의 병기 12개를 입수한 후 이스카라 투스카르의 템나유에게 가져가야 합니다.', '아, 딱 맞춰 오셨군요! 노쿠드 켄타우로스가 폭풍 마법부여가 깃든 강력한 무기를 보유하고 있다는 이야기를 들었습니다. 마법부여사들이 연구할 수 있도록 표본을 좀 가져오고 싶습니다. \n\n하다못해 무기를 해체해서 다른 좋은 일에 쓸 수도 있고 말이에요.', '', '', '', '', '', '', 47187),
(72410, 'koKR', '집게발과 바늘', '용의 섬의 사이시드에게서 뾰족 집게발 10개를 입수한 후 용비늘 원정대의 노클린 쿼크코일에게 가져가야 합니다.', '요즘 재봉술에 쓸 바늘이 부족해서 고민이에요. 걸핏하면 반으로 부러지니 원!\n\n이 지역 사이시드의 뾰족한 부위를 대체품으로 쓸 수 있을 거예요.', '', '', '', '', '', '', 47187),
(72406, 'koKR', '안내: 발드라켄', '발드라켄에서 중요 협의회 보급원을 만나야 합니다.', '발드라켄에 오신 것을 환영합니다, $p 님. 전 발드라켄 협의회 영예의 수호자 우나토스입니다.\n\n용사님은 용군단에 적극적으로 협조해주셨죠. 그 노고를 인정해 도시의 여러 보급원에게 최상급 제품을 제공해도 좋다는 허가가 내려왔습니다.\n\n이참에 보급원들 위치와 취급 상품을 살펴보시는 게 어떨까요?', '', '', '', '', '', '', 47187),
(72399, 'koKR', '은둔자의 정원', '어둠 절벽 지대에서 사레스와 대화해야 합니다.', '부모님은 항상 겔리키르 위쪽 정원에 들어가면 안 된다고 말씀하셨어요. 아주 못되고 위험한 정원사가 산다고요.\n\n하지만 사실 그렇지 않아요! 좀 괴팍하긴 하지만 좋은 사람이거든요! \n\n그런데 원시술사들이 나타난 뒤로는 너무 위험해져서 올라가 본 사람이 없어요. 정원사가 괜찮은지 모르겠어요. 저희는 갈 수 없으니, 대신 확인해 주시겠어요?', '', '', '', '', '', '', 47187),
(72397, 'koKR', '안내: 용비늘 기지', '용비늘 기지의 중요 보급원을 만나야 합니다.', '$p, 기지에 오신 것을 환영합니다.\n\n토디랑 어디가 최적의 장소인가 싸우느라 꽤 걸렸지만, 끝나고 보니 아주 마음에 듭니다.\n\n유적이랑 원시용 번식지, 게다가 용군단까지 접근하기 쉬운 곳이니 말입니다.\n\n잠깐 여유를 가지고 주둔지를 둘러보겠습니까? 원정을 돕는 보급원도 만나 보십시오.', '', '', '', '', '', '용비늘 기지 막사에서 토디 위스커스를 만나야 합니다.', 47187),
