(72383, 'koKR', '마루크 켄타우로스', '토르톨란 전역 퀘스트 3개를 완료해야 합니다.', '전역 퀘스트 3개를 완료하여 토르톨란을 도와야 합니다.', '', '', '', '', '', '수집가 코조에게 돌아가야 합니다.', 47187),
(72382, 'koKR', '이스카라 투스카르', '토르톨란 전역 퀘스트 3개를 완료해야 합니다.', '전역 퀘스트 3개를 완료하여 토르톨란을 도와야 합니다.', '', '', '', '', '', '수집가 코조에게 돌아가야 합니다.', 47187),
(72381, 'koKR', '용비늘 원정대', '토르톨란 전역 퀘스트 3개를 완료해야 합니다.', '전역 퀘스트 3개를 완료하여 토르톨란을 도와야 합니다.', '', '', '', '', '', '수집가 코조에게 돌아가야 합니다.', 47187),
(72380, 'koKR', '함께할 때 우리는 무적이다', '위상의 권좌로 돌아가 알렉스트라자에게 현신의 금고에서 라자게스를 쓰러뜨린 후 무슨 일이 있었는지 알려야 합니다.', '$n, 알렉스트라자 님과 노즈도르무 님께 여기서 무슨 일이 있었는지 전하세요.\n\n전 잠시 후에 카드가와 함께 위상의 권좌로 합류하겠습니다.', '', '', '', '', '', '발드라켄 위상의 권좌에 있는 생명의 어머니 알렉스트라자에게 가야 합니다.', 47187),
(72374, 'koKR', '협의회 지원: 용의 파멸 성채', '깨어나는 해안으로 가서 용의 파멸 성채를 함락시켜야 합니다. 용의 섬 전역에서 지속적으로 발드라켄 협의회와 동맹을 지원해야 합니다.', '섬에서 할 일은 아직도 많은데, 이 와중에 동맹이 다시 한번 지원을 요청해 왔습니다. 발드라켄 내부적으로는 당신 덕택에 장래가 밝아졌다는 얘기가 나올 정도죠.\n\n자, 아무튼 본론으로 넘어갑시다.\n\n위협적인 자라딘 잔당이 깨어나는 해안 깊은 곳에 있는 용의 파멸 성채에서 준동하고 있습니다. 그야말로 이글거리는 불지옥이 따로 없죠. 이자들의 진군을 방해해야 합니다.\n\n그럼 $n 님의 귀환을 기다리겠습니다.', '', '', '', '', '', '', 47187),
(72373, 'koKR', '협의회 지원: 사냥의 시작', '용의 섬에서 마루크의 사냥을 도와야 합니다. 용의 섬 전역에서 지속적으로 발드라켄 협의회와 동맹을 지원해야 합니다.', '온아라 평야의 동맹이 전갈을 보냈습니다. 일종의 요청인데, 이 땅의 사냥꾼 모두에게 대의에 협조해 달라는 내용이었습니다.\n\n섬을 모험할 때 우리 동맹의 사냥 야영지를 찾아가 힘을 보태주셨으면 합니다.\n\n할 일이 많습니다. 지금은 지체할 때가 아닙니다.', '', '', '', '', '', '', 47187),
(72372, 'koKR', '용...족 길들이기', '', '', '', '', '', '', '', '', 47187),
(72364, 'koKR', '자리즈', '', '', '', '', '', '', '', '', 47187),
(72363, 'koKR', '행동이 앞서는 편', '', '', '', '', '', '', '', '', 47187),
(72358, 'koKR', '폭포수', '', '', '', '', '', '', '', '', 47187),
(72354, 'koKR', '위대한 금고', '위대한 금고에서 전리품을 입수해야 합니다.', '지난 세월 위상과 그 동족은 걸출한 유물과 병기를 모았습니다. 위상들은 자격을 갖춘 영혼이 찾아올 때까지 물건들을 안전히 보관할 마법 금고의 건설을 명령했지요.\n\n그 위대한 금고는 은행 안에 있습니다. 만약 당신이 자질을 증명한다면 위상들이 먼 옛날부터 축적한 보고에서 보물을 받을 수 있을지도 모릅니다.', '', '', '', '', '', '', 47187),
(72338, 'koKR', '상급 흑요석 열쇠', '완성한 열쇠 $1oa개를 입수해야 합니다.', '완성한 열쇠를 가져오거라.', '', '', '', '', '', '흑요석 성채에 있는 어느 한 진영에 완성한 열쇠를 반납해야 합니다.', 47187),
