(72298, 'koKR', '발드라켄 협의회', '토르톨란 전역 퀘스트 3개를 완료해야 합니다.', '전역 퀘스트 3개를 완료하여 토르톨란을 도와야 합니다.', '', '', '', '', '', '수집가 코조에게 돌아가야 합니다.', 47187),
