(72293, 'koKR', '용의 섬 모험', '정찰 지도를 살펴보고 용의 섬에서 지원할 지역을 선택해야 합니다.', '아, 마침 해주실 일이 있습니다!\n\n용비늘 원정대에서 아주 상세한 용의 섬 지도를 마련해뒀더군요. \n\n제가 보기에도 꽤 세밀하고 정확합니다. 아, 죄송합니다. 지도 품평을 들으려고 말을 거신 게 아닐 텐데.\n\n한번 지도를 확인해 보십시오. 용의 섬에서 어떤 지역에 도움이 필요한지 확인하실 수 있을 겁니다!', '', '', '', '', '', '', 47187),
(72292, 'koKR', '환상적인 승리의 이야기', '이스카라의 장로 포아에게 무용담을 들려줘야 합니다.', '<가슴이 웅장해지는 전투였습니다! \n\n이스카라의 장로 포아가 이 환상적인 무용담에 관심을 보일 것입니다.>', '', '', '', '', '', '', 47187),
(72291, 'koKR', '추억할 만한 승리의 이야기', '이스카라의 장로 포아에게 무용담을 들려줘야 합니다.', '<훌륭한 전투였습니다! \n\n이스카라의 장로 포아가 이 무용담에 관심을 보일 것입니다.>', '', '', '', '', '', '', 47187),
