(72269, 'koKR', '탈드라서스', '발드라켄으로 이동해 생명의 어머니 알렉스트라자를 만나야 합니다.', '생명의 어머니 알렉스트라자가 원시술사의 위협을 논하고자 위상의 권좌에서 회합을 준비하고 있습니다.\n\n더불어 도울 생각이 있는 모험가라면 누구든 환영한다고 합니다.', '', '', '', '', '', '발드라켄으로 이동해 생명의 어머니 알렉스트라자를 만나야 합니다.', 47187),
(72268, 'koKR', '하늘빛 평원', '온아라 평야에서 현자 마수드와 대화해야 합니다.', '키린 토가 푸른용 서약의 돌 추적을 도울 사람을 모으고 있습니다.\n\n온아라 평야에서 도와줄 사람을 찾는 마법사가 몇몇 목격됐다고 합니다.', '', '', '', '', '', '', 47187),
(72267, 'koKR', '온아라 평야', '루비비늘 전초기지에서 대사 타우라자를 만나야 합니다.', '녹색용군단은 모험가의 지원이 필요합니다. 그러려면 평야의 켄타우로스와 연대하는 게 우선입니다.\n\n대사 타우라자에게 도움을 받으십시오.', '', '', '', '', '', '', 47187),
(72266, 'koKR', '깨어나는 해안', '깨어나는 해안에서 센드락스를 만나야 합니다.', '용기병 센드락스가 깨어나는 해안에 새로 도착한 이들을 도와줄 인원을 물색하고 있습니다.', '', '', '', '', '', '', 47187),
(72263, 'koKR', '기병대의 자리', '전용 보르퀸 탈것 타는 법을 배워야 합니다.', '기원사님! 보르퀸이 아직 서식하고 있더군요!\n\n탈것으로 쓸 만한 녀석을 몇 마리 모아두었습니다. 날개가 뻐근할 때 사용하시죠. 탈것을 타는 방법은 기억하십니까?\n\n비늘사령관님들의 명령을 받아 분주히 돌아다니셔야 하는 몸인 만큼, 이 탈것을 드리겠습니다. 잘 보살펴 주시길.', '', '', '', '', '', '', 47187),
(72261, 'koKR', '감옥 그 이상?', '릴리안 브라이트문에게 고대의 금고 유물을 가져가야 합니다.', '<정기의 성질을 타고난 것으로 보이는 고대의 유물입니다. 발드라켄의 릴리안 브라이트문에게 보여주면 자세한 설명을 들을 수 있을 것입니다.>', '', '', '', '', '', '', 47187),
(72260, 'koKR', '금고 유물', '', '', '', '', '', '', '', '', 47187),
(72259, 'koKR', '금고 유물', '', '', '', '', '', '', '', '', 47187),
(72256, 'koKR', '검은 갈퀴발톱', '코데시와 검은 갈퀴발톱에게 비늘사령관의 명령을 전달해야 합니다.', '날레디아는 열정은 있지만, 본분은 역사가다. 군인은 아니지. 용의 섬에서 마주하게 될 위험에 관해서는 아무것도 몰라.\n\n물론 누가 됐든 그런 걸 신경 쓸 이유는 없다. 우리 검은 갈퀴발톱이 원정대를 보호할 테니까.\n\n난 에비시안과 그대 호드의 지도자들을 만나 임무 수행 계획을 논의하도록 하겠다.\n\n지금쯤 내 부관 코데시가 드랙티르 동지들과 도시를 둘러보고 있을 거다. 부탁이니 비행선 탑승장으로 집결하라고 전해다오. 알아서 나머지 병사들에게 전파할 거다.', '', '', '', '', '', '오그리마 바깥 비행선 탑승장에서 날레디아를 만나야 합니다.', 47187),
