(72246, 'koKR', '평온의 꿈', '온천 관리자와 대화해야 합니다.', '평온의 꿈 온천에 오신 것을 환영합니다!\n\n우선 사과의 말씀부터 드리겠습니다. 걷잡을 수 없는 문제가 생겨 지금은 새 손님을 접수하기 어렵습니다!\n\n대신 온천 관리자 시잔 쏜포우 님을 소개해 드리죠. 모든 질문에 답해드릴 거예요.', '', '', '', '', '', '', 47187),
