(72244, 'koKR', '용의 섬 주문각인', '', '', '', '', '', '', '', '날개쉼터 대사관에서 제사민 스핏츠와 대화해야 합니다.', 47187),
(72243, 'koKR', '용의 섬 약초채집', '', '', '', '', '', '', '', '', 47187),
