(72241, 'koKR', '과거의 교훈', '비늘사령관 엠버탈과 대화해야 합니다.', '나는 드랙티르 비늘사령관 엠버탈이라고 한다. 래시온이 오랜 시간 정지장에 갇혀 있다 막 깨어난 우리를 도와줬으니, 이번에는 내가 도와줄 차례겠지.\n\n우리 종족이나 역사에 대해 궁금한 게 많겠군. 나도 얼마 전까지는 같은 심경이었다. \n\n하지만 시간의 지배자 노즈도르무께서 드랙티르의 진실을 보여주셨지. 우리의 기원이 담긴 환상을 보여주셨고... 왜 우리가 감금당했는지도 알 수 있었다. \n\n내가 뭘 봤는지 알려주지.', '', '', '', '', '', '', 47187),
(72240, 'koKR', '흑요석 수호병단', '더비시안과 흑요석 수호병단에게 비늘사령관의 명령을 전달해야 합니다.', '이 토디라는 자의 열정은 존경스럽군. 하지만 그 열정에 눈이 멀어 용의 섬에 산적한 위험에 흐린 눈을 뜨진 않기를 바랄 뿐이야.\n\n상관없다. 우린 흑요석 수호병단이 아닌가. 원정대를 지키는 것이 곧 우리의 의무다.\n\n임무에 착수하기 전에 래시온과 총사령관을 만나 이야기를 나눠봐야겠군.\n\n드랙티르 동지들은 도시를 둘러보고 있다. 더비시안을 만나 부두로 집결하라고 전해다오. 내가 신임하는 부관이다. 알아서 나머지 병사들에게 전파할 거다.', '', '', '', '', '', '스톰윈드 항구에 있는 토디 위스커스에게 성과를 보고해야 합니다.', 47187),
(72193, 'koKR', '알게타르 대학', '알게타르 대학을 둘러봐야 합니다.', '알게타르 대학이 다시 세상에 문을 연다고 들었습니다. \n\n먼 옛날에는 오직 용에게만 허락되는 신성한 배움의 전당이었죠. 세월이 흐르면서 교장님의 지혜가 한층 더 깊어져, 배움에 뜻이 있는 이라면 누구나 받기로 한 겁니다. 장래가 기대되는 신입생이 있다면 추천해 달라고 따로 부탁까지 하시더군요. \n\n용족의 훌륭한 동맹으로서 우리 용족의 위대한 대학을 보여드리고 싶습니다. 입학 여부는 용사님 뜻에 맡기겠습니다. 어쨌든 도라고사 님은 대학을 견학시켜 드리고 싶을 거예요.', '', '', '', '', '', '', 47187),
(72192, 'koKR', '주입의 전당: 혼돈에서 질서로', '주입의 전당에 들어가 원시 지진해일을 처치해야 합니다.', '본 것처럼 원시술사들이 이 세상에 혼란을 일으키려고 하고 있다. 목표를 이루기 위해서라면 절대 쉬지 않을 것이다.\n\n원시술사가 티르홀드에 침투했다는 우려스러운 소식을 들었다. 그들은 사악한 목적을 이루기 위해 수호자 티르가 이뤄온 일을 망치려 한다.\n\n$n, 부디 전당을 조사해 위협적인 원시술사를 모두 처리해주기를 바란다.', '', '', '', '', '', '', 47187),
(72191, 'koKR', '공급 부족 보상', '', '', '', '', '', '', '', '', 47187),
(72190, 'koKR', '저수지 보호 구역', '주티키를 찾아야 합니다.', '$c님! 용사님의 힘이 꼭 필요한 분이 계십니다.\n\n티르홀드 저수지가 원시술사의 공격을 받았습니다. 전 운 좋게 빠져나왔지만 다른 사람들은 위험에 빠진 것 같아 걱정됩니다.\n\n여기서 북쪽으로 가면 나옵니다. 주티키 님을 찾으십시오. 자세한 설명을 해주실 겁니다.\n\n아직 살아 계신다면 말이죠...', '', '', '', '', '', '', 47187),
(72189, 'koKR', '정원의 다양성', '그림페크와 대화해야 합니다.', '나비 정원 구경은 재밌게 하고 계십니까?\n\n여기 남쪽으로 가면 훨씬 더 큰 정원이 나옵니다. 그림페크라는 나이 든 용기병이 관리하는 곳이죠.\n\n일손이 필요할 거예요. \'조수\'는 있다지만 전 실제로 본 기억이 없거든요. 그림페크에게 별다른 도움이 될 거란 생각은 안 듭니다.\n\n혹시 남쪽 정원에 가게 되면 시나가 보냈다고 말하면 될 거예요.', '', '', '', '', '', '', 47187),
(72175, 'koKR', '환상의 시간', '진풍경의 홀: 화염 $1oa개, 진풍경의 홀: 바람 $2oa개를 만들어 발드라켄에 있는 소라고사에게 가져가야 합니다.', '이번 주는 흥미진진한 주문이 들어왔습니다! 알게타르 대학 학생들이 이번 물품인 홀이 재밌다며 아주 홀딱 빠졌더라고요.\n\n당신도 조금 돕지 않으시겠습니까?', '', '', '', '', '', '', 47187),
(72172, 'koKR', '정수, 조각, 오색 가루', '오색 가루 $1oa개를 만들어 발드라켄에 있는 소라고사에게 가져가야 합니다.', '기본 재료는 항상 모자랍니다. 정수라든지, 조각이라든지... 그 중에도 오색 가루는 조금이라도 남는 날이 없습니다.\n\n혹시 물자 보충을 도와주신다면, 다음주는 재료를 다시 채우기까지 하루 정도는 버티지 않을까 생각합니다.', '', '', '', '', '', '', 47187),
(72171, 'koKR', '단독의 증명', '1인 조합전을 12회 완료해야 합니다.', '스스로 분쟁을 찾아다니는 그 열정적인 모습이 참 기특하구나. 본인 실력에 그렇게 자신이 있다면... 이 몸이 즐겁게 감상해주마. \n\n어디 네 실력을 증명한 다음 돌아오너라.', '', '', '', '', '', '', 47187),
(72168, 'koKR', '연습 전투의 증명', '투기장 연습 전투에서 명예를 획득해야 합니다.', '본인의 전술적 능력이 확신이 있다 이건가? 너희 필멸자 사이에 종종 소규모 접전이 일어난다고 들었다. 가서 맞수들과 붙어보거라.\n\n어디 네 실력을 증명한 다음 돌아오너라.', '', '', '', '', '', '', 47187),
(72167, 'koKR', '전쟁의 증명', '대규모 전장에서 명예를 획득해야 합니다.', '\'진정한 도전\'을 바라느냐? 좋다. 나조차 가벼운 마음으로 마주하기 어려운 대규모 분쟁이 몇 개 있지.\n\n너희가 어떤 식으로 실패할지 궁금하구나... 진심이다. 어디 한번 실력을 증명해 보거라.', '', '', '', '', '', '', 47187),
(72166, 'koKR', '전투의 증명', '무작위 전장에서 명예를 획득해야 합니다.', '너희 필멸자는 한 줌의 땅을 갖고도 옥신각신 싸우는 걸 어련히도 즐기는구나.\n\n어쨌든 재밌으니 되었다. 나는 그거면 충분해. 어디 \'실력\'을 얼마나 증명할 수 있는지 보자꾸나.', '', '', '', '', '', '', 47187),
(72159, 'koKR', '비늘 벗기기', '반짝이는 비늘 생가죽 $1oa개를 채집해 발드라켄에 있는 투박한 랄라토르에게 가져가야 합니다.', '비늘의 사용처는 무궁무진합니다. 보호 기능도 있지만, 가끔 매끈한 반사경이 되어주기도 한답니다. 사실 우리가 만든 거울 중 최상급에 속하는 상품은 모두 비늘로 만들어졌답니다.\n\n요즘 들어 거울 주문량이 부쩍 늘었더군요. 비늘로 덮인 생가죽을 모아주시면 제작 비법을 몇 가지 알려드리겠습니다.', '', '', '', '', '', '', 47187),
(72157, 'koKR', '대지의 무게', '각성하는 대지 $1oa개를 모아 발드라켄에 있는 잠복자 세키타에게 가져가야 합니다.', '원시 용암 합금 수백 톤 주문이 들어왔는데, 각성하는 대지가 동나버렸습니다. 힘든 부탁인 건 알지만, 보상은 꼭 후하게 드리겠습니다!', '', '', '', '', '', '', 47187),
(72154, 'koKR', '투척자 스캐그', '', '', '', '', '', '', '', '', 47187),
(72137, 'koKR', '부화 계획', '', '', '', '', '', '', '', '', 47187),
(72135, 'koKR', '넬타루스: 안에 잠든 비밀', '넬타루스에서 넬타리온의 기록 $1oa개, 흑요석 일지 $2oa개, 연구 고서를 회수해야 합니다.', '여행자님, 문제가 생겼습니다. 넬타루스안에 자라딘이 나타났습니다. 그들이 전당을 뒤지고 있는 게 분명합니다!\n\n넬타루스 안에 많은 보물이 있지만, 가장 귀한 것은 지식입니다. 우리 용군단의 역사와 타락... 사벨리안과 래시온도 넬타리온의 삶과 행적에 대해 더 많은 정보를 찾은 바 있어요.\n\n가세요. 자라딘이 약탈하기 전에 구할만한 것을 찾아보세요!', '', '', '', '', '', '', 47187),
(72134, 'koKR', '모험가의 지원', '정찰 지도를 사용해, 첫 번째로 갈 곳을 선택해야 합니다.', '이번에 저 아래의 부서진 섬에 여러 문제가 발생했다는 사실을 알아냈소.\n\n우린 여기서 할 수 있는 조치를 할 것이오. 저쪽에 있는 지도를 살펴보고 먼저 지원할 곳을 선택하시오.', '', '', '', '', '', '', 47187),
(72131, 'koKR', '지나친 비축', '', '', '', '', '', '', '', '', 47187),
(72130, 'koKR', '잊혀진 그리핀', '', '', '', '', '', '', '', '', 47187),
(72129, 'koKR', '카드가 돕기', '달라란의 보랏빛 성채에서 카드가를 만나야 합니다.', '달라란에 어서 오시오, $n. 무탈하게 도착한 것 같아 다행이구려.\n\n얘기는 보랏빛 성채에서 나눕시다. 할 일이 태산이오.', '', '', '', '', '', '달라란의 보랏빛 성채에서 카드가를 만나야 합니다.', 47187),
(72128, 'koKR', '탐식자 엔킨', '', '', '', '', '', '', '', '', 47187),
(72127, 'koKR', '대장 랜서', '', '', '', '', '', '', '', '', 47187),
(72126, 'koKR', '경악의 달팽이 쩝쩝이', '', '', '', '', '', '', '', '', 47187),
(72122, 'koKR', '기성 생태학자', '떠돌이 생태학자를 찾아가야 합니다.', '$n 님. 부상자들은 안정을 되찾았지만, 아직 남은 문제가 있어요.\n\n두 용혈족 생태학자가 습지를 연구하기 위해 전초기지에 왔었는데 공격당한 이후로 비늘이나 발톱 하나도 보이지 않아 걱정돼요.\n\n습지에 갈 예정이라면 그들이 안전한지 알아봐 주시겠어요?\n\n몸조심하세요. 소문에 의하면 습지에 골록이 득실하다고 해요.', '', '', '', '', '', '', 47187),
(72121, 'koKR', '위대한 껍질의 칸', '', '', '', '', '', '', '', '', 47187),
(72117, 'koKR', '문화 교류의 장', '', '', '', '', '', '', '', '', 47187),
(72116, 'koKR', '찬란한 자 리스크론', '', '', '', '', '', '', '', '', 47187),
(72114, 'koKR', '아크로소스', '', '', '', '', '', '', '', '', 47187),
(72113, 'koKR', '장막 너머의 형상', '', '', '', '', '', '', '', '', 47187),
(72090, 'koKR', '원시술사 계획 방해', '', '', '', '', '', '', '', '', 47187),
(72089, 'koKR', '하늘마루 관측소를 향하여', '활공하여 고리를 통과해야 합니다.', '경로의 통과 지점 고리를 통과해야 합니다.', '', '', '', '', '', '', 47187),
(72083, 'koKR', '행운의 미끼', '선장 하브의 행운의 미끼를 회수해야 합니다.', '민망한 모습으로 뵙는군요, $r 친구. 죽어서 이러는 게 아닙니다.\n\n저는 사냥 중에 목숨을 잃었습니다. 제 선원들의 목숨을 빼앗은 야수가 다시는 생명을 해치지 못하게 막으려다 이렇게 됐죠. 잘못된 행동이라고는 생각 안 합니다. 제 아버지라도 그렇게 하길 바라셨을 테니까요.\n\n문제는 그 승부가 무승부로 끝났다는 겁니다!\n\n야수의 영혼도 아직 남아 있습니다. 제가 이렇게 당신 앞에 서 있는 것처럼 말입니다. 제 시체를 말끔히 먹어 치운 동물들에게서 행운의 미끼를 되찾지도 못해 다시 싸우지도 못하고 있는 거죠!\n\n절 좀 도와주시겠습니까?', '', '', '', '', '', '', 47187),
(72079, 'koKR', '공동체 잔치', '', '', '', '', '', '', '', '', 47187),
(72072, 'koKR', '용온천 투하', '낚시 구멍 비축분을 보충하는 데 쓸 생선을 모은 다음, 비룡에 올라타 공중에서 투하해야 합니다.', '물고기들 입질이 영 시원찮죠?\n\n이 얘기를 하니 갑자기 생각이 하나 떠오르네요. 그런 전설이 있어요. 이 호수와 강에 처음부터 물고기가 서식한 건 아니었다고 하더군요. 듣기로는 용들이 물 구멍 위로 날아가면서 물고기를 던져 넣어 보충해 줬다지 뭐예요. 믿어지시나요?\n\n잘하면 모험가님과 비룡이 그 전설을 재현할 수 있지 않겠어요?', '', '', '', '', '', '', 47187),
(72071, 'koKR', '낚시 2회전', '모코비를 처치해야 합니다.', '낚시를 즐길 생각은 없으십니까, $n 님?\n\n여기 해안에서 떨어진 곳에 미끼용 생선 떼가 있습니다. 멍청한 야수 녀석은 생선이 모였다 하면 공격을 해대더군요. 자긴 이미 죽은 몸이라는 것도 모르고 말이에요.\n\n그곳으로 가서 미끼를 흔들어 보세요. 부상당한 물개를 잘 유혹하면 저항하지 못할 겁니다.', '', '심해의 공포로 통하는 존재입니다.\n\n하브 선장이 사냥에 나서 함께 생명이 다했으나, 죽음조차 이 야수의 복수심을 가라앉히지는 못했습니다.', '모코비', '', '', '', 47187),
(72068, 'koKR', '협의회 지원: 모두를 위한 잔치', '하늘빛 평원의 이스카라로 가서 공동체 잔치에 참여해야 합니다. 또한 용의 섬 전역에서 지속적으로 발드라켄 협의회와 동맹을 지원해야 합니다.', '$n 님, 동맹이 당신을 부릅니다!\n\n당신이 이 섬을 위해 애쓴 일은 모두가 알고 있습니다. 남쪽의 굳건한 동맹인 이스카라 투스카르가 잔치 중에도 대잔치를 열어 당신의 행적을 기리겠다 합니다!\n\n협의회 동맹도 계속 도우면서 이스카라 땅으로 가 보십시오. 반짝이는 남쪽 바다에 닿으면 곧바로 축제에 참석하세요!', '', '', '', '', '', '', 47187),
(72067, 'koKR', '휴식 시간!', '평온의 꿈 온천으로 가야 합니다.', '저기요!\n\n피로가 많이 쌓인 것 같네요. 휴식이 절실해 보여요. 제가 해결책을 알려드리죠! 평온의 꿈 온천으로 가면 돼요!\n\n이번에 요우가 교실을 신설했는데, 인기가 아주 엄청나답니다. 진흙덩이 요법이 더 취향에 맞으실 수도 있겠네요. 둘 다 꼭 추천하고 싶어요.\n\n온천은 도시 북쪽으로 쭉 가면 나와요!', '', '', '', '', '', '', 47187),
(72063, 'koKR', '돌아온 옌누의 장난감 배', '장난감 배를 주위에 있는 옌누에게 돌려줘야 합니다.', '<옌누의 장난감 배입니다. 돌려주면 기뻐할 것입니다.>', '', '', '', '', '', '', 47187),
(72061, 'koKR', '폭풍소환사 벨드라', '', '', '', '', '', '', '', '', 47187),
(72060, 'koKR', '특수 치료', '젤디스에게 색안경을 돌려줘야 합니다. 또 말이죠.', '<진흙덩이가 당신의 의도를 알고 싶어 하는 눈치입니다. 하지만 궁지에 몰린 상태입니다.>', '', '', '', '', '', '', 47187),
