INSERT INTO `quest_template_locale` (`ID`, `locale`, `LogTitle`, `LogDescription`, `QuestDescription`, `AreaDescription`, `PortraitGiverText`, `PortraitGiverName`, `PortraitTurnInText`, `PortraitTurnInName`, `QuestCompletionLog`, `VerifiedBuild`) VALUES
(71242, 'koKR', '폭풍 연구자 돕기', '발드라켄에 있는 연구원에게 넘치는 정기 덩어리를 가져가야 합니다.', '<원시술사의 폭풍에 휘말린 생명체에게서 나온 넘쳐흐르는 힘의 덩어리로 보입니다.\n\n발드라켄에 분명 이 물건에 관심을 보일 연구원이 있을 것입니다.>', '', '', '', '', '', '', 47187),
(71241, 'koKR', '꽥꽥 함정', '태고의 골짜기에서 아일라그 부족의 사냥용 덫을 재설정해야 합니다.', '태고의 골짜기 숲은 옛 용들이 남긴 마법이 짙게 남아 있는 곳이다. 그곳에 서식하는 슬라이번의 모피가 우리 동족들 사이에서는 귀중품으로 여겨지지. 문제는 놈들이 신출귀몰해서 찾기 어렵다는 거다.\n\n추적하는 대신 일대에서 우리의 사냥용 덫을 찾아봐라. 인근 물오리를 잡아 고기를 채취해 덫에 둬. 뭐가 잡히든 나중에 사람을 보내 회수하겠다.', '', '', '', '', '', '', 47187),
(71239, 'koKR', '하늘 속으로 사라지다', '푸른깃 절벽에서 할린 처프스나이드를 찾아야 합니다.', '도와줄 사람이 필요한데, 딱 보탬이 되어줄 것 같은 분이 와주셨네요.\n\n제 오랜 친구인 할린 처프스나이드를 여기서 만나기로 했는데, 며칠이 지나도 감감무소식이에요. 원래는 루비 연회장에서 배불리 먹을 계획이었어요. 미용실에서 머리도 하고, 경매장에도 들를 참이었죠.\n\n그런데 당사자가 오질 않으니 원. 자기 일에 몰두할 때가 잦은 친구이긴 한데, 그래도 어디 있는지 알면 마음이 놓일 것 같아요.\n\n이곳 남쪽에 있는 산맥을 둘러봐 주세요. 오는 길에 한번 둘러보겠다고 했거든요.', '', '', '', '', '', '', 47187),
(71238, 'koKR', '루비 연회장!', '루비 연회장에서 요리사 루미아스트라자 및 모젤과 대화해야 합니다.', '모든 미식가에게 알립니다!\n\n이 세상 궁극의 맛을 찾고 싶으신가요? 위대한 여정을 떠나고 싶으신가요? 일면식도 없는 사람을 위해 팔다리나 목숨까지도 내걸 수 있나요?\n\n그렇다면 세계적으로 유명하고 명망 높은 2인조 요리사, 루미아스트라자와 모젤을 찾아오세요! 현재 발드라켄 도시에서 루비 연회를 주최하고 있습니다!', '', '', '', '', '', '', 47187),
(71235, 'koKR', '현장의 마법사들', '하늘빛 평원 슬라이번 침식곡 근처 키린 토 마법사를 확인해야 합니다.', '록타르, $r 친구여.\n\n혹시 시간 괜찮소? 이 근처에서 마법사 둘이 일을 보고 있는데, 도와줄 사람이 필요해서 말이외다.\n\n이 동네가 평소에도 여간 위험한 곳이 아니잖소. \n\n게다가 지금이 평소랑 같은 상황도 아니고 말이오.', '', '', '', '', '', '', 47187),
(71234, 'koKR', '귀퉁이 소식', '하늘빛 평원 고래잡이의 귀퉁이를 방문해야 합니다.', '이봐요, $r 친구. \n\n여행 경험이 풍부한 것 같군요.\n\n제 사촌 와윤이 고래잡이의 귀퉁이에서 잡은 생선을 가져오다 무슨... 이상한 사람들이 야영지를 세워놓은 걸 봤다지 뭡니까.\n\n얌전한 사람들 같긴 한데, 혹시 모르니 와윤이 잘 있는지 확인해주실 수 있을까요?\n\n살짝 까다로운 면이 있는 친구라서요.', '', '', '', '', '', '', 47187),
(71233, 'koKR', '떨어지는 물', '하늘빛 평원의 세갈래 폭포 망루에서 윌라와 대화해야 합니다.', '전 폭포가 좋아요. \n\n폭포 하나보다 더 좋은 게 뭔지 아세요? \n\n두 개의 폭포죠. \n\n그리고 그 두 개보다... 음. 여기서 서쪽으로 가면 나오는 세갈래 폭포를 보면 직접 눈으로 확인하실 수 있어요!\n\n여관주인 성격도 좋고요.', '', '', '', '', '', '', 47187),
(71232, 'koKR', '용의 섬의 영예', '발드라켄에서 테라잘과 대화해야 합니다.', '용의 섬은 아직 많은 부분에서 도움이 필요하다.\n\n테라잘과 얘기해 보거라. 이 섬에서 누가 도움이 필요한지 훤히 꿰고 있을 테니.', '', '', '', '', '', '발드라켄에서 테라잘과 대화해야 합니다.', 47187),
(71231, 'koKR', '사냥의 부름', '온아라 평야에서 교관 프로드럼과 대화해야 합니다.', '<당신의 손에 쪽지를 떨구는 로키>\n\n$n, 시카르 부족에서 사냥의 제전에 초대한다. 온아라 평야에서 교관 프로드럼을 만나보도록.', '', '', '', '', '', '', 47187),
(71230, 'koKR', '투스카르 낚시 장비', '하늘빛 평원의 이스카라에서 타비오와 대화해야 합니다.', '또 뵙네요, $n 님.\n\n<주변을 두리번거리고는 작게 흥얼거리는 로위>\n\n아참! 타비오 님이 제 그물을 새로 만들어 주시는 김에 용사님 것도 챙겨주겠다고 하셨어요. 재료를 가져가면 다른 낚시 장비도 만들어주실 거예요.\n\n한번 타비오 님을 만나보세요.', '', '', '', '', '', '', 47187),
(71229, 'koKR', '평야의 부름', '온아라 평야에서 하다리 칸과 대화해야 합니다.', '<당신의 손에 전언을 떨구는 로키>\n\n$n, 네 위대한 업적 이야기가 아일라그 부족에까지 전해지더군. 정식으로 초대하는 바이니, 우리 부족을 만나봐 줬으면 한다.\n\n하다리 칸', '', '', '', '', '', '', 47187),
(71227, 'koKR', '비행 도전', '청동 시간지기와 대화하여 특별한 비행 도전에 관해 배워야 합니다.', '<퍼덕이가 신나서 날개를 퍼덕거립니다. 쪽지와 살짝 탄 쥐가 발밑에 떨어집니다.>\n\n용기수여! 비행 능력이 뛰어나다고 소문이 자자하더군요. 용의 섬 전역에 있는 비행 도전으로 실력을 보여주십시오.\n\n청동 시간지기에게 말을 걸면 시작할 수 있습니다.', '', '', '', '', '', '', 47187),
(71225, 'koKR', '바람결을 타고: 루자스트', '', '', '', '', '', '', '', '', 47187),
(71219, 'koKR', '방황하는 길잡이', '길잡이 알비를 찾아야 합니다.', '요즘 몇몇 젊은 길잡이들이 태만해진 것 같습니다.\n\n길잡이 노리가 동생 알비를 확인해 달라는 요청을 보냈더군요. 알비는 시간의 통로 초입에 배치된 아입니다. 최근 고과는 수준 이하라고 할 수 있죠.\n\n동쪽으로 가서 길잡이 알비를 만나주셨으면 합니다. 본인의 위치가 얼마나 중요한지 일깨워 주시고, 언니가 걱정하고 있다는 얘기도 전해주세요.', '', '', '', '', '', '', 47187),
(71212, 'koKR', '담쟁이가죽 공격', '', '', '', '', '', '', '', '', 47187),
(71210, 'koKR', '용의 파멸 성채를 향하여!', '깨어나는 해안으로 이동해 흑요석 추방자와 합류하여 용의 파멸 성채 공성전을 진행해야 합니다.', '<퍼덕이가 당신 손에 살짝 탄 쪽지를 떨어뜨립니다.>\n\n$n 님, 흑요석 추방자가 당신의 영웅담을 들었습니다. 저희는 삶의 터전인 용의 파멸 성채를 자라딘에게 빼앗겼습니다. 용납할 수 없는 일입니다. 빼앗긴 땅을 되찾는 데 힘을 보태주시면 좋겠습니다.\n\n- 우두머리', '', '', '', '', '', '', 47187),
(71209, 'koKR', '평야의 야수', '리지의 고삐를 받아야 합니다.', '리지가 다시 평야의 야수로서 살아갈 준비가 된 것 같아. 지금이야 우리 둘 다 제법 친해지긴 했지만 나는 보면 알아. 자연으로 돌아가고 싶어 하는 눈치야.\n\n나도 언젠가는 바람현자가 돼서 이 샘 너머의 세상을 구석구석 탐험할 거야. 물론 수습생 중간시험을 통과하는 게 우선이지만! 시간 참 빠르게 간다니까.\n\n저번에 모아준 털실로 안장하고 고삐를 만들었어. 당신이 가자고 하면 리지도 기쁜 마음으로 따라갈 거야.\n\n모험하는 동안 잘 챙겨줘, $p.', '', '', '', '', '', '', 47187),
(71205, 'koKR', '수생 투스카르', '', '', '', '', '', '', '', '', 47187),
(71202, 'koKR', '작은 마나마귀 근접병', '애완동물 대전에서 아르칸투스를 꺾어야 합니다.', '', '', '', '', '', '', '', 47187),
(71199, 'koKR', '천둥가시 길들이기', '', '', '', '', '', '', '', '', 47187),
(71198, 'koKR', '천둥가시 길들이기', '', '', '', '', '', '', '', '', 47187),
(71197, 'koKR', '천둥가시 길들이기', '', '', '', '', '', '', '', '', 47187),
(71196, 'koKR', '천둥가시 길들이기', '용의 섬의 곤충에게서 형광성 액체 $1oa개를, 용의 섬 보급품 $2oa개를 모아야 합니다.', '리지가 우리 품에서 안전하게 지내게 되어 정말 다행이야.\n\n그런데 상처 회복 속도가 예상보다 더뎌. 마법으로 생긴 피해가 영구적으로 남지는 않아야 할 텐데.\n\n곤충 체액 모으는 것 좀 도와주지 않을래? 알아. 듣기만 해도 징그러운 소리인 거! 근데 그게 각종 치유 연고의 밑 재료로 쓰여.', '', '', '', '', '', '', 47187),
(71195, 'koKR', '천둥가시 길들이기', '온이르 샘에서 메룬의 녹색 카레와 용의 섬 보급품 $2oa개를 모아야 합니다.', '리지가 이젠 여기가 마음에 들었나 봐. 집으로 들어올 생각을 통 하질 않네. 하긴 근본이 야생동물이니.\n\n사실 할 말이 있는데... 리지를 구한 이후로 메룬 님과 아무런 대화도 하지 않았어. 그분이 옳다는 건 알아. 근데 그냥... 어떻게 다가가면 좋을지 모르겠어. 메룬 님은 내가 뭘 하든 인정하지 않는 것 같거든. 훈련에 더 정진해야 한다는 건 알지.\n\n리지가 메룬 님이 만든 카레에 사족을 못 써. 혹시 메룬 님께 부탁해서 카레를 받아올 수 있을까? 평소에는 샘 서쪽에 있는 온님 댁에서 일하셔.', '', '', '', '', '', '', 47187),
(71194, 'koKR', '화염의 개구리', '뿔가시 몇 마리에게 고드름 혼합물을 피하는 방법을 가르쳐야 합니다.', '내가 낚시 그물 놓기 정말 좋은 곳을 찾았는데, 한 가지 문제가 있네. 근처에 있는 뿔가시 놈들이 놔둔 그물을 십중팔구 찢어놓을 거야. 어떻게 할까?\n\n음, 생각이 있네. 용암 낚시 그물은 고드름 혼합물을 입혀서 열을 견디게 만들지. 그러니 뿔가시가 그 냄새를 피하게 만들면 될 거야.\n\n뿔가시한테 고드름 혼합물을 던진 다음 공격해. 처치하지는 않게 조심하고. 죽으면 학습할 수가 없을 거 아닌가?', '', '', '', '', '', '', 47187),
(71193, 'koKR', '수중의 위협', '티르홀드 낚시 구멍에 불길한 고둥 5개를 사용해 물속의 야수를 소환하여 처치한 후, 처치한 증거를 가져와야 합니다.', '방금 보셨습니까? 물속이요! 거대하고 단단한 껍질을 가진 야수가 지나갔습니다! 분명 배고픈 상태일겁니다! 전 저런 괴물이 도사리는 물가에 그물을 갖고 가지 않을 겁니다. 놈을 유인할 생각이라면 불길한 고둥을 이용해 보십시오. 고둥은 어렵지 않게 낚을 수 있습니다.', '', '', '', '', '', '', 47187),
(71192, 'koKR', '포식자 통제', '으스스한 입상을 놓아야 합니다.', '안녕하신가, 친구!\n\n내가 근처에 낚시 그물 설치할 만한 곳 없나 찾아보다 알게 됐는데, 여기 뒤뚱이가 너무 많아서 어린 물고기가 크기도 전에 다 잡아먹히게 생겼더라고. \n\n그래서 저 게걸스러운 새를 조금이라도 쫓아줄 인형을 만들었네. 이거면 용온천의 풍족한 물고기 수를 유지할 수 있을 걸세. \n\n같이 설치해주지 않겠나?', '', '', '', '', '', '', 47187),
(71191, 'koKR', '순자산', '하늘빛 평원의 얼음 구멍에서 그러프 낚시꾼의 그물을 회수해야 합니다.', '이런, 낚시 그물이 강물에 떠내려갔네요. <한숨> 친구들처럼 낚싯대를 쓰고 싶진 않은데...\n혹시 제 낚시 그물을 찾거든 가져다주시겠습니까?', '', '', '', '', '', '', 47187),
(71182, 'koKR', '방황하는 기록관', '하늘빛 기록 보관소 상부 보관소에서 신드라고사를 만나야 합니다.', '거기, 드랙티르.\n\n이곳으로부터 동쪽에서 네 동족 두 명이 기록 보관소를 살피고 있다. 내 아직 모습을 드러내지는 않고 있는데, 동행인이 있으면 좋을 것 같구나.\n\n시간이 된다면 기록 보관소 상부로 오너라.', '', '', '', '', '', '', 47187),
(71179, 'koKR', '전망대 전망하기', '겔리키르 전망대에서 사령관 타데지우스와 대화해야 합니다.', '$n, 일을 하나만 더 맡기고 싶소만.\n\n겔리키르 초소 근처에서 원시술사들이 움직이고 있다고 하오. 티르홀드의 통제권에 위협이 되고 있소.\n\n타데지우스 사령관과 대화해 협조 방안을 논의해 보시오.', '', '', '', '', '', '겔리키르 전망대에서 사령관 타데지우스와 대화해야 합니다.', 47187),
(71178, 'koKR', '차원문: 그늘진 성역', '온아라 평야의 그늘진 성역에 있는 휴면 중인 차원문을 찾아야 합니다.', '원정대 보고가 들어왔네. 남서쪽 울창한 언덕 지역에 휴면 상태인 돌이 있다는군. 좀 멀지만 자네처럼 지식을 갖춘 사람을 보내볼 만하지.', '', '', '', '', '', '', 47187),
(71166, 'koKR', '최고령 쐐기벌레', '애완동물 대전에서 뿔꺼비를 꺾어야 합니다.', '', '', '', '', '', '', '', 47187),
(71165, 'koKR', '차원문: 영겁의 끝자락', '탈드라서스의 영겁의 끝자락에 있는 휴면 중인 차원문을 찾아야 합니다.', '저 멀리 탈드라서스 산악 지대에 자그마한 여관이 하나 있다네. 출입구에 먼 옛날 잊힌 채 잠들어 있는 돌이 자리하고 있지.\n\n자네 생각은 어떤가? 모험을 떠날 마음이 드나, $n?', '', '', '', '', '', '', 47187),
(71162, 'koKR', '차원문: 알게테라', '탈드라서스의 알게테라 첨탑 꼭대기에 있는 휴면 중인 차원문을 찾아야 합니다.', '돌과 첨탑이 또 발견됐네.\n\n얼른 출발하는 게 좋을 걸세. 이번에는 길이 꽤 험하니 말이야. 발견한 대원들 말로는 위험성도 상당한 모양일세.\n\n그럼 준비는 됐나?', '', '', '', '', '', '', 47187),
(71161, 'koKR', '차원문: 바크스로스', '하늘빛 평원의 바크스로스 첨탑 꼭대기에서 휴면 중인 차원문을 찾아야 합니다.', '남동쪽 추운 지역에 휴면 상태인 돌이 또 있다는 보고가 들어왔네.\n\n신나서 출발하기 전에 알아둬야 할 게 있네. 이번 장소는 대다수의 사람이 선뜻 가지 않는 곳이네. 뭐, 모험이나 죽음의 위기를 즐긴다면 안성맞춤인 곳이 되겠지만!\n\n이 정도면 마음이 동했겠지? 훌륭해!\n\n가능한 따뜻하게 챙겨 입고, 차가운 바람의 한기가 코를 옭아맬 때까지 쭉 동쪽으로 가게나. 멈추지 말고 계속 나아가야 하네. 호흡이 힘들어지고 뼛속까지 냉기가 파고들기 시작하면 제대로 찾아왔다는 뜻이니 그리 알게나.', '', '', '', '', '', '', 47187),
(71160, 'koKR', '수중 폭탄', '', '', '', '', '', '', '', '', 47187),
(71157, 'koKR', '차원문: 하늘마루 관측소', '깨어나는 해안의 하늘마루 관측소에서 휴면 중인 차원문을 찾아야 합니다.', '북쪽으로 탐험을 나갔던 대원들 말로는 북동쪽 첨탑 꼭대기에 또 다른 돌이 있다고 하네.\n\n워낙 높은 곳에 있어 접근이 어렵다고는 하는데, 자네라면 길을 찾을 수 있겠지!', '', '', '', '', '', '', 47187),
(71155, 'koKR', '하늘빛 보관소', '하늘빛 보관소에서 분리된 불길을 저지해야 합니다.', '문제가 생겼다, $n.\n\n하늘빛 기록 보관소 지하에는 하늘빛 보관소라는 장소가 있다. 내가 살아있던 시절에는 온갖 중요하고 위험한 마법 물품이 안치되어 있었지.\n\n그런데 상당히 규모가 큰 분리된 불길 일당이 보관소에 침입했더구나. 모종의 비밀이 숨겨져 있을 거란 확신에서 비롯된 행각 같더군.\n\n금고로 내려가 놈들의 염치를 모르는 공격을 막아다오. 그냥 뒀다간 저들 스스로조차 이해 못 하는 위협을 해방시킬지도 모른다.\n\n도둑들은 금고 안에 무엇이 도사리고 있는지 몰라.', '', '', '', '', '', '', 47187),
(71153, 'koKR', '전역 퀘스트, 추가 목표, 시나리오', '토르톨란 전역 퀘스트 3개를 완료해야 합니다.', '전역 퀘스트 3개를 완료하여 토르톨란을 도와야 합니다.', '', '', '', '', '', '수집가 코조에게 돌아가야 합니다.', 47187),
(71152, 'koKR', '다시 주전당으로', '주전당에서 토디와 합류해야 합니다.', '초기화 제어장치도 확보했겠다, 저 방벽을 넘어가는 건 이제 일도 아니겠어요.\n\n주전당에서 뵈어요. 같이 통과해 보자고요!', '', '', '', '', '', '', 47187),
(71151, 'koKR', '계속되는 차원문 탐험', '깨어나는 해안의 루비비늘 전초기지에서 테일린 다크앤빌을 만나야 합니다.', '<깨끗하고 빳빳한 편지입니다. 용비늘 원정대의 인장이 찍혀 있습니다.\n\n테일린 다크앤빌이 협조를 요청한다는 내용입니다.>', '', '', '', '', '', '', 47187),
(71150, 'koKR', '계속되는 차원문 탐험', '깨어나는 해안의 루비비늘 전초기지에서 테일린 다크앤빌을 만나야 합니다.', '<양피지에서 불쾌한 곰팡내가 납니다. 힘겹게 집중력을 회복한 끝에 펼쳐보니, 테일린이 새롭게 발견한 정보에 대한 해답을 찾는 데 도움이 필요해진 것 같습니다.\n\n이제 남은 의문은 단 하나, 이 견딜 수 없는 악취 나는 두루마리를 어떻게 처리하느냐입니다.>', '', '', '', '', '', '', 47187),
(71149, 'koKR', '계속되는 차원문 탐험', '깨어나는 해안의 루비비늘 전초기지에서 테일린 다크앤빌을 만나야 합니다.', '<놀랍게도 전령이 이번에는 주머니나 쪽지가 아닌 테일린의 개인 소장품을 건넵니다.\n\n자세히 살펴보니 다시 도움이 필요해졌다는 테일린의 짤막한 전언이 작은 글씨로 적혀 있습니다.>', '', '', '', '', '', '', 47187),
(71148, 'koKR', '계속되는 차원문 탐험', '깨어나는 해안의 루비비늘 전초기지에서 테일린 다크앤빌을 만나야 합니다.', '<유별난 의사 내너스가 쪽지를 보여줍니다. 용비늘 원정대의 서명과 인장이 눈에 들어옵니다.\n\n어쩌면 유명한 탐험가의 협조 요청일지도 모릅니다.>', '', '', '', '', '', '', 47187),
(71146, 'koKR', '계속되는 차원문 탐험', '깨어나는 해안의 루비비늘 전초기지에서 테일린 다크앤빌을 만나야 합니다.', '<수습 탐험가가 돌돌 만 쪽지를 건넵니다. 내용을 살펴보니 오랜 친구인 테일린 다크앤빌에게 도움이 필요한 모양입니다.\n\n탐험가가 후다닥 달려가기 전에 손을 쭉 내밉니다. 간식을 달라는 듯합니다. 잠시 후 이 유별난 동물이 괴성을 내지르면서 빈손으로 돌아갑니다.>', '', '', '', '', '', '', 47187),
(71145, 'koKR', '거장', '애완동물 대전에서 패추를 꺾어야 합니다.', '', '', '', '', '', '', '', 47187),
(71144, 'koKR', '얼라이언스 학살자', '현상금이 걸린 상태로 얼라이언스 10명을 처치해야 합니다.', '바로 그겁니다! 그렇게만 계속 하면 됩니다. 얼라이언스 개들을 계속 쓸어버리십시오!\n\n얼라이언스를 조금 더 죽이면 기록 경신입니다, $c님.\n\n하지만 쉽지 않을 겁니다. 얼라이언스가 당신의 머리에 현상금을 걸었으니까요. 조심하십시오!\n\n호드를 위하여!', '', '', '', '', '', '', 47187),
(71143, 'koKR', '호드 학살자', '현상금이 걸린 상태로 호드 10명을 처치해야 합니다.', '멋집니다! 이대로만 하십시오, 병사여!\n\n호드를 조금만 더 죽이면 얼라이언스의 역사에 길이 남겠군요.\n\n하지만 쉽지 않을 겁니다. 호드가 당신의 머리에 현상금을 걸었으니까요. 조심하십시오!\n\n얼라이언스를 위하여!', '', '', '', '', '', '', 47187),
(71141, 'koKR', '뻔뻔한 아가미', '절벽이슬 야영지에서 침략자 구르므옳을 처치해야 합니다.', '카디르자는 무모하긴 해도 게를 잘 아는 사람입니다. 이번엔 골록들이 정도가 지나쳤어요!\n\n골록 녀석들이 무슨 일만 생겼다 하면 구르므옳에게 쪼르르 달려가더군요. 그 녀석이 게를 포획하라고 명령을 내리고 있는 게 분명합니다. 언제까지고 이 사태를 방관할 순 없습니다. 생명의 균형을 위해서든, 게들을 보살피는 사람들의 안위를 위해서든 말이죠.\n\n구르므옳을 쓰러뜨리십시오. 더는 강 너머로 확장하지 못하게 막아야 합니다!', '', '불쾌할 정도로 큰 골록이라. 분명 실존하겠죠.', '침략자 구르므옳', '', '', '', 47187),
(71140, 'koKR', '이것저것', '애완동물 대전에서 바쿠셰크를 꺾어야 합니다.', '', '', '', '', '', '', '', 47187),
(71139, 'koKR', '빛나는 비전 보석', '안토니다스 야영지에 있는 만물의 암기자 노리코에게 빛나는 비전 보석을 가져가야 합니다.', '<음산한 광채가 뿜어져 나오는 것이, 상당히 강력한 힘이 깃든 보석 같습니다.\n\n키린 토에 전달해 안전한 장소에 보관하는 게 좋을지도 모릅니다.>', '', '', '', '', '', '안토니다스 야영지에 있는 만물의 암기자 노리코에게 빛나는 비전 보석을 가져가야 합니다.', 47187),
(71138, 'koKR', '차원문: 루사타르 요새', '온아라 평야의 루사타르 요새에 있는 휴면 중인 차원문을 찾아야 합니다.', '한 원정대원이 온아라 평야 망루 꼭대기에서 휴면 상태인 돌을 봤다고 하네.\n\n모험을 떠날 준비는 됐는가?', '', '', '', '', '', '', 47187),
(71135, 'koKR', '매듭짓지 못한 일', '하늘빛 평원의 눈가죽 야영지에서 얼음이빨을 대면해야 합니다.', '제가 이 야생에서 지내면서 하나 배운 게 있습니다. 뭔지 아십니까? 악을 발견했을 때 처리하지 않으면, 뼈를 부수고 뿌리째 뽑아버리지 않으면 몇 번이고 도로 자라난다는 겁니다. 심지어 갈수록 해치우기 어려워지죠.\n\n이 산은 제가 당신처럼 어렸을 때부터 얼음이빨이 지독한 존재감을 떨쳤습니다. 놈이 눈가죽 부족을 장악하면 더 심해지겠죠.\n\n진작 옛날에 손을 썼어야 했는데... 지금 실수를 바로잡을 수 있는 건 우리뿐입니다.', '', '얼음이빨의 잔혹한 지배에 마침표를 찍을 때입니다.', '얼음이빨', '', '', '', 47187),
(71097, 'koKR', '도움의 발톱', '코발트 전당 상부 탑에서 유물을 활성화하고 벤더스반의 행동을 지켜봐야 합니다.', '좋아요. 유물을 충전하셨군요. 어디 한번 활성화해보죠.\n\n...그리고 그 표정 좀 치우십쇼. 작동할지 안 할지 궁금하긴 그쪽도 마찬가지면서 무슨 내숭입니까. \n\n한 번 더 흔들고 뒤로 물러나세요. 나머지 작업은 제가 끝내겠습니다.', '', '', '', '', '', '', 47187),
(71096, 'koKR', '진정한 발톱', '유물을 활성화해야 합니다.', '<눈을 비비면서 고통에 신음을 흘리는 벤더스반>\n\n알겠습니다. 줄 생각이 없다니 어련히 직접 알아내 보시죠. \n\n당신이 알아낸 다음 빼앗으면 그만이니까요. 무력을 동원해서라도 그럴 겁니다.\n\n얼른 해보세요. 흔들든 어쩌든 해보라고요.', '', '', '', '', '', '', 47187),
(71095, 'koKR', '위기의 발톱', '벤더스반에게 그를 어떻게 도우면 되는지 물어보고 말하는 대로 해야 합니다.', '우리 저 사람을 도와주자고요!\n\n<가까이 몸을 숙여 속삭이는 헬레스>\n\n걱정 마세요. 물건을 빼앗기거나 그러진 않을 테니까요. 재밌게 놀고 싶어서 그래요!\n\n누가 우릴 확인하러 온지도 한참 됐거든요. 심심해서 죽을 것 같다고요!\n\n<당신을 보고 눈을 찡긋하는 헬레스>\n\n저 사람이 뭘 원하는지 여쭤봐 주실 수 있나요?', '', '', '', '', '', '', 47187),
(71094, 'koKR', '지원군 출동!', '코발트 전당 상부 탑에서 붕대를 찾아 벤더스반을 치유해야 합니다.', '안녕하세요! \n\n도와주러 오신 건가요? 큰 도움이 되어주실 것 같은데!\n\n<부상당한 드랙티르를 가리키는 헬레스>\n\n여기까지 날아서 올라오다 날개를 다쳤나 봐요! 저 아래 있는 악당들하고 같은 편인 것 같긴 한데, 그래도 전 하나도 안 무서워요! 어쨌든 도와줄 생각이고요! 그게 우리 방식이니까!\n\n<가슴을 당당하게 펴는 헬레스>\n\n저 사람은 제가 지켜보고 있을 테니, 붕대를 구해다 주세요!', '', '', '', '', '', '', 47187),
(71093, 'koKR', '티르의 유산: 과거의 비밀', '황야의 땅에 있는 울다만: 티르의 유산에 들어가 원반을 회수해야 합니다.', '라자게스가 다른 현신들을 해방하지 못하게 저지하려면 위상들의 힘을 복원해야 한다.\n\n근데 티탄이란 양반들은 다른 데 정신이 팔렸고, 수호자 티르는 한참 전에 세상을 떠났으니 참 공교롭기 짝이 없지.\n\n그래서 알렉스트라자 여왕이 제안한 계획이 있다. 황야의 땅 깊은 곳에 울다만이란 티탄 시설이 있어. 티르의 동료들이 그의 기억이 담긴 원반을 보관해뒀을지도 모른다는군.\n \n들려오는 얘기로는 트로그가 울다만을 점유했다고 한다. 동료를 모아 울다만으로 출발해라. 용의 여왕의 이름으로 원반을 확보하도록.', '', '', '', '', '', '', 47187),
