(71029, 'koKR', '사냥 전술: 동반자 훈련', '사냥의 제전에서 사용할 추가 동반자 능력을 선택해야 합니다.', '마루크 사이에서 네 영예가 또 높아졌더군. 그 노력을 가상히 여겨 전투 중 사냥의 동반자를 더 효율적으로 부리는 방법을 알려주겠다.', '', '', '', '', '', '', 47187),
(71028, 'koKR', '사냥 전술: 온아라의 축복', '사냥의 제전에서 사용할 온아라의 축복을 선택해야 합니다.', '마루크 사이에서 네 영예가 높아지고 있다. 지금부터 경청하도록. 온아라의 축복을 일깨워 스스로와 동료를 보호하는 방법을 알려줄 테니.', '', '', '', '', '', '', 47187),
(71027, 'koKR', '현상 수배: 천둥의 마라나르', '태고의 골짜기에서 천둥의 마라나르를 처치하고 마라나르의 판금을 입수해야 합니다.', '날뛰는 야수를 제압할 강대한 사냥꾼을 찾습니다!\n\n천둥의 마라나르라는 천둥도마뱀이 천둥가시 숲에서 태고의 골짜기로 흘러들어와 지역 야생동물 생태를 어지럽히고 있습니다. 물에 전류를 퍼뜨리고, 숲을 파괴했으며, 오리 둥지를 엉망으로 만들어 놓기까지 한 상황입니다.\n\n이 위협을 반드시 저지해야 합니다. 놈을 처치하고 비늘을 증거로 채취해 칸수호병 제보타이에게 보여주십시오.\n\n온아라의 인도가 함께하기를.', '', '태고의 골짜기의 야생동물 생태를 어지럽히는 야수입니다. 지금까지 수없이 많은 오리 둥지를 짓밟았습니다.', '천둥의 마라나르', '', '', '', 47187),
(71024, 'koKR', '혼돈과 소요', '에리마를 도와 위상의 권좌 최하층에서 일어난 사건을 조사해야 합니다.', '$n! 방금 들었소? 최하층에서 사건이 일어났소.\n\n지금 내가 신임하는 수사관 에리마가 현장에 먼저 도착해 있다오. 그 친구가 수많은 인파 사이에서 단서를 찾아내려면 도움이 필요할 거요.', '', '', '', '', '', '', 47187),
(71023, 'koKR', '발드라켄 협의회의 영예로운 자', '발드라켄에서 우나토스와 대화해야 합니다.', '과연 용의 섬에 오기 전부터 전설적인 평판을 쌓아 올린 분다운 활약입니다.\n\n보급품을 추가로 지급해 더욱 힘을 실어드리고 싶습니다. 발드라켄에서 뵙도록 하죠.', '', '', '', '', '', '', 47187),
(71022, 'koKR', '산양의 군림', '타이반에게 명령을 내려 무리의 고집스러운 산양을 대면하게 해야 합니다.', '큰뿔양이 타이반을 별로 존중하지 않는 것 같으니, 무리의 산양을 제어할 수 있는지 알아보죠.\n\n이곳 산뿔양 사이에서 우두머리 역할을 하는 녀석입니다. 고집도 상당히 센 편이죠. 타이반이 제압하기만 한다면 무리가 복종하기 시작할 거예요.\n\n산양은 저 언덕 위에 있어요. 행운을 빈다, 타이반. 이번에도 안 되면 네게 목양견 소질은 없다고 봐야 해!', '', '', '', '', '', '', 47187),
(71020, 'koKR', '현신의 금고: 알 깨뜨리기', '신화 난이도 현신의 금고에 있는 혈족지기 디우르나에게서 대지팡이의 파편 3개를 수집해야 합니다.', '이 요새 어딘가에 혈족지기 디우르나가 있습니다. 십중팔구 자기 공간에서 금고를 지켜보고 있겠죠. 대지팡이의 파편이 있으면 바로 디우르나의 소굴을 공격할 수 있을 겁니다\n\n세 개면 충분합니다. 네 개는 과하고요.', '', '', '', '', '', '', 47187),
(71019, 'koKR', '현신의 금고: 알 깨뜨리기', '영웅 난이도 현신의 금고에 있는 혈족지기 디우르나에게서 대지팡이의 파편 3개를 수집해야 합니다.', '이 요새 어딘가에 혈족지기 디우르나가 있습니다. 십중팔구 자기 공간에서 금고를 지켜보고 있겠죠. 대지팡이의 파편이 있으면 바로 디우르나의 소굴을 공격할 수 있을 겁니다\n\n세 개면 충분합니다. 네 개는 과하고요.', '', '', '', '', '', '', 47187),
(71018, 'koKR', '현신의 금고: 알 깨뜨리기', '일반 난이도 현신의 금고에 있는 혈족지기 디우르나에게서 대지팡이의 파편 3개를 수집해야 합니다.', '이 요새 어딘가에 혈족지기 디우르나가 있습니다. 십중팔구 자기 공간에서 금고를 지켜보고 있겠죠. 대지팡이의 파편이 있으면 바로 디우르나의 소굴을 공격할 수 있을 겁니다\n\n세 개면 충분합니다. 네 개는 과하고요.', '', '', '', '', '', '', 47187),
(71017, 'koKR', '날루키의 편지', '날루키의 생선 머리를 늙은 음울엄니에게 전달해야 합니다.', '제가 한번 맞혀볼까요? 음울엄니가 편지 열어볼 생각 말라고 했죠?\n\n진짜 시킨 대로 하셨나 보네요. 하긴, 그러니 당신을 신뢰하는 거겠죠!\n\n이 생선 머리를 전달해 주세요. 녀석에게 보여주면 무슨 의미인지 이해할 거예요.', '', '', '', '', '', '날루키의 생선 머리를 음울엄니에게 전달해야 합니다.', 47187),
(71016, 'koKR', '음울엄니의 누이', '음울엄니의 편지를 이스카라에 있는 음울엄니의 자매 날루키에게 전달해야 합니다.', '마지막은 제 누이인 날루키입니다. 지금 이스카라에서 여관 운영을 돕고 있죠.\n\n이 편지를 전해주세요.\n\n뜯어서 볼 생각 마시고요.', '', '', '', '', '', '음울엄니의 편지를 이스카라에 있는 음울엄니의 누이 날루키에게 전달해야 합니다.', 47187),
(71015, 'koKR', '단순무식', '고대의 전망대에서 바르세크를 찾아야 합니다.', '바르세크는 현존하는 용기병 중 가장 튼튼한 친구입니다. 무식하기로도 최고지만요. 뭐, 본인은 절대 아니라고 손사래를 칠 겁니다.\n\n바르세크는 얼음이빨 사건 이후로 덜컥 겁을 집어먹고는 뭔가... 인생을 되돌아본 것 같습니다. 자기 선조들이 남긴 폐허를 연구해야 한다면서 \"학자\"가 되러 떠났다더군요.\n\n그 친구를 여기로 데려다주십시오. 바르세크는 다른 곳에는 어울리지 않습니다!', '', '', '', '', '', '고대의 전망대에서 바르세크를 찾아야 합니다.', 47187),
(71014, 'koKR', '머나먼 펄볼그 친구', '긴발톱 섬에서 바르스트를 찾아야 합니다.', '바르스트는 제가 여태껏 본 펄볼그 중 가장 강인한 친구입니다. 얼음이빨이 무리까지 동원해서 녀석을 쓰러뜨린 것만 봐도 대강 짐작이 되겠죠.\n\n마지막으로 소식을 들었을 땐 이스카라 해안의 어떤 섬으로 향했다더군요. \"은퇴\"니 뭐니 하면서.\n\n바르스트에게 돌아올 때가 되었다고 전해주세요. \n\n아, 그리고 그 친구 말하는 것만 보고 속단하지 마세요. 괜히 밉보였다간 두 쪽이 날 수도 있습니다.', '', '', '', '', '', '긴발톱 섬에서 바르스트를 찾아야 합니다.', 47187),
(71013, 'koKR', '복수도 식후경', '음울엄니의 은신처에서 얼어붙은 꼬리 화살고기 $2oa마리를 낚아야 합니다.', '목표로 했던 상황에 돌아왔으니, 몇 가지 사항을 짚고 넘어갑시다. 얼음이빨이라고 했나요? 당신이 대화를 나눈 놀이?\n\n얼음이빨이라면 좀 압니다.\n\n말하자면 긴 내용입니다. 친구, 가서 생선을 좀 잡아다 주셨으면 합니다. 모두 배불리 먹어야 합니다. 그래야 다음 일을 할 수 있으니까요.', '', '', '', '', '', '', 47187),
(71012, 'koKR', '바르세크 영입', '음울엄니에게 바르세크를 영입했다고 알려야 합니다.', '나중에 어렵지 않게 이 장소의 불가사의를 밝혀낼 수 있을 것 같네요. \n\n이 얘기는 늙은 음울엄니에게 비밀입니다. 아시겠죠?\n\n그럼 전 그의 은신처로 출발하겠습니다. 얼음이빨에게 쌓인 분노를 풀 생각을 하니 재밌을 것 같군요.', '', '', '', '', '', '음울엄니에게 가야 합니다.', 47187),
(71011, 'koKR', '현상 수배: 격류의 백합', '격류의 백합을 찾아야 합니다.', '<팻말에 아름다운 필체로 글이 적혀 있습니다.>\n\n기록관이 모든 원정대 구성원 여러분께 정중히 요청합니다. 유물 보관소에 안치할 격류의 백합을 찾아 주셨으면 합니다.\n\n해당 물품을 입수할 시 분류학자 제이크스에게 전달해 관련 업무를 처리하고 보상을 수령해 주시기 바랍니다.\n\n원정대 구성원의 보고에 따르면 탈드라서스 겔리키르 전망대에 있는 강력한 원시술사의 목줄에 마법 꽃이 꽂혀 있는 걸 목격했다고 합니다. 전설로 전해지는 그 격류의 백합인지는 알려지지 않았으나, 탐색을 시작하기에 좋은 지점으로 사료됩니다.', '', '탈드라서스에서 활동하는 강력한 물의 원시술사로, 격류의 백합을 자신의 두건에 고정해놓고 있습니다.', '알로라 미스트브리즈', '', '', '용비늘 기지에 있는 분류학자 제이크스에게 가야 합니다.', 47187),
(71010, 'koKR', '현상 수배: 시간의 망원경', '시간의 망원경을 찾아야 합니다.', '<팻말에 아름다운 필체로 글이 적혀 있습니다.>\n\n기록관이 모든 원정대 구성원 여러분께 정중히 요청합니다. 유물 보관소에 안치할 시간의 망원경을 찾아 주셨으면 합니다.\n\n해당 물품을 입수할 시 분류학자 제이크스에게 전달해 관련 업무를 처리하고 보상을 수령해 주시기 바랍니다.\n\n원정대 구성원의 보고에 따르면 남부 탈드라서스의 어느 여관에서 마법 망원경을 손에 넣었다고 자랑하는 드워프의 이야기를 언뜻 들었다고 합니다. 해당 지역을 중심으로 탐색을 진행할 것을 권장합니다.', '', '탈드라서스에서 활동하는 원시술사 망꾼으로, 시간의 망원경을 사용해 다음 공격을 계획합니다.', '망꾼 모드렌', '', '', '용비늘 기지에 있는 분류학자 제이크스에게 가야 합니다.', 47187),
(71009, 'koKR', '명탐정 용기병', '바르세크를 도와 고대의 전망대의 수수께끼를 풀어내야 합니다.', '늙은 음울엄니가 다시 한번 얼음이빨을 잡으려 한다고요? 그의 부탁을 거절하기는 싫지만, 저는 학자의 삶을 택하면서 그 이전 생활을 내려놓았습니다.\n\n역사를 드러내고, 또 새로운 역사를 만들고 있죠. 그런데 이 고대 폐허에 비밀스럽게 남겨진 수수께끼 때문에 막혀서 이도 저도 못 하고 있습니다.\n\n수수께끼는 이겁니다. 저 수정에 손을 대보면 \"양식을 따라가라\"라는 문구를 확인할 수 있습니다. 근데 그게 무슨 소린지 모르겠어요!\n\n이렇게 하죠. 수수께끼 풀이를 도와주시면 저도 음울엄니가 얼음이빨을 끝장내는 걸 돕겠습니다.', '', '', '', '', '', '', 47187),
(71008, 'koKR', '현상 수배: 돌심장의 돌 심장', '돌심장의 돌 심장을 찾아야 합니다.', '<팻말에 아름다운 필체로 글이 적혀 있습니다.>\n\n기록관이 모든 원정대 구성원 여러분께 정중히 요청합니다. 유물 보관소에 안치할 돌심장의 돌 심장을 찾아 주셨으면 합니다.\n\n해당 물품을 입수할 시 분류학자 제이크스에게 전달해 관련 업무를 처리하고 보상을 수령해 주시기 바랍니다.\n\n원정대 구성원의 보고에 따르면 중부 하늘빛 평원에 있는 동굴에서 돌심장을 목격했다고 합니다.', '', '돌심장은 본인의 돌로 된 심장을... 음, 어디에 두는지 짐작이 가시겠죠.', '돌심장', '', '', '용비늘 기지에 있는 분류학자 제이크스에게 가야 합니다.', 47187),
(71004, 'koKR', '현상 수배: 오후나 대규모 구속의 토템', '오후나 대규모 구속의 토템을 찾아야 합니다.', '<팻말에 아름다운 필체로 글이 적혀 있습니다.>\n\n기록관이 모든 원정대 구성원 여러분께 정중히 요청합니다. 유물 보관소에 안치할 오후나 대규모 구속의 토템을 찾아 주셨으면 합니다.\n\n해당 물품을 입수할 시 분류학자 제이크스에게 전달해 관련 업무를 처리하고 보상을 수령해 주시기 바랍니다.\n\n원정대 구성원의 보고에 따르면 온아라 평야의 바람노래 마루에 있는 아주 강력한 원시술사가 이 토템에 담겨 있다는 소문이 파다한 능력을 사용한다고 합니다.', '', '강력한 바람의 원시술사로, 온아라 평야에 침입해 오후나 대규모 구속의 토템을 다룹니다.', '프로젤라 게일샷', '', '', '용비늘 기지에 있는 분류학자 제이크스에게 가야 합니다.', 47187),
(71002, 'koKR', '역사상 최고의 주문', '\"초보자를 위한 마나스톰 안내서\"를 읽고 밀하우스의 비밀 주문을 알아내야 합니다.', '<살짝 공중에 뜬 채 비전 마력을 발산하는 마력 깃든 책입니다. 이 책에는 혼란스럽지만, 한편으로는 우수한 밀하우스 마나스톰이 만들어낸 무수한 주문과 마법부여가 기록되어 있습니다.>', '', '', '', '', '', '', 47187),
(71001, 'koKR', '현상 수배: 대지결속 태고의 핵', '넬타루스에서 대지결속 태고의 핵을 찾아야 합니다.', '<팻말에 아름다운 필체로 글이 적혀 있습니다.>\n\n기록관이 모든 원정대 구성원 여러분께 정중히 요청합니다. 유물 보관소에 안치할 대지결속 태고의 핵을 찾아 주셨으면 합니다.\n\n해당 물품을 입수할 시 분류학자 제이크스에게 전달해 관련 업무를 처리하고 보상을 수령해 주시기 바랍니다.\n\n최근 흑요석 성채에서 회수한 기록에서 알아낸 정보에 따르면 한때 넬타루스 용의 궤짝에 보관되어 있었다고 합니다. 다만 현재 위치는 알려져 있지 않습니다.', '', '소문에 따르면 넬타루스의 용의 궤짝에 사라진 핵이 있다고 합니다.', '대지결속 태고의 핵', '', '', '용비늘 기지에 있는 분류학자 제이크스에게 가야 합니다.', 47187),
(71000, 'koKR', '바르스트 영입', '음울엄니에게 바르스트를 영입했다고 알려야 합니다.', '뭐, 약속은 약속이죠. 음울엄니가 얼음이빨의 숨통을 완벽히 끊어버리는 데 일손이 필요하다니 돕겠습니다.\n\n이 몸뚱어리에 남은 증오라곤 얼음이빨을 향한 증오가 전부니까요. 무슨 일이 있었는지 음울엄니에게 들으셨습니까?\n\n사실 우린 음울엄니와 함께 사냥을 다녔습니다. 이 세상에 상대 못 할 적은 없는 줄 알았죠. 얼음이빨을 만나면서 그 생각은 와르르 무너졌습니다.\n\n얼음이빨은 우릴 꺾는 정도에서 그치지 않았습니다. 은신처에 있던 모든 사람 앞에서 치욕을 주었지요. \n\n그렇게 우린 은신처에서 피투성이에 만신창이가 되어 패배의 쓰라린 맛을 봤습니다. 얼음이빨이 우릴 본보기로 삼은 거죠.\n\n갚아줄 때가 온 것 같습니다.', '', '', '', '', '', '늙은 음울엄니에게 가야 합니다.', 47187),
(70996, 'koKR', '친구에게 물풀을', '긴발톱 섬에서 야생 물풀의 정령을 처치해야 합니다.', '저런, 음울엄니가 곤경에 빠지긴 했나 보군요. 다른 때 같았으면 본토에서 싸우든 말든 관심 없다고 했겠지만...\n\n뭐, 얼음이빨과는 사연이 있습니다. 갚아야 할 몫도 있고.\n\n아, 하지만 여기 있는 다른 이들을 그냥 두고 떠나는 건 말도 안 됩니다... 해변에 웬 정령이 소란을 일으키고 있어서 말이죠. 그들을 막을 수 있는 건 말 그대로 재빠른 저뿐입니다. \n\n이렇게 합시다. 저 대신 정령을 처리해 준다면 음울엄니에게 가보겠습니다.\n\n어떻습니까, 영웅님?', '', '그럼 안녕히!', '물풀의 정령', '', '', '', 47187),
(70995, 'koKR', '현상 수배: 페니스트라자의 해골', '페니스트라자의 해골을 찾아야 합니다.', '<팻말에 아름다운 필체로 글이 적혀 있습니다.>\n\n기록관이 모든 원정대 구성원 여러분께 정중히 요청합니다. 유물 보관소에 안치할 페니스트라자의 해골을 찾아 주셨으면 합니다.\n\n해당 물품을 입수할 시 분류학자 제이크스에게 전달해 관련 업무를 처리하고 보상을 수령해 주시기 바랍니다.\n\n몇몇 원정대 구성원의 보고에 따르면 서쪽 산맥의 추방자 자라딘이 갖고 있는 것을 목격했다고 합니다. 다만 자라딘을 설득해 물건을 받아낸 구성원은 없는 상황입니다.', '', '마력 깃든 두개골을 전시해놓고 지내는 은둔자 자라딘입니다.', '눈먼 타르진', '', '', '용비늘 기지에 있는 분류학자 제이크스에게 가야 합니다.', 47187),
(70994, 'koKR', '배수 문제', '생명의 금고 폐허 동쪽 동굴에서 빛나는 물결 정령 $1oa마리를 흡수해야 합니다.', '세계적으로 유명한 용비늘 원정대의 수석 지질학자를 돕는 영광을 누리고 싶지 않으신가요? 그래요. 제가 바로 그런 사람이에요. 마침 도움이 필요한 상황이고요!\n\n퇴적물 표본을 찾아 이 강을 돌아다니고 있었는데, 흥미로운 유사가 들어 있는 물의 정령이 돌아다니기 시작하더군요!\n\n여기 특허를 낸 격리 장치가 있는데, 이 주변을 돌아다니면서 물의 정령을 흡수해줄 사람이 필요해요.\n\n과제를 해내실 수 있겠어요?', '', '', '', '', '', '', 47187),
(70992, 'koKR', '현상 수배: 잃어버린 투스카르 연', '잃어버린 투스카르 연을 찾아야 합니다.', '<팻말에 아름다운 필체로 글이 적혀 있습니다.>\n\n기록관이 모든 원정대 구성원 여러분께 정중히 요청합니다. 유물 보관소에 안치할 잃어버린 투스카르 연을 찾아 주셨으면 합니다.\n\n해당 물품을 입수할 시 분류학자 제이크스에게 전달해 관련 업무를 처리하고 보상을 수령해 주시기 바랍니다.\n\n몇몇 원정대 구성원의 보고에 따르면 서쪽 해안에서 연을 달고 돌아다니는 수송선을 목격했다고 합니다. 다만 수송선이 접근할 수 있는 범위를 벗어나 이동하는지라 접촉에 성공한 구성원은 없는 상황입니다.', '', '길 잃은 아르빌로를 따라 고고하게 하늘을 누비는 연입니다...', '잃어버린 투스카르 연', '', '', '용비늘 기지에 있는 분류학자 제이크스에게 가야 합니다.', 47187),
(70990, 'koKR', '정답은 양털에 있다', '벼랑발굽 큰뿔양의 양털을 깎아야 합니다.', '우리는 보통 우리가 기르는 큰뿔양 무리로부터 대부분의 양털을 얻지만, 수가 적어지면 야생에서 얻어야 한다.\n\n근처 평원에 야생 큰뿔양 서식지가 있다. 우리 부족의 무리보다 더 변덕스럽다더군. 이 칼을 챙겨서 양털을 깎아와 준다면 아일라그 부족에게 큰 보탬이 될 거다.', '', '', '', '', '', '', 47187),
(70989, 'koKR', '무리의 일부', '타이반을 비롯한 사냥 바카르 무리와 함께 게걸스러운 비룡을 사냥해야 합니다.', '어쩌면 네 바카르에게 필요한 건 동족의 가르침일 수도 있다. 제대로 된 사냥법을 보고 배우는 거지.\n\n훈련된 바카르 몇 마리를 데려가라. 녀석들을 데리고 가서 이 지역을 맴도는 비룡을 처리하도록.\n\n타이반이 동족 틈에서는 어떻게 행동하는지 지켜보겠다.', '', '', '', '', '', '', 47187),
(70987, 'koKR', '수풀의 심장', '깨어나는 해안 생명의 금고 폐허에서 멜리안 에노라스와 대화해야 합니다.', '탐험하면 이동하면서 먹을 수 있는 음식만 한 게 또 없죠!\n\n요즘 세상에 바쁜 도시라면 어디든 꼭 길거리 음식이 있어요. 하지만 음식이라고 뭐든 움직이면서 먹을 수 있는 건 아니에요. 이동식 식품의 기본은 바로 움직이는 중에도 무너지지 않게 잡아줄 전분이에요. 빵, 감자, 밥 등등이 손안의 간편한 식사의 핵심인 이유죠.\n\n여기 제 판다렌 동지한테 도약옥수수라는 맛있는 식재를 맛보여주고 싶어요. 옛날에 깨어나는 해안 근처 티탄 유적 근처에서 처음 모젤을 만났을 때 소개받은 먹거리예요.', '', '', '', '', '', '', 47187),
(70986, 'koKR', '병사 시크자르', '', '', '', '', '', '', '', '', 47187),
(70985, 'koKR', '고독한 정찰병', '그늘진 성역에서 드리아드와 대화해야 합니다.', '압니다, 알아요. 우스꽝스럽긴 하죠. 켄타우로스와 드리아드라니. 닮은 구석이라곤 눈을 씻고 봐도 찾아볼 수 없을 지경 아닌가요.\n\n하지만 에메랄드 정원을 처음 눈에 담은 이후로 진심으로 드리아드를 알고 싶어졌습니다. 그런데 아무리 용을 써도 저들의 관심을 끌기 어렵더군요.\n\n드리아드는... 식물을 좋아한다고 들었습니다. 깜찍한 아기 동물도. 밀렵꾼의 숨통을 끊는 것도 좋아할지 모르겠네요. 어쨌든 어디서부터 시작하면 좋을지 감이 안 잡힙니다.\n\n대신 얘기를 나눠봐 주실 수 있을까요? 드리아드가 무엇을 좋아하는지 물어봐 주세요. 그걸 알면 저에게도 기회가 올지 모르죠.', '', '', '', '', '', '정찰병 샌툰에게 가야 합니다.', 47187),
(70984, 'koKR', '쇄도 파쇄자', '', '', '', '', '', '', '', '', 47187),
(70983, 'koKR', '오나크 해안탐색자', '', '', '', '', '', '', '', '', 47187),
(70981, 'koKR', '바다의 풍미', '하늘빛 평원 고래잡이의 귀퉁이에서 와윤과 대화해야 합니다.', '바다 냄새! 느껴지죠, $n 님? 두터운 바다 소금 속에 풍부한 무기질 냄새가 느껴지죠? 네?\n\n오늘의 기쁨 속에 유난히 큰 빈자리가 있네요. 예전에 하늘빛 평원 이스카라의 고향 근처에서 맛본 희귀한 물고기가 있어요. 투스카르 친구 두 명이 불에 구워줬는데, 그 풍미가 어찌나 뛰어나던지 차가운 동토를 다 덮고도 남을 정도였죠!\n\n어떻게 한 마리 구해다 주실 수 있을까요? 우리 손님들도 저만큼이나 그 바다의 맛에 홀릴 거예요.', '', '', '', '', '', '', 47187),
(70979, 'koKR', '마그마톤', '', '', '', '', '', '', '', '', 47187),
