(70976, 'koKR', '게으름과 썰매', '남동쪽 섬에서 키오포를 찾아야 합니다.', '알고 계시겠지만 이스카라의 자손은 자립성이 아주 강합니다. 어렸을 때부터 자족하는 법을 배우죠.\n\n나이가 찬 아이들이 몰래 남서쪽 빙산으로 빠져나가는 것도 제대로 자라고 있다는 증거입니다. 그중에 맏이인 키오포가 지금 거기 있습니다. 제가 보냈다고 말하면 썰매 하나를 내어줄 거예요!\n\n아, 말하고 나니 어렸을 때가 새록새록 떠오르는군요... 친구들과 같이 어울려 놀곤 했는데...', '', '', '', '', '', '', 47187),
(70972, 'koKR', '충직하고 흐느적거리는 탈것', '', '', '', '', '', '', '', '', 47187),
