(70970, 'koKR', '선한 의도', '알리아 선소어를 저지하고 유물 발트룩스를 파괴해야 합니다.', '유물이 어딨는지 알 것 같습니다. 용사님이 조각을 가지고 돌아왔을 때 알리아가 정신 나간 사람처럼 웅얼거리는 소리를 들었습니다.\n\n\"동굴\" 이야기를 계속 늘어놓으면서, 거미들이 집착한다는 말을 하더군요.\n\n이 앞 일대에 동굴은 없는데 말이죠... 그렇다면 폐허 깊은 곳에 있다는 얘기가 됩니다.\n\n우린 여기 남아서 퇴로를 확보해 두겠습니다, $n 님. 알리아를 구하고 저주받은 유물을 파괴해 주십시오.', '', '알리아가 유물에 삼켜지기 전에 도착할 수 있기를 기도해야 합니다.', '발트룩스', '', '', '', 47187),
