(70958, 'koKR', '연회 최고의 버섯', '탈드라서스 시간의 합일점에서 감시관 대장 신조이르미와 대화해야 합니다.', '뭐니 뭐니 해도 미식의 본질은 최고의 재료를 최고의 기술로 조리하는 거예요. 값과 재료의 귀함 때문에 미식 요리를 못 먹는 경우도 많지만, 적어도 루비 연회장에서 그런 일이 일어나서는 안 돼요!\n\n모젤 덕분에 오늘의 주제에 완벽하게 맞는 재료를 알게 됐어요. 어찌나 희귀하고, 어찌나 뛰어난지... 아직 존재조차 하지 않는 재료래요! 흥미가 생기지 않나요?\n\n청동용군단이 발견한 위험한 미래로 향하는 차원문으로 들어가면, 전에 없던 맛의 검은 송로버섯이 있을 거예요!\n\n어서 가세요!', '', '', '', '', '', '', 47187),
(70957, 'koKR', '서쪽의 드넓은 바다', '온아라 평야 그늘진 성역에서 슈가바우와 대화해야 합니다.', '주변의 초목을 구경하고 있나요, $n 님?\n\n이걸 보면 옛날에 드리아드 자매와 착한 나무정령 친구가 해줬던 음식이 생각나요. 평원 서쪽 해안의 그늘진 성역에 사는 슈가바우라는 친구들이었죠!\n\n대접받은 음식은 허브와 야채, 양념이 한데 어우러져 있었어요. 세상에서 가장 맛있는 해조류 층이 중심에 있었고요!\n\n네? 해조류는 먹어본 적 없다고요? 그럼 얼른 가서 구해보세요. 가시는 김에 다른 사람도 먹을 만큼 더 따다 주세요!', '', '', '', '', '', '', 47187),
