(70946, 'koKR', '누구도 가지지 못하도록', '발트룩스를 파괴하도록 알리아를 설득해야 합니다.', '지금 용사님이 찾아온 정보를 보면, 유물은 지금껏 자신을 사용한 사람을 모두 파멸로 몰아간 것 같습니다.\n\n이곳에 살았던 용혈족들은 유물을 갖겠다고 싸우다 서로의 목숨을 빼앗아 버렸고, 분리된 불길도 영향력에 잠식되는 게 보입니다.\n\n이건 회수해야 하는 물건이 아닙니다. 또 다른 희생자가 나오기 전에 파괴해야 하는 물건이죠.\n\n알리아와 카티가트를 설득해야 합니다.', '', '', '', '', '', '', 47187),
(70945, 'koKR', '그물 낚시꾼', '', '', '', '', '', '', '', '', 47187),
(70944, 'koKR', '얼음 낚시', '', '', '', '', '', '', '', '', 47187),
(70943, 'koKR', '작살 낚시', '', '', '', '', '', '', '', '', 47187),
(70942, 'koKR', '고원 낚시', '', '', '', '', '', '', '', '', 47187),
(70941, 'koKR', '낚시 구멍', '하늘빛 평원의 이스카라에서 눈부크와 대화해야 합니다.', '다시 만나서 반가워요! 제가 마을에서 최고의 낚시꾼이 될 거라고 말씀드렸나요? 제가 거대한 피라냐를 잡은 적이 있거든요. 거의 제 얼굴을 먹으려고 했어요!\n\n<산만하게 주위를 살펴보는 로위>\n\n아, 맞아요! 드릴 말씀이 있어요. 이스카라에 있는 눈부크가 낚시 구멍에 대해 말해줄 게 있대요.', '', '', '', '', '', '', 47187),
(70940, 'koKR', '투스카르 용사의 이야기', '', '', '', '', '', '', '', '', 47187),
(70939, 'koKR', '조리 도구', '', '', '', '', '', '', '', '', 47187),
(70938, 'koKR', '공동체 잔치', '하늘빛 평원의 이스카라에서 덩치 큰 키눅과 대화해야 합니다.', '여기 계셨군요, $n 님! 수프 요리를 시작한대요! \n\n서둘러서 이스카라로 가보세요. 덩치 큰 키눅이 찾고 있어요.\n\n한번은 키눅이 저한테 수프를 만들기 위해 끈적끈적하고 기분 나쁜 가시고기를 구해달라고 했어요. 근데 전 하기 싫어서 이렇게 말했어요. \"싫은데요!\"\n\n키눅이 화가 잔뜩 나서 저를 수프에 빠뜨리려고 하더라고요!', '', '', '', '', '', '', 47187),
(70937, 'koKR', '발트룩스의 실체', '발트룩스가 실제로 어떤 유물인지에 관한 단서를 찾아야 합니다.', '<당신에게 속삭이는 토티크> \n\n불길한 예감이 듭니다. 정체불명의 유물이 위대하게 만들어주겠다고 약속한다? 절대 좋은 일이 아니에요.\n\n근데 그렇다고 손 털고 떠날 수도 없는 노릇이죠... 우리가 아니면 분리된 불길이 유물을 차지할 테니. \"그것\"의 정체가 뭔지는 모르겠지만요...\n\n전 이런 폐허가 익숙합니다. 종종 푸른용들이 남겨놓은 기록을 찾아볼 수 있었죠. 두 눈을 크게 뜨고 잘 둘러보면 찾을 수 있을지도 모릅니다.\n\n단서를 찾아서 알리아와 카티가트에게 경고하는 게 좋겠습니다.', '', '', '', '', '', '', 47187),
(70936, 'koKR', '도둑맞은 투스카르 토템', '', '', '', '', '', '', '', '', 47187),
(70935, 'koKR', '포획 방류 사업: 섬지느러미 황새치', '', '', '', '', '', '', '', '', 47187),
(70932, 'koKR', '향신료 인생', '흑요석 왕좌에서 그립타와 대화해야 합니다.', '식사라 하면 고기를 빠뜨릴 수 없겠죠? 하지만 고기 음식에도 빠질 수 없는 게 있는데, 뭘까요?\n\n양념이죠!!\n\n그 중에도 향이나 식감, 희귀도로 따지면 그 무엇도 따라올 수 없는 양념 재료가 있어요. 이 섬에 있지만, 안타깝게도 흑요석 보루 깊은 곳의 정령한테서만 구할 수 있어요. 지금은 자라딘이 점령한 지역이죠.\n\n제가 거기서 특이한 트롤을 만났거든요. 한번 의논해 보세요. 제 기억으론 이름이...그립타였을 거예요.', '', '', '', '', '', '', 47187),
(70931, 'koKR', '속삭임이 깃든 조각', '분리된 불길에게서 속삭이는 파편 $1oa개를 회수해야 합니다.', '발트룩스가 일전에 회수한 조각을 통해 소통을 시도하고 있는 것 같습니다.\n\n유물의 영향력에서 정신을 온전하게 지켜낼 수만 있다면 오히려 유리하게 이용할 수 있을 것입니다.\n\n그리고 제가 분리된 불길에 대한 판단을 잘못 내렸더군요. 유감스럽게도 벌써 조각을 여러 개 모은 것 같습니다.\n\n발트룩스의 속삭임은 자신과 가까이 있는 자들의 정신부터 지배합니다.\n\n분리된 불길이 유물을 손에 넣기 전에 조각을 회수하십시오!', '', '', '', '', '', '', 47187),
(70930, 'koKR', '망령잎은 어디에', '오한그물 골짜기에서 릴리알 던버스트와 대화해야 합니다.', '오늘은 차를 위한 날이에요. 홍차든 냉차든, 뭐든 좋아요! 예쁜 조각 케이크나 비스킷도 좋죠.\n\n그런데 새로운 맛의 영역에 도달할 차를 만들기 위해필요한 귀한 재료가 이 섬에 있다는 거 아세요? 거미 가득한 오한그물 골짜기 깊은 곳까지 가면 덤불이 자라고 있는데, 이 덤불에서 활력을 돋우는 환상의 이파리가 나요. \'한파의 화살촉\'이라는 잎이죠!\n\n최근 용비늘 원정대가 그 지역을 탐사했다 해요. 도와줄 사람 한 명 정도는 구할 수 있지 않을까요?', '', '', '', '', '', '', 47187),
(70929, 'koKR', '더 많은 사냥 전리품', '', '', '', '', '', '', '', '', 47187),
(70928, 'koKR', '사냥 전리품', '', '', '', '', '', '', '', '', 47187),
(70927, 'koKR', '넘쳐나는 도둑맞은 토템', '', '', '', '', '', '', '', '', 47187),
(70926, 'koKR', '도둑맞은 토템', '', '', '', '', '', '', '', '', 47187),
(70925, 'koKR', '공동체 잔치', '', '', '', '', '', '', '', '', 47187),
