(70918, 'koKR', '일생일대의 꽥꽥', '기포에 갇힌 새끼 오리를 생태학자 야영지로 데려가야 합니다.', '<부산하게 꽥꽥대고 있는 새끼 오리입니다. 누가 도와주지 않으면 심기가 불편해진 골록들이 쫓아올 게 분명합니다!>\n\n<생태학자라면 이 새끼 오리를 도울 방법을 알지도 모릅니다.>', '', '', '', '', '', '기포에 갇힌 새끼 오리를 생태학자 야영지로 데려가야 합니다.', 47187),
(70917, 'koKR', '꽥꽥댈 어깨', '기포에 갇힌 새끼 오리를 생태학자 야영지로 데려가야 합니다.', '<긴장한 기색이 역력한 새끼 오리입니다. 당장의 위기를 벗어나고 싶어 하는 눈치입니다.>\n\n<생태학자라면 이 새끼 오리를 도울 방법을 알지도 모릅니다.>', '', '', '', '', '', '기포에 갇힌 새끼 오리를 생태학자 야영지로 데려가야 합니다.', 47187),
