(70893, 'koKR', '공동체 잔치', '공동체 잔치에서 과제 $1oa개를 완수해야 합니다.', '지금 공동체 잔치가 열렸어요! 모두 힘을 합쳐서 최고의 수프를 만들 시간이에요!\n\n같이 가요!', '', '', '', '', '', '', 47187),
