(70883, 'koKR', '재배의 손', '단결의 정원에서 그림페크를 찾아야 합니다.', '반갑습니다, 필멸자여. 수석 정원사 그림페크 님이 전언을 보내셨습니다. 정원이 혼란스럽다고 하시더군요. 새삼 이상할 것도 없지만.\n\n어쨌든 상황은 단단히 틀어쥐고 있다고 합니다. 실제로는 \'삽의 힘\'으로 해결하고 있다는데... 가보면 자세히 설명해줄 거예요. 수석 정원사님을 만나봐 주세요. 상황에 적절한 도구를 제공해 주실 겁니다.', '', '', '', '', '', '', 47187),
(70882, 'koKR', '영예 보급품', '', '', '', '', '', '', '', '', 47187),
(70880, 'koKR', '멋쟁이 요리사', '', '', '', '', '', '', '', '', 47187),
(70879, 'koKR', '반란군 보고', '위상의 권좌 최상층에서 대장 드라인을 만나야 합니다.', '오늘 놀라운 업적을 세웠군요. $n 님도 같은 생각이시죠?\n\n원시술사와 결탁한 반란군의 극악무도한 흉계를 저지하지 않았습니까. 한동안은 조용하겠죠. 불온한 움직임은 계속 주시해야겠지만 말입니다.\n\n어서 드라인 대장님께 가보십시오. 상세한 보고를 기다리고 계실 겁니다.', '', '', '', '', '', '', 47187),
(70878, 'koKR', '화염 고리', '멜드라 플레임텅이 원시술사 차원문을 봉인할 동안 보호해야 합니다.', '원시술사들이 잿불판암 동굴 가장 깊은 곳에 불의 차원문을 만들어 정령들을 불러오고 있습니다.\n\n차원문은 제가 닫을 수 있는데, 봉인을 시작하면 상대편에서 득달같이 달려들 겁니다. 원시술사들이 돕는 망령 마그마티쿠스도 분명 나타날 거예요.\n\n원시술사를 막으려면 절 지켜주셔야 합니다.', '', '원시술사가 이 날뛰는 망령을 용의 섬에 풀어놓기 전에 제거해야 합니다.', '마그마티쿠스', '', '', '', 47187),
(70877, 'koKR', '시간의 꽥꽥', '기포에 갇힌 새끼 오리를 생태학자 야영지로 데려가야 합니다.', '<새끼 오리가 낙담한 채 조용히 울음소리를 내고 있습니다. 흔들리는 눈에는 공포가 어려 있습니다.>\n\n<생태학자라면 이 새끼 오리를 도울 방법을 알지도 모릅니다.>', '', '', '', '', '', '기포에 갇힌 새끼 오리를 생태학자 야영지로 데려가야 합니다.', 47187),
(70876, 'koKR', '집중 장치 부수기', '잿불판암 동굴에서 원시술사 집중 장치 $1oa개를 파괴해야 합니다.', '멜드라의 말이 사실이라는 전제하에, 반란군은 잿불판암 동굴에서 룬석을 만들고 있을 겁니다.\n\n더욱이 이런 도구는 그 특성상 원시술사 집중 장치가 쓰였을 거란 사실도 유추할 수 있죠.\n\n집중 장치를 파괴하십시오. 눈에 띄게 생겼으니 바로 알아보실 수 있을 겁니다.\n\n반란군이 이런 대량 살상 병기를 더 만들도록 두어선 안 됩니다.', '', '', '', '', '', '', 47187),
(70875, 'koKR', '최악 중의 최악', '잿불판암 동굴에서 반란군 $1oa명과 정령 $2oa마리를 처치해야 합니다.', '잿불판암 동굴에 있는 반란군은 원시술사를 향한 충성심이 확고한 자들입니다. 다시 말해 발드라켄 최대의 위협이죠.\n\n반란군과 저들이 해방시킨 정령을 제거해 주십시오.', '', '', '', '', '', '', 47187),
(70874, 'koKR', '화염의 벽을 뚫는 법', '멜드라에게서 정령의 축복을 받아야 합니다.', '동굴 안에 있는 반란군은 정령의 축복을 이용해 화염의 벽을 안전하게 드나들고 있습니다. 그것과 같은 은혜를 내려드릴게요.\n\n걱정하지 마세요. 은혜 내리는 광경을 여러 번 보았습니다. 효과적으로 재현해 내는 데 문제는 없을 겁니다.', '', '', '', '', '', '', 47187),
(70873, 'koKR', '폭포를 쫓아서', '낙수 티끌 $1oa개를 채집해야 합니다.', '진정한 위협은 잿불판암 동굴에 있어요. 룬석을 조각해 원시 화염을 주입하는 작업이 이뤄지는 곳입니다.\n\n입구가 이글거리는 화염의 벽으로 막혀있는 것을 보셨을 겁니다. 제가 없앨 수는 없지만, 약소하게나마 도움을 드릴 순 있어요. 낙수를 적절하게 활용하면 안전하게 통과할 수 있을 겁니다.\n\n주위 정령에게서 물의 티끌을 모아주세요.', '', '', '', '', '', '', 47187),
(70871, 'koKR', '이스카라 낚시 그물', '타비오에게 재료를 가져가 이스카라 낚시 그물을 만들어야 합니다.', '마을 사람들과 잘 지내고 계시네요.\n\n낚시 방법에 대해서 더 배우고 싶으시다고요? 음, 일단 아무도 맨손으로 낚시하지는 않죠. 제가 강하고 좋은 이스카라 낚시 그물을 만들어 드릴 수 있어요.', '', '', '', '', '', '', 47187),
(70867, 'koKR', '비늘파멸 성채', '', '', '', '', '', '', '', '', 47187),
(70859, 'koKR', '수호자가 품은 것', '타락한 수호자 에다빅스에게서 속삭임이 깃든 조각을 회수해야 합니다.', '도와주셔서 감사합니다, $c님. 제가 처음 유물 발트룩스를 발견하고, 분리된 불길의 계획을 알아낸 키린 토 마법사입니다.\n\n발트룩스는 자아가 있는 강력한 유물입니다. 그렇기에 회수해 연구를 진행하는 것이 무엇보다 중요하죠. 제가 어떻게든 해낼 겁니다.\n\n분리된 불길은 지레짐작으로 유물의 위치를 찾고 있더군요. 전 마법으로 길을 찾을 수 있습니다.\n\n이 근처에 타락한 수호자가 있습니다. 발트룩스와 연결된 마법의 편린을 지니고 있지요. 그것만 있으면 유물 본체를 찾을 수 있습니다.', '', '발트룩스의 힘에 타락해버리고 만 수호자입니다. 유물의 위치를 알아내는 데 필요한 비밀을 품고 있습니다.', '에다빅스', '', '', '', 47187),
(70858, 'koKR', '임무 복귀', '얼음장 같은 해독제를 알리아 선소어에게 사용해야 합니다.', '자, 해독제가 준비됐습니다. 제가 알리아를 단단히 붙잡고 있을 테니, 용사님이 입에 해독제를 부어 넣으십시오.\n\n죽지 말아야 할 텐데요... 유물을 추적하려면 알리아의 마법이 꼭 필요합니다.', '', '', '', '', '', '알리아 선소어와 대화해야 합니다.', 47187),
(70856, 'koKR', '불로 처치하기', '화염방사기 횃불로 감염된 시체 $1oa구를 파괴해야 합니다.', '저 부정한 거미들은 시체에 알을 낳습니다.\n\n가끔 살아있는 사람에게 낳을 때도 있죠.\n\n놈들의 희생양으로 전락한 분리된 불길 시체를 몇 구 봐서 압니다.\n\n여기서 살아남아 분리된 불길을 쓰러뜨리려면 알들이 부화하지 못하게 막아야 합니다.\n\n이 횃불을 받으세요. 바람과 화염의 힘이 깃들어 있습니다. 불태우고 싶은 방향을 가리키면 나머지는 알아서 처리될 거예요.\n\n투스카르는 거미를 절대 만만하게 보지 않거든요. 다 이럴 줄 알고 대비를 해왔다, 이 말씀이죠.', '', '', '', '', '', '', 47187),
(70854, 'koKR', '상황 전달', '발드라켄의 새끼용 탁아소에 있는 자이한나에게 가야 합니다.', '잘해주셨어요, $n 님. 문질이도 열의있게 아주 잘 따라주었네요.\n\n자이한나가 애타게 소식을 기다리고 있을 테니, 얼른 좋은 소식을 전해주세요!', '', '', '', '', '', '', 47187),
(70853, 'koKR', '문질이의 친구', '깨어나는 해안 야생의 보존지에서 부끄럼벌레를 포획해야 합니다.', '아까 말씀드렸던 것처럼 문질이에게 필요한 건 두 가지예요. 친구와 실전 경험이죠.\n\n한 번에 두 마리 새를 모두 잡을 방법이 있어요.\n\n이 지역은 부끄럼벌레라는 생명체들이 짝짓기 장소로 애용하는 곳이에요. 조금만 찾아봐도 여러 마리 찾을 수 있죠.\n\n덫으로 잡기 전에 약화해야 한다는 걸 잊지 마세요.\n\n한 마리 생포하는 대로 돌아오세요. 용사님과 한바탕한 뒤일 테니 약간 다친 상태겠지만, 제 수중에 있는 전투 훈련석으로 말끔하게 치료할 수 있을 거예요!', '', '', '', '', '', '', 47187),
(70851, 'koKR', '야성은 내 운명', '하니코를 통해 문질이에게 무엇이 필요한지 알아야 합니다.', '말씀드릴 게 많아요. 일단 얘기 좀 나누고 문질이한테 뭐가 제일 좋을지 결정해봐요.', '', '', '', '', '', '', 47187),
(70850, 'koKR', '멜드라의 고난', '오리언 다크워터에게서 멜드라를 구출해야 합니다.', '훌륭합니다. 용사님이 적을 교란할 동안 야영지를 정찰했습니다. 오랜 친구 멜드라 플레임텅을 만나게 될 줄은 몰랐지만요.\n\n실종된 건 알고 있었습니다. 반란군에 가담했다는 소문이 돌았죠. 하지만 제가 보기엔 포로로 잡혀있는 것 같습니다!\n\n그냥 모르는 체하고 갈 순 없습니다. 용혈족 간수에게서 멜드라를 구해주십시오!', '', '반란군 지도자입니다. 원시 물의 사슬로 멜드라 플레임텅을 속박했습니다.', '오리언 다크워터', '', '', '', 47187),
(70849, 'koKR', '전문가가 필요해', '깨어나는 해안 야생의 보존지에서 하니코와 대화해야 합니다.', '문질이가 훨씬 나아졌네요. 여전히 도움의 손길이 좀 필요해 보이지만요. \n\n얼마 전에 하니코라는 똑똑한 용비늘 원정대원을 만난 적 있어요. 한시도 쉬지 않고 원시비룡을 연구하는 사람이었죠. 또, 애완동물 조련사이기도 하고요. 하니코라면 틀림없이 문질이를 도와줄 수 있을 거예요! \n\n깨어나는 해안으로 간다고 했으니, 한번 만나러 가보시죠.\n\n어쨌든 제가 도움을 드릴 수 있어 정말 기뻤습니다! \n\n<즐겁게 손을 흔들어주는 패추>\n\n안녕히 가세요! 문질이도 행운을 빌어.', '', '', '', '', '', '', 47187),
(70848, 'koKR', '잊힌 용의 문장', '엑사드리아에게 물품을 전달해야 합니다.', '<엑사드리아가 이 물품을 원할 것입니다.>', '', '', '', '', '', '', 47187),
(70847, 'koKR', '고대 흑요석 부적', '갈퀴추적자 카비아에게 물품을 전달해야 합니다.', '<갈퀴추적자 카비아가 이 물품을 원할 것입니다.>', '', '', '', '', '', '', 47187),
(70845, 'koKR', '티르의 발자취를 따라서', '하늘빛 평원에서 첫 번째 티르의 도전을 찾아야 합니다.', '수호자 티르 님은 모든 경우의 수를 생각하고 준비했습니다. 혁신의 동력장치도 그래서 만든 대비책으로, 이 세상의 장인들에게 강력한 힘이 필요할 때를 위한 설비입니다. 장치로 만든 특별한 재료를 사용하면, 물품의 역량을 필멸자의 한계 이상으로 끌어낼 수 있습니다.\n\n동력장치를 잘못된 방향으로 사용해서는 안 됩니다. 그래서 티르는 저를 만들고 그 힘을 원하는 자를 평가하는 역할을 맡겼습니다. 자격이 있는 자만이 동력장치의 능력을 최대로 다룰 수 있게 됩니다.\n\n도전을 이겨내실 수 있겠습니까?', '', '', '', '', '', '하늘빛 평원에서 첫 번째 티르의 도전을 찾아야 합니다.', 47187),
(70843, 'koKR', '룬석 망치기', '화염 룬석 보관함을 파괴해야 합니다.', '<반란군이 발드라켄에 설치하려 했던 것과 매우 비슷하게 생긴 룬석입니다.\n\n차이가 있다면 이 룬석은 미완성된 상태라는 거죠. 다만 저 멀리 완성된 룬석이 들어 있는 보관함이 보입니다.\n\n보관함을 부수면 반란군이 사용 못 하게 막을 수 있을 것입니다.>', '', '', '', '', '', '', 47187),
(70842, 'koKR', '지점 폭파', '안개의 골짜기 지도를 수집해야 합니다.', '장담컨대 반란군이 향후 공격 계획을 담은 문서를 만들어뒀을 겁니다. 실행에 옮기기 전에 속셈을 알아내야 합니다.\n\n야영지에서 표시된 지도를 찾아보십시오. 발드라켄에서 입수한 것과 같은 형태일 겁니다.', '', '', '', '', '', '', 47187),
(70841, 'koKR', '더 많은 티탄 유물', '', '', '', '', '', '', '', '', 47187),
(70840, 'koKR', '티탄 유물', '', '', '', '', '', '', '', '', 47187),
(70839, 'koKR', '티탄 유물 탐색 작전', '', '', '', '', '', '', '', '', 47187),
(70838, 'koKR', '반란군의 명분', '반란군 및 원시술사 $1oa명을 처치해야 합니다.', '반란군 거점... 지금껏 이 장소를 찾겠다고 얼마나 고생했는지 모릅니다. 파괴공작원의 부주의가 우리에겐 요행이 됐군요.\n\n피를 나눈 동족이 다른 누구도 아닌 원시술사와 결탁하다니 보고도 믿기 어렵습니다. 이대로 있을 때가 아닙니다. 반란군과 원시술사 동맹이 더 큰 혼란을 야기하기 전에 제거해야 합니다.', '', '', '', '', '', '', 47187),
(70837, 'koKR', '단서를 따라서', '안개의 골짜기에서 수사관 에리마를 만나야 합니다.', '<지도를 살펴보는 수사관 에리마>\n\n위상의 권좌 위에 휘갈긴 X가 무슨 뜻인지는 분명합니다.\n\n하지만 안개의 골짜기에도 원이 그려져 있습니다. 어쩌면 반란군의 다음 목표일 수도 있습니다. 작전기지일 수도 있고요.\n\n알아내는 방법은 하나뿐입니다. 골짜기에서 만납시다.', '', '', '', '', '', '', 47187),
