(70783, 'koKR', '스카라', '', '', '', '', '', '', '', '', 47187),
(70781, 'koKR', '갑작스러운 파란', '푸른깃 절벽에서 할린 처프스나이드를 찾아야 합니다.', '방금 보셨습니까?\n\n웬 날개 달린 생명체가 하늘에서 뚝 떨어졌습니다! 뭔지는 몰라도, 이 섬에 살던 토착 생명체는 절대 아닙니다.\n\n잠깐... 그러고 보니 웬 작은 고블린이 푸른깃 절벽으로 가는 길을 물어봤습니다. 그 사람이 뭔가 아는 게 있지 않겠습니까?', '', '', '', '', '', '', 47187),
(70780, 'koKR', '온아라의 깃발', '', '', '', '', '', '', '', '', 47187),
(70779, 'koKR', '타르진의 이야기', '용의 섬의 강력한 용과 원시용에게서 인상적인 용 두개골 $1oa개를 입수해야 합니다.', '<여전히 멀리 떨어진 섬을 바라보며 말을 이어 나가는 타르진>\n\n너 따위가 자라딘의 경이로운 전설과 역사를 들을 자격이 있다고 생각하나?\n\n우리가 휘두르는 무기보다 작은 네 녀석이? 쯧쯧.\n\n너는 우리 종족의 명맥을 감당하지도 못할 것이다.\n\n내게 틀렸다면 어디 증명해 보아라. 이 섬에서 유일하게 경쟁자로서 자격을 갖춘 용을 찾아보란 말이다.\n\n가장 강력한 용을 쓰러뜨리고 전리품을 가져오도록.', '', '', '', '', '', '', 47187),
(70763, 'koKR', '세계분쇄자 아티르', '', '', '', '', '', '', '', '', 47187),
(70754, 'koKR', '화염의 원시술사 진압하기', '레텔시에게 원시 핵을 가져가야 합니다.', '발드라켄에서 원시술사를 연구하는 레텔시에게 이 물건을 가져가면 고맙게 생각할 것입니다.', '', '', '', '', '', '', 47187),
(70753, 'koKR', '바람 원시술사 흩뜨리기', '레텔시에게 원시 핵을 가져가야 합니다.', '발드라켄에서 원시술사를 연구하는 레텔시에게 이 물건을 가져가면 고맙게 생각할 것입니다.', '', '', '', '', '', '', 47187),
(70752, 'koKR', '물의 원시술사 증발시키기', '레텔시에게 원시 핵을 가져가야 합니다.', '발드라켄에서 원시술사를 연구하는 레텔시에게 이 물건을 가져가면 고맙게 생각할 것입니다.', '', '', '', '', '', '', 47187),
(70751, 'koKR', '경건한 신자 테릴로드', '', '', '', '', '', '', '', '', 47187),
(70750, 'koKR', '협의회 지원', '용의 섬 전역에서 지속적으로 발드라켄 협의회와 동맹을 지원해야 합니다.', '거기 당신! 그래요! 당신 말입니다. 당신 말고 부를 사람이 또 있습니까?\n\n<여러 사람 지나가는 광경을 본 테라잘>\n\n아니요, 저는 제가 들어본 사람을 부른 겁니다. 당신처럼 유명한 사람 말입니다! \n\n저는 발드라켄 협의회에서 나왔습니다. 섬에서 실력 좋기로 이름난 자를 찾고, 이들한테 협의회의 동맹 및 이들의 안전을 최우선으로 생각하는 작업을 맡기고 있습니다.\n\n이미 잘 하는 일을 하시면 됩니다. 보수는 후하게 드리겠습니다.', '', '', '', '', '', '', 47187),
(70748, 'koKR', '푸른용만이 볼 수 있는 것', '하늘빛 기록 보관소에서 말리고스의 기록을 찾아야 합니다.', '네 동료들이 아직 아무것도 못 알아낸 게 그리 대수로운 일은 아니다.\n\n애초에 이곳 장서는 오직 푸른용만 볼 수 있게 되어 있거든. \n\n그래도 내가 왔으니 저들의 비밀이 담긴 고서를 몇 권 정도는 찾을 수 있을 것이다.', '', '', '', '', '', '', 47187),
(70747, 'koKR', '하늘빛 마법사', '안토니다스 야영지에서 대마법사 카드가와 대화해야 합니다.', '마법사란 족속하고 어물쩍거리고 싶진 않군요. \n\n$p 님, 가서 저 \"대마법사\"라는 자를 좀 상대해 주셨으면 합니다. 캐낼 수 있는 정보는 캐내되, 항상 경계의 끈을 놓지 마세요. 아군인지 적인지는 아직 모르는 것이니...\n\n보고에 따르면 이곳 남쪽에 거대한 기록 보관소가 있다고 합니다. \n\n전 그곳으로 향하겠습니다.', '', '', '', '', '', '', 47187),
(70746, 'koKR', '푸른 그늘', '엠버탈과 텔라시를 따라 안토니다스 야영지로 가야 합니다.', '이봐, $p!\n낯익은 얼굴을 보니 반갑군. 마침 텔라시와 함께 보고에 대한 논의를 나누고 있었다. 이 일대에... 새로운 자들이 출현했거든.\n\n<목소리를 낮추는 엠버탈>\n\n푸른용이 왔다.\n\n푸른용과 우린... 과거가 좀 있지 않나. 그래서 상황을 파악할 겸 텔라시와 같이 온 거다. \n\n같이 가줬으면 좋겠어.', '', '', '', '', '', '', 47187),
(70745, 'koKR', '강제 휴식', '정령 소환사를 처치해야 합니다.', '당신이 찾은 원시술사들이 우두머리는 아닐 겁니다. 작은 개 하나 어쩌지 못하고 벌벌 떨어댄 걸 보면 말이죠!\n\n아마 진짜 우두머리는 원시술사들이 말한 그 바드네라는 자일 겁니다. 정령을 불러들이는 것도 그자일 겁니다. 그 소환사를 잡아야 하는데, 이렇게까지 난장판을 만든 걸 보니 가까이 있는 게 분명합니다. 여기 바로 밑에 동굴이 있으니 확인해 보세요. 직원들이 게으름 피울 때 자주 쓰는 곳이라 잘 압니다.', '', '증기와 화염의 소환사로, 적을 산 채로 요리하는 걸 즐기는 원시술사입니다.', '바드네 블릭하트', '', '', '', 47187),
(70744, 'koKR', '이 뼈 좀 봐!', '어지럽혀진 현장 $1oa곳을 청소해야 합니다.', '<사방에 묻은 혈흔을 없애면 온천 관리자가 고맙게 생각할 것입니다...>', '', '', '', '', '', '', 47187),
(70743, 'koKR', '소중한 아기', '엘자라의 아기를 찾아야 합니다.', '이봐, 거기 당신! $pr! 반푼이는 아니지?\n\n일의 우선 순위는 잘 파악하겠지?\n\n그래!\n\n우리 소중한 아이가 사라졌어. 지금 당장 구해줘. 서둘러야 해. 이런 끔찍한 환경에서 버티면 얼마나 버티겠어.', '', '', '', '', '', '', 47187),
(70742, 'koKR', '유전', '흑요석 관측소에서 드랙티르의 과거에 관한 단서를 찾아야 합니다.', '하늘에서 정찰을 해보니, 폐허 입구 근처에 에드레스가 발견한 유물이 하나 보이더군. 분명 안에는 더 많은 유물이 있겠지.\n\n한데 어떻게 된 일인지 녀석들이 경계 태세를 유지하고 있었다. 좀 더 접근해봐야 자세히 알아볼 수 있겠지만 말이야. 이곳에 깃든 마법은 매우 오래됐어.\n\n당장은 버려진 장소처럼 보이지만, 우리가 수색을 시작하면 그것도 옛말이 될 거다. 경계를 늦추지 마라. 알아낼 수 있는 정보는 모두 알아내야 해.', '', '', '', '', '', '', 47187),
(70741, 'koKR', '애정 가득한 물건', '사라진 소지품 $1oa개를 수집해야 합니다.', '<정황을 보아하니 요우가 수업이 방해를 받은 것 같습니다. 개인 소지품이 사방에 널브러져 있습니다.\n\n물품을 모아다 주면 평온의 꿈 온천에 큰 도움이 될 것입니다.>', '', '', '', '', '', '', 47187),
(70740, 'koKR', '증기 청소', '하부 온천에서 정령 $1oa마리를 처치해야 합니다.', '시잔은 우리의 아름다운 온천에 정령들이 들이닥친 사건을 별것 아닌 일로 생각하는 모양인데, 당장 쇄도하는 불꽃과 증기를 통제해야 해요.\n\n온천 하층에서 공연할 악단을 섭외했는데, 정령들이 공연 장비를 망가뜨렸어요. 문제가 이러게 심한 적은 없었어서, 분명 원시술사의 짓일 거예요\n\n돕고 싶으면 우선 온천 하층 동쪽에 있는 공격적인 정령들 위주로 처리해 주세요. 행사가 그곳에서 열리기로 되어 있거든요.', '', '', '', '', '', '', 47187),
(70739, 'koKR', '혈통과 사랑, 그리고 티라이', '사냥꾼 나르만이 청혼을 위한 전통 축복을 받을 수 있도록 도와야 합니다.', '나는 칸들과 함께 사냥하고, 가장 빠른 바카르를 추월해 내달리고, 맨손으로 다 큰 브루팔론 수컷과 힘겨루기를 벌였다. 사냥꾼으로서는 더 증명할 게 남아 있지도 않아.\n\n하지만 동반자로서는 아직도 배울 게 많지.\n\n온이르 부족의 바람현자 다와는 나의 기쁨이고 사랑이다. 그의 사랑을 받을 자격이 있다는 걸 보여주고 싶다. 하지만 난 전통이나 의식에 대해서는 완전히 문외한이다. 그래서 마루카이에 있는 장로들의 조언이 필요하다.', '', '', '', '', '', '마루카이 시카르 오름길에 있는 사냥꾼 나르만과 대화해야 합니다.', 47187),
(70738, 'koKR', '요우가 수업', '강사와 요우가 수강생 $1oa명을 찾아야 합니다.', '이놈의 정령들은 왜 지금껏 조용히 있다가 갑자기... 음, 운영상 문제를 일으키는 걸까요?\n\n손님들이 편하게 영업장을 이용하던 중 놈들이 나타났습니다. 모든 게 엉망이 됐습니다. 새로 오신 요우가 강사님마저도 심란해지셨을 거예요. \n\n아, 요우가라는 건 명상도 같이하는 새로운 방식의 몸풀기 운동입니다. 아마 강사님도 수강생들도 너무 느긋해져서 정령이 있는지도 모르겠죠. \n\n어쨌든 안전이 우선이니, 사람들 안전을 확인해 주셨으면 합니다.', '', '', '', '', '', '', 47187),
(70732, 'koKR', '실전 경험', '애완동물 대전에서 그워시를 꺾어야 합니다.', '좋아요! 문질이에 전투석을 사용했으니, 실전 경험에서 기술을 시험해볼까요!\n\n이곳 북쪽 해안에 가면 그워시라는 덩치 큰 용뿔두꺼비가 살고 있어요. 그워시는 싸움을 좋아해요! 어, 노는 것 말이에요. 그워시는 다른 애완동물과 아주 잘 지낸답니다!\n\n문질이와도 잘 놀 거예요... 제 말은 잘 싸울 거라고요.', '', '', '', '', '', '', 47187),
(70730, 'koKR', '베푸는 시카르', '바람현자 다와를 도와 완벽한 청혼을 준비해야 합니다.', '아, $p.\n\n햇살이 선사하는 편안함이 느껴지나? 따뜻하게 보듬어주는 태양의 손길에 안전함을 느끼는지 궁금하군. 매일매일 미래가 기대되고, 평생 꿈꿔왔던 삶을 살아갈 기회가 왔다는 생각은 안 드나?\n\n그렇다면 나처럼 사랑에 빠진 거다.\n\n시카르 부족의 나르만은 나의 태양이고, 온기이며, 빛이고, 희망이야.\n\n그러니 그의 격에 맞는 훌륭한 청혼이 되어야 하겠지.\n\n어떻게 하면 좋을지 온께 여쭤보는 게 좋겠군.', '', '', '', '', '', '', 47187),
(70723, 'koKR', '대지의 원시술사 분쇄하기', '레텔시에게 원시 핵을 가져가야 합니다.', '발드라켄에서 원시술사를 연구하는 레텔시에게 이 물건을 가져가면 고맙게 생각할 것입니다.', '', '', '', '', '', '', 47187),
(70722, 'koKR', '문질이에게 필요한 것', '이스카라에서 패추와 대화해야 합니다.', '$n 님, 우리가 할 일은 정해져 있어요.\n\n일단 얘기 좀 해요.\n\n다 끝나면 드릴 선물도 있어요! 재밌겠죠?', '', '', '', '', '', '', 47187),
(70721, 'koKR', '온 마음을 담아', '바람현자 다와와 사냥꾼 나르만의 청혼을 도와야 합니다.', '하늘의 거울 근처에 작은 연못이 하나 있다. 내가 수습생 훈련을 받던 시절, 나르만과 처음으로 만난 곳이지.\n\n수습생은 온아라와 좀 더 가까워져 바람을 느끼기 위해 그 연못을 찾아가곤 한다. 갑작스럽게 불어온 산들바람에 눈을 떴을 때, 연못 수면에 비치던 그의 모습을 본 게 첫 만남이었지. 이 평야에서 가장 아름다운 풍경이었다고 단언할 수 있다.\n\n청혼을 하기에 더없이 완벽한 장소야.', '', '', '', '', '', '', 47187),
(70719, 'koKR', '망령절단자 트라켄', '', '', '', '', '', '', '', '', 47187),
(70716, 'koKR', '용군단 (70) E', '', '', '', '', '', '', '', '', 47187),
(70715, 'koKR', '용군단 (70) E', '', '', '', '', '', '', '', '', 47187),
(70711, 'koKR', '강 급류 비행로 - 고급', '활공하여 고리를 통과해야 합니다.', '경로의 통과 지점 고리를 통과해야 합니다.', '', '', '', '', '', '', 47187),
(70710, 'koKR', '강 급류 비행로', '활공하여 고리를 통과해야 합니다.', '경로의 통과 지점 고리를 통과해야 합니다.', '', '', '', '', '', '', 47187),
(70708, 'koKR', '텅 빈 마음', '콜가르와 한잔해야 합니다.', '꼭 몇 년이 흐른 기분이군. 불과 몇 분밖에 안 된 것 같기도 하고 말이오.\n\n말동무가 필요해서 그런데, 잠시 괜찮겠소? \n\n우선 음료를 부탁하고 싶소. 뭐든 괜찮다오. 돈은 내가 내리다.', '', '', '', '', '', '', 47187),
(70706, 'koKR', '차원문: 그늘진 성역', '온아라 평야의 그늘진 성역에 있는 휴면 중인 차원문을 찾아야 합니다.', '원정대 보고가 들어왔네. 남서쪽 울창한 언덕 지역에 휴면 상태인 돌이 있다는군. 좀 멀지만 자네처럼 지식을 갖춘 사람을 보내볼 만하지.', '', '', '', '', '', '', 47187),
(70703, 'koKR', '티르홀드의 유산', '티르홀드에서 코라노스와 은빛 비늘을 조사해야 합니다.', '수호자 티르께서는 수수께끼를 좋아하셨다. 그분이 우리에게 주신 선물에도 깊은 속뜻이 숨어 있겠지. 예전에 머무르셨던 성채에서 이 비늘을 만들었을 가능성이 큰 만큼, 성채의 비밀을 풀어내는 열쇠 그 자체가 될지도 모른다.\n\n$n, 코라노스와 함께 티르홀드로 가거라. 코라노스는 믿음직한 고문이자 이 땅의 감시자이니, 분명 의미 있는 조언을 해줄 수 있을 것이야.', '', '', '', '', '', '티르홀드에서 코라노스와 대화해야 합니다.', 47187),
(70702, 'koKR', '계속되는 차원문 탐험', '깨어나는 해안의 루비비늘 전초기지에서 테일린 다크앤빌을 만나야 합니다.', '<작은 전령이 내는 크고 끽끽거리는 소리가 시선을 사로잡습니다. 당신의 손에 쪽지를 건네주고는 도망갑니다.\n\n쪽지에는 테일린 다크앤빌이 당신의 도움을 구한다는 내용이 적혀 있습니다.>', '', '', '', '', '', '', 47187),
(70701, 'koKR', '바카르는 길 잃은 큰뿔양의 꿈을 꾸는가', '길 잃은 큰뿔양을 아일라그 부족으로 돌려보내야 합니다.', '우리 부족의 큰뿔양 일부가 또 무리에서 나와 떠돌아다니고 있다.\n\n주변에 있는 산등성이는 목동들이 찾아다니기에는 너무 위험한 곳이다. 바카르를 데리고 가서 큰뿔양을 다시 몰아와 준다면 큰 도움이 될 거다. 우리 목동들이 방향을 알려줄 거다.', '', '', '', '', '', '', 47187),
(70698, 'koKR', '연구원 스닉윙', '', '', '', '', '', '', '', '', 47187),
(70697, 'koKR', '전문가의 의견', '하늘빛 평원에서 패추와 대화해야 합니다.', '문질이의 부상은 회복됐지만, 자신감은 여전히 상처투성이인 것 같아서 걱정이에요. 다른 이들에게 도움을 청할 때가 된 것 같군요.\n\n하늘빛 평원 남서쪽 극단에 패추라는 애완동물 조련사가 머무는 외딴 구역이 있습니다. 이런 문제를 해결하는 데 있어 최고의 권위자로 꼽히는 인물이죠.\n\n패추를 찾아가 주세요. 분명 문질이를 도와줄 수 있을 거예요!', '', '', '', '', '', '', 47187),
(70662, 'koKR', '뼈와 곡괭이', '', '', '', '', '', '', '', '', 47187),
(70659, 'koKR', '온아라 평야 분류 사업', '', '', '', '', '', '', '', '', 47187),
(70658, 'koKR', '유물인가, 허구인가', '', '', '', '', '', '', '', '', 47187),
(70653, 'koKR', '내한성의 과학', '', '', '', '', '', '', '', '', 47187),
(70652, 'koKR', '하나를 내려서 넘겼네', '', '', '', '', '', '', '', '', 47187),
(70648, 'koKR', '불을 살려내는 자 피라바', '', '', '', '', '', '', '', '', 47187),
(70647, 'koKR', '땅으로 꺼졌나 하늘로 솟았나?', '문질이를 구출한 후 발드라켄의 꼬마 비늘 탁아소에 있는 자이한나에게 데려가야 합니다.', '$n 님, 정말 반가워요! 실은 걱정되는 일이 있는데, 도움을 좀 받고 싶어요.\n\n얼마 전에 버려진 원시비룡 새끼용을 구조해서 문질이란 이름을 붙여주고 돌보고 있었어요. 얘가 정말 깜찍하거든요! 이곳으로 데려와 보살피면서 누군가의 애완동물로서 행복하게 지내게 해주고 싶었어요.\n\n근데 어디 갔는지 안 보여요. 길을 잃었거나 다친 건 아닌지 걱정됩니다. 저는 다른 아이들을 지켜봐야 해서 움직일 여유가 없는데, 대신 찾아봐 주실 수 있을까요?', '', '', '', '', '', '', 47187),
(70644, 'koKR', '난폭한 염소 조련기', '', '', '', '', '', '', '', '', 47187),
(70643, 'koKR', '비전 폭발물', '', '', '', '', '', '', '', '', 47187),
(70641, 'koKR', '깨어나는 서약', '루비 생명의 제단에 있는 붉은용군단 구성원과 대화해야 합니다.', '잠깐 기다리거라, $p|1이여;여;. 우리 서약의 돌 복구를 도와준 것에 대하여 내 개인적으로 감사를 표하고 싶구나.\n\n금지된 해안에서 너희가 깨어나기 전까지, 드랙티르에 관하여는 나조차도 알지 못하였다. 너희의 귀환이 무엇을 뜻할지 분명하지 않았지. 생명을 지키는 사명에 내려진 은총일지... 저주일지 말이야.\n\n네가 우리 서약의 돌에 대해 더 많은 것을 알게 되면 좋겠구나. 여기 루비 생명의 제단에 있는 내 용군단과 얘기를 나눠보거라. 어쩌면 너도 유사점을 찾을지도 모르지.', '', '', '', '', '', '', 47187),
(70640, 'koKR', '현상 수배: 우두머리', '안토니다스 야영지에서 프리젤루스를 처치해야 합니다.', '<글귀에서 은은한 푸른색 빛이 뿜어져 나옵니다.>\n\n과거 말리고스가 아꼈던 장난감 정령, 프리젤루스가 주인의 방치 속에서 삐뚤어지고 말았습니다. \n\n한때 행복이 넘쳤던 이 서식지가 무너져 내리면서 이 버릇없고 쾌활했던 생명체도 이 땅을 좀먹는 악에 의해 뒤틀렸습니다.\n\n안전을 위해 무력화해 주시기 바랍니다.\n\n성공 시 관리인 시네고스에게 말씀하시면 됩니다.', '', '', '프리젤루스', '', '', '', 47187),
(70638, 'koKR', '바람 파괴자', '', '', '', '', '', '', '', '', 47187),
(70634, 'koKR', '힐난', '', '', '', '', '', '', '', '', 47187),
(70633, 'koKR', '동력장치의 동력원', '병에 담긴 정수를 사용해 혁신의 동력장치를 강화해야 합니다.', '수호자 티르 님이 남긴 첫 번째 도전을 훌륭하게 통과하셨습니다. 아직 첫 번째 단계일 뿐이지만, 당신이라면 잘 해내리라 믿습니다. 이제 제련소의 비밀을 더 알아낼 때가 왔습니다. \n\n병에 담긴 정수를 혁신의 동력장치에 넣고 어떤 일이 발생하는지 봅시다.', '', '', '', '', '', '', 47187),
(70632, 'koKR', '깨어나는 해안 분류 작업', '', '', '', '', '', '', '', '', 47187),
(70631, 'koKR', '하늘 정리', '', '', '', '', '', '', '', '', 47187),
(70627, 'koKR', '겨울가죽 부족의 운명', '테론의 감시터에서 소노바 스노우덴을 만나야 합니다.', '다른 부족에 합류하는 방법도 있지만... 안전을 확보하는 게 우선입니다.\n\n원시술사들이 우리처럼 다른 부족에도 손을 내밀진 않았을지 걱정입니다. \n\n\"용비늘 원정대\" 말로는 겨울가죽 부족 근처에 거점을 두고 있다고 합니다.\n\n겨울가죽 부족까지 오염됐을지도 모릅니다. 경고를 들어울지도 모르고요. 어느 쪽이든 그들에게 우리가 필요한 건 사실이죠.\n\n테론의 감시터에 소노바 스노우덴이라는 \"펄볼그 전문가\"가 있습니다. 그를 찾아가 정보를 모아주셨으면 합니다.', '', '', '', '', '', '', 47187),
(70625, 'koKR', '주문벼림 창조물', '', '', '', '', '', '', '', '', 47187),
(70620, 'koKR', '비늘을 차곡차곡', '견고한 비늘 $1oa개를 채집해 발드라켄에 있는 투박한 랄라토르에게 가져가야 합니다.', '어떻게 무두질을 그렇게 잘하냐는 질문을 많이 받습니다. 그런 질문을 받을 때마다 이렇게 말합니다. \'비늘이 답이다.\' \n\n궁금하신가요? 비늘을 가져오시면 무슨 뜻인지 보여드리겠습니다.', '', '', '', '', '', '', 47187),
(70618, 'koKR', '가열로의 부름', '세레바이트 광석 $1oa개를 채집해 발드라켄에 있는 잠복자 세키타에게 가져가야 합니다.', '가열로의 말을 들었습니다. 가열로가 세레바이트를 원합니다. 거기 당신! 어서 가서 세레바이트를 가져오십시오! 아주 많이! <미친 듯이 웃기 시작하는 세키타>', '', '', '', '', '', '', 47187),
(70617, 'koKR', '다 내 거야, 전부 다!', '드라코니움 광석 $1oa개를 채집해 발드라켄에 있는 잠복자 세키타에게 가져가야 합니다.', '드라코니움 광석만큼 쓸모 있는 물건도 없습니다. 무궁무진한 가능성을 가진 광물이지요! 모든 면에서 완벽합니다.\n\n드라코니움을 가져오십시오. 꼭 가져야겠습니다. 광부라면 어서 광질을 하세요!', '', '', '', '', '', '', 47187),
(70613, 'koKR', '아프니까 격통이다', '격통껍질 $1oa개를 채집해 발드라켄에 있는 아그리쿠스에게 가져가야 합니다.', '$p 님, 당신은 솜씨 좋은 약조채집가지요? 연금술사들이 매일 격통껍질을 달라고 문을 두드리는 통에... 아니, 문은 없지만, 아무튼 재고가 동나게 생겼습니다. \n\n좀 모아주실 수 있으실까요? 행여나 재료가 부족하기라도 하는 날엔 약을 못 만든 연금술사들이 제 물건을 실험 용품으로 써버릴 겁니다...', '', '', '', '', '', '', 47187),
(70595, 'koKR', '재봉술 지원 요청', '장인 무역연합의 재봉술 주문 제작 의뢰를 완료해야 합니다.', '안녕하세요! 반가워요! 잘 부탁해요, $p 님! 주문 제작 의뢰가 정신없이 들어오고 있어요!\n\n일감이 필요하다면 언제든 장인 무역연합을 찾아 주세요. 주문은 늘 있으니까요!\n\n공개 주문을 살펴도 좋고, 단골들을 만들어 뒀다면 길드 주문이나 개인 주문을 받아도 괜찮아요! 어떤 방식으로든 일만 해내면 그만이죠!', '', '', '', '', '', '', 47187),
(70594, 'koKR', '가죽세공 지원 요청', '장인 무역연합의 가죽세공 주문 제작 의뢰를 완료해야 합니다.', '안녕하세요! 반가워요! 잘 부탁해요, $p 님! 주문 제작 의뢰가 정신없이 들어오고 있어요!\n\n일감이 필요하다면 언제든 장인 무역연합을 찾아 주세요. 주문은 늘 있으니까요!\n\n공개 주문을 살펴도 좋고, 단골들을 만들어 뒀다면 길드 주문이나 개인 주문을 받아도 괜찮아요! 어떤 방식으로든 일만 해내면 그만이죠!', '', '', '', '', '', '', 47187),
