(70592, 'koKR', '주문각인 지원 요청', '장인 무역연합의 주문각인 주문 제작 의뢰를 완료해야 합니다.', '안녕하세요! 반가워요! 잘 부탁해요, $p 님! 주문 제작 의뢰가 정신없이 들어오고 있어요!\n\n일감이 필요하다면 언제든 장인 무역연합을 찾아 주세요. 주문은 늘 있으니까요!\n\n공개 주문을 살펴도 좋고, 단골들을 만들어 뒀다면 길드 주문이나 개인 주문을 받아도 괜찮아요! 어떤 방식으로든 일만 해내면 그만이죠!', '', '', '', '', '', '', 47187),
(70591, 'koKR', '기계공학 지원 요청', '장인 무역연합의 기계공학 주문 제작 의뢰를 완료해야 합니다.', '안녕하세요! 반가워요! 잘 부탁해요, $p 님! 주문 제작 의뢰가 정신없이 들어오고 있어요!\n\n일감이 필요하다면 언제든 장인 무역연합을 찾아 주세요. 주문은 늘 있으니까요!\n\n공개 주문을 살펴도 좋고, 단골들을 만들어 뒀다면 길드 주문이나 개인 주문을 받아도 괜찮아요! 어떤 방식으로든 일만 해내면 그만이죠!', '', '', '', '', '', '', 47187),
(70589, 'koKR', '대장기술 지원 요청', '장인 무역연합의 대장기술 주문 제작 의뢰를 완료해야 합니다.', '안녕하세요! 반가워요! 잘 부탁해요, $p 님! 주문 제작 의뢰가 정신없이 들어오고 있어요!\n\n일감이 필요하다면 언제든 장인 무역연합을 찾아 주세요. 주문은 늘 있으니까요!\n\n공개 주문을 살펴도 좋고, 단골들을 만들어 뒀다면 길드 주문이나 개인 주문을 받아도 괜찮아요! 어떤 방식으로든 일만 해내면 그만이죠!', '', '', '', '', '', '', 47187),
(70586, 'koKR', '무수한 요리사의 향연', '야생천 요리사 모자 $1oa개를 만들어 발드라켄에 있는 풀라퐁에게 가져가야 합니다.', '$p 님, 제가 재봉사로 일하면서 배운 것이 하나 있다면 요리사가 많으면 일을 망친다는 겁니다.\n\n이번에는 제가 술을 마시려고 나가는데 마지막 순간에 옷장을 가득 채울만큼 요리사 제복을 만들어 달라는 의뢰를 받았습니다.\n\n모자를 좀 만들어주시면, 다른 건 제가 만들겠습니다.', '', '', '', '', '', '', 47187),
(70571, 'koKR', '북 급구!', '야성의 가죽 북 $1oa개를 만들어 발드라켄에 있는 가죽장인 코루즈에게 가져가야 합니다.', '우리가 만든 북은 품질이 좋기로 유명하지요. 켄타우로스는 몇 대에 걸쳐 북 제작 기술을 갈고 닦았습니다.\n하지만 이 말은 곧 북 재고가 많이 부족하다는 뜻이기도 합니다.\n\n보아하니 기술자이신 것 같은데, 저를 도와 북을 몇 개 만들어주지 않으시겠습니까?', '', '', '', '', '', '', 47187),
(70569, 'koKR', '트리스켓에게 과제를', '약초채집꾼의 꽃바구니 $1oa개를 만들어 발드라켄에 있는 가죽장인 코루즈에게 가져가야 합니다.', '트리스켓은 제가 아끼는 단골 중 한 명이지요. 최근에 약초 채집용 주머니가 많이 해져 저를 찾아왔었습니다.\n\n오래된 주머니를 대체할 만한 가죽 바구니를 만들어주겠다고 했습니다.\n\n$p, 이번 일을 좀 도와주시겠습니까? 트리스켓도 고마워할 겁니다.', '', '', '', '', '', '', 47187),
(70567, 'koKR', '바카르에게 뼈다귀를 줬을 때', '뼈다지 석궁 $1oa개를 만들어 발드라켄에 있는 가죽장인 코루즈에게 가져가야 합니다.', '세공이 끝내주는 뼈로 만든 석궁이 있었는데, 사용하기도 전에 바카르들에게 물어뜯기고 말았습니다. 바카르는 석궁이든 아니든, 뼈라면 다 좋아하지요. 그래서 모두 망가졌다 이 말입니다!\n\n새 석궁 만드는 일 좀 도와주시겠습니까?', '', '', '', '', '', '', 47187),
(70565, 'koKR', '포화도 기준 분류', '임박한 위험의 펜던트 $1oa개를 만들어 발드라켄에 있는 툴루라도르미에게 가져가야 합니다.', '아, 보석세공인 친구. 제 목걸이 어떻습니까?\n\n물론 마음에 들겠죠. 하지만 더욱 눈에 띄지 않으면 뽐내고 다닐 수가 없어요.\n\n좋은 생각이 있습니다! 간단한 디자인의 펜던트를 만들어서 시장에 잔뜩 팔아 보시는 건 어떻습니까? 모두가 당신이 만든 펜던트를 하고 다니면, 제 목걸이는 더 빛날 수 있을 겁니다!', '', '', '', '', '', '', 47187),
(70564, 'koKR', '적당한 안경', '분리된 오닉스 확대경 $1oa개를 만들어 발드라켄에 있는 툴루라도르미에게 가져가야 합니다.', '보석세공인 친구. 전시회가 다가오고 있는데, 고객들이 적당한 확대경 없이는 각 세공품의 아름다움을 제대로 볼 수 없을 것 같아 걱정스럽습니다.\n\n멋지게 만들 필요는 없으니, 잘 볼 수 있을 만한 확대경 몇 개만 만들어 주시겠습니까?', '', '', '', '', '', '', 47187),
(70560, 'koKR', '사상 최강의 도구: 적절한 문서', '탐험가의 필수 도감 $1oa개를 만들어 발드라켄에 있는 탈렌다라에게 가져가야 합니다.', '주문각인사 수습생 친구, 오늘 뭔가 쓸 준비가 되었나요? 용비늘 원정대가 모험하면서 휘갈긴 방대한 양의 기록물을 주고 가면서, 우리가 그 악필로 적힌 서류뭉치를 현장에서 바로 읽을 수 있는 검토서로 편찬할 수 있는지 물어보더군요. 그런데 저는 오늘 그 일을 할 수가 없어요. 다시 한번 도움을 부탁드려도 될까요?', '', '', '', '', '', '', 47187),
(70559, 'koKR', '깃펜 지원', '주문각인사의 고정식 깃펜 $1oa개를 만들어 발드라켄에 있는 탈렌다라에게 가져가야 합니다.', '주문각인사 수습생 친구, 만나서 반가워요.\n\n오늘 아침에 수습생 몇 명이 와서 주문각인을 시험했어요. 모두 힘이 너무 많이 들어가서 깃펜 촉을 부러뜨리고 말았죠!\n\n죄송하지만 깃펜을 만들어줄 수 있을까요?', '', '', '', '', '', '', 47187),
(70557, 'koKR', '조준경 부족', '청동용군단 폭죽 $1oa개를 만들어 발드라켄에 있는 클링키클릭 섀터붐에게 가져가야 합니다.', '잘 지냈어요, 기계공학도 친구? 오늘은 중요한 일을 맡기려고 해요!\n\n아닌 게 아니라 사냥꾼들 사이에서 폭죽이 유행하는 것 같더라고요. 폭죽 소리로 오리를 놀라게 해서 펄쩍 뛰게 만들려는 속셈 같아요. 오리가 그런 술수에 넘어가 줄 정도로 머리가 안 돌아가진 않을 텐데... 뭐, 어쨌든 우린 돈 벌면 장땡이니까요! 잘할 수 있겠어요?', '', '', '', '', '', '', 47187),
(70550, 'koKR', '전당에 오신 것을 환영합니다', '코발트 전당에 있는 자빈과 대화하여 해당 지역에서 사용할 수 있는 능력을 살펴봐야 합니다.', '우릴 도와주셨으면 합니다. \n\n분리된 불길이 코발트 전당 대부분을 장악했습니다. \n\n부디 놈들에게 맞서는 데 힘을 빌려주십시오. 우리가 머릿수는 적지만 모험가님을 도와드릴 재주는 몇 가지 있습니다.', '', '', '', '', '', '', 47187),
(70542, 'koKR', '하늘빛 평원 대경주', '', '경로의 통과 지점 고리를 통과해야 합니다.', '', '', '', '', '', '', 47187),
(70541, 'koKR', '사냥 전술: 동반자', '사냥의 제전에서 바카르와 오후나 중 함께 싸울 동료를 선택해야 합니다.', '마루크 사이에서 네 명성은 나날이 높아지고 있다. 이제 포기를 모르는 바카르나 날렵한 오후나를 동반자 삼아 사냥에 참여할 수 있게 해주지.', '', '', '', '', '', '', 47187),
(70540, 'koKR', '기계공학자의 둘도 없는 친구', '다용도 도구 $1oa개를 만들어 발드라켄에 있는 클링키클릭 섀터붐에게 가져가야 합니다.', '반가워요, 기계공학도 친구. 뭘 찾고 있는데 혹시 그...\n\n저... 그것 좀 저한테...\n\n바로 그거야! 제 생각에는 상점에 더 많은 도구를 들이면 좋을 것 같아요. 뭔 말 하려는지 아시겠죠?', '', '', '', '', '', '', 47187),
(70533, 'koKR', '기름 가뭄의 재래', '격통불꽃 기름 $1oa개를 만들어 발드라켄에 있는 컨플라고에게 가져가야 합니다.', '비약 제조를 마무리하는 데 격통불꽃 기름이 최고의 재료라는 걸 알고 계십니까? 전 알고 있었지만, 재고가 다 떨어지고 말았습니다. 기름이 충분하지 않으면 작업을 할 수가 없습니다. $p, 제발 실험실의 재고를 보충하는 일을 도와주세요.', '', '', '', '', '', '', 47187),
(70532, 'koKR', '습격 지원', '원기회복의 치유 물약 $1oa개를 만들어 발드라켄에 있는 컨플라고에게 가져가야 합니다.', '아 $p, 반갑습니다. 최근 원시술사의 공격 때문에 용사들이 상처를 입었다고 해 치유 물약이 많이 필요합니다. 모험가시니까 몇 개 있으실 것 같은데, 정말 많이 필요합니다.', '', '', '', '', '', '', 47187),
(70531, 'koKR', '마나 시장', '공기의 마나 물약 $1oa개를 만들어 발드라켄에 있는 컨플라고에게 가져가야 합니다.', '$p 친구, 이번 주에 마나 물약에 대한 수요가 급격하게 증가했습니다. 고객들의 주문량을 따라가려면 당신의 도움이 필요합니다. 물론 숙련된 연금술사시니까 몇 개 있으시겠죠, 그렇죠?', '', '', '', '', '', '', 47187),
(70526, 'koKR', '온아라 평야 대경주', '', '경로의 통과 지점 고리를 통과해야 합니다.', '', '', '', '', '', '', 47187),
(70501, 'koKR', '사냥 자격증', '사냥의 제전 훈련 과업을 완료해야 합니다.', '아, 드디어 사냥꾼으로서 실력을 증명할 준비가 되셨나? 사방팔방 뛰면서 움직이는 걸 닥치는 대로 잡아들이는 게 아니라는 걸 명심하도록. 시카르의 사냥에는 의도가 있어야 한다. 부족민에게 식량과 가죽을 공급하고, 강대한 적에 맞서 힘을 증명하며, 자연의 균형을 맞추는 것이 우리가 사냥하는 이유다.\n\n우린 땅을 황량하게 만들 사냥은 하지 않아. 훗날의 사냥의 제전을 염두에 두고 씨앗을 뿌리지. 지금 내가 말한 지침을 따르며 능력을 증명한다면 우리와 함께하는 걸 허락하겠다.\n\n다만 그쪽 친구가 성공할 것 같진 않군그래.', '', '', '', '', '', '', 47187),
(70450, 'koKR', '수달의 황폐', '성가신 오투크를 겁줘서 쫓아내야 합니다.', '이봐, 친구. 오투크 녀석들이 자꾸 내가 잡은 걸 훔쳐가고 있어!\n\n마음만 같아선 폭파해버리고 싶은데 말이야... 투스카르 친구들은 그런 행동을 좋아하지 않는 눈치더라고. 자, 여기 오투크 퇴치 장치 MK-상.어.라는 녀석이야. 내가 만들었다고. 근데... 내가 맥주병이라.\n\n자네는 재주가 있는 것 같은데, 우리 모두를 도울 겸 부탁 하나 들어주지 않겠어? 장치를 활성화하고 저쪽을 헤엄치며 겁주면 된다고.', '', '', '', '', '', '', 47187),
(70446, 'koKR', '개인사', '흑요석 관측소에서 엠버탈을 만나야 합니다.', '이 기록 보관서를 살피던 중에 실마리를 찾았습니다. 흑요석 관측소가 대지의 수호자께 개인적으로 중요한 장소였다는 걸 암시하는 내용이었죠. 그곳에 우리 용군단의 역사가 얼마나 담겨 있을지는 상상에 맡길 뿐입니다.\n\n엠버탈 님이 관심을 두고 있는 영역이라 그분께도 보고해뒀습니다. 실수가 아니었길 바랄 뿐입니다.\n\n엠버탈 님이 먼저 정찰을 나가셨습니다. 부디 잘 보살펴 주세요. 군인으로서는 더할 나위 없이 유능한 분이지만, 아무래도 다소... 불안한 사안이라서요. 어떤 진실이 기다리고 있을지 누가 알겠습니까.', '', '', '', '', '', '', 47187),
(70444, 'koKR', '야성의 전장', '야성의 전장에서 굴그토크를 만나야 합니다.', '누구보다 용감한 시카르에게 고합니다! \n\n최고의 동료들을 모아 야성의 전장으로 향하십시오. 경쟁자를 제치고 흉포한 최강자의 자리에 오를 기회입니다다!\n\n힘을 증명하고 멋진 싸움을 보여주십시오!\n\n관련 약관과 조건이 적용됩니다.', '', '', '', '', '', '', 47187),
(70442, 'koKR', '연회 전투', '', '', '', '', '', '', '', '', 47187),
(70438, 'koKR', '물고기, 날다', '낚시 구멍 비축분을 보충하는 데 쓸 생선을 모은 다음, 비룡에 올라타 공중에서 투하해야 합니다.', '물고기들 입질이 영 시원찮죠?\n\n이 얘기를 하니 갑자기 생각이 하나 떠오르네요. 그런 전설이 있어요. 이 호수와 강에 처음부터 물고기가 서식한 건 아니었다고 하더군요. 듣기로는 용들이 물 구멍 위로 날아가면서 물고기를 던져 넣어 보충해 줬다지 뭐예요. 믿어지시나요?\n\n잘하면 모험가님과 비룡이 그 전설을 재현할 수 있지 않겠어요?', '', '', '', '', '', '', 47187),
(70437, 'koKR', '티르홀드를 향하여', '위상의 권좌에서 알렉스트라자를 만나야 합니다.', '용군단이 티르홀드를 방문한 지 수백 년이 지났구나.\n\n모체 서약의 돌이 정상적으로 기능하는지 알아보려면 직접 가서 보는 수밖에.\n\n위상의 권좌에서 얘기하자꾸나. 한때 티르께서 기거하셨던 요새에 어떤 위험이 도사리고 있을지 알아봐야 한다.', '', '', '', '', '', '티르홀드에서 알렉스트라자를 만나야 합니다.', 47187),
