(70414, 'koKR', '흔들리는 땅', '파열 토템을 놓아 붙잡힌 동굴석을 풀어줘야 합니다.', '어이구야, 도대체 일이 어떻게 돌아가는 거야? \n\n용암이 자아가 있는 것처럼 움직이면서 지하에서 온 정령 동굴석들을 집어삼키고 있어요. 분명 무언가 원인이 있을 텐데... 한번 알아봐야겠군요!\n\n우선 이 파열 토템을 사로잡힌 정령 옆에 놓아서 풀어주세요!', '', '', '', '', '', '', 47187),
(70412, 'koKR', '용 경주 - 야생의 보존지 활강로', '', '', '', '', '', '', '', '', 47187),
(70377, 'koKR', '고리타분한 유행', '색안경의 주인을 찾아야 합니다.', '<점액이 뚝뚝 떨어지는 모습이 역겨운 색안경입니다. 그래도 비싼 물건처럼 보이긴 합니다.\n\n누군가가 잃어버린 물건이 분명합니다. 요즘 한창 유행하는 색안경입니다.>', '', '', '', '', '', '', 47187),
(70376, 'koKR', '티르의 두 번째 도전: 힘', '온아라 평야에서 두 번째 티르의 도전을 완료해야 합니다.', '<가까이 다가가자 동상에 새겨진 글씨가 희미하게 빛납니다.>\n\n\"수호자의 힘을 발휘해 강인하게 서 있는 사람의 굳은 결의를 보여주길.\"', '', '', '', '', '', '', 47187),
(70374, 'koKR', '축복받은 자 히미아', '정령을 처치해야 합니다.', '이 땅을 장악한 정령들이 우리의 침입을 달갑게 여기지 않는구나.\n\n오오, 정령들이여! 그대들은 우리의 보호자 공기를 잊었는가? 비록 보이지 않으나 어디에나 있고, 만물에게 없어선 안 되는 것이 공기일진저! 그대들 숨결처럼 너무나 쉽게 잊혔구나. 이 나를 마주하고 나면 다시는 공기를 잊지 못하리라.', '', '', '', '', '', '티라카이에 있는 장로 나준에게 가야 합니다.', 47187),
(70373, 'koKR', '데스위이옳옳!', '멀록콥터에 올라가 데스위이옳옳을 처치해야 합니다!', '데스위이옳옳! 데스위이옳옳! 데스위이옳옳 죽어오오옳!!\n\n그로오오오오오옴 브옳옳!\n\n<통역 없이도 멀록 형태의 데스윙을 해치워달라는 의미인 건 알 것 같습니다. 이윽고 무어라 대답을 채 꺼내기도 전에 기계 동력장치의 굉음이 당신을 향해 다가옵니다!>', '', '데스위이옳옳! 데스위이옳옳! 데스위이옳옳 죽어오오옳!!', '데스위이옳옳', '', '', '', 47187),
(70371, 'koKR', '데스위이옳옳!', '멀록콥터에 올라가 데스위이옳옳을 처치해야 합니다!', '데스위이옳옳! 데스위이옳옳! 데스위이옳옳 죽어오오옳!!\n\n그로오오오오오옴 브옳옳!\n\n<통역 없이도 멀록 형태의 데스윙을 해치워달라는 의미인 건 알 것 같습니다. 이윽고 무어라 대답을 채 꺼내기도 전에 기계 동력장치의 굉음이 당신을 향해 다가옵니다!>', '', '데스위이옳옳! 데스위이옳옳! 데스위이옳옳 죽어오오옳!!', '데스위이옳옳', '', '', '', 47187),
(70370, 'koKR', '직업 조사', '헤페스타의 성격 검사를 통해 적성에 맞는 전문 기술을 알아내야 합니다.', '안녕하세요! 장인 무역연합과 함께 큰돈을 벌고 싶지 않으신가요? 겸사겸사 아제로스 전역의 고객분들께 양질의 상품과 용역도 제공하고 말이죠?\n\n훌륭해요! 어떤 기술 두 가지를 배우셨나요?\n\n...흠? 전문 기술을 하나만 배웠다고요? 이런, 큰 기회를 놓치셨네요!\n\n<잠시 고민하는 헤페스타>\n\n이렇게 해요! 지금부터 당신의 성격에 관한 몇 가지 질문을 할 거예요. 첫 번째 전문 기술을 보완할 수 있는 두 번째 기술을 알아봐요! 어때요?', '', '', '', '', '', '', 47187),
(70368, 'koKR', '직업 조사', '헤페스타의 성격 검사를 통해 적성에 맞는 전문 기술을 알아내야 합니다.', '안녕하세요! 장인 무역연합과 함께 큰돈을 벌고 싶지 않으신가요? 겸사겸사 아제로스 전역의 고객분들께 양질의 상품과 용역도 제공하고 말이죠!\n\n...흠? 익힌 전문 기술이 없다고요? 이런, 큰 기회를 놓치셨네요!\n\n<잠시 고민하는 헤페스타>\n\n이렇게 해요! 지금부터 당신의 성격에 관한 몇 가지 질문을 할 거예요. 우리 같이 적성에 제일 잘 맞는 전문 기술을 알아봐요! 어때요?', '', '', '', '', '', '', 47187),
