(70352, 'koKR', '어느 때보다도 높은 곳으로', '톨루키에서 용뿔두꺼비와 텃세하는 원시비룡을 처치해야 합니다.', '이봐, 거기 이방인! 원시용 잡아본 적 있지?\n\n그렇다면 네 경험에 내 사냥 실력을 더하면 꽤 많이 사냥할 수 있겠군! 이 일대에 용족 야수들을 끌어들이는 샘이 있거든. \n\n평생의 반쪽에게 내가 더 뛰어난 사냥꾼이라는 걸 증명할 수 있도록 도와줬으면 해.', '', '', '', '', '', '', 47187),
(70351, 'koKR', '정원 연회', '루비 생명의 웅덩이에 있는 아코라와 대화해야 합니다.', '전 생명의 부름을 받을 날만을 학수고대하면서 몇 년 동안 이 정원을 가꿔 왔습니다. 그리고 오늘이 바로 그날이죠!\n\n전 꽃과 나무, 식물을 모두 사랑해요. 그 틈바구니에서 살아가는 벌레들까지도요. 정원을 가꿀 때면 자연 속 위대한 용의 혼령이 느껴지죠.\n\n이제 남은 할 일은 하나뿐이에요. 전설로 전해지는 것처럼 위대한 용의 혼령을 일깨울 겁니다.\n\n<환한 미소를 짓는 아코라>\n\n정원에서 뵙겠습니다. 그분의 뼈가 영면에 든 웅덩이 근처로 와주세요. 자세한 설명은 만나고 해드릴게요.', '', '', '', '', '', '', 47187),
(70341, 'koKR', '힘겹게 얻어낸 승리', '발드라켄에 있는 혁신의 동력장치로 가야 합니다.', '가장 작은 것이 가장 큰 보물을 담을 수 있습니다.\n\n정수를 혁신의 동력장치로 가져가시기 바랍니다.', '', '', '', '', '', '', 47187),
(70339, 'koKR', '티르의 발자취를 따라서: 온아라 평야', '온아라 평야에서 티르의 두 번째 도전을 찾아야 합니다.', '첫 번째 도전은 잘 해냈지만, 모든 것을 쉽게 뛰어넘을 수 있다고는 생각하지 마십시오. 수호자 티르께서는 충분히 지혜롭게 사용할 수 있는 자격이 증명된 자만을 위해 혁신의 동력장치를 만들었습니다.\n\n포기할 생각이 없다면, 다음 도전은 온아라 평야에서 찾을 수 있을 것입니다. 당신의 능력을 시험해 볼 수 있기를 기대합니다, 모험가여.', '', '', '', '', '', '온아라 평야에서 티르의 두 번째 도전을 찾아야 합니다.', 47187),
(70338, 'koKR', '사라진 새끼 슬라이번들', '새끼들을 구출해야 합니다.', '실비에가 이 정도로 신경을 곤두세운 걸 보면 새끼들이 저 안에 있는 게 분명합니다! \n\n아무래도 실비에가 감염됐을 때 거인들이 납치해갔나 봅니다. 몸이 쇠약해졌으니 지킬 힘도 없었겠죠.\n\n한창 활기 넘칠 나이대의 새끼들이니, 아직까지 거인들을 피할 수 있었을지도 몰라요...\n\n투명화 주문 부적을 드리겠습니다. 새끼들이 잡아먹히기 전에 구해주세요!', '', '', '', '', '', '', 47187),
(70337, 'koKR', '잿불 감시터', '잿불 감시터로 온이르 풍경을 가져가야 합니다.', '반갑네, 이방인.\n\n바람이 전하길, 잿불 감시터 폐허에 일련의 무리가 자리를 잡았다고 하네. 과거에만 관심이 있는 모양이더군. 우리 켄타우로스는 온아라 님의 은총 아래 현재를 바라보며 살아가는데 말일세.\n\n어쨌거나 그 사람들도 우리 터전을 찾은 손님 아니겠는가. 그들도 온아라 님의 존재를 느낄 수 있도록 풍경을 만들었네.\n\n이게 그들의 화로에 기쁨과 위로를 선사해주면 좋겠구먼.', '', '', '', '', '', '', 47187),
(70335, 'koKR', '단순한 발굴 도구', '', '', '', '', '', '', '', '', 47187),
(70319, 'koKR', '네르가주라이', '오투크 심장, 돌송곳니 다리뼈, 뿔타조 비늘, 시체매 모래주머니를 나무계단 전초 기지에 있는 비에 물든 무쿠르에게 가져가야 합니다.', '삼촌께서는 네르가주라이라는 뿔타조와 벌였던 싸움 이야기를 여러 번 들려주시곤 했다. 평야의 언덕을 헤치고 사냥감을 물색하는 놈의 비늘은 바늘과도 같고, 갈퀴발톱은 서슬 퍼런 날이 서 있으며, 이빨에는 맹독이 흐른다고 하셨지.\n\n그런데 일전에 사냥에 나가서 놈을 만났다. 하지만 행동이 늦는 바람에 내 어깨에 고약한 이빨 자국만 남겨놓고 사라졌지. 삼촌께서 말씀해주신 대로 무시무시한 놈이었지만, 난 어떻게든 살아남았어.\n\n어쨌든 감염된 부위를 소독해야 한다. 필요한 재료를 좀 모아다오. 일분일초라도 낭비해선 안 돼.', '', '', '', '', '', '', 47187),
(70299, 'koKR', '용의 방어', '폭풍의 상흔에서 원시술사를 처치해야 합니다.', '노쿠드 부족이 우리의 용 이웃을 쓰러뜨릴 작정으로 이방인들과 손잡았다는 얘기가 들려오네. 원시술사란 자들인데, 우리 선조들의 평야를 엉망으로 만들고 있지.\n\n그들을 처치하게. 그리고 놈들이 부리는 정령들의 핵을 가져오게나.', '', '', '', '', '', '', 47187),
(70279, 'koKR', '용의 피', '카르키단을 처치해야 합니다.', '너도 봐서 알겠지만 이 땅은 일반적인 덩치 이상으로 성장하는 개체들이 나타나곤 한다.\n\n우린 그런 야수들을 자연의 신의 축복을 받은 걸로 여기고, 힘을 증명하고자 하는 사냥꾼들의 명예로운 표적으로 간주한다. 이 근처에 바로 그런 야수가 하나 있다. 카르키단이란 녀석이지. 네가 그놈을 잡는다면 진심으로 놀라울 것 같군.', '', '', '', '', '', '', 47187),
(70268, 'koKR', '되살아난 기억', '베리티스트라즈에게 일기를 주어야 합니다.', '<반쯤 파괴된 일기를 찾았습니다. 타락하기 전, 젊은 검은용 여성의 관점에서 쓰인 것으로 보입니다.\n\n뒷부분은 알아볼 수 없는 상태지만, 앞부분을 살피던 중 베리티스트라즈라는 이름이 눈에 들어옵니다.>', '', '', '', '', '', '루비 성소에 있는 베리티스트라즈에게 일기를 주어야 합니다.', 47187),
(70244, 'koKR', '백해무익 노쿠드', '카남 마트라 사레스트와 함께 마을에 진입해 노쿠드로부터 탈환해야 합니다.', '지난 수천 년 동안 티라이는 가장 소중한 유물인 드루살의 뿔피리를 지켜왔다. 발라카르는 이 마을을 파괴함으로써 마루크의 정체성을 완전히 부정했다. 이젠 구원의 여지조차 남지 않은 게지.\n\n발라카르가 뿔피리를 파괴하기 전에 탈환해야 한다. 더불어 아직 숨이 붙어 있는 티라이들을 구출해야 해. 나도 동행해 그 거짓된 칸에게 직접 심판을 내리겠다. 노쿠드의 뼈에 카남 마트라의 분노를 새기리라!', '', '', '', '', '', '', 47187),
(70242, 'koKR', '삶 이후의 삶', '루비 생명의 제단에 있는 트렐레인에게서 마력을 잃은 그릇을 받아야 합니다.', '그 친구분께 깊은 흉터가 있는 건 직감적으로 알고 있었습니다. 이곳의 무언가가 그 흉터를 다시 벌어지게 한 것이죠. 어쩌면... 이번에야말로 말끔하게 봉합되려고 그런 걸지도 모릅니다.\n\n이젠 콜가르가 치유될 차례입니다.\n\n위쪽 정원에 가보면 제 친구 트렐레인이 마법부여사들과 일하고 있을 겁니다. 그 친구가 일에 쓰는 그릇을 제가 찾는다고 전해주세요. 군말 없이 넘겨줄 겁니다.', '', '', '', '', '', '', 47187),
(70241, 'koKR', '씁쓸한 끝', '바토라스를 두로즈와 콜가르에게 데려가야 합니다.', '갑자기 이렇게 됐소. 그러니까... 영감은 잠자고 나는 잠깐 다른 곳을 보는 사이에... 여긴 우리가 매일 들르는 곳이오. 새끼용과 같이 앉아보고 싶다고 하기에... 나는 몰랐...\n\n<콜가르의 얼굴이 눈물로 범벅되어 있습니다. 그가 손등으로 눈을 비빕니다.>\n\n아니, 알긴 알았소. 알고는 있었지. 하지만 이제 어떻게 하면 좋을지 모르겠소. 두로즈를 어떻게 하지?\n\n혹시... 바토라스를 찾아주겠소?', '', '', '', '', '', '', 47187),
(70240, 'koKR', '고통 관리', '우윳빛 덥썩꽃 $1oa개, 만개한 여울 백합 $2oa개, 가득 찬 생명의 웅덩이 물병을 모아야 합니다.', '지금이라도 환자를 데려오신 건 잘한 겁니다. 언뜻 보기에도 고통이 극심해 보여요. 잘 견뎌내고 있을 뿐이죠. 우리 모두 때가 오면 저렇게 견뎌내야 한답니다.\n\n애석하게도 저분이 고통스러워하는 원인은 질병이 아니라 노환 때문입니다. 대신 고통을 덜어줄 물약을 만들어드릴 순 있습니다.\n\n이 근처 정원에서 우윳빛 덥썩꽃과 여울 백합, 깨끗한 물을 좀 구해다 주실 수 있겠습니까? 그 재료만 충분히 있으면 진통제를 조제할 수 있습니다.', '', '', '', '', '', '', 47187),
(70239, 'koKR', '전하지 못한 후회', '두로즈, 콜가르와 함께 걸으며 도와줄 사람을 찾아봐야 합니다.', '두로즈는 늙고 병든 데다, 고집은 코도 못지않소. 이곳으로 오는 비행선에 어떻게든 타겠다는데 막을 수가 있어야지. 그나마 지팡이 노릇이라도 해주는 게 내가 할 수 있는 최선이었다오.\n\n난 전장에서 영감이 고통에 떠는 모습을 자주 봐서 척 보면 숨기고 있는 건지, 아닌지 알 수 있소. 여기서 하루가 지날수록 상태는 악화되고 있지. 두로즈를 물약 제작자에게 데려가려고 하는데, 좀 도와주겠소? 이젠 맥주 핑계도 안 통하오. \n\n부축은 내가 할 테니 무기만 대신 들어주시오.', '', '', '', '', '', '', 47187),
(70236, 'koKR', '분리된 용의 눈', '물건을 에밀리아 벨로크에게 전달해야 합니다.', '<어쩌면 에밀리아 벨로크가 찾는 물건일지도 모릅니다.>', '', '', '', '', '', '', 47187),
(70235, 'koKR', '수리 견적서', '세레바이트 수리 망치 $1oa개를 만들어 발드라켄에 있는 금속형성사 쿠로코에게 가져가야 합니다.', '최근 수천 년 동안 용의 섬에서 이렇게 두들기는 일은 없었을 겁니다. 우리는 끄떡 없지만 좋은 방어구는 항상 착용하고 있기 때문에 수리를 해줘야합니다. 대규모 세레바이트 수리 망치 의뢰가 들어왔는데 도와줄 사람이 필요합니다. 당신이 도와준다면 다시 한번 용의 섬 대장기술에 대해 알려드리겠습니다.', '', '', '', '', '', '', 47187),
(70229, 'koKR', '비술사 보쿠', '티라카이에서 보쿠를 찾아야 합니다.', '비술사들은 며칠 전 부름을 받아 물마루 은신처로 향했네. 잔류한 비술사는 한 명뿐이지. 이름은 보쿠라고 하네. 언덕 꼭대기 온아라의 제단에 있을 걸세.\n\n아직은 수습생이네만, 능력은 충분하니 온아라 님과 교감해 축복을 받을 수 있을 걸세. 온아라 님의 지원을 등에 업으면 전쟁이 본격적으로 시작되기도 전에 승기를 쥘 수 있지.', '', '', '', '', '', '티라카이에서 보쿠를 찾아야 합니다.', 47187),
(70221, 'koKR', '장인의 기상으로', '', '', '', '', '', '', '', '토마스 브라이트에게서 장인의 기상을 받아야 합니다.', 47187),
(70220, 'koKR', '그늘진 성역', '경비대장 알로웬, 사리오사, 치유사 시드라, 비라니쿠스와 대화해야 합니다.', '나머지 녹색용군단 일원들에게도 고대의 가지 방벽이 위협받고 있음을 알려야 한다. 게리투스와 나는 상의할 것이 많구나.\n\n$n, 나의 징표를 주겠다. 다른 용들이 보면 네가 나의 신임을 받는 전령임을 알아차릴 것이니라.\n\n가서 녹색용군단을 집결시켜라. 다가올 전투를 대비하게 해야 한다.', '', '', '', '', '', '', 47187),
(70215, 'koKR', '호기심이란 이름의 열쇠', '안토니다스 야영지에서 왜곡술사 델란드라와 대화해야 합니다.', '제가 당신을 못 믿어서 이 상징 이야기를 꺼내지 않고 머뭇거린 게 아닙니다. 그보단 미지의 영역에 있는 상징의 본질과 새겨진 바위 때문이지요.\n\n예. 제대로 들으신 거 맞습니다. 바위. 실은 섬 곳곳에 여러 개가 분포되어 있습니다.\n\n<왜곡술사 델란드라가 당신을 힐끔 바라봅니다. 그녀의 얼굴에 호기심과 들뜬 감정이 어우러져 피어납니다.>\n\n모르셨나 보군요.\n\n좋습니다. 힘들게 저를 찾아오신 것도 그렇고, 이번 발견을 이해하고 싶은 마음만큼은 진심이란 걸 알겠습니다. 깊이 있는 논의를 나누어 보도록 할까요?', '', '', '', '', '', '', 47187),
(70213, 'koKR', '하르킨 그림스톤', '', '', '', '', '', '', '', '', 47187),
(70212, 'koKR', '페넘브로스', '', '', '', '', '', '', '', '', 47187),
(70210, 'koKR', '전통 보존', '영원한 쿠르간에서 향을 놓고 유령 야수를 정리해야 합니다.', '이 야영지에 머무는 아일라그의 전통 중 하나는 영원한 쿠르간으로 순례를 떠나 선조들을 괴롭혔던 것들로부터 안전한 여행이 되길 기원하는 걸세. 하지만 노쿠드의 존재로 순례길이 위험해졌어.\n\n자네만 괜찮다면 우리 대신 전통을 지켜주었으면 하네.', '', '', '', '', '', '', 47187),
(70209, 'koKR', '진격의 꽥꽥이', '', '', '', '', '', '', '', '', 47187),
(70207, 'koKR', '꼬리 조각', '물건을 에밀리아 벨로크에게 전달해야 합니다.', '<어쩌면 에밀리아 벨로크가 찾는 물건일지도 모릅니다.>', '', '', '', '', '', '', 47187),
(70204, 'koKR', '황금 발톱', '물건을 에밀리아 벨로크에게 전달해야 합니다.', '<어쩌면 에밀리아 벨로크가 찾는 물건일지도 모릅니다.>', '', '', '', '', '', '', 47187),
