(70198, 'koKR', '섬의 부름', '듀로타에서 날레디아 리버글림을 만나야 합니다.', '동료들이 듀로타에 모였습니다. 정말 가슴이 벅차오릅니다!\n\n$n 님도 동참해 주십시오! 용의 섬으로 출발할 때입니다!', '', '', '', '', '', '', 47187),
(70197, 'koKR', '섬의 부름', '스톰윈드 항구에서 토디 위스커스를 만나야 합니다.', '일생일대의 모험을 떠날 준비는 되셨나요? 저는 준비됐어요!\n\n동료들도 모두 모였고, 물자도 충분히 챙겼어요. 더 우물쭈물할 이유가 없다 이 말씀이죠.\n\n스톰윈드 부두에서 뵈어요. 용의 섬으로 출항해 보자고요!', '', '', '', '', '', '', 47187),
(70196, 'koKR', '보존지 정리', '', '', '', '', '', '', '', '', 47187),
(70195, 'koKR', '폭풍이 앗아간 것', '알탄을 구출한 후 이방인에 관한 단서를 찾아야 합니다.', '보고에 따르면 노쿠드는 일찍이 드러난 적 없는 마법을 다루는 이방인과 함께 움직이고 있다고 하네. 그 이방인이 폭풍우처럼 우리 병력을 분쇄한 장본인일세. \n\n노쿠드가 그 정도로 강력한 동맹을 보유하고 있다면 어떻게 해서든 정체를 알아내야 하네.\n\n그 이방인을 찾을 겸 내 오후나 알탄을 보내두었네. 아직 돌아오지 않은 게 걱정되는군. $n, 이방인에 대한 단서를 찾고 알탄이 어떻게 됐는지 알아봐 줄 수 있겠는가?', '', '', '', '', '', '', 47187),
