(70185, 'koKR', '수수께끼의 야수', '야수를 찾아 처치한 후 정찰병 토물에게 증거를 가져가야 합니다.', '<흙에 깊이 찍힌 커다란 발자국을 발견했습니다. 주변을 살펴보니 인근 동물 중 크기는 고사하고 형태가 같은 발을 가진 개체가 없습니다.\n\n이 거대한 야수를 사냥하면 켄타우로스들이 깊은 감명을 받을지도 모릅니다.>', '', '', '', '', '', '콘쿨라르의 모피를 정찰병 토물에게 가져가야 합니다.', 47187),
(70184, 'koKR', '전문화의 비결: 대장기술', '', '', '', '', '', '', '', '', 47187),
