(70182, 'koKR', '달콤한 승리의 맛', '발드라켄에 있는 혁신의 동력장치로 가야 합니다.', '작지만 그 안에는 엄청난 잠재력이 있습니다. 병에 담긴 정수는 깃털처럼 가볍지만 가공할 힘을 지니고 있습니다. \n\n혁신의 동력장치로 가져가시기 바랍니다.', '', '', '', '', '', '', 47187),
(70181, 'koKR', '티르의 첫 번째 도전: 기교', '하늘빛 평원에서 첫 번째 티르의 도전을 완료해야 합니다.', '<가까이 다가가자 동상에 새겨진 글씨가 희미하게 빛납니다.>\n\n\"수호자의 힘을 발휘해 우리 모두의 더 나은 미래에 빛을 비추길\"', '', '', '', '', '', '', 47187),
(70180, 'koKR', '본격 시동!', '그레이직을 도와 수수께끼의 장치를 가동해야 합니다.', '이 도시에 전설적인 티탄 감시자 티르가 만든 장치가 있다고 하더라고.\n\n그런데 문제는 작동시킬 수가 없다는 거지! 모든 잔기술과 해체 방법과 자이로 기술과 전기 충격까지 다 시도해봤는데 전기가 좀 통한 거 말고는 효과가 없다는 말이야. 사실... 방금 좋은 생각이 떠올랐어.\n\n저기 자이로콥터 보이지? 그걸 타고 이 티탄 장치에 동력을... 더 줘보자고.', '', '', '', '', '', '', 47187),
(70179, 'koKR', '일석이조', '각 대지의 정령에게서 건설 자재를 입수해야 합니다.', '안녕하세요, 모험가님! 보아하니 실력 있는 분 같은데, 저 좀 도와주실 수 있을까요?\n\n아즈크라와 저는 이 탑을 감시하는 임무를 받았습니다. 건물이 \"보수를 앞둔 흥미진진한 상태\"에 있더군요. 문제는 여기서부터입니다. 우리가 수리를 시작하려니까 대지의 정령들이 공격하지 뭡니까!\n\n그래서 생각했습니다. \"제프렌, 저 대지의 정령들을 처리하면 건설 자재도 마련할 수 있지 않을까?\"라고 말이죠. 모험가님의 도움이 필요한 부분이기도 해요! 어떻게 안 될까요?', '', '', '', '', '', '', 47187),
(70175, 'koKR', '끊어진 띠', '물건을 에밀리아 벨로크에게 전달해야 합니다.', '<어쩌면 에밀리아 벨로크가 찾는 물건일지도 모릅니다.>', '', '', '', '', '', '', 47187),
(70174, 'koKR', '시카르', '산소크 칸을 만나야 합니다.', '산소크 칸은 우리 부족에서 가장 뛰어난 사냥꾼이시다. 소리를 듣진 못하시지만 몇 번이고 사냥꾼이자 지도자의 역량을 증명해 보이셨지.\n\n그분은 우리 모두의 스승이고, 믿음직한 지도자이시며, 마루크를 지키는 매서운 수호자다.\n\n그러니 말을 섞을 수 있게 된 걸 영광으로 알도록.', '', '', '', '', '', '', 47187),
(70171, 'koKR', '사소하지만 유쾌한 사고', '허드슨의 마지막 작품을 찾아야 합니다.', '<그렁그렁한 시선을 보내는 란피아타>\n\n저 때문이었나요? 저 때문에 그이가 열정을 잃어버린 거였나요?\n\n저를 사랑한다고는 말하지만... 붓을 놓는 일이 얼마나 고통스러운지 용사님도 들으셨지요.\n\n제가 바라는 건 남편이 잘되는 거예요. 제가 없는 편이 낫다면... 떠나겠어요. \n\n남편이 내버린 작품이 하나 남았어요. 붓을 놓기 전까지 어떻게든 그리려고 했던 작품이죠. \n\n저는 그게 허망하게 사라지길 바라지 않는 마음에 우리 집에 숨겼어요. 제발... 그림을 남편에게 가져다 주세요. 기념으로 간직할 수 있게요.', '', '', '', '', '', '', 47187),
(70170, 'koKR', '툭툭 털고 일어나', '주입의 전당, 알게타르 대학, 하늘빛 보관소, 넬타루스 던전의 마지막 우두머리에게서 허드슨의 잃어버린 그림을 회수해야 합니다.', '남편 고집은 황소도 울고 갈 정도예요.\n\n근데 그렇다고 해서 그이를 포기하진 않을 거예요. 다시 한번 시도해보면 되죠! \n\n남편이 내다버린 그림이 몇 점 더 있어요. 저번보다 훨씬 위험한 장소에 있으니, 각오 단단히 하시는 게 좋을걸요!', '', '', '', '', '', '', 47187),
(70169, 'koKR', '나무도 친구가 있는데', '로브로스와 대화해야 합니다.', '용사님이나 아내나 단순히 돕고 싶은 마음에 그러시는 건 압니다. \n\n그런데 도움이 되는 것 같지 않아요. 제 열정은, 그러니까 그림을 그리고 싶은 의욕이... 사라졌습니다. 그뿐이에요. \n\n어쨌든 아내 말도 사실입니다. 용사님께 신세를 졌으니, 한번 시도라도 해봐야겠지요.\n\n그 예술가 꿈나무 친구를 데려와 주십시오.', '', '', '', '', '', '', 47187),
(70168, 'koKR', '사소하지만 슬픈 사고', '루비 생명의 웅덩이, 노쿠드 공격대, 담쟁이가죽 골짜기 던전의 마지막 우두머리에게서 허드슨의 잃어버린 그림을 회수해야 합니다.', '먼 길을 왔다 갔다 하게 해서 죄송해요...\n\n우리 남편 허드슨은 그림을 사랑했답니다. 그이의 인생이나 다름없었죠! 어쩌다 붓을 놓았는지 모르겠어요. \n\n불과 몇 주 전이었어요. 남편이 그림 여행에서 돌아왔는데, 그간 그린 작품을 전부 내다버리며 분노를 쏟아내더군요. \n\n여행자님. 염치 없는 소리인 건 알지만... 그 그림들을 찾아주실 수 있을까요? 어쩌면 남편에게 필요한 영감을 불어넣어 줄지도 몰라요. \n\n허드슨은 최고의 풍경을 찾을 수만 있다면 위험한 장소라도 거리낌 없이 찾아갔어요. 준비를 단단히 하셔야 할 거예요.', '', '', '', '', '', '', 47187),
(70166, 'koKR', '그림의 즐거움', '로브로스의 소개의 그림을 허드슨에게 가져가야 합니다.', '제 수집품이 마음에 드십니까? 모두 역사상 최고로 위대한 화가 허드슨 님의 걸작입니다.\n\n희귀하기도 하고 값도 상당할 겁니다. 작가님이 두문불출하시면서 어떤 작품도 그리지 않으신 지 꽤 됐지만요. 아, 작가님 존안을 뵙거나... 그림을 배울 수만 있다면 소원이 없을 텐데!\n\n당신... 배짱이 좀 있는 분 같은데, 화가님을 찾아주실 수 있을까요? 여, 여기 받으시죠! 제 작품 몇 점을 드리겠습니다. 화가님이 보고 높게 평가해주실지도 모르잖아요?\n\n반대로 끔찍하게 보실 수도 있지만... 이런.', '', '', '', '', '', '', 47187),
(70164, 'koKR', '땜장이의 기회', '생명의 금고 폐허에서 시간술사 포실드랄 및 시브리트 크래킷페이지와 대화해야 합니다.', '$p 님. 잠시 시간 괜찮으십니까? 제가 지금 중요한 돌파구를 앞두고 있어서요!\n\n요람이 무너진 이후로 전 비행 능력 말고도 많은 걸 잃었습니다. 드랙티르의 정체성을 잃어버렸죠. 당신이라면 이해할 겁니다.\n\n이런저런 물건을 만들고 분해하는 걸 즐겼기에 원정대가 제 적성에 맞을 거라 생각했습니다. 그런데 이 유물 때문에 골치가 아픕니다. \n\n포실드랄과 시브리트에게 제 연구 기록 검토를 부탁해주실 수 있을까요? 사람들에게도... 저 자신에게도 제가 유능한 땜장이라는 걸 증명해 보이고 싶습니다.', '', '', '', '', '', '', 47187),
(70163, 'koKR', '동굴 십자로 - 고급', '활공하여 고리를 통과해야 합니다.', '경로의 통과 지점 고리를 통과해야 합니다.', '', '', '', '', '', '', 47187),
(70161, 'koKR', '동굴 십자로', '활공하여 고리를 통과해야 합니다.', '경로의 통과 지점 고리를 통과해야 합니다.', '', '', '', '', '', '', 47187),
(70159, 'koKR', '고향의 맛', '용비늘 기지의 호드 구성원에게 수소문하여 필요한 재료를 빌려야 합니다.', '아, 드디어! 같은 드랙티르로서 일손 좀 보태주시지 않겠어요?\n\n실은 형제하고 같이 먹을 만한 식량을 조리하려고 하는데, 그게...\n\n<주변을 손짓하는 스칼라레쉬>\n\n환경이 달라도 너무 달라서요. 예전에 요리할 때 쓰던 식재료를 구하기가 너무 힘듭니다.\n\n물론 적응하면 되겠죠. 호드 사람들에게 적당히 대체용으로 쓸 만한 채소와 단백질, 유화 용액이 있는지 물어봐 주세요. 재료만 확보되면 제대로 된 음식을 제공할 테니까.', '', '', '', '', '', '', 47187),
(70158, 'koKR', '정원 탐방로 - 고급', '활공하여 고리를 통과해야 합니다.', '경로의 통과 지점 고리를 통과해야 합니다.', '', '', '', '', '', '', 47187),
(70157, 'koKR', '정원 탐방로', '활공하여 고리를 통과해야 합니다.', '경로의 통과 지점 고리를 통과해야 합니다.', '', '', '', '', '', '', 47187),
(70156, 'koKR', '고대의 각성', '차원문에 동력을 공급해야 합니다.', '제 바로 뒤에 있는 게 차원문입니다. 이 그릇에 부여된 마법이 언제 사라질지 모릅니다. 아니, 최악의 경우에는 파괴될지도 모릅니다.\n\n그렇게 됐다간 불안정한 마력이 방출되면서 재앙을 일으킬 겁니다.\n\n자, 그럼 계속할까요?', '', '', '', '', '', '', 47187),
(70155, 'koKR', '보고, 듣고, 숨 쉬고', '스레쉬라크와 함께 낚시해야 합니다.', '반갑네, $r 친구. 잠깐 멈춰 서는 건 고사하고 인사라도 하는 친구는 간만에 보는군. 대부분은 다음 목적지로 달려가느라 정신 없거든.\n\n잠깐 낚시라도 하지 않겠나?', '', '', '', '', '', '', 47187),
(70154, 'koKR', '어딘가로 통하는 관문', '왜곡술사 델란드라를 따라 차원문이 있는 곳으로 가야 합니다.', '그릇에 부여된 마법이 우릴 불안정한 마력으로부터 보호해줄 겁니다.\n\n우선 가장 가까운 돌로 통하는 길을 열겠습니다. \n\n통과한 다음부터는 가까이 붙어 계십시오. 장치를 가동할 때 용사님의 도움이 필요합니다.', '', '', '', '', '', '', 47187),
(70152, 'koKR', '광란의 낚시!', '', '', '', '', '', '', '', '', 47187),
(70148, 'koKR', '정처 없는 방황', '날개쉼터 대사관에서 갈퀴발톱 에스레티를 찾아야 합니다.', '잠깐 시간 좀 내주실 수 있을까요? \n\n아까 어떤 드랙티르가 또 들렀는데 영 찝찝해서요. 저나 동료들을 붙잡고 온갖 질문을 해댔는데, 어쩐지 표정이 좀... 대답에 실망한 기색이었어요.\n\n이름은 \"갈퀴발톱 에스레티\"라고 한 것 같아요. 여러분 사회에서는 비교적 낮은 계급이죠?\n\n제 감이지만 도움이 필요한 분 같았어요. 평화를 유지하는 데 힘을 빌려주시겠어요?\n\n아까 보니까 저기서 콜마르하고 얘기를 나누고 있더군요.', '', '', '', '', '', '', 47187),
(70146, 'koKR', '고원의 반격', '', '', '', '', '', '', '', '', 47187),
(70139, 'koKR', '수호물이 있는 곳에 길이 있다', '티르홀드 저수지 수호물이 받은 피해 상황을 확인해야 합니다.', '이 저수지는 티르께서 직접 설치하신 세 개의 수호석으로 보호받고 있습니다. \n\n용의 섬에 만연하는 정기를 안정시키는 효과가 있죠. \n\n용사님이 절 깨우셨을 때 서쪽 수호물이 손상된 게 느껴졌습니다. 원시술사들이 나머지 두 개에도 마수를 뻗친 건 아닌지 걱정됩니다. \n\n어쨌든 다음 방침을 결정하려면 피해 상황을 파악해야 합니다.', '', '', '', '', '', '', 47187),
(70136, 'koKR', '아파할 시간조차 아까운', '탈드라서스의 흐르는 숲에서 시간여행단 지팡이와 시간여행단 기록을 회수한 후 광기에 사로잡힌 우두머리를 처치해야 합니다.', '어... 잠시만요...\n\n원래는 제 첫 임무였어요... 불안정한 시간 마력이 숲으로 흘러 들어가 야생동물에 영향을 주고 있었죠. 제 임무는 사태의 여파를 파악하고, 시간여행단이 사용할 수 있도록 마력을 수집하는 일이었어요...\n\n<잠시 고개를 흔드는 제라>\n\n보르퀸 무리를 살피는데 웬 실성한 곰이 덮치더군요... 넘치는 시간 마력에 폭주한 개체였어요. 예상에 없던 일이었죠. 간신히 목숨만 건져 빠져나왔고요.\n\n$c님, 잃어버린 장비를 좀 찾아주시겠어요? 용사님이라면 곰을 상대할 수 있을 거예요...', '', '', '', '', '', '', 47187),
(70135, 'koKR', '엄습하는 정령들', '날개쉼터 대사관에서 원시 정령 $1oa마리를 처치해야 합니다.', '용비늘 원정대의 기술자, 장인, 탐험가들은 억센 전투에 적합하지 않네.\n\n하지만 $p 자네와 난 다르지.\n\n이곳 용의 섬에서, 이 힘으로 스스로를 돌보지 못하는 자들을 지켜내야 하네.\n\n북쪽에서 다가오는 정령들을 쓸어내, 원정대가 고상한 목적에 충실할 수 있도록 돕게.', '', '', '', '', '', '', 47187),
(70134, 'koKR', '추억', '베리티스트라즈의 영구 매몰함을 회수해야 합니다.', '이야기를 들어줘서 고맙네, 젊은 친구. 사실 부탁이 하나 더 있네만. \n\n이야기를 더 들어달라는 부탁은 아니니 걱정 말게.\n\n우리가 이 섬을 떠날 당시... 일종의 영구 매몰함을 남겼네. 혹시... 그걸 찾아와줄 수 있겠나? 루비 생명의 제단 하층부, 어느 기둥 뒤에 파묻어 숨겼다네.\n\n숨길 때 인장을 이용했으니, 활성화하면 영구 매몰함이 눈에 보일 걸세.', '', '', '', '', '', '', 47187),
(70132, 'koKR', '잠깐 내 이야기를 들어보겠나', '잠시 앉아 풍경을 감상해야 합니다.', '<늙은 드워프는 당신의 기척에 반응하지 않고 풍경을 감상하고 있습니다. 그의 이마에는 깊은 골이 파여 있습니다. 어쨌든 절경이 바로 앞에 있으니 잠시 쉬면서 감상하는 것도 나쁘지 않을 듯합니다.>', '', '', '', '', '', '', 47187),
(70129, 'koKR', '공포의 토잼', '로위를 도와 공포의 토잼을 처치해야 합니다.', '용사님 말이 맞아요. 전 아직 설인을 상대하기엔 약해요... 혼자서는 말이죠! \n\n근데 지금 이렇게 와주셨잖아요!\n\n저 바로 앞이 사악한 설인, 공포의 토잼의 소굴이에요. 동굴이... 엄청 커요. 무섭단 얘기는 아니고요! 살짝만... \n\n들어가서 녀석을 좀 약하게 만들어 주실 수 있을까요? 제가... 제가 곧장 뒤따를게요!', '', '', '', '', '', '', 47187),
(70126, 'koKR', '마지막 다듬기', '미구엘의 고객을 설득해 다음에도 미구엘에게 주문 제작 의뢰를 맡기게 해야 합니다.', '아, $p 님. 뵙게 되니 좋군요.\n\n용사님은 장인 무역연합에 눈부신 도움을 주셨습니다. 토마스와 저도 개인적으로 큰 은혜를 입었고 말이죠. 감사합니다.\n\n제작자로서 알아두실 게 하나 더 있습니다. 그건 바로 고객과 관계를 형성하는 겁니다.\n\n제가 오늘 어느 한 고객의 주문 제작 의뢰를 완료했는데, 대신 말씀 좀 나눠주실 수 있을까요? 나중에 또 무언가를 만들 일이 생기면 제게 의뢰하도록 설득해 주십시오. 고품질의 물품이 필요하다면 개인적으로 제게 의뢰하면 된다고 말씀해 주시면 됩니다.', '', '', '', '', '', '', 47187),
(70125, 'koKR', '래시온은 어디에?', '센드락스에게 언제쯤 용이 도착하는지 물어봐야 합니다.', '흠, 래시온이 어디있는지 모르겠네요?\n\n원래는 용의 여왕이자 생명의 어머니이신 알렉스트라자 님의 대사와 미리 마중을 나와 있기로 했거든요.\n\n약속을 어기는 건 용답지 않은 일인데 말이죠.\n\n뭐, 그나마 이 열정적인 용기병이라도 우릴 맞아줘서 다행이네요. 다른 양반들은 언제쯤 도착하는지 여쭤봐 주실래요?', '', '', '', '', '', '', 47187),
(70124, 'koKR', '연습 재료', '태고의 새끼 원시용 비늘 $1oa개를 수집해야 합니다.', '이 원시비룡이란 존재들은 내가 지금껏 봐온 그 어떤 생명체들과 비교해봐도 다르네.\n\n비늘이 선천적으로 화염에 저항력이 있고, 강철보다 단단하며, 그 과정에서 탄력을 잃지도 않는 것 같더군. 실로 경이로워.\n\n오죽하면 장인들이 원시비룡 소재로 작업해보고 싶다고 아우성일세.\n\n새끼용부터 시작하세. 작은 비늘이면 그만큼 가공하기 쉬울 것이고, 우리가 소재를 다루는 방법을 통달할 때까지 활용할 수 있겠지.', '', '', '', '', '', '날개쉼터 대사관에서 테일린 다크앤빌을 만나야 합니다.', 47187),
(70123, 'koKR', '원시 해충', '야생의 해안에서 태고의 원시비룡 $1oa마리를 처치해야 합니다.', '<뒤쪽 능선에서 꾸물거리는 원시용들을 미심쩍은 시선으로 흘기는 아주라텔>\n\n내가 등을 보일 때마다 저 원시용들이 조금씩 야영지로 접근하는 것 같은데...\n\n래시온이 이곳으로 초대한 용은 분명히 아니야.\n\n원시용은 일말의 타협조차 통하지 않는 무정한 포식자들이다. 그러니 우리도 인정사정 봐줄 것 없어.\n\n쓸데없이 설치지 못하도록 개체수를 좀 줄여두는 게 좋겠군. 그냥 뒀다간 원정이 시작하기도 전에 끝날 테니.', '', '', '', '', '', '날개쉼터 대사관에서 비늘사령관 아주라텔을 만나야 합니다.', 47187),
(70122, 'koKR', '위기의 탐험가들', '야생의 해안에서 용비늘 원정대원 3명을 구출해야 합니다.', '원정대가 학술 목적으로 왔다고 해서 소극적일 거라 넘겨짚진 마세요, $p 님.\n\n우린 어디 산골 탑에 틀어박혀 사는 책상물림이 아니랍니다.\n\n아제로스 구석구석을 누비며 누구보다 먼저 지식을 찾는 모험가들이죠!\n\n물론 그놈의 모험을 향한 열정 때문에 위기에 처할 때도 적지 않지만요. 자기 한계도 모르고 무리하다 큰일 난 양반들도 좀 있고...\n\n어쨌든 위험하니까 더 재밌는 거 아니겠어요?', '', '', '', '', '', '날개쉼터 대사관에서 토디 위스커스를 만나야 합니다.', 47187),
(70112, 'koKR', '펄볼그의 위협', '', '', '', '', '', '', '', '', 47187),
(70110, 'koKR', '탈드라서스 분류 작업', '', '', '', '', '', '', '', '', 47187),
(70100, 'koKR', '하늘빛 평원 분류 작업', '', '', '', '', '', '', '', '', 47187),
(70079, 'koKR', '온아라 평야 분류 사업', '', '', '', '', '', '', '', '', 47187),
(70070, 'koKR', '사실은 오리의 영웅이로소이다', '불꽃꽥꽥이를 찾아 어떻게든 그라쿠스에게 데려가야 합니다.', '잠깐... 뭔가 있는데...\n\n<주변을 살펴보는 그라쿠스>\n\n불꽃꽥꽥이! 이 녀석이 또 강 하류로 갔나 보군! 몇 번을 타일러도 용뿔두꺼비하고 놀겠다고 야단법석을 피우니 원! \n\n가서 녀석을 확인해다오. 또 삼켜진 건 아니어야 할 텐데.', '', '', '', '', '', '그라쿠스에게 당신이 본 것을 말해야 합니다.', 47187),
(70069, 'koKR', '오리 몰이꾼도 괜찮고', '새끼 오리 $1oa마리에게 먹이를 주고 그라쿠스에게 가야 합니다.', '내 수명이 날로 줄어들고 있지만... 아직 할 일이 끝난 것은 아니야. \n\n무리는 지금쯤 개울에 모여 있을 거다. 그 아이들이 좀 더 독립성을 기르면 좋겠건만. 머잖아 홀로 살아가야 할 테니.\n\n그렇지만 지금 그 아이들은 네게 기대어 살아가고 있지. 새끼 오리들에게 잡은 먹이를 전해주고, 내게로 데려와다오. 조종사 녀석을 조심해야 할 거야. 항상 옆길로 튀는 구석이 있으니.', '', '', '', '', '', '', 47187),
(70068, 'koKR', '코발트 참사', '', '', '', '', '', '', '', '', 47187),
(70067, 'koKR', '노쿠드에 보내는 전언', '', '', '', '', '', '', '', '', 47187),
(70062, 'koKR', '나를... 벌레잡이라고 불러주시겠어요?', '하늘날이 딱정벌레 부위 $1oa개를 수집해야 합니다.', '아, 어린 $r|1이여;여;. 나를 도와줄 수 있겠는가? 나는 이곳에서 수 세대에 걸쳐 생명을 길러왔다. \n\n하지만 새끼 오리처럼 소중한 아이들은 없었지. 내 비록 노쇠하여 몸뚱이가 예전 같지 않고 약해졌지만... 그렇다고 해서 순환이 멈추지는 않지.\n\n내 자손들에게 먹일 음식을 구해다오.', '', '', '', '', '', '', 47187),
(70061, 'koKR', '날개 훈련', '새끼용을 이끌어 동요한 잡초 포들링 $2oa마리, 침략하는 새끼가시 $3oa마리, 가혹한 돌풍 $4oa마리를 처치해야 합니다.', '$p 님, 용들은 꽤 오랜 세월 섬을 떠나 있었습니다. 사실대로 말씀드리자면... 몇몇 기술은 세대를 거치면서 오히려 퇴화한 수준입니다.\n\n저 새끼용들은 가르치긴 쉽지만 말을 영 듣질 않습니다.\n\n이런 건 어떻습니까?\n\n청지기 셀리스트라 님이 당신에게 막중한 임무를 맡기시는 걸 봤습니다. 같은 맥락에서 어린 친구를 도와주실 수 있을까요?', '', '', '', '', '', '', 47187),
(70060, 'koKR', '대학 승천로 - 고급', '활공하여 고리를 통과해야 합니다.', '경로의 통과 지점 고리를 통과해야 합니다.', '', '', '', '', '', '', 47187),
(70059, 'koKR', '대학 승천로', '활공하여 고리를 통과해야 합니다.', '경로의 통과 지점 고리를 통과해야 합니다.', '', '', '', '', '', '', 47187),
(70058, 'koKR', '친구의 회복', '루비 생명의 제단에서 부드러운 루비 깃털 $1oa개, 직물 조각 $2oa개, 유리 구슬 $3oa개를 수집해 오리 행복이 수선을 도와야 합니다.', '주변을 날아다니다가 행복이가 다쳤어요... 잘 날고 있었는데 제가... 나무에 부딪히고 말았어요!\n\n<회한에 찬 손짓으로 머리에 올려놓은 손상된 오리 봉제인형을 가리키는 릴리스트라자>\n\n솜털이 흘러나와요! 깃털은 다 찌그러졌고요! 게다가 눈도 한쪽 사라졌어요! 어떡해애애!\n\n우리 행복이 좀 고쳐 주세요, 네?', '', '', '', '', '', '', 47187),
(70055, 'koKR', '폭풍의 인장', '폭풍의 인장을 스톰윈드에 있는 폭풍 사냥꾼 윌리엄에게 가져가야 합니다.', '<마법에 관해 방대한 지식을 갖춘 사람이라면 이 물건을 연구하는 데 관심을 보일지도 모릅니다.>', '', '', '', '', '', '폭풍의 인장을 스톰윈드에 있는 폭풍 사냥꾼 윌리엄에게 가져가야 합니다.', 47187),
(70052, 'koKR', '절벽 순환로 - 고급', '활공하여 고리를 통과해야 합니다.', '경로의 통과 지점 고리를 통과해야 합니다.', '', '', '', '', '', '', 47187),
(70051, 'koKR', '절벽 순환로', '활공하여 고리를 통과해야 합니다.', '경로의 통과 지점 고리를 통과해야 합니다.', '', '', '', '', '', '', 47187),
(70050, 'koKR', '폭풍 추적자', '스톰윈드 항구에 있는 폭풍 사냥꾼 윌리엄과 대화해야 합니다.', '아, 그러니까 저 잘 생긴 친구들이 자네를 작은 모험에 내보냈다는 말인가?\n\n문제 없네. 어차피 저 정기 폭풍을 다스리기 전까진 출항하지도 못 할 게 뻔하니까.\n\n폭풍 사냥꾼 윌리엄과 대화해보게나. 원정대에서 폭풍 조사를 책임지고 있는 친구니, 자네에게 필요한 장비를 제공해 줄 수도 있을 걸세.\n\n난 자네들이 거기서 노닥거리는 동안 여기서 준비나 마저 하고 있겠네.\n\n나중에 한 턱 내야 하네!', '', '', '', '', '', '스톰윈드 항구에 있는 폭풍 사냥꾼 윌리엄과 대화해야 합니다.', 47187),
(70049, 'koKR', '폭풍을 다스리다', '칼림도어와 동부 왕국 전역의 활성화된 원시 폭풍 지점에 있는 적에게서 원시 힘이 실린 티끌 $1oa개를 모아야 합니다.', '원시술사 세력이 집요하게 동부 왕국과 칼림도어 전역에 파괴적인 정령을 풀어놓고 있소.\n\n눈에는 눈 이에는 이라고, 이런 집요함에는 같은 집요함으로 맞서야 한다오. $n, 놈들을 저지할 다른 방법은 없소.\n\n원시술사의 다음 침공 지역을 알아내시오. 늦기 전에 원시 폭풍에 숨어 있는 적을 처치하고 음모를 저지하시오.\n\n아제로스를 지켜야 하오!', '', '', '', '', '', '', 47187),
(70048, 'koKR', '원시의 위협', '칼림도어와 동부 왕국 전역의 활성화된 원시 폭풍 지점에 있는 적에게서 원시 힘이 실린 티끌 $1oa개를 모아야 합니다.', '라자게스는 일분일초도 낭비하지 않고 원시술사 병력을 끌어모으고 있소.\n\n키린 토에서 칼림도어와 동부 왕국의 여러 요충지에 가공할 폭풍이 일어난 것을 관측했다오.\n\n원시술사들이 정기를 방출해 힘을 모으고 있는 거요. 단순히 용의 섬에 그치지 않고 얼라이언스와 호드의 영토에도 혼란을 일으킬 요량인 게지.\n\n적을 찾아 수법을 잘 살펴보시오. 너무 늦기 전에 저지해야 하오.', '', '', '', '', '', '', 47187),
(70047, 'koKR', '얼음 감옥', '', '', '', '', '', '', '', '', 47187),
(70042, 'koKR', '기회의 바다', '여러 물품을 입수해 살금살금 비쉬에게 전달해야 합니다.', '간 떨어질 뻔했잖아요. 들킨 줄 알았네!\n\n저 용의 섬을 정복하려고 결연한 표정을 짓고 있는 모험가들을 보세요... 도구하고 장비를 꽉꽉 채워 넣어서 배낭이 터지기 직전이죠.\n\n부자가 될 기회예요!\n\n주변을 살펴보고 물건 몇 개를 슬쩍해 오세요. 이익이 생기면 몫을 떼드릴 테니까.', '', '', '', '', '', '', 47187),
(70041, 'koKR', '폭풍포식자의 격노', '카드가의 비행 원반을 타고 원시술사 군대를 저지해야 합니다.', '라자게스가 탑을 무너뜨릴 작정으로 비전 마법을 모조리 파훼하고 있소!\n\n칼렉고스가 최선을 다해 막아내고 있고, 나도 마법으로 지맥 마력을 보충하고 있는 상황이오.\n\n하나 오래 버티기엔 역부족이오. 지금 이 순간에도 우리를 밀어내려고 더 많은 원시술사들이 모여들고 있으니.\n\n개조한 비전 원반을 가져가시오. 몰려드는 원시술사들을 막아야 하오... 아무쪼록 우리에게 기적이 있기를.', '', '', '', '', '', '바크스로스 기슭에서 칼렉고스와 대화해야 합니다.', 47187),
(70040, 'koKR', '시간의 낭떠러지', '동료를 집결시키고 노즈도르무와 대화해야 합니다.', '청동용과 무한의 용의 마법이 충돌하면서 크로노르무와 이터누스 둘 다 통제할 수 없는 시간의 낭떠러지로 추락하고 말았다.\n\n시간의 장막 그 자체를 찢어발기면서 떨어지고 있어 시공에 헤아릴 수 없이 많은 파문을 일으키고 있지. 두 사람을 찾아서 데려와야 한다. 그래야 이 이상의 피해를 방지할 수 있어. 크로노르무의 추락을 막을 수 있는 건 너뿐이니라.\n\n크로노르무를 함께 구할 동료들을 모아라. 나는 그 아이의 마법에 집중할 테니.', '', '', '', '', '', '동료를 집결시키고 노즈도르무와 대화해야 합니다.', 47187),
(70035, 'koKR', '루리크의 급류 주파', '', '', '', '', '', '', '', '', 47187),
(70034, 'koKR', '장인 공급: 도룡뇽 비늘', '루비 생명의 제단에 있는 헤페스타에게 도롱뇽 비늘을 전달해야 합니다.', '일거리 필요하지 않으십니까, 무두장이님? 장인 무역연합에서 고객에게 전달할 도롱뇽 비늘을 모아달라고 의뢰를 보내왔습니다.\n\n전 장인은 맞지만 그 누구의 심부름꾼도 아닙니다!\n\n뭐 그래도... 음, 몇 개 찾아주실 수 있을까요?', '', '', '', '', '', '루비 생명의 제단에 있는 헤페스타에게 도롱뇽 비늘을 전달해야 합니다.', 47187),
(70033, 'koKR', '장인 공급: 선구자의 가죽 장화', '루비 생명의 제단에 있는 헤페스타에게 선구자의 가죽 장화를 전달해야 합니다.', '일거리 필요하지 않나, 가죽세공인 친구? 장인 무역연합에서 고객에게 전달할 장화를 만들어 달라고 의뢰를 보내왔네.\n\n그 친구들은 내가 인기 있는 몸이라는 걸 이해 못 하는 모양이야. 오늘 하루만 해도 신발에 구멍이 났다면서 날 찾아와 불평을 늘어놓은 탐험가가 몇 명인지 알기나 하는 건지.\n\n이건 치수 측정표일세. 시간 괜찮으면 만들어 보게나. 혹시 알아? 자네라면 장인 무역연합에서 훌륭한 사업을 일굴 수 있을지도 모르지.', '', '', '', '', '', '루비 생명의 제단에 있는 헤페스타에게 선구자의 가죽 장화를 전달해야 합니다.', 47187),
(70032, 'koKR', '장인 공급: 보석세공인의 안경', '분리된 오닉스 확대경을 루비 생명의 제단에 있는 헤페스타에게 전달해야 합니다.', '혹시 일거리 필요하지 않나, 보석세공인 친구? 장인 무역연합에서 고객에게 전달할 안경을 만들어 달라고 의뢰를 보내왔네. \n\n다른 사람도 아니고 내게 말일세! 누군 시간이 넘쳐나는 줄 아나?\n\n자네 실력이면 만들 수 있겠지, 응?', '', '', '', '', '', '분리된 오닉스 확대경을 루비 생명의 제단에 있는 헤페스타에게 전달해야 합니다.', 47187),
(70031, 'koKR', '장인 공급: 요리사의 매끈한 밀대', '루비 생명의 제단에 있는 헤페스타에게 요리사의 매끈한 밀대를 전달해야 합니다.', '일거리 필요하지 않으십니까, 주문각인사님?\n\n장인 무역연합이란 회사에서 의뢰가 들어왔습니다.\n\n용사님 같은 수습 제작자에게 적당한 작업 같더군요.', '', '', '', '', '', '루비 생명의 제단에 있는 헤페스타에게 요리사의 매끈한 밀대를 전달해야 합니다.', 47187),
(70030, 'koKR', '장인 공급: 품질 보증 광학 탐지경', '루비 생명의 제단에 있는 헤페스타에게 품질 보증 광학 탐지경을 전달해야 합니다.', '아, 기계공학자라! 절묘하게도 나타나셨네요.\n\n고쳐야 할 설계도가 몇 개 있는데, 웬 덩치 큰 아가씨가 와서는 조준경을 만들어 달라고 하더군요.\n\n그거 만드는 방법 아시죠?\n\n다 만들면 루비 생명의 제단으로 가져가세요. 아까 그 아가씨 말로는 자기가 장인 무역연합인가 어디 소속이라고 했거든요.', '', '', '', '', '', '루비 생명의 제단에 있는 헤페스타에게 품질 보증 광학 탐지경을 전달해야 합니다.', 47187),
(70029, 'koKR', '장인 공급: 룬새김 세레바이트 마법막대', '룬새김 세레바이트 마법막대 $1oa개를 루비 생명의 제단에 있는 헤페스타에게 전달해야 합니다.', '마법부여를 할 수 있는 손을 가지신 것 같네요. 제가 주문을 받았는데 좀 도와주실 수 있나요?\n\n장인 무역연합에서 고객을 위해 세레바이트로 만든 마법막대를 여럿 요청했는데, 룬에 마법부여하는 일은 제 전문이 아니라서요.\n\n혹시 괜찮으시다면, 루비 생명의 제단에 있는 헤페스타를 찾아가 보세요. 시간과 노력에 대해 보상을 해줄 거예요!', '', '', '', '', '', '', 47187),
(70028, 'koKR', '장인 공급: 소금 뭉치', '루비 생명의 제단에 있는 헤페스타에게 소금 뭉치 $1oa개를 전달해야 합니다.', '일거리 필요하지 않으십니까, 광부님?\n\n저번에 헤페스타와 얘기를 나눴는데 장인 무역연합에서 고객에게 전달할 소금이 필요하다더군요.\n\n물론 제가 직접 해결하고는 싶습니다만, 꼭 그렇게까지 움직이고 싶은 것도 아니라서 말입니다.\n\n그러니 대신 모아다 주시겠습니까?', '', '', '', '', '', '루비 생명의 제단에 있는 헤페스타에게 소금 뭉치 $1oa개를 전달해야 합니다.', 47187),
(70027, 'koKR', '장인 공급: 측량사의 천 손목매듭', '루비 생명의 제단에 있는 헤페스타에게 측량사의 천 손목매듭을 전달해야 합니다.', '혹시 일거리 필요하지 않으십니까, 재봉사님? 장인 무역연합에서 고객에게 전달할 손목띠를 만들어 달라고 의뢰를 보내왔습니다.\n\n탐험가들이 우리 재봉술에 관심을 가져준다니 감사하긴 한데, 문제는 제가 이런 요청까지 처리할 시간이 없습니다.\n\n대신 맡아주실 생각은 없으신지요?', '', '', '', '', '', '루비 생명의 제단에 있는 헤페스타에게 측량사의 천 손목매듭을 전달해야 합니다.', 47187),
(70026, 'koKR', '장인 공급: 용암 딱정벌레', '루비 생명의 제단에 있는 헤페스타에게 용암 딱정벌레 $1oa마리를 전달해야 합니다.', '일거리 필요하지 않으세요, 약초채집사님? 장인 무역연합에게 고객에게 전달할 딱정벌레를 모아달라고 의뢰를 보내왔어요.\n\n자원이야 풍요롭지만... 지금 제가 그 요청을 처리하려고 자리를 비울 수 있는 형편이 아니라서요.\n\n용사님이 대신 나가서 딱정벌레 몇 마리를 채집해주실 수 있을까요?', '', '', '', '', '', '루비 생명의 제단에 있는 헤페스타에게 용암 딱정벌레 $1oa마리를 전달해야 합니다.', 47187),
(70025, 'koKR', '장인 공급: 드라코니움 낫', '루비 생명의 제단에 있는 헤페스타에게 드라코니움 낫을 전달해야 합니다.', '지금 특별히 할 일 없죠? 척 보면 척이죠. 일거리가 있는데 어디, 관심 있으신가요?\n\n장인 무역연합에서 드라코니움 낫 주문 제작 의뢰가 들어왔어요. 제 실력으로 어렵지 않게 쳐낼 수 있지만, 수습생으로서 용사님이 맡는 게 옳다고 생각해요.\n\n낫을 만들어 루비 생명의 제단으로 가져가세요. 헤페스타란 드레나이가 보수를 지급할 거예요.', '', '', '', '', '', '루비 생명의 제단에 있는 헤페스타에게 드라코니움 낫을 전달해야 합니다.', 47187),
