(69992, 'koKR', '폭풍의 인장', '폭풍의 인장을 듀로타에 있는 폭풍 여사냥꾼 슈라카에게 가져가야 합니다.', '<마법에 관해 방대한 지식을 갖춘 사람이라면 이 물건을 연구하는 데 관심을 보일지도 모릅니다.>', '', '', '', '', '', '폭풍의 인장을 듀로타에 있는 폭풍 여사냥꾼 슈라카에게 가져가야 합니다.', 47187),
