(69984, 'koKR', '황금 띠를 두른 용 이빨', '엑사드리아에게 물품을 전달해야 합니다.', '<스러져간 용의 잔재를 발견했습니다. 엑사드리아가 관심을 보일지도 모릅니다.>', '', '', '', '', '', '', 47187),
(69983, 'koKR', '불꽃각인 뼈', '갈퀴추적자 카비아에게 물품을 전달해야 합니다.', '<뼈에 불가사의한 자라딘 룬이 새겨져 있습니다. 갈퀴추적자 카비아가 관심을 보일지도 모릅니다.>', '', '', '', '', '', '', 47187),
(69981, 'koKR', '고객 만족', '장인 무역연합 고객에게 재제작 주문에 만족하는지 물어봐야 합니다.', '안녕하세요, $c님. 잠시 저 좀 도와주시겠어요?\n\n몇몇 단골분들이 장인 무역연합을 통해 재제작 의뢰를 넣으셨어요. 근데 그 이후로 소식이 뜸하네요.\n\n단골분들을 만나면 구매한 상품에 만족하셨는지 확인 좀 해주시겠어요? 고객의 행복이 곧 우리의 행복인 법이죠!', '', '', '', '', '', '갈래지류 교차로에 있는 마라 트리벤더에게 장비를 전달해야 합니다.', 47187),
(69979, 'koKR', '자격 증명', '대장로 천리사슴을 처치해야 합니다.', '지혜는 주어지는 게 아니라 얻어내는 것일세. 우리 종족의 방식대로 자격을 증명하고, 우리 방식대로 배우게.\n\n대장로 천리사슴은 지난 수 세대 동안 사냥당하지 않고 여기저기 잘 빠져나갔지. 놈을 찾아 사냥하게.\n\n그럼 자네가 원하는 지혜를 주도록 하지.', '', '대장로 천리사슴은 수 세대에 걸쳐 사냥꾼들을 따돌리고 피해왔습니다. 어쩌면 이번에야말로 잡을 수 있을지도 모릅니다.', '천리사슴', '', '', '', 47187),
(69976, 'koKR', '펜란', '', '', '', '', '', '', '', '', 47187),
(69975, 'koKR', '닐라 파이어베인', '', '', '', '', '', '', '', '', 47187),
