(69970, 'koKR', '케인 파이어브랜드', '', '', '', '', '', '', '', '', 47187),
(69969, 'koKR', '보라즈카', '', '', '', '', '', '', '', '', 47187),
(69968, 'koKR', '프로젤라 게일샷', '', '', '', '', '', '', '', '', 47187),
(69967, 'koKR', '망꾼 모드렌', '', '', '', '', '', '', '', '', 47187),
(69966, 'koKR', '로크무르', '', '', '', '', '', '', '', '', 47187),
(69965, 'koKR', '품질 보증', '장인 무역연합을 대신해 주변 정동석에 헤페스타의 도구를 시험해야 합니다.', '일감을 찾으시나요, 용사님?\n\n전 신흥 무역 회사 장인 무역연합의 대리인이랍니다. 주문 제작 연결망을 통해 장인과 고객을 연결해주는 업무를 보고 있죠.\n\n용비늘 원정대에서 마법을 부여한 채광 도구를 의뢰했어요. 물건 자체는 완성됐는데, 납품하기 전에 시험을 좀 해보려고요.\n\n보수는 당연히 챙겨드릴 거예요.', '', '', '', '', '', '', 47187),
(69964, 'koKR', '암반격노 정령', '', '', '', '', '', '', '', '', 47187),
