(69958, 'koKR', '티르홀드 시험 - 고급', '활공하여 고리를 통과해야 합니다.', '경로의 통과 지점 고리를 통과해야 합니다.', '', '', '', '', '', '', 47187),
(69957, 'koKR', '티르홀드 시험', '활공하여 고리를 통과해야 합니다.', '경로의 통과 지점 고리를 통과해야 합니다.', '', '', '', '', '', '', 47187),
