(69946, 'koKR', '기술의 거장', '거장 카딘을 찾아가 전문 기술에 관한 지혜를 얻어야 합니다.', '평야를 여행하던 중 북쪽 동굴에서 어떤 나이 많은 켄타우로스를 만난 기억이 납니다. 기술에 통달하신 분이라 많은 지혜를 전수받았지요.\n\n용의 섬에서 습득한 지식을 이해하는데 도움을 주셨습니다.\n\n전문 기술의 전문화에 관심 있으시다면 그 거장님에게 물어보면 될 겁니다. 그분의 존함은 티라이 부족의 카딘 님입니다.', '', '', '', '', '', '카딘의 동굴에 있는 카딘과 대화해야 합니다.', 47187),
(69944, 'koKR', '폭풍을 쫓아서', '비행선 탑승장에서 폭풍 여사냥꾼 슈라카와 대화해야 합니다.', '아, 저 마법사 멋있는 등장에는 일가견이 있는 모양이군요. 그렇지 않나요?\n\n누군가가 이 정기 폭풍을 다스리기 전에는 출항하지 못 할 거예요.\n\n폭풍 여사냥꾼 슈라카와 대화해보세요. 원정대에서 폭풍 조사를 책임지는 자이니 필요한 장비를 챙겨줄 수도 있을 테죠.\n\n다녀오시는 동안 전 나머지 준비를 지휘할게요. 핑계에 출항 전 용의 역사에 대해 더 읽을 시간도 좀 갖고요.', '', '', '', '', '', '비행선 탑승장에서 폭풍 여사냥꾼 슈라카와 대화해야 합니다.', 47187),
(69938, 'koKR', '광란의 낚시!', '', '', '', '', '', '', '', '', 47187),
(69936, 'koKR', '훼손범의 수장 잠불', '감독관 잠불을 처치해야 합니다.', '잘하셨습니다. 모독자 놈들이 이제 우리 선조들을 싸움으로 내몰지 못할 겁니다. 하지만 큰소리치면서 명령을 내리던 그 덩치는 처리해야 합니다.\n\n저게 감독관 잠불입니다. 꼭 저지해야 하는 적이죠.\n\n놈을 해치워주세요.', '', '', '감독관 잠불', '', '', '', 47187),
(69934, 'koKR', '피 흘리는 심장', '의약품을 전달해야 합니다.', '물약은 완성됐고, 이제 전달할 일만 남았습니다.\n\n상자 하나는 이 아래 골짜기에 있는 작은 동굴로 가져가 주세요. 받아줄 사람이 따로 나와있진 않겠지만 좋은 데 쓰일 테니 걱정은 하지 않으셔도 됩니다.\n\n다른 상자는 겔리키르 초소의 치료소로 전달해 주시면 됩니다. 제 오랜 친구가 환자들을 보살피는 곳이에요.\n\n사실... 용사님이나 저나, 이 일을 반드시 할 의무 같은 건 없긴 해요. 그래도 지금껏 잘 협조해 주셨고... 이 약품으로 사람 목숨을 구할 수 있을지도 모르잖아요?', '', '', '', '', '', '', 47187),
(69933, 'koKR', '호기심의 대가', '억센 덩굴을 절단해야 합니다.', '저 협곡 건너편을 봐요, $r 친구. 며칠 전 원시술사가 겔리키르 초소를 공격했습니다. 전투는 여전히 이어지고 있죠.\n\n초소 사람들에겐 연고와 봉합 도구가 필요해요. 제가 만들 줄은 아는데, 문제는 재료가 얼마 없습니다. 이왕 제 보금자리를 침범한 김에 자원봉사자 역할을 맡아 주셨으면 해요.\n\n정원으로 가서 가장 큰 덩굴을 찾으세요. 뿌리에서 뜯어내 가져오시면 됩니다.', '', '', '', '', '', '', 47187),
(69932, 'koKR', '모든 생명은 소중하다', '작은 기류의 붕대를 교체할 재료를 수집해야 합니다.', '겔리키르를 위한 물약을 만든다는 것은 다른 일을 할 여유가 없다는 뜻입니다.\n\n얼마 전에 오리 한 마리가 갈비뼈가 골절된 상태로 제 정원에 왔습니다. 상처는 치료했지만 붕대를 갈아줘야 합니다. 그렇게 돕고 싶으시다면...\n\n<당신 손에 재료 목록을 쥐여주는 사레스>\n\n그 목록에 적힌 재료가 필요합니다. 나머지를 모아 가져다주세요.', '', '', '', '', '', '', 47187),
(69931, 'koKR', '강하해 낚아채기', '', '', '', '', '', '', '', '', 47187),
(69930, 'koKR', '바스리크론', '', '', '', '', '', '', '', '', 47187),
(69925, 'koKR', '폭풍을 다스리다', '칼림도어와 동부 왕국 전역의 활성화된 원시 폭풍 지점에 있는 적에게서 원시 힘이 실린 티끌 $1oa개를 모아야 합니다.', '원시술사 세력이 집요하게 동부 왕국과 칼림도어 전역에 파괴적인 정령을 풀어놓고 있소.\n\n눈에는 눈 이에는 이라고, 이런 집요함에는 같은 집요함으로 맞서야 한다오. $n, 놈들을 저지할 다른 방법은 없소.\n\n원시술사의 다음 침공 지역을 알아내시오. 늦기 전에 원시 폭풍에 숨어 있는 적을 처치하고 음모를 저지하시오.\n\n아제로스를 지켜야 하오!', '', '', '', '', '', '', 47187),
(69924, 'koKR', '타오르는 힘의 탑', '', '', '', '', '', '', '', '', 47187),
(69923, 'koKR', '원시의 위협', '칼림도어와 동부 왕국 전역의 활성화된 원시 폭풍 지점에 있는 적에게서 원시 힘이 실린 티끌 $1oa개를 모아야 합니다.', '라자게스는 일분일초도 낭비하지 않고 원시술사 병력을 끌어모으고 있소.\n\n키린 토에서 칼림도어와 동부 왕국의 여러 요충지에 가공할 폭풍이 일어난 것을 관측했다오.\n\n원시술사들이 정기를 방출해 힘을 모으고 있는 거요. 단순히 용의 섬에 그치지 않고 얼라이언스와 호드의 영토에도 혼란을 일으킬 요량인 게지.\n\n적을 찾아 수법을 잘 살펴보시오. 너무 늦기 전에 저지해야 하오.', '', '', '', '', '', '', 47187),
(69919, 'koKR', '필요의 미학', '애즐리와 대화하여 주문 제작 납품에 관해 배워야 합니다.', '제작 기술에 일가견이 있는 분 같은데, 동료 모험가들의 주문 제작 의뢰를 받아 엄청난 부자가 될 생각은 없으신가요?\n\n장인 무역연합과 일하려면 지켜야 할 규칙이 있는데, 그건 제가 알려드릴게요. 다 듣고 나면 용의 섬에 있는 아무 제작대에서 주문 제작 의뢰를 고르시면 돼요!', '', '', '', '', '', '', 47187),
(69918, 'koKR', '흔들리는 기반', '바위난봉꾼 토카라와 분쇄자 몰카, 그리고 이들이 풀어놓은 정령을 처치해야 합니다.', '자라딘 돌결속자들이 성채 기반을 부수려고 작정한 것 같습니다! 반드시 저지해야 합니다!\n\n아직 성채를 제대로 수복하지도 못했는데 무너져 내릴 위기에 처하다니, 있어선 안 될 일입니다.\n\n할 수 있는 데까지 도와주십시오, $n 님... 그러니까 놈들 숨통을 끊어달란 얘깁니다!', '', '몰카는 바위난봉꾼 토카라와 더불어 성채 지하의 흑요석을 능숙하게 조작합니다.', '분쇄자 몰카', '', '', '', 47187),
(69915, 'koKR', '표적 광고', '갈래지류와 성가신 염소에게서 전단을 회수해야 합니다.', '안녕하세요! 반가워요! 잘 부탁해요! 혹시 일거리 필요하지 않으세요?\n\n주문 제작 의뢰소를 새로 개장하는 기념으로 성대하게 할인 행사를 진행할 예정이랍니다. 그러려면 관심을 끌어야 해요! 근데 그게, 바람에 전단이 날아가 버렸어요. 설상가상으로 지역 염소들이 물고 달아나 버린 것 같고요.\n\n전단을 되찾아주실 수 있을까요?', '', '', '', '', '', '', 47187),
(69914, 'koKR', '자라딘의 각성', '청지기 셀리스트라에게 명령을 받아야 합니다.', '즐겁게 소개를 주고받을 시간이 있었으면 더없이 좋았겠지만, 모두가 크로노르무 님은 아니지 않소?\n\n나는 셀리스트라라고 하오. 용의 여왕이자 생명의 어머니이신 알렉스트라자 님을 모시는 청지기요.\n\n알렉스트라자 여왕님께서 진심을 담은 안부 인사를 전하시며 당신을 정성스럽게 생명의 웅덩이로 안내하라고 명하셨소.\n\n하나 여왕님을 뵈러 가기 전에 먼저 협조를 요청해야 할 것 같구려.\n\n우리의 오랜 숙적인 자라딘이 지하에서 잠들어 있다 깨어났소. 벌써 주변 전초기지를 공격하기 시작했다오!', '', '', '', '', '', '날개쉼터 대사관에서 센드락스를 만나야 합니다.', 47187),
(69912, 'koKR', '용생 첫 비상사태', '센드락스를 설득해 비상 신호탄을 발사하여 용들에게 당신의 도착을 알리도록 해야 합니다.', '<당혹한 표정을 짓는 센드락스>\n\n청지기님은 무슨 일이든 늦을 분이 아닙니다. 하물며 오늘처럼 중요한 일에 이 정도로 늦을 분은 더더욱 아니고요.\n\n정말 이상하군요...\n\n<좋은 생각이 떠올랐는지 얼굴이 밝아지는 센드락스>\n\n비상 신호탄을 발사하면 여러분의 도착을 알릴 수 있을 겁니다. 곧바로 달려오실 거예요!\n\n근데 제가 비상 신호탄을 한 번도 발사해본 적이 없는지라...', '', '', '', '', '', '날개쉼터 대사관에서 래시온을 만나야 합니다.', 47187),
(69911, 'koKR', '누추한 곳에 귀한 손님', '대사 파스트라즈를 도와 대사관을 복원해야 합니다.', '저도 마음만 같아서는 좀 더 제대로 된 방식으로 여러분의 용의 섬 입성을 환영해드리고 싶지만, 일개 파수꾼인지라 의전을 잘 모릅니다.\n\n<뒤로 보이는 탑을 가리키는 센드락스>\n\n사무소에 파스트라즈 대사님이 계시니 한번 말씀 나눠 보시죠. 용들께서 도착하시기 전에 질문에 답을 해주실 겁니다.\n\n바닥 조심하세요. 아까 보니까 대사님이 잔해를 치우느라 정신이 없더군요.', '', '', '', '', '', '', 47187),
(69910, 'koKR', '래시온은 어디에?', '센드락스에게 언제쯤 용이 도착하는지 물어봐야 합니다.', '이상하군요.\n\n에비시안 님은 래시온 님이 용의 여왕이자 생명의 어머니이신 알렉스트라자 님의 대사와 마중을 나올 거라고 하셨습니다.\n\n약속을 어기는 건 용답지 않은 일인데 말이지요.\n\n그나마 이 열정적인 용기병이라도 우릴 맞아줘서 다행입니다. 다른 분들은 언제쯤 도착하는지 여쭤봐 주시겠습니까?', '', '', '', '', '', '', 47187),
(69904, 'koKR', '수상한 침묵', '안토니다스 야영지에서 노리코의 수습생을 찾아야 합니다.', '$p 님, 잠시 시간 좀 내어주실 수 있을까요? 문하에 스크럼피와 터키라고 두 수습생을 두고 있는데, 연락이 끊긴 지 좀 돼서요. \n\n무사한지 걱정됩니다. \n\n여관에서 보급품을 받아오라고 보냈는데... 옆길로 멀리 빠지진 못했을 거예요.\n\n수습생을 찾아주세요. 그리고... 다루기 쉬운 친구들은 아니니 조심하시길.', '', '', '', '', '', '', 47187),
(69902, 'koKR', '이론 실증', '티르곤을 도와 생명체를 치유해야 합니다.', '$n 님, 도움이 필요합니다...\n\n어떻게 강사 혼자서 필요한 것을 만드는 일, 새끼용을 진정시키고 치료하는 일, 아이들을 교육하는 일을 한꺼번에 다 하겠습니까? 몸은 하나뿐이란 말입니다.\n\n저 꽃으로 시작하시면 됩니다. 새끼비룡을 치료하기 위해서는 제가 아직 준비 시간이 필요합니다.\n\n아이들이 이 일로 뭐라도 배웠으면 좋겠습니다.', '', '', '', '', '', '', 47187),
(69901, 'koKR', '전문가 호출', '햇살꽃 $1oa개를 채집해야 합니다.', '이 생명체가 언제부터 아팠는지 이얄리에게 들으셨나요? 먹지 못할 만큼 심한 부상이라면 빨리 치료해야합니다.\n\n일반적인 용비늘 원정대 야영지라면 이 새끼용을 치료할만한 모든 것들이 있겠지만, 용의 섬의 \"경계\"에서 필요한 물건을 받기는 쉽지 않습니다. 보급이 상당히 지연되고 있거든요.\n\n하지만 걱정하지 않으셔도 됩니다. 땅 자체에서 구할 수 있을 겁니다. 제게 햇살꽃을 가져오시면 용을 치료할 수 있도록 진정제를 만들어서 달래보겠습니다.', '', '', '', '', '', '', 47187),
(69900, 'koKR', '근원 파악', '야생의 보존지에서 실험 중인 원시술사들을 처치해야 합니다.', '아이들 말을 종합적으로 판단해봤을 때, 야생의 보존지에 원시술사가 들어왔을 공산이 큽니다.\n\n지금 바로 조사에 착수해야 합니다.\n\n다른 연구원들이 목격한 바에 따르면, 원시술사가 알과 새끼용을 훔쳐 힘을 주입해 타락시키려고 한다고 합니다. 이 과정에서 적응하지 못한 개체들은 서서히 죽어갑니다... 원시술사에게 그런 건 안중에도 없겠지만...\n\n놈들을 야생의 보존지에서 몰아내야 합니다. 일을 해결하실 동안 전 아이들의 관심을 돌려보겠습니다. 이 일을 알릴 순 없어요.', '', '', '', '', '', '', 47187),
(69899, 'koKR', '비밀 연구', '이얄리와 친구들을 도와야 합니다.', '알아요... 제가 좀 이상하게 굴긴 했죠. 죄송해요! \n\n제가 숨기는 것이 있다고 생각하셨겠죠.\n\n정 아시고 싶다면... 제 비밀을 알려드릴게요. 대신 다른 어른한테는 절대 말하지 않기로 약속해 주세요.', '', '', '', '', '', '', 47187),
(69898, 'koKR', '과학적인 방법', '대단히 맛있는 강물하마 고기 $1oa개를 수집해야 합니다.', '숙제가 하나 더 있어요... 티르곤 교수님의 수업은 너무 벅차요! 교수님이 새끼 원시용은 뭘 먹는지 알아보래요! 아...\n\n사실 정답은 저도 알아요. 강물하마 고기예요.\n\n혹시 강물하마 고기를 구해다 주실 수 있을까요? 실제 고기가 있으면 제 과제에 \"시각 자료\"로 유용하게 쓸 수 있을 거예요.\n\n대신 진짜 상태가 좋은 고기여야 해요. 아시겠죠? 그러니까... 땅딸막한 강물하마 고기는 되어야 해요. 새끼 원시용이 먹고 튼튼해질 수 있을 만한 걸로요. 어, 그러면, 티르곤 선생님이 만족하실 거예요.', '', '', '', '', '', '', 47187),
(69897, 'koKR', '행동 분석 \"숙제\"', '잠자는 새끼용 $4oa마리를 쓰다듬고 이얄리에게 가야 합니다.', '새끼 원시용을 잘 아는 분하고 얘기해보고 싶어요. 야생의 보존지에 사는 녀석들 말이에요! \n\n걔들도 덩치 큰 원시용들처럼 화가 나 있나요? 막 깨물고 불도 쏘고 그래요?\n\n만약에... 어... 음... 새끼 원시용을 쓰다듬으면 어떻게 될까요? 도우려는 거라는 걸 이해할까요?\n\n과학을 위해서 물어보는 거예요. 티르곤 님은 항상 그... 가슬... 아닌데... 가솔... 흠! 가술... 으으! 가설을 검증해봐야 한다고 말씀하셨거든요!\n\n제 생각으로는 쓰다듬어 주면 좋아할 것 같아요. 검증해 주실 수 있을까요?', '', '', '', '', '', '', 47187),
(69896, 'koKR', '참혹한 우회로', '생명의 금고 폐허에서 정령술사 타이양을 만나야 합니다.', '용비늘 원정대에 들어올 때 위험한 지역으로 가게 될 줄은 알았습니다만, 설마 정령들과 싸우게 될 줄은 몰랐습니다!\n\n생명의 금고 폐허는 지금 혼돈의 도가니 그 자체입니다! 웬 돌 괴수들이 땅에서 막 솟구쳐 올라오고 있다니까요! 정령술사를 불러 자문을 구해봤지만 그래도 도움이 필요한 모양이더군요.\n\n용사님이 도와주시면 안 되겠습니까? 야영지는 강 건너편에 있습니다.', '', '', '', '', '', '', 47187),
