(69870, 'koKR', '의도가 있는 사진', '범람하는 여울 근처에서 분류학자 아쿤다와 사수 프렌을 만나야 합니다.', '$p 님, 사진은 사람을 모으는 마력이 있답니다.\n\n우리 분류학자는 보통 안전상의 이유로 2인 1조로 파견되는데, 이 경이로운 섬에서 지식이란 공통의 목적 아래 서로 다른 진영과 배경을 가진 사람들이 협력하는 모습을 보니 마음이 절로 흐뭇해지더군요.\n\n마침 열정적인 2인조가 지금 깨어나는 해안의 중앙 강을 측량하고 있죠.\n\n원정대를 돕고 싶다면 그 사람들을 도와 야생 환경을 분류해 주세요.', '', '', '', '', '', '범람하는 여울 근처에서 분류학자 아쿤다와 사수 프렌을 만나야 합니다.', 47187),
(69869, 'koKR', '분류학자의 낙원', '용비늘 기지에서 분류학자 코랄리와 대화해야 합니다.', '<의사 내너스가 숨을 몰아쉬며 초청장을 건넵니다. 용비늘 원정대 기지로 복귀해 훈련을 받으라는 내용의 편지입니다. 의사 내너스가 의욕적으로 설명합니다.>\n\n착한 엘프가 보냈다. 콧대 높은 작은 사람. 카메라 많아. 알지?\n\n<당신의 답변을 기대하는 눈치로 고개를 까딱이는 의사 내너스>', '', '', '', '', '', '용비늘 기지에서 분류학자 코랄리와 대화해야 합니다.', 47187),
