(69862, 'koKR', '슬라이번 구하기', '실비에가 불편해하는 이유를 찾아야 합니다.', '실비에가 좀 괜찮아졌네요. 우리에게 보여주고 싶은 게 있는 것 같아요.\n\n아직 일이 끝나지 않은 것 같군요, $n 님! 뭐가 실비에 마음에 걸리는 건지 찾아보죠.', '', '', '', '', '', '', 47187),
