(69855, 'koKR', '등반가의 부름', '용비늘 기지에서 길잡이 제브와 대화해야 합니다.', '<의사 내너스가 숨을 몰아쉬며 초청장을 건넵니다. 용비늘 원정대 기지로 복귀해 훈련을 받으라는 내용의 편지입니다. 의사 내너스가 의욕적으로 설명합니다.>\n\n덩치 큰 제브가 보냈다. 제브 좋은 친구. 지금 등반해야 해. 알았지?\n\n<당신의 답변을 기대하는 눈치로 고개를 까딱이는 의사 내너스>', '', '', '', '', '', '용비늘 기지에서 길잡이 제브와 대화해야 합니다.', 47187),
