(69097, 'koKR', '금고 개방', '용비늘 기지에서 분류학자 제이크스와 대화해야 합니다.', '<의사 내너스가 숨을 몰아쉬며 초청장을 건넵니다. 용비늘 원정대 기지로 복귀해 훈련을 받으라는 내용의 편지입니다. 의사 내너스가 의욕적으로 설명합니다.>\n\n시끄러운 드워프. 진지한 엘프. 준비됐대. 알겠지?\n\n<당신의 답변을 기대하는 눈치로 고개를 까딱이는 의사 내너스>', '', '', '', '', '', '용비늘 기지에서 분류학자 제이크스와 대화해야 합니다.', 47187),
(69096, 'koKR', '타이반의 목적', '켄타우로스 고아 치메이를 달래주어야 합니다.', '저기 저 아이 보이시나요? 강둑에 혼자 앉아있는 아이요.\n\n<북동쪽을 가리키는 셀베크의 손끝으로 물을 빤히 들여다보는 젊은 켄타우로스 한 명이 보입니다.>\n\n치메이는 노쿠드의 공격으로 양친을 잃었습니다. 신체의 상처는 전부 치료했지만, 발견된 이후로 음식을 입에 대지도, 누구와 말을 하지도 않고 있어요. 그냥 앉아서 우두커니 있을 뿐이죠. \n\n이건 제가 치료할 수 있는 영역이 아니라 어떻게 해야 할지 모르겠어요. 아이와 얘기를 나눠주실 수 있을까요, $n 님?', '', '', '', '', '', '', 47187),
(69095, 'koKR', '집으로 가는 개', '타이반을 타고 마루카이로 이동해야 합니다.', '모두 안정됐습니다. 이게 다 용사님과 타이반 덕분이에요. 그래도 다른 마을 주민들은 한동안 마루카이에서 치료를 받아야겠지만요. \n\n이왕 이렇게 된 거 둘이 앞장서는 게 어때요? 오늘의 주역이기도 하니까!', '', '', '', '', '', '', 47187),
(69094, 'koKR', '켄타우로스 구출 작전', '다루칸 마을에서 부상당한 켄타우로스를 구출해야 합니다.', '노쿠드 이 작자들의 배반에는 정말 끝이 없군요! 다루칸 마을은 장인들만 사는 곳입니다. 그런 사람들이 무슨 재간으로 약탈병들을 상대하겠어요?\n\n$n 님의 도움이 꼭 필요합니다. 부상자들을 치료해야 하는데, 인근에 노쿠드가 아직 남아 있어요!\n\n마을을 살펴서 생존자를 찾아 데려다주세요. 숨이 붙어 있는 사람들은 응급처치를 하고 안정시킬 겁니다!', '', '', '', '', '', '', 47187),
(69093, 'koKR', '새로운 불가사의', '용비늘 기지에서 날레디아 리버글림과 대화해야 합니다.', '<의사 내너스가 숨을 몰아쉬며 초청장을 건넵니다. 용비늘 원정대 기지로 복귀해 훈련을 받으라는 내용의 편지입니다. 의사 내너스가 의욕적으로 설명합니다.>\n\n봉인된 문. 티탄 비밀. 알겠지?\n\n<당신의 답변을 기대하는 눈치로 고개를 까딱이는 의사 내너스>', '', '', '', '', '', '용비늘 기지에서 날레디아 리버글림과 대화해야 합니다.', 47187),
(68799, 'koKR', '루비 생명의 제단으로 가기', '루비 생명의 제단으로 가야 합니다.', '오늘은 용 조련술 통달을 향한 여정에서 첫걸음을 내디딘 것에 불과하오!\n\n잘 살펴보면 용의 섬 곳곳에서 새로운 모험과 경험을 쌓을 수 있을 거요. 어느 전초기지든 우리 사람이 있으니 꼭 찾아주시오.\n\n이제 슬슬 알렉스트라자 님께 돌아가는 게 좋겠군. 섬 탐험을 계속해야 하지 않겠소.', '', '', '', '', '', '루비 생명의 제단에 있는 알렉스트라자에게 가야 합니다.', 47187),
(68798, 'koKR', '용 문양과 당신', '하늘마루 관측소에서 용 문양을 수집한 후 리스라고사와 대화하여 특성을 사용해야 합니다.', '사실 이 모험에 관심이 있는 건 나나 글렌세라뿐만이 아니오. 셀로르무는 이미 만났을 테고, 리스라고사도 그대의 용 조련술을 연마해줄 생각에 신이 났소.\n\n용의 섬에는 더 많은 기술과 능력을 배울 수 있는 문양들이 흩어져 있소. 사실, 여기 하늘마루 관측소에도 한 개 있지.\n\n문양을 찾은 후에는 리스라고사가 사용 방법을 알려줄 것이오!', '', '용의 섬 전역에서 찾아볼 수 있는 이 문양을 사용해 더 많은 용 조련술 능력과 기술을 배울 수 있습니다.', '용 문양', '', '', '', 47187),
(68797, 'koKR', '새로운 뿔모양', '글렌세라를 만나 변신 강단에서 비룡을 꾸며야 합니다.', '겉모습을 신경 쓰는 마음은 용이라고 해서 필멸자와 다르지 않소. 그대의 비룡 역시 발견과 경험을 통해 변화할 수 있지.\n\n변신 강단에 있는 글렌세라와 얘기해 보시오. 백문이 불여일견 아니겠소!', '', '', '', '', '', '', 47187),
(68796, 'koKR', '하늘마루 관측소', '깨어나는 해안에 있는 하늘마루 관측소로 가야 합니다.', '이걸로 비룡 조련술의 기초는 모두 가르쳤소! 가르치는 족족 흡수하는군.\n\n자, 이제 이 모험에 동참하기로 한 다른 이들을 소개해주고 싶소. 저기 하늘마루 관측소를 우리의 거처로 삼았다오.\n\n셀로르무가 안내를 도와줄 것이오. 준비되면 그에게 말해 하늘로 올라가시오!\n\n그럼 가서 보겠소!', '', '', '', '', '', '하늘마루 관측소에서 군주 안데스트라즈를 만나야 합니다.', 47187),
(68795, 'koKR', '용 조련술', '루비 생명의 제단에서 군주 안데스트라즈와 대화해야 합니다.', '이미 눈치챘을지도 모르겠지만, 용의 섬은 무척이나 광활한 곳이니라. \n\n몇몇 비룡들이 섬 곳곳을 살펴보고 숨겨진 장소를 찾아내는 데 지대한 관심을 두고 있다. 지상에서는 쉽게 접근할 수 없는 곳들까지 말이다. 다들 여정을 도와줄 동행인을 찾고 있고, 기꺼이 기수를 태워줄 것이다.\n\n루비 생명의 제단에 있는 안데스트라즈 군주와 얘기를 나눠보렴. 아이들의 뜻을 자세히 설명해줄 것이야.', '', '', '', '', '', '루비 생명의 제단에서 군주 안데스트라즈와 대화해야 합니다.', 47187),
(68794, 'koKR', '용의 동맹', '발드라켄 위상의 권좌에서 알렉스트라자와 대화해야 합니다.', '$n 님, 용의 섬의 안위를 위하는 당신의 헌신은 모르는 이가 없습니다.\n\n생명의 어머니께서 용족을 향한 헌신에 직접 보답하고 싶다고 말씀하셨습니다.\n\n탑 꼭대기로 가서 말씀 나누시지요. 위상들께서 모두 기다리고 계십니다.', '', '', '', '', '', '발드라켄 위상의 권좌에서 알렉스트라자와 대화해야 합니다.', 47187),
(68644, 'koKR', '설탕, 향신료 외의 온갖 좋은 재료들', '실비에 치료를 도와야 합니다.', '좋습니다! 실비에 치료제를 만드는 데 필요한 준비물은 다 모였네요!\n\n늦지 않게 적절히 구해다 주셨어요. 실은 실비에가 더 버티지 못할 것 같았던지라.\n\n하지만... 도와줄 사람이 필요해요. 마음만 같아선 캘리에게 부탁하고 싶지만... 한 번만 더 용사님 손을 빌려도 괜찮을까요?\n\n준비되면 말씀해 주세요, $n 님.', '', '', '', '', '', '', 47187),
(68643, 'koKR', '영양분과 광물', '광천수가 든 병 $1oa개를 모아야 합니다.', '동물과 싸워달란 부탁을 하면 스테리아가 화낼 게 당연했는데, 그걸 간과하고 있었네요...\n\n다른 연구 방법도 있는데 말이죠.\n\n이 유리병을 받으세요. 주변 얼음 수정에서 물 표본을 채취해 주셨으면 해요. \n\n가설이긴 한데, 그 물에 지맥 수정 마력이 주입된 광물이 함유되어 있을 거예요. 어쩌면 이곳에서 일어나고 있는 감염 사태의 원인일지도 몰라요.', '', '', '', '', '', '', 47187),
(68642, 'koKR', '바늘 돋친 말', '비전 주입 깃 $1oa개를 수집해야 합니다.', '실비에를 돕고 싶은 마음은 굴뚝같지만, 그렇다고 캘리를 더 기다리게 만들고 싶진 않아요.\n\n실비에에게 투여할 치료제를 만들려면 수정가시의 비전 마력이 주입된 깃이 필요해요. 몇 개쯤 뽑아간다고 내색하진 않겠죠! \n\n그리고 바카르를 조심하세요! 수정가시를 잡아먹는 녀석들이라 자기들 먹잇감을 건드린다고 화낼 수도 있거든요. 어쩔 수 없이 맞서 싸워야 하는 일이 생긴다면... 바카르에게서도 가시를 몇 개 채취하실 수 있을 겁니다.\n\n그래도... 될 수 있으면 싸움은 피해 주세요. 부탁드릴게요.', '', '', '', '', '', '', 47187),
(68641, 'koKR', '이끼 징표', '용이끼 덩어리 $1oa개를 수집해야 합니다.', '가엾은 녀석...\n\n오염된 물질을 먹은 게 독이 된 모양이에요.\n\n다행인 것은 제 조부께서 드루이드이셨다는 겁니다. 그분께 비전 기반 질병을 치료하는 방법을 배웠죠.\n\n재료가 다 있는 건 아니지만, 이 주변에서 조달할 수 있을 겁니다.\n\n우선 용이끼가 좀 필요합니다. 용의 뼈에서만 자라는 희귀한 종이지요.', '', '', '', '', '', '', 47187),
(68639, 'koKR', '배회하는 북극의 포식자', '감염된 혹한가죽 $1oa마리를 처치해야 합니다.', '우린 혹한가죽이란 동물 종을 연구하는 임무를 받고 파견됐어요.\n\n혹한가죽의 사냥터가 지맥에 오염됐거든요. 비전 마력이 물과 식물은 물론이고... 슬라이번 같은 피식 종에까지 스며든 거죠.\n\n하지만 다른 유기체와 달리 혹한가죽은 그 과정에서 살아남아 힘을 얻기까지 했어요.\n\n게다가 공격적으로 변하기도 했고요. 문제는 여기서부터 시작이에요. 혹한가죽 몇 마리를 상대해 주세요. 저는 놈들의 힘과 공격성을 기록으로 남길게요. \n\n보고서를 작성하면 나중에 키린 토에서 대응 방침을 결정하는 데 도움이 될 거예요.', '', '', '', '', '', '', 47187),
(68087, 'koKR', '다루칸의 위기', '티라이 전령과 대화하여 셀베크의 긴급 요청을 들어야 합니다.', '아무래도 당신과 타이반을 마루카이로 돌려보내는 수밖에 없겠네요. \n\n잠깐... 저기 누가 오는데? 또 다른 거대 바카르 견주는 아니면 좋겠군요!', '', '', '', '', '', '', 47187),
(68085, 'koKR', '양치기의 탄생', '말라크에서 타이반에게 큰뿔양 모는 법을 가르쳐야 합니다.', '바카르를 목양견으로 조련해달라고요? 흠. 여기서 하는 일이 딱 그렇긴 한데, 저렇게나 큰 녀석은 훈련시켜 본 적이 없어서...\n\n그래도 뭐, 큰뿔양들이 불편해하는 기색은 드러내지 않으니 다행입니다. 농담이 아니라 쟤들이 눈치 하나는 귀신 같거든요. \n\n한번 시도는 해보죠. 하지만 목양 바카르는 그냥 착하기만 해선 안 됩니다. 머리도 영리해야 해요. 무리를 이끌 능력이 없으면 큰뿔양들이 복종하지 않을 겁니다. 보기보다 어려운 일이다 이 말이죠! 자, 제가 지켜볼 테니 한번 해보세요.', '', '', '', '', '', '', 47187),
(68084, 'koKR', '상냥한 거인', '말라크에 있는 양치기 테바테이에게 타이반을 보내 훈련을 받게 해야 합니다.', '자다르 말마따나 타이반이 \"온순한\" 성격이라면... 차라리 목양 바카르가 적성에 맞겠는데요! 아일라그 부족은 큰뿔양 사육에 도가 튼 전문 목동들이고, 누구처럼 선물 없인 꼼짝 않을 만큼 자신들에게 취해있지도 않죠. 타이반을 말라크에 있는 양치기 테바테이에게 보내주세요. 남서쪽의 두 언덕 사이에 있는 장소인데, 아일라그가 바카르 훈련장으로 쓰고 있습니다.\n\n온아라시여... 제발 이번에는 성공하기를. 이것도 아니면 더 쥐어짜 낼 생각도 없습니다.', '', '', '', '', '', '', 47187),
(68083, 'koKR', '포기하지 마, 타이반!', '마루카이에 있는 치유사 셀베크에게 가서 안 좋은 소식을 전해야 합니다.', '티라이로 가서 아무리 나라도 타이반을 사냥꾼으로 길러내지는 못하겠다고 전해줬으면 한다. 애초에 천성을 타고나지 못했어. 내 살면서 이렇게 온순한 바카르는 처음 본다. 가만히 두면 야생의 사냥감하고 친해지려고 들걸? 하!', '', '', '', '', '', '마루카이에 있는 치유사 셀베크에게 가야 합니다.', 47187),
(67921, 'koKR', '사냥개', '타이반과 함께 위험한 야수를 사냥해 훈련받을 자격이 있음을 증명해야 합니다.', '그 거대 바카르를 데리고 가서 인근 야수를 사냥해라. 사냥감은 클수록 좋아. 난 이곳에서 지켜보면서 그 녀석이 시카르 훈련을 받을 자격이 있는지 판단하겠다.\n\n어중이떠중이는 상종도 안 하니 명심하도록.', '', '', '', '', '', '', 47187),
(67772, 'koKR', '타이반의 문제', '치유사 셀베크를 도와 타이반을 훈련에 임할 수 있도록 준비시켜야 합니다.', '반가워요, 친구. 마루카이에 온 것을 환영해요. 저는 티라이 부족의 치유사 셀베크라고 합니다. \n\n혹시 동물 좋아하시나요, $n 님? 새로운 분의 영향력으로 해결할 수 있을지도 모르는 문제가 있어서요.\n\n여기 이 타이반은 친구로서 손색없지만, 부족의 천덕꾸러기 신세가 되고 말았어요. 이 아이에게 어울리는 역할을 찾아주지 못하면 다른 곳으로 보내야 할지도 몰라요. 도와주실 수 있을까요?', '', '', '', '', '', '', 47187),
(67742, 'koKR', '기록 보관소 일주로 - 고급', '활공하여 고리를 통과해야 합니다.', '경로의 통과 지점 고리를 통과해야 합니다.', '', '', '', '', '', '', 47187),
(67741, 'koKR', '기록 보관소 일주로', '활공하여 고리를 통과해야 합니다.', '경로의 통과 지점 고리를 통과해야 합니다.', '', '', '', '', '', '', 47187),
(67724, 'koKR', '불꽃 보호 작전', '오한그물 비단 $1oa개를 수집해야 합니다.', '카티가트와 저는 분리된 불길 놈들이 발트룩스를 손에 넣지 못하게 저지해 실력을 증명할 생각으로 왔습니다.\n\n지금은 얼음 거미한테 몇 번 물리고 앓아누운 엘프를 지키는 처지가 됐지만 말이죠. 분리된 불길하고는 싸워보지도 못했어요. 그전에 거미 녀석들에게 다 죽을 것 같지만!\n\n지금은 거미를 견제해야 합니다.\n\n다행히도 놈들을 몰아낼 천연 요법이 있습니다. 고치에서 채취한 비단을 태우면 거미들이 싫어하는 향이 나죠.\n\n비단을 모아다 주시면 제가 태우겠습니다. 그거면 접근을 차단할 수 있을 거예요!', '', '', '', '', '', '', 47187),
(67700, 'koKR', '용의 섬으로!', '스톰윈드 항구에서 거친 용비늘호를 타고 용의 섬으로 이동해야 합니다.', '좋은 소식이에요, $p 님! 선두 원정대가 무사히 용의 섬에 상륙했어요.\n\n용사님과 다른 용비늘 원정대원들의 활약 덕분에 안전한 상륙지를 확보하고, 용군단의 대사관과 접선할 수 있었어요.\n\n자, 그럼 함께 용의 섬으로 다음 모험을 떠날 준비는 되셨나요?', '', '', '', '', '', '용의 섬 해안에서 토디 위스커스를 만나야 합니다.', 47187),
(67606, 'koKR', '드리아드식 특효약', '맛있는 새끼용 간식을 입수한 후 낙담한 새끼 오리에게 줘야 합니다.', '용사님이 자리를 비우신 동안 이 근처 새끼 오리의 몸 상태가 좋지 않다는 소식을 전해 들었습니다. 다행히도 제가 고치는 방법을 압니다!\n\n저는 몸 상태가 좋지 않을 때마다 달콤하고 맛있는 간식을 입에 물어요! 깜찍하고 사랑스러운 동물 전문가로서 같은 원칙이 적용될 거라 믿어 의심치 않는다, 이 말씀이죠.\n\n특히 그 새끼 오리는 맛있는 새끼용 간식이란 후식을 좋아한다고 하네요. 가엾은 녀석에게 좀 구해다 주시겠어요? 드리아드라면 마땅히 할 일이니 말이에요!', '', '', '', '', '', '', 47187),
(67605, 'koKR', '천둥의 평야', '아얀가의 뿔을 입수해야 합니다.', '이 산등성이에는 거대한 폭풍 야수가 돌아다니고 있다. 많은 시카르 사냥꾼이 잡으려고 시도했지만, 너무 흉포해서 모두 실패했지.\n\n영광스러운 사냥을 원한다면, 야수를 쓰러뜨리고 공물로 사용할 뿔을 가지고 와라.', '', '켄타우로스 야영지를 파괴하는 걸 즐기는 고약한 천둥도마뱀입니다.', '아얀가', '', '', '', 47187),
(67566, 'koKR', '서리지대 고가로 - 고급', '활공하여 고리를 통과해야 합니다.', '경로의 통과 지점 고리를 통과해야 합니다.', '', '', '', '', '', '', 47187),
(67565, 'koKR', '서리지대 고가로', '활공하여 고리를 통과해야 합니다.', '경로의 통과 지점 고리를 통과해야 합니다.', '', '', '', '', '', '', 47187),
(67564, 'koKR', '장인의 급사', '장인 무역연합 송장을 토마스 브라이트에게 전달해야 합니다.', '모험가님, 지금 생명의 제단으로 가는 길이신가요?\n\n이 송장을 토마스 브라이트에게 전달해 주시겠어요? 얼마 전에 토마스가 맞춤 제작 병을 몇 개 주문했는데, 우리 유리공이 드디어 재료 가격 견적을 보내줬거든요.\n\n이 길을 쭉 따라가면 만날 수 있어요. 아마 불쌍한 행인 하나 붙잡고 자기 남편이 얼마나 대단한지 자랑을 마구 늘어놓고 있을 거예요...\n\n수고비도 받으실 수 있을 거고요.', '', '', '', '', '', '루비 생명의 제단에 있는 토마스 브라이트에게 장인 무역연합 송장을 전달해야 합니다.', 47187),
(67299, 'koKR', '사라져라, 비룡아', '비전 작렬포를 사용해 원시비룡 $1oa마리를 처치해야 합니다.', '원시술사들이 비룡을 내세워 끝도 없이 야영지를 공격하고 있소!\n\n당장은 보호막으로 막아내는 데 성공했지만, 하늘에서 끌어 내리려면 도움이 필요한 상황이라오.\n\n작렬포를 사용해 비룡을 떨어뜨리시오!', '', '', '', '', '', '', 47187),
(67298, 'koKR', '세상의 경이', '토마스가 장인으로서 발상을 어디에서 얻는지 알아내야 합니다.', '우리 남편 토마스는 이 원시의 땅을 탐험하면서 많은 통찰을 쌓았답니다.\n\n용사님도 그 자취를 따라가보면 영감을 얻을 수 있지 않을까요?', '', '', '', '', '', '', 47187),
(67297, 'koKR', '이스카라 관광 - 고급', '활공하여 고리를 통과해야 합니다.', '경로의 통과 지점 고리를 통과해야 합니다.', '', '', '', '', '', '', 47187),
(67296, 'koKR', '이스카라 유람', '활공하여 고리를 통과해야 합니다.', '경로의 통과 지점 고리를 통과해야 합니다.', '', '', '', '', '', '', 47187),
(67295, 'koKR', '나만의 특기', '미구엘 브라이트와 전문 기술 전문화에 관해 대화해야 합니다.', '그래, 전문화에 본격적으로 파고들고 싶으신가 보군요? 전문화를 갖는다는 건 참으로 영광스러운 일입니다. 나만의 확고한 분야가 생기는 셈이니.\n\n장인 무역연합의 일원으로서 전문화를 갈고닦는 걸 도와드리겠습니다.\n\n일단은 조언을 몇 가지 드리지요. 모험에 도움이 될지도 모를 일 아니겠습니까?', '', '', '', '', '', '', 47187),
(67222, 'koKR', '어둠에 물든 구름', '바람노래 마루에 있는 원시술사를 섬멸해야 합니다.', '원시술사들이 말도 안 되는 주장을 바람노래 마루에 퍼뜨리고 있다. 거기 있는 우리 동족은 어리석게도 그 말에 동조하고 있지.\n\n이번에 우리가 원시술사들을 그 성스러운 땅에서 쓸어낼 수 있도록 도와준다면, 나중에 우리가 필요할 때 동족들이 와줄지도 모른다. 도와줄 수 있겠나?', '', '', '', '', '', '', 47187),
(67221, 'koKR', '금속의 재능', '잿더미파편 암석층에서 결정화된 드라코니움 $1oa개를 수집해야 합니다.', '대지 감시자의 제련소를 온전히 활용하려면 흑요석 작열 합금 제작의 기본을 터득해야 하네. 그래야지만 넬타리온 님의 위대한 대장장이들이 남긴 발자취를 따를 수 있지.\n\n결정화된 드라코니움을 가져오게나. 잿더미파편 암석층 깊은 곳에서 찾을 수 있네. 그럼 자네가 원하는 지식을 선물로 줌세.', '', '드라코니움의 힘으로 살아 움직이는 위험한 존재입니다.', '결정화된 강철조각', '', '', '', 47187),
(67178, 'koKR', '하얀 눈의 푸른용', '유마도르무를 도와 세토고사를 꺾어야 합니다.', '$PC님, 경기를 가능한 한 공정하게 치를 수 있도록 도와주실 수 있을까요?\n\n세토고사는 자기 입맛대로 규칙을 비트는 걸로 악명이 자자하거든요. \n\n유마도르무가 부정행위 때문에 억울하게 지는 걸 보고 싶진 않아요.', '', '', '', '', '', '', 47187),
(67177, 'koKR', '현상 수배: 먹보', '먹보를 처치하고 뿔을 회수해야 합니다.', '투스카르와 함께할 생각이면 마땅히 일손을 보태야지요! \n\n최근 들어 먹보라는 야수가 이 근처를 보금자리로 삼았습니다.\n\n그 이후로 놈의 동족으로 보이는 것들이 점점 더 이주해오더군요. 이걸 이용할 겁니다.\n\n먹보를 처치하고 뿔을 가져오세요. 전초기지를 확장하는 데 사용할 생각입니다.', '', '사냥터에서 평소보다 멀리 나온 거대 야수입니다.', '먹보', '', '', '', 47187),
(67175, 'koKR', '장난감 배의 폭발을 막는 방법', '툴크의 어머니와 대화한 후 장난감 배를 회수해야 합니다.', '아이의 장난감을 빼앗으려니 마음이 아프지만... 어떤 경위로 비전력을 흡수했는지 알아보면 키린 토에 큰 도움이 될 거예요.\n\n하지만... 새로 얻은 투스카르 동맹에 안 좋은 인상을 남기고 싶지도 않군요. 마법을 무효화할 수 있는 마법봉이 있긴 한데...\n\n툴크의 어머니와 대화를 나누고 결정하도록 하죠.', '', '', '', '', '', '', 47187),
(67174, 'koKR', '비전 감지', '쿠리의 낚시터에 있는 투스카르 물체에서 비전 마법의 흔적을 조사해야 합니다.', '안녕하세요! 별의 눈 미바라고 해요. 이 지역의 비전 조사를 책임지고 있죠. \n\n하늘빛 평원은 온 사방이 마법으로 가득한 곳이에요. 안전한 마법이 있는가 하면... 상당히 위험한 마법도 있죠.\n\n저는 투스카르의 소지품 중에 비전 마력이 깃든 물건은 없는지 확인하는 임무를 받았어요. \n\n안토니다스 야영지에서 생선 상자가 갑자기 폭발하는 사건이 있었거든요! \n\n여기 감지기를 드릴 테니 몇 가지 물체를 확인해 주시겠어요? 저는 줄크와 나눌 얘기가 남아 있어서.', '', '', '', '', '', '', 47187),
(67173, 'koKR', '손버릇 나쁜 놀', '', '', '', '', '', '', '', '', 47187),
(67167, 'koKR', '대결의 시간!', '드랙티르 $1oa명에게 하스스톤 게임을 도전해야 합니다.', '덱이 생겼으니 이제 친구들을 모으는 일만 남았네요! 드랙티르를 영입할까 생각 중이었습니다...\n\n아, 혹시 이것도 도와주실 수 있으실까요, $n 님?\n\n드랙티르들도 꼭 함께 했으면 좋겠지만, 전 다른 용들을 영입하느라 좀 바쁠 것 같아서요.\n\n저 대신 드랙티르들을 데려와주실 수 있으실까요? 참, 그 친구들은 한번도 이걸 해 본적이 없을 거예요.', '', '', '', '', '', '', 47187),
(67154, 'koKR', '혼돈의 잔재', '흐르는 모래의 생명체에게서 유리화된 모래 $1oa개를 입수해야 합니다.', '존재가 시간의 길을 통과할 때, 이따금 몸에 시간의 모래가 축적되곤 합니다.\n\n일반적으로 이 모래는 금방 소멸합니다. 하지만 시간 여행이라는 게 본질적으로 혼란스럽고 변동이 심하다 보니 이따금 그 모래가 유리화되는 현상이 발생하곤 합니다. 그렇게 되면 제거하기가 몹시 까다로워집니다. 당장 저만 해도 유리화된 모래 때문에 좋은 신발을 몇 켤레나 버렸을 정도죠.\n\n동시에 유리화된 모래는 활용성이 상당히 뛰어납니다. 그러니 가능한 한 많이 모으는 편이 낫습니다.', '', '', '', '', '', '', 47187),
(67143, 'koKR', '한 사람의 진심을 담아', '아무 제작 전문 기술로 병에 담긴 심장 |A:Professions-Icon-Quality-Tier3-Small:20:20|a을 만들어야 합니다.', '정령의 정수는 다 모였군요. 이제 이것들을 병에 담아야 하는데, 가능하시겠습니까?\n\n제작법 자체는 간단합니다. 다른 제작법으로 물건을 만들 때처럼 같은 방법으로 하시면 됩니다.\n\n양질의 시약을 잃어버리거나 다 써버렸다 해도 얼마든지 용뿔두꺼비 숲의 정령에게서 구할 수 있으니 괜찮습니다.', '', '', '', '', '', '루비 생명의 제단에 있는 미구엘 브라이트에게 선물을 전달해야 합니다.', 47187),
(67142, 'koKR', '지룡 음식', '잿불 여울의 껍질 잠복꾼에게서 용암에 그슬린 살점을 입수해야 합니다.', '흑요석 성채를 지키고 싸우다 보면 금세 배가 푹 꺼지곤 합니다. 가뜩이나 용들은 먹는 양도 많은데 말이지요. 이렇게 된 이상 창고를 채워야 합니다.\n\n경화된 용암 밑에는 맛이 훌륭한 벌레들이 꾸물거리며 돌아다닙니다. 그대로서는 별다른 식욕이 돌지 않는 음식이겠지만, 굶주린 용에게는 맛있는 먹거리입니다.\n\n하인 굴차크를 붙여드리겠습니다. 용암이 요동치는 부분을 찾아가서 지시기를 사용하십시오. 그럼 그 친구가 벌레들을 유인할 테니, 그대는 포획만 하면 됩니다.', '', '', '', '', '', '', 47187),
(67137, 'koKR', '전문적인 장비', '마라 트리벤더와 대화해야 합니다.', '헤페스타에게서 당신 역시 장인이시라 들었습니다.\n\n전문 장비를 무료로 제공하고 싶습니다. 자고로 동업자란 함께 나아가는 관계 아니겠습니까?\n\n재봉사 마라 트리벤더와 얘기해 보십시오. 맞춤 제품으로 만들어줄 겁니다.', '', '', '', '', '', '루비 생명의 제단에서 마라 트리벤더와 대화해야 합니다.', 47187),
(67111, 'koKR', '병든 수습생', '얼어붙은 독 분비선 $1oa개를 수집해야 합니다.', '이 임무는 처음부터 잘못됐습니다. 알리아 선소어가 분리된 불길이 위험한 유물을 손에 넣지 못하게 막아야 한다면서 협조를 구하더군요. 추적하다 보니 이 폐허에 도착했습니다.\n\n하지만 분리된 불길이 먼저 도착한 상태였고, 일대는 얼음 거미가 들끓고 있었습니다. 설상가상으로 알리아는 독에 중독돼 중태에 빠졌습니다. 해독제 없이는 오래 못 버틸 겁니다.\n\n제가 해독제 조제법을 알긴 합니다만, 주변 거미에게서 독 분비선을 채취해야 합니다. 문제는 지금 제가 알리아 곁을 떠나기 어려운 형편입니다. 대신 좀 구해다 주실 수 있을까요?', '', '', '', '', '', '', 47187),
(67100, 'koKR', '미구엘을 위한 선물', '토마스와 품질에 대해 이야기를 나눈 후 미구엘의 선물 재료로 용뿔두꺼비 숲 근처에서 불꽃 같은 영혼 $2oa개를 모아야 합니다.', '$p 님, 혹시 부탁 하나만 들어주실 수 있으실까요?\n\n우리 남편 미구엘에게 줄 선물을 마련하려고 합니다.\n\n제겐 정말 소중한 사람인데, 요즘 너무 바빠서 그이에게 뭘 만들어줄 시간을 내지 못하고 있습니다. \n\n용사님께서 선물을 구하는 걸 도와주실 수 있을까요?', '', '', '', '', '', '', 47187),
(67099, 'koKR', '용의 눈', '주변 지역에서 미리디안, 제파리온, 에보리안과 대화해야 합니다.', '자라딘이 직접 공격할 거란 건 기정사실이나 다름없지. 나는 그보다 다른 위험 요소가 신경 쓰이는구나. 눈에 띄지 않는 그런 위협들 말이다.\n\n일찍이 나는 잠재적인 위협의 정확한 위치를 알아내고 정보도 수집할 겸, 인근 지역에 세 마리의 용을 파견했다.\n\n모두 만나봐라. 그리고 보고서를 취합해 가져오도록. 정보가 충분히 모이는 대로 돌아와라. 자라딘이 무슨 계획을 꾸밀지 모르니 충분히 대비해야지 않겠나.', '', '', '', '', '', '', 47187),
(67096, 'koKR', '흐르는 숲 비행로 - 고급', '활공하여 고리를 통과해야 합니다.', '경로의 통과 지점 고리를 통과해야 합니다.', '', '', '', '', '', '', 47187),
(67095, 'koKR', '흐르는 숲 비행로', '활공하여 고리를 통과해야 합니다.', '경로의 통과 지점 고리를 통과해야 합니다.', '', '', '', '', '', '', 47187),
(67094, 'koKR', '드리아드의 일은 끝이 없어', '탈렌드라를 도와 발드라켄의 수많은 작은 동물들에게 먹이를 줘야 합니다.', '발드라켄에 다시 활기가 도는 걸 보니 감회가 참 새롭군요. 하지만 수천 년 동안 방치되어 있었던지라 손상된 부분이 너무 많습니다. 특히 깜찍한 도시 동물들은 말할 것도 없죠! 그런데 또 모두를 보살피기에는 드리아드 수가 부족해서 어려운 상황이에요. \n\n그래서 그런데, 명예 발드라켄 드리아드 직위에 관심 없으신가요? 앙증맞은 도시 동물 중에 좋아하는 간식도 못 먹고 세월을 보낸 친구들이 좀 있어요. 그 친구들 보살피는 걸 도와주셨으면 해요.', '', '', '', '', '', '', 47187),
(67093, 'koKR', '변칙적인 성소', '모래에 묻힌 성소에 숨겨진 유물을 입수할 방법을 알아낸 후, 발드라켄 위상의 권좌에 있는 노즈도르무에게 반환해야 합니다.', '제 조사대가 근처에서 이상한 성소를 발견했습니다. 외부에 쓰여 있는 글 일부를 해석했는데, 티탄 룬 문자였죠. 티탄 지도자인 대부 아만툴을 가리키는 내용이 몇 군데에 쓰여 있었습니다.\n\n더 자세히 조사하고 싶었으나 성소의 방어 체계를 가동한 모양입니다. 거대한 모래 혼합물이 길을 막는 바람에 겨우 탈출했습니다.\n\n무엇을 방어하고 있는지는 모르겠지만, 분명 중요한 것임이 틀림없습니다. 당신이 알아봐 주실 수 있나요?', '', '', '', '', '', '발드라켄에 있는 노즈도르무에게 가야 합니다.', 47187),
(67084, 'koKR', '은빛 사명', '제련소에 고대 티탄강철 주괴를 놓고 티르가 마무리하지 못한 과업을 끝내야 합니다.', '<당신의 존재감에 반응해 활성화되는 티르의 메아리>\n\n과업의 시간이 왔다, 친우들이여.\n\n주괴를 불 속에 던져 넣고 제련소를 가동해라. 다른 필요한 절차는 내가 일찍이 준비해 두었다.\n\n설계도는 은빛 비늘에 담겨 있다. 비늘의 목적이 밝혀질 것이니라.', '', '', '', '', '', '티르홀드에서 알렉스트라자와 대화해야 합니다.', 47187),
(67081, 'koKR', '재료의 주입', '주입의 전당에서 고대 티탄강철 주괴 $1oa개를 회수하고 원시 지진해일을 처치해야 합니다.', '<다시 입을 여는 티르의 메아리>\n\n제련소를 다시 활성화했다. 다음 과업은 그리 간단하지 않을 것이야.\n\n그 비늘에는 어떤 것의 설계도가 기록되어 있지. 제작에 필요한 재료는 내 부하 중 하나인 감시자 이리데우스에게 맡겨두었다. 범상치 않은 기원에서 유래한 것이며, 극히 적은 수만이 남아있지.\n\n주입의 전당에서 이리데우스를 찾아라. 그 친구가 철저한 감시를 통해 시설을 원활하게 운영하고 있기를 바라지.', '', '', '', '', '', '', 47187),
(67080, 'koKR', '장인 공급: 용의 연금술 용해제', '혼합물 재활용 제작법을 사용해 용의 연금술 용해제 $1oa개를 만든 후 루비 생명의 제단에 있는 헤페스타에게 전달해야 합니다.', '일거리 필요하지 않으세요, 연금술사님?\n\n장인 무역연합에서 제 연금술 용액 \"주문 제작\" 의뢰를 보내왔어요. 마음만 같아선 이 사업을 자세히 알아보고 싶은데, 너무 바빠서 그럴 틈조차 없는 게 현실이네요.\n\n어쩌면 용사님께 좋은 기회일지도 몰라요. 이전에 만든 혼합물을 재활용해 연금술 혼합물을 조제해서 헤페스타에게 가져가세요. 이 길을 곧장 따라가면 만날 수 있어요.', '', '', '', '', '', '', 47187),
(67079, 'koKR', '힘겨운 생활', '티르홀드에서 주 보안 원반과 보조 보안 원반을 회수해야 합니다.', '제련소의 보안은 티르홀드의 다른 구역보다 더 엄격하다. 마냥 극복하기 쉬운 도전은 아닐 거다, $c|1이여;여;.\n\n보안을 우회하려면 성채에 있는 특별한 장치를 확보해야 할 터. 더욱이 절차의 잠금을 해제하려면 하나의 코드만으로는 안 될 것이다. 손상을 대비한 결과지.\n\n권한을 쉽게 내어놓지는 않을 것이다. 강제로 빼앗아야 할 수도 있겠지. 조심해라, $n.', '', '', '', '', '', '', 47187),
(67078, 'koKR', '작별 당부', '티르홀드에 있는 제련소에 은빛 비늘을 놓아야 합니다.', '<고대의 목소리로 말하는 메아리>\n\n나의 소중한 친우들에게. 갑작스럽게 떠나게 되어 미안한 마음이 가득하다.\n\n하나 아무것도 남겨두지 않고 떠나진 않겠다. 한시가 급한 상황이겠지만, 혹여나 이 선물이 잘못 사용되지 않도록 몇 가지 과업을 수행해야 한다.\n\n첫 과업은 간단하다. 티르홀드 안에 있는 제련소를 다시 활성화하는 것이다. 열쇠는 바로 은빛 비늘이다.', '', '', '', '', '', '티르홀드에서 코라노스와 대화해야 합니다.', 47187),
(67077, 'koKR', '과거의 기억', '노즈도르무와 대화하여 과거의 기억을 목격해야 합니다.', '이곳에서의 만남을 끝으로 우린 친우였던 티르를 다시 만나지 못했다.\n\n당시 떠나야 했던 정황은 우리도 파악한 바가 없다. 단지 중요한 일이란 것만 짐작했을 뿐.\n\n우리로서는 심적으로 부담스러운 일이지만... 다시 그 시간을 목도하도록 불꽃이 우리를 불렀으리라고 믿는다. 노즈도르무의 도움을 받으면 그 당시를 다시 체험할 수 있을 것이야. 어쩌면 티르가 남긴 또 다른 단서를 찾아낼 수 있을지도.', '', '', '', '', '', '', 47187),
(67076, 'koKR', '발견의 불꽃', '티르홀드에서 티탄의 불꽃을 조사해야 합니다.', '이 불꽃은 기원부터 남다르면서도 어쩐지 익숙하군. 그 용도는 알 수 없지만 분명 이 수수께끼의 다음 단계로 넘어갈 때 어떻게든 필요할 거다.\n\n불꽃을 따라가 보거라. 잘하면 용도를 알아낼 수 있을 터. 그동안 나는 다른 방면으로 알아보겠다.', '', '', '', '', '', '티르홀드에서 칼렉고스와 대화해야 합니다.', 47187),
(67075, 'koKR', '내면의 마법', '티르홀드에서 제어장치에 숨겨진 마법을 끌어내 은빛 비늘의 수수께끼를 풀어야 합니다.', '참 흥미롭구나. 이 성채에는 수호자 티르 본인을 제외하면 누구도 이해하지 못하는 수수께끼가 가득하지. 이걸 더 풀어내려면 티르홀드 곳곳을 탐험해야 할 것이다. \n\n이곳에 숨겨진 비밀을 끌어내려면 아무래도 비늘이 필요할 것 같군.\n\n다만 하나 문제가 있다. 티르홀드의 수호자들은... 그대가 여기저기 들쑤시는 걸 그리 달갑게 받아들이지 않을 거다. 이 도관을 받아라. 수호자들이 골치 아프게 할 때 보탬이 될지도.', '', '', '', '', '', '', 47187),
(67074, 'koKR', '은빛 선물', '알렉스트라자와 대화하여 티르의 선물을 드러내야 합니다.', '먼 옛날, 수호자 티르께서 돌아가시기 직전에 가장 순수한 은으로 만든 용비늘을 하사하셨다. 우리가 없는 동안에는 이곳 발드라켄에 보관했지만, 다시 꺼낼 때가 된 것 같군.\n\n그 물건에 어떤 수수께끼가 담겨있는지는 몰라도, 언제나 우리에겐 단합과 우정의 상징이었다. 용족의 진정한 우군인 너에게 그 보물을 보여주겠다. 준비되면 말하려무나, $n.', '', '', '', '', '', '', 47187),
(67073, 'koKR', '붉은 여명', '알렉스트라자를 찾아야 합니다.', '우리가 힘을 되찾기까지 얼마 안 남았지만... 라자게스가 먼저 선수를 친다면 시간의 길은 아제로스의 모두가 불행해지는 암울한 미래로 틀어지고 말 것이다.\n\n$n, 그런 일은 절대로 일어나선 안 된다!\n\n서둘러라. 모든 것이 수포로 돌아가기 전에 알렉스트라자를 찾아 도와야 한다!', '', '', '', '', '', '', 47187),
(67067, 'koKR', '도약옥수수 돌파', '야생의 도약옥수수 줄기 $1oa개를 수집해야 합니다.', '발드라켄에 용 요리사가 있다고 하셨습니까? 정말입니까? 그 요리사에게 우리 집안의 오래된 요리법으로 만든 전깃불 비스크를 맛보게 해주고 싶습니다.\n\n당신이 말하는 그 식물을 알고 있습니다. 이 시냇물 주위에서 자라는데, 문제가 좀 있습니다.\n\n도약옥수수의 줄기를 먹이로 하는 딱정벌레와 작은 도마뱀이 있고, 또 그 작은 동물을 먹잇감으로 하는 용뿔두꺼비도 있습니다. 만약 탁 트인 곳에서 알아보신다면 좋겠지만, 잘 숨어있는 것들도 있습니다.\n\n저라면 뒤를 조심하겠습니다.', '', '', '', '', '', '발드라켄 루비 연회장에 있는 루미아스트라자에게 가야 합니다.', 47187),
(67066, 'koKR', '파고드는 기쁨', '돌연변이 물고기 홍투라치를 수집해야 합니다.', '루미와 모젤?\n\n허, 그건 꽤 오래전 이야기인데. 용과 오리 요리사가 만든 생선 요리 이야기는 장로 포아가 아이들에게 들려주던 그 이야기인 것 같군. 그런 일은 잊힐 수가 없지!\n\n그 물고기는 투스카르가 가장 좋아하는 돌연변이 물고기 홍투라치다. 잡기 어렵지만, 이 해안에서는 찾을 수 있지.\n\n경고 하나 하자면, 지금은 하늘이빨 짝짓기 철이야. 하늘이빨의 먹잇감을 건들면 피에 굶주린 괴물들이 가만히 있지 않을 거야.', '', '', '', '', '', '발드라켄 루비 연회장에 있는 루미아스트라자에게 가야 합니다.', 47187),
(67065, 'koKR', '미래의 신선한 버섯', '원시술사 평행세계에서 시간 작렬 송로버섯 7개를 포획해야 합니다.', '맛있는 버섯을 찾고 있다는 말입니까? 늦은 아침에 간식을 먹으려고 식료품 창고를 터는 미래와는 거리가 있군요.\n\n그래도... 루미와 모젤의 요리를 다시 먹어보고 싶지 않았다고 말하면 거짓말일 겁니다.\n\n좋습니다! 차원문을 통해 넘어갈 수 있도록 허락해드리겠습니다. 하지만 함께 여행할 다른 동료를 알아보는 게 좋으실 겁니다.\n\n예전에 감시관들이 이 어두운 버섯에 대해 말해준 적이 있습니다. 듣자 하니 같은 장소에 그리 오래 있지는 않다더군요. 받아들이기 나름이겠죠.', '', '', '', '', '', '발드라켄 루비 연회장에 있는 루미아스트라자에게 가야 합니다.', 47187),
(67064, 'koKR', '퍼지는 기쁨', '희미하게 빛나는 새끼 나그네 구근 $1oa개를 수집해야 합니다.', '오, 루미아스트라자! 드리아드 자매인 셀리나와 펠리나와 함께, 그녀를 위해 요리하면서 즐거운 저녁 식사를 한 적이 있어요!\n\n우리가 먹었던 물풀은 희미하게 빛나는 새끼 나그네라는 이름의 특이한 종이예요. 주름감펭 떼가 해안가를 따라 그 물풀을 먹어요. 바다에서 그들의 먹이를 건져내면 틀림없이 당신을 공격할 거예요.\n\n다시 만나면 안부 전해주세요! 언제든지 우리 성역에 찾아와도 된다는 말도요.', '', '', '', '', '', '발드라켄 루비 연회장에 있는 루미아스트라자에게 가야 합니다.', 47187),
(67063, 'koKR', '일만 년 전통 구이', '매운 용암 향신료 $1oa개를 수집해야 합니다.', '향신료 말인가? 오! 그 용 요리사를 만났나 보구먼. 머리에 꼬마 오리 요리사가 있는 친구 말이야.\n\n자라딘은 저 아래에 있는 불타는 정령으로부터 매운 용암 향신료 가루를 얻는다네.\n\n그런 눈으로 쳐다보지 말게! 내가 아니라 그들이 그렇게 부른다는 말일세!\n\n행운을 빌겠네. 나라면 혼자 가지는 않겠네.', '', '', '', '', '', '발드라켄 루비 연회장에 있는 루미아스트라자에게 가야 합니다.', 47187),
(67053, 'koKR', '평화의 기회', '호드 대표들에게 자신을 소개해야 합니다.', '빛이 자네와 함께하길, $p.\n\n이 원정대는 호드와 얼라이언스 모두의 보호를 받고 있다네. 우리는 원정대 인원이라면 진영 상관없이 누구든 지원하라고 명령받았네.\n\n호드의 대표자인 장군 그림액스와 그의 딸 슈자는 야영지 반대쪽을 지키고 있네.\n\n전에 장군 그림액스와 한 편이 되어 스컬지와 싸운 적이 있다네. 명예로운 자이니, 원정대에 좋은 전력이 될 걸세.\n\n장군 그림액스에게 도움을 제의해보게. 얼라이언스가 협약을 존중한다는 사실을 보여주게.', '', '', '', '', '', '날개쉼터 대사관에서 장군 브레카 그림액스와 대화해야 합니다.', 47187),
(67050, 'koKR', '동상: 원인과 증상', '하늘빛 평원에서 토템을 놓아 사로잡힌 투스카르 사냥꾼을 해방해야 합니다.', '$r 친구, 토템에 정기 남아 있다. 이거 내보내면 얼음 부서진다. 투스카르 친구들 구할 수 있다!', '', '', '', '', '', '', 47187),
(67047, 'koKR', '추위 떨쳐내기', '한파의 화살촉 나뭇잎 $1oa개를 수집해야 합니다.', '당신이 찾는 식물은 곱고 가는 줄기가 있고 잎이 모두 붉은색일 겁니다.\n\n하지만 꽃을 모으는 동안 그 악랄한 포복자를 마주치지 않으려면 애 좀 먹을 겁니다. 가능하면 잘 피해 다니고, 그렇지 못할 경우에는 무기를 준비하십시오. \n\n용 친구에게는 다음에 도시에서 만나면 한두 잔 사야 한다고 전해주십시오.', '', '', '', '', '', '발드라켄 루비 연회장에 있는 루미아스트라자에게 가야 합니다.', 47187),
(67039, 'koKR', '놀라운 여정', '실종된 동물을 찾아야 합니다.', '지난번 야영지 간 이동 중에 부족 애완동물 몇 마리가 사라졌다. 사냥용 동물도 아니니 자급자족하기도 어려울 것이다.\n\n혹시 동물들을 찾아줄 수 있겠나? 사냥하는 동료는 아니어도 다들 소중한 부족 구성원이다.', '', '', '', '', '', '', 47187),
(67036, 'koKR', '키린 토의 분노', '카드가를 도와 비전 작렬포를 사용해 원시술사를 처치해야 합니다.', '찾아오신 장치 조각을 수리했어요. \n\n카드가 님 근처에 놓고 원시술사를 물리치는 데 써주세요! \n\n칼렉고스 님이 오시기 전까지 조금만 더 버티면 됩니다.', '', '', '', '', '', '', 47187),
(67035, 'koKR', '지식 보존', '안토니다스 야영지에 흩어져 있는 고대의 고서 $1oa권을 찾아야 합니다.', '환영합니다, $r|1이여;여;. 저는 알타누스라 합니다. 애석하게도 이런... 혼란한 시기에 처음 인사를 나누는군요.\n\n저희는 원시술사가 공격하기 직전까지 키린 토를 도와 이 지역의 역사를 연구하고 있었습니다.\n\n아직 몇몇 고서가 이 끔찍한 공격으로 인해 사라질 위기에 처해 있습니다.\n\n부디 고서들을 되찾아주십시오! 서적이 파괴되면 이 땅의 역사도 함께 사라지고 맙니다.', '', '', '', '', '', '', 47187),
(67034, 'koKR', '바람과 물의 춤', '울부짖는 용온천에서 재료를 모아야 합니다.', '동쪽엔 야생 독수리들의 번식지로 쓰이는 거대한 용온천이 있다. 이들이 흘린 깃털은 어느 정도 시간이 지나도 아직 마력이 담겨 있어 여러 의식에 쓰인다.\n\n그 지역에선 노호하는 정령도 찾을 수 있는데, 이들의 핵도 유용하게 쓰인다.\n\n두 가지 모두를 양껏 모아와라. 그리고 독수리는 신성하니, 그들을 해하고 가져온 깃털은 받지 않겠다.', '', '', '', '', '', '', 47187),
(67033, 'koKR', '방어 병력 집결', '부서진 비전 장치 $1oa개를 회수해야 합니다.', '키린 토는 하늘빛 평원에 진출한 이후로 줄곧 원시술사들에게 추적당했어요. 비전 마법을 연마하는 우리가 여간 혐오스러운 게 아닌가 보더군요.\n\n칼렉고스 님께 하늘빛 기록 보관소에서 돌아오시라고 전언을 넣겠습니다. 그때까진 놈들을 막아야 해요.\n\n녀석들의 첫 공격으로 주요 비전 방어 시설 하나가 파괴됐어요. 조각을 모아 가져다주시면 제가 다시 조립하겠습니다.', '', '', '', '', '', '', 47187),
(67032, 'koKR', '바크스로스 승천로 - 고급', '활공하여 고리를 통과해야 합니다.', '경로의 통과 지점 고리를 통과해야 합니다.', '', '', '', '', '', '', 47187),
(67031, 'koKR', '바크스로스 승천로', '활공하여 고리를 통과해야 합니다.', '경로의 통과 지점 고리를 통과해야 합니다.', '', '', '', '', '', '', 47187),
(67027, 'koKR', '죽음의 그림자', '', '', '', '', '', '', '', '', 47187),
(67015, 'koKR', '해답을 채집하다', '', '', '', '', '', '', '', '', 47187),
(67007, 'koKR', '기록적인 도움', '발드라켄의 기록 보관소에서 케모라와 대화해야 합니다.', '<군더더기 없이 말끔하고 유려한 필체로 적힌 글이 젖은 양피지 잉크로 인해 빠르게 번집니다. 그리고 발효한 음료를 흘렸는지 희미하게 냄새가 납니다.>\n\n모험을 찾는 여러분, 기록을 뒤쫓는 여러분.\n\n기록 보관소에서 해답과 발견을 갈구하는 이들을 부릅니다. 과거와 미래의 비밀을 밝혀내고 싶지 않으신가요?\n\n그러나 심약하거나 흔들리기 쉬운 의지를 가진 자들은 이 부름에 답하지 마십시오.\n\n오직 호기심과 용기를 두루 갖춘 모험가만이 필요합니다.\n\n- 케모라 올림', '', '', '', '', '', '', 47187),
(67006, 'koKR', '불꽃 꺼뜨리기', '', '', '', '', '', '', '', '', 47187),
(67005, 'koKR', '원시비룡 길들이기', '', '', '', '', '', '', '', '', 47187),
(67004, 'koKR', '큰 상자에 담은 행복', '대지의 수호자의 금고를 찾아 화부 볼락스에게 전달하여 전리품을 나누어야 합니다.', '그렇게 애를 쓴 덕분에 대지의 수호자의 금고를 열 준비물을 모두 갖췄습니다. 성채 아래에 금고가 여러 개 있습니다. 하나 찾으시면 보상을 드리겠습니다.\n\n끌고 오실 수 있도록 사슬을 만들었습니다. 만약 하나 가지고 오시면 함께 금고를 열고 그 안의 보물을 나눠드리겠습니다.\n\n다른 이들도 보냈으니 움직일만한 금고를 함께 찾아보세요.', '', '', '', '', '', '대지의 수호자의 금고가 있든 없든 화부 볼락스에게 가야 합니다.', 47187),
(67003, 'koKR', '하늘빛 평원 활강로 - 고급', '활공하여 고리를 통과해야 합니다.', '경로의 통과 지점 고리를 통과해야 합니다.', '', '', '', '', '', '', 47187),
(67002, 'koKR', '하늘빛 평원 활강로', '활공하여 고리를 통과해야 합니다.', '경로의 통과 지점 고리를 통과해야 합니다.', '', '', '', '', '', '', 47187),
(66998, 'koKR', '눈에는 눈, 불에는... 물', '분출하는 동굴에 있는 용암의 정령을 처치해야 합니다.', '지금껏 용암의 정령을 관리하면서 이 정도로 난동을 부리는 모습은 처음 봅니다! 이대로는 동굴 안에 가둬두기도 어렵겠군요.\n\n잠깐 시간을 내주시겠어요? 저희가 출구를 막을 테니 정령의 수를 줄여주세요.\n\n여기 병에 담은 물의 정령을 가져가세요. \n\n용암의 정령을 돌볼 때 늘 물의 정령이 담긴 병 몇 개를 챙겨서 다닌답니다. 천적은 주의를 돌리는 데 참 유용하거든요!', '', '', '', '', '', '', 47187),
(66997, 'koKR', '탁아소 지침', '루비 생명의 웅덩이 정원에서 배로스를 만나야 합니다.', '라즈타크가 새끼용지기의 부름을 받들어서 정말 기쁩니다! 그러잖아도 요즘 이갈이를 하는 아이들이 너무 많아서 곤란할 지경이었거든요.\n\n사실 그 외에도 탁아소는 많은 문제를 직면하고 있습니다. 새끼용들은 스트레스가 이만저만이 아니고, 새끼용지기들은... 음. 평상시 이상으로 정신적인 한계에 몰려 있죠.\n\n제발... 잠깐이라도 시간이 괜찮으시다면 아래 정원으로 와주세요. 용사님의 도움이 필요합니다!', '', '', '', '', '', '', 47187),
(66972, 'koKR', '오래된 돌엄니', '안토니다스 야영지 주변에서 오래된 돌엄니를 제압해야 합니다.', '참담한 임무가 있소, $p 님. 모든 사냥이 실력의 증명은 아니라오. 어떤 것은 연민의 증명이기도 하오. \n\n안토니다스 야영지 동쪽 숲을 배회하는 늙은 수컷 매머드가 하나 있소. 며칠 전 멀리서 그놈을 봤는데 가끔 놈의 슬픈 울음소리가 들려온다오. 큰 고통에 시달리는 게 분명하오.\n\n놈이 수풀을 마구 헤치고 다니기 시작했는데 이러다 다른 녀석들한테 위협이 되는 건 아닐지 걱정된다오. \n\n그 지쳤을 놈을 편히 쉬게 해 주면 같은 늙은이의 마음도 안심할 수 있을 것이오. 놈을 기릴 수 있게 엄니를 가져와 주시오.', '', '고대의 수컷 매머드로, 자기 자신은 물론이고 다른 동물에게도 위험한 존재가 되고 말았습니다.', '오래된 돌엄니', '', '', '두멧골 야영지에서 헤멧 네싱워리 2세와 대화해야 합니다.', 47187),
(66971, 'koKR', '죽음의 얼굴', '겨울가죽 공동 북쪽에서 서리턱을 추적해야 합니다.', '친구, 혹시 죽음의 얼굴을 똑바로 본 적 있소?\n\n<극적인 분위기를 위해 뜸을 들이는 네싱워리>\n\n내가 무슨 소릴... 당연히 있겠지.\n\n하지만 죽음이란 여러 얼굴을 가진 법이라오. \n\n임부의 투스카르가 말하던데 그런 죽음의 얼굴 하나가 이 언덕에 산다더군. 그 이름을 입에 올리기만 해도 잔혹하고 살을 에는 최후를 맞는다는, 그런 죽음이.\n\n그 이름은... 서리턱이오.\n\n<불안한 듯 주변을 둘러보는 네싱워리>\n\n아, 알았으면 나를 위해서라도 빨리 사냥해 주시오!', '', '전설로 전해지는 싸늘한 죽음의 전조입니다.', '서리턱', '', '', '두멧골 야영지에서 헤멧 네싱워리 2세와 대화해야 합니다.', 47187),
(66970, 'koKR', '승천자 타이푼', '', '', '', '', '', '', '', '', 47187),
(66969, 'koKR', '평야의 부족들', '마루카이에 있는 산소크 칸에게 보고해야 합니다.', '사절이 도착하려면 아직 시간이 좀 있잖아. 산소크 칸께서 부족들과 만남의 결과를 알고 싶어 하셔. 할 얘기가 있으니 널 찾아서 마루카이 중앙으로 보내라고 하시더라니까.', '', '', '', '', '', '', 47187),
(66968, 'koKR', '무리 솎아내기', '로닌의 방패 주변에서 예토르를 추적해야 합니다.', '<길 옆을 가리키는 네싱워리>\n\n눈에 찍힌 발자국이 보이오?\n\n설인 흔적이오. \n\n이렇게 길 근처까지 나와 사냥했다니, 뭔가가 이놈들을 자극한 거요. 이놈들의 우두머리를 사냥하시오. 여행자들을 습격하기 시작하면 곤란하오! \n\n특히 성질 사나운 놈이라면 머리카락을 가져오시오. 그 정도로도 다른 놈들을 겁줄 수 있소.', '', '덩치 큰 설인보다 끔찍한 게 단 하나 있다면, 바로 친구들을 거느린 덩치 큰 설인이죠.', '예토르', '', '', '두멧골 야영지에서 헤멧 네싱워리 2세와 대화해야 합니다.', 47187),
(66964, 'koKR', '못된 손에 유물이', '하늘빛 평원의 잊힌 폐허에서 알리아 선소어를 찾아야 합니다.', '지금 쌓인 문제가 산더미, 아니지. 셀 수 없이 넘칠 지경이에요!\n\n어디부터 손대야 할지 감도 안 와요!\n\n키린 토에서 분리된 불길의 음모를 알아냈어요. \"발트룩스\"라는 유물을 뒤쫓고 있더군요.\n\n상상을 초월할 정도로 강력하고... 자의식이 있다는 모양이에요. 엄청난 위험성을 내포하고 있단 얘기죠.\n\n그래서 알리아 선소어가 분리된 불길을 조사할 겸 해서 두 투스카르를 대동하고 남쪽으로 향했어요. 지금쯤이면 복귀했어야 정상인데...\n\n부디 알리아를 찾아 주세요. 그리고 분리된 불길이 유물을 손에 넣지 못하게 막아야 해요!', '', '', '', '', '', '', 47187),
(66963, 'koKR', '배송지로 출발', '주변 기지에 있는 분류학자 울퍼드에게 당분간 보급품이 도착하지 않을 것임을 알려야 합니다.', '베베시에게는 제가 진창에서 수레를 끌어낼 수 있다고 얘기를 했습니다.\n\n하지만 기어코 마법을 써서 꺼내겠다고 고집하더군요...그 결과물을 보십시오.\n\n<한숨을 쉬는 운반꾼 베네트>\n\n제가 베베시를 설득하는 동안 언덕 위의 기지에 가셔서 분류학자 울퍼드에게 말씀을 좀 전해주시겠습니까? 보랄러스에다 카메라 보급품을 다시 보내달라고 해야 할 것 같다고 말입니다.', '', '', '', '', '', '용비늘 기지에 있는 분류학자 울퍼드에게 안 좋은 소식을 전달해야 합니다.', 47187),
(66960, 'koKR', '승천자 클로직', '', '', '', '', '', '', '', '', 47187),
(66958, 'koKR', '보호와 인도', '이스카라 동쪽에서 핏빛뿔을 추적해야 합니다.', '이스카라 변두리에서 사냥꾼들과 얘기를 나눴는데, 꽤나 끔찍한 장면을 목격했다더군.\n\n핏빛뿔이라는 흉포한 코뿔소가 그보다 작은 브루팔론을 꿰고 있었다고 했소. \n\n브루팔론은 이미 하늘빛 평원에서 이리저리 치이는 동물이라 어떤 외래종 한 마리한테 머릿수가 줄면 큰일이오!\n\n그놈 뿔을 가져오시오. 투스카르 친구들한테 좋은 인상을 남겨줘야겠소!', '', '지역 브루팔론을 절멸로 몰아넣고 있는 악독한 야수입니다.', '핏빛뿔', '', '', '두멧골 야영지에서 헤멧 네싱워리 2세와 대화해야 합니다.', 47187),
(66957, 'koKR', '얼음 속의 그림자', '안토니다스 야영지가 내려다보이는 빙하 꼭대기를 조사해야 합니다.', '안토니다스 야영지를 지날 때 소문을 들었소. 얼음 평원 전역에 훼손된 동물 사체가 발견된다더군. 몇몇은 핏덩어리 수준이라고도 했소. \n\n이유가 뭐든 간에 마법사들이 겁에 질리고 근방의 야생동물이 많이 줄었소.\n\n빙하 윗부분을 들쑤셔보시오. 이름 좀 날리는 최상위 포식자라면 거기에 숨을 것이오. 내기해도 좋소.\n\n키린 토를 달랠 수 있게 토벌한 증거를 가져오시오.', '', '먹잇감을 가지고 노는 걸 즐기는 악독한 거인입니다.', '서리주먹', '', '', '두멧골 야영지에서 헤멧 네싱워리 2세와 대화해야 합니다.', 47187),
(66956, 'koKR', '용사냥꾼 이고르단', '', '', '', '', '', '', '', '', 47187),
(66952, 'koKR', '놀 의복 문화 탐방', '용의 섬의 놀에게서 놀이 착용한 옷감 20개를 입수한 후 발드라켄 협의회의 도테노스에게 가져가야 합니다.', '놀은 피투성이가 될 정도로 용의 섬에 있는 원정대나 사람들을 습격해서 거듭 위협이 되고 있습니다. 그런데 어떻게 놀의 옷은 그렇게 깨끗할까요?\n\n이 약탈자들과 전투가 끝나면, 제가 분석할 수 있도록 낡은 옷의 시료를 수집해주시겠습니까?', '', '', '', '', '', '', 47187),
(66950, 'koKR', '거인의 심장', '용의 섬의 산악, 얼음, 용암거인에게서 거인 핵 5개를 입수한 후 이스카라 투스카르의 템나유에게 가져가야 합니다.', '용의 섬에 사는 여러 종류의 거인은 모두 아름다운 보석을 핵으로 가지고 있다고 해요. 보통은 보물을 얻자고 섬에 사는 것들을 사냥하진 않지만, 요즘 이 거인들이 꽤 말썽을 부린 모양이네요.\n\n파괴를 일삼는 거인들을 사냥하면서 보석도 모아보는 게 어때요?', '', '', '', '', '', '', 47187),
(66948, 'koKR', '사절의 도착', '에메랄드 정원에서 상황을 파악해야 합니다.', '솔직히 말씀드리자면 전 평생을 에메랄드 정원 안에서만 지냈고 실제로 켄타우로스를 만나본 적도 없습니다. 본토에서 온 필멸자는 말할 필요도 없죠.\n\n어쨌거나 지금의 저는 단순한 화친의 사절로 온 게 아닙니다. 서약의 돌을 확보하고 책임져야 할 이들을 지키는 데 켄타우로스의 지원을 청하러 왔죠.\n\n용사님이 계셔서 얼마나 기쁜지 모릅니다. 논의해야 할 게 태산이거든요.', '', '', '', '', '', '', 47187),
(66947, 'koKR', '하늘빛 평원 질주로 - 고급', '활공하여 고리를 통과해야 합니다.', '경로의 통과 지점 고리를 통과해야 합니다.', '', '', '', '', '', '', 47187),
(66946, 'koKR', '하늘빛 평원 질주로', '활공하여 고리를 통과해야 합니다.', '경로의 통과 지점 고리를 통과해야 합니다.', '', '', '', '', '', '', 47187),
(66944, 'koKR', '공작 안료', '용의 섬의 공작에게서 공작 깃털 8개를 채취한 후 용비늘 원정대의 노클린 쿼크코일에게 가져가야 합니다.', '용의 섬에 사는 공작은 정말 다채로운 깃털을 가지고 있어요! 그 색소를 뽑아내면 서기들이 잉크로 쓸 수 있을 거예요.', '', '', '', '', '', '', 47187),
(66943, 'koKR', '집필용 나무', '용의 섬의 부패의 나무정령에게서 나무껍질 양피지 15개를 입수한 후 발드라켄 협의회의 도테노스에게 가져가야 합니다.', '용의 섬 연구를 진행하던 중, 특이한 정보를 알아냈습니다. 예를 들어, 부패 마법에 영향을 받은 나무정령의 껍질은 생가죽으로 만든 양피지와 매우 비슷합니다.\n\n이 특이한 양피지에는 더 강력한 주문각인에 필요한 마법을 담을 수 있습니다. 참 유용하지요! 몇 개 모아다주지 않으시겠습니까?', '', '', '', '', '', '', 47187),
(66940, 'koKR', '영약 실험', '용의 섬의 골록에게서 골록 점액 15개를 채취한 후 마루크 켄타우로스 더렐에게 가져가야 합니다.', '최근 우리 연금술사들이 다양한 재료를 실험했다. 가장 최근에 눈길을 사로잡은 연구는... 흥미롭다고 할 수밖에 없겠군.\n\n골록 점액이 가진 효능이 특정한 영약 제조에 도움이 된다고 한다.', '', '', '', '', '', '', 47187),
(66939, 'koKR', '사냥지배자 사냥', '임부의 방패에서 사냥지배자 크라클을 뒤쫓아야 합니다.', '두멧골 야영지의 경비병에게서 들었는데 주변 야생동물을 불구로 만드는 지독한 놈이 하나 있다더군. 자신을 사냥지배자라 부른다고 했소.\n\n사냥은 그렇다 쳐도 살아있는 것을 고문하는 걸 두고 볼 수는 없소.\n\n게다가 마침 수레에 달 부적 없나 찾고 있기도 했고.\n\n<옆으로 침을 뱉는 네싱워리>\n\n그놈의 발을 가져오시오.', '', '무고한 야생동물을 고문하면서 쾌락을 느끼는 사악한 놀입니다.', '사냥지배자 크라클', '', '', '두멧골 야영지에서 헤멧 네싱워리 2세와 대화해야 합니다.', 47187),
(66934, 'koKR', '파괴자 파괴', '', '', '', '', '', '', '', '', 47187),
(66933, 'koKR', '하늘의 거울 질주로', '활공하여 고리를 통과해야 합니다.', '경로의 통과 지점 고리를 통과해야 합니다.', '', '', '', '', '', '', 47187),
(66931, 'koKR', '누가 소란이냐?', '루비 생명의 제단에서 일어난 소란을 조사해야 합니다.', '보통 지진이 아니군.', '', '', '', '', '', '', 47187),
(66929, 'koKR', '다 모으고 말겠어', '유마도르무의 덱을 되찾아야 합니다.', '$PC님, 카드 되찾는 것 좀 도와주실 수 있을까요?\n\n다른 학생들에게 하스스톤 하는 법을 알려줄 때 필요하다고 세토고사한테 말했어요. 동아리를 만들고 싶은데, 카드를 돌려주질 않네요!\n\n예전부터 저한테 유독 까칠하긴 했지만, 이번에는 평소보다 심해요.', '', '', '', '', '', '', 47187),
(66921, 'koKR', '마루카이 질주로', '활공하여 고리를 통과해야 합니다.', '경로의 통과 지점 고리를 통과해야 합니다.', '', '', '', '', '', '', 47187),
(66903, 'koKR', '금고 청소', '', '', '', '', '', '', '', '', 47187),
(66901, 'koKR', '세계를 부수다', '', '', '', '', '', '', '', '', 47187),
(66897, 'koKR', '제련소의 연료', '용의 섬의 용암 생명체에게서 용암 핵 10개를 입수한 후 마루크 켄타우로스 더렐에게 가져가야 합니다.', '최고의 칼날을 만들려면 용암 핵의 열기가 필요해. 제련소의 연료로 쓰려고 몇 개 확보해 두었는데 최근에 거의 다 떨어져서 새로 구해야 해.\n\n용암 핵은 용의 섬에 있는 대부분의 용암 생명체에게서 얻을 수 있어.', '', '', '', '', '', '', 47187),
(66895, 'koKR', '옛 우두머리와 매한가지', '예언자 비조스를 처치해야 합니다.', '세계파괴자 용족은 쉽게 신뢰를 주는 경향이 있지. 지금까지 믿고 따른 지도자만 몇 명이더냐? 하나하나가 우릴 황혼의 시간으로, 데스윙의 재림으로 이끌어 줄 거란 기대를 받았다.\n\n하지만 데스윙은 돌아오지 않았고 황혼은 도래할 기미조차 보이지 않아.\n\n이젠 새로운 지도자가 필요한 때다. 네가 그 변화에 일조할 수 있다.', '', '기나긴 지도자들의 명맥을 잇는 자.', '이익추구자 비조스', '', '', '', 47187),
(66893, 'koKR', '부리 달린 녀석들의 귀환', '범람하는 여울에서 부상당한 뿔타조 $1oa마리를 치유해야 합니다.', '물의 정령에 관해서는 문외한이지만 뿔타조의 습성은 아주 잘 알아요!\n\n연고를 만들었습니다. 이거면 뿔타조를 치료하고 전투 태세를 갖추게 할 수 있을 거예요. 사실 진짜 뿔타조에게 발라본 적은 없지만, 최대한 연구한 결과물이기도 해요.\n\n어디 한번 용감하게 발라보자고요!', '', '', '', '', '', '', 47187),
(66892, 'koKR', '폭우의 난제', '범람하는 여울에서 물의 정령 $1oa마리를 처치해야 합니다.', '정령들이 뿔타조를 학살하고 있습니다! 덩치 큰 동물 조련하는 방법이야 알지만, 정령하고 직접 부딪히게 될 줄은 꿈에도 몰랐다고요! 천둥도마뱀하고는 차원이 다른데...\n\n<괴로워하며 한숨을 내쉬는 다자크로스>\n\n일단 정령 몇 마리를 처리해 주세요. 뿔타조는 우리 생각보다 머리가 잘 돌아가는 동물이니, 싸울 방법만 알아낸다면 녀석들도 맞서 싸울 겁니다!', '', '', '', '', '', '', 47187),
(66891, 'koKR', '폭발성 재', '용의 섬의 불사조에게서 폭발성 재 20개를 입수한 후 용비늘 원정대의 노클린 쿼크코일에게 가져가야 합니다.', '용의 섬에 사는 녹아내린 불사조는 죽으면 독특한 재가 생겨요. 그 물질을 이용하면 복잡한 장치에 들어가는 재료를 개선할 수도 있어요. 삶을 바꿀 만한 장치 같은 거요. 그래도 저는 폭발물을 만드는 데 쓸 것 같지만요.', '', '', '', '', '', '', 47187),
(66890, 'koKR', '도난당한 도구', '용의 섬의 놀에게서 도난당한 도구 20개를 입수한 후 발드라켄 협의회에 있는 도테노스에게 가져가야 합니다.', '저희 보급품 짐마차를 습격하는 놀들 때문에 아주 골치가 아픕니다. 놀들이 안에 들어있는 여러 기계 부품에 눈이 돌아간 것 같습니다. 그 난폭한 약탈자들이 저희의 특화된 기술을 알아내도록 내버려 둘 수는 없습니다. 더군다나, 부품을 도둑맞은 탓에 저희 생산 일정도 민망하리만큼 늦어졌습니다.\n\n놀들이 훔쳐 간 기계 부품을 일부 되찾는다면 저희도 일정을 재개할 수 있을 겁니다.', '', '', '', '', '', '', 47187),
(66886, 'koKR', '에메랄드 정원 승천로 - 고급', '활공하여 고리를 통과해야 합니다.', '경로의 통과 지점 고리를 통과해야 합니다.', '', '', '', '', '', '', 47187),
(66885, 'koKR', '에메랄드 정원 승천로', '활공하여 고리를 통과해야 합니다.', '경로의 통과 지점 고리를 통과해야 합니다.', '', '', '', '', '', '', 47187),
(66884, 'koKR', '방화 장비', '용의 섬의 자라딘에게서 방화 장비 10개를 입수한 후 이스카라 투스카르의 템나유에게 가져가야 합니다.', '자라딘의 장비는 어마어마한 불길에도 끄덕없습니다. 그런 요소들이 놈들과 맞서 싸울 때 큰 도움이 될 겁니다!\n\n자라딘에게서 표본을 좀 모아주십시오. 그 마법을 연구해서 우리 장비에 똑같이 적용할 수 있도록 해보겠습니다.', '', '', '', '', '', '', 47187),
(66883, 'koKR', '고대의 뿔반지', '엑사드리아에게 물품을 전달해야 합니다.', '<엑사드리아가 이 물품을 원할 것입니다.>', '', '', '', '', '', '', 47187),
(66882, 'koKR', '잃어버린 군장', '갈퀴추적자 카비아에게 물품을 전달해야 합니다.', '<갈퀴추적자 카비아가 이 물품을 원할 것입니다.>', '', '', '', '', '', '', 47187),
(66881, 'koKR', '협곡 강변로 - 고급', '활공하여 고리를 통과해야 합니다.', '경로의 통과 지점 고리를 통과해야 합니다.', '', '', '', '', '', '', 47187),
(66880, 'koKR', '협곡 강변로', '활공하여 고리를 통과해야 합니다.', '경로의 통과 지점 고리를 통과해야 합니다.', '', '', '', '', '', '', 47187),
(66879, 'koKR', '뿔타조 대혼란', '범람하는 여울에서 다자크로스를 만나야 합니다.', '뿔타조. 뼈도 부술 만큼 강한 부리와 어떤 위험도 피할 수 있는 빠른 다리, 섬의 어떤 것이든 먹어 치울 수 있는 식성을 가진 동물이죠.\n\n이렇게 쉬운 일이 어디 또 있겠어요? 그냥 좋아하는 새들 사이에 섞여서 시간을 보내면 되는데. 저는 이 섬의 어떤 동물이든 다루는 법을 알아서 무슨 일에도 대처할 수 있다고요.\n\n북쪽 뿔타조 고원으로 갈 건데, 같이 가주시겠어요? 거처를 마련할 때 도와줄 사람이 있으면 좋을 것 같거든요.', '', '', '', '', '', '', 47187),
(66878, 'koKR', '늪지대 경유로 - 고급', '활공하여 고리를 통과해야 합니다.', '경로의 통과 지점 고리를 통과해야 합니다.', '', '', '', '', '', '', 47187),
(66877, 'koKR', '늪지대 경유로', '활공하여 고리를 통과해야 합니다.', '경로의 통과 지점 고리를 통과해야 합니다.', '', '', '', '', '', '', 47187),
(66875, 'koKR', '과거 보존하기: 알게타르 대학', '알게타르 대학의 교장에게서 뒤엉킨 기억의 꿈위습을 입수해야 합니다.', '반가운 소식이 있습니다! 알게타르 대학이 다시 문을 열었어요. 도라고사 교장도 배움의 전당이 옛 모습을 찾아가는 걸 보며 기뻐하고 있겠죠.\n\n제 오랜 친구이기도 한데, 대화를 나눠본 지 참으로 오래됐군요. 저 대신 찾아가 차 한잔하실 수 있을까요? 대학에 등록할 기회도 될 거예요. 이제는 누구나 학생으로 받는다고 들었거든요.\n\n저와 기록 보관소를 자주 찾으시는 걸 보면 분명 관심이 있을 거라 생각해요.', '', '', '', '', '', '', 47187),
(66874, 'koKR', '과거 보존하기: 주입의 전당', '주입의 전당의 원시 지진해일에게서 홀로그램 분배기를 입수해야 합니다.', '티르홀드 지하 깊은 곳에... 주입의 전당이란 거대한 시설이 있다는 사실, 알고 계셨습니까? 엄청난 불가사의죠! 흥미롭고요! 무궁무진한 가능성을 생각해볼 수 있다고요! \n\n수호자 티르가 그곳에 무수한 비밀을 숨겨뒀을 겁니다. 과연 어떤 비밀일까요? 수호자들 중에서 총명하기로는 으뜸으로 손꼽히던 자였으니. \n\n<몽상에 빠지는 케모라>\n\n하지만 문제가 있어요. 원시술사들이 들어가 엉망으로 만들고 있나 보더군요. 그냥 내버려 뒀다간 수호자 티르가 남긴 경이를 모조리 엉망으로 만들어 놓을 겁니다. 놈들이 지나친 해악을 끼치기 전에 제거해 주세요.', '', '', '', '', '', '', 47187),
(66868, 'koKR', '과거 보존하기: 티르의 유산', '울다만에 있는 시간의 군주 데이오스에게서 잃어버린 시간의 수집품을 입수해야 합니다.', '수호자 티르에 관한 정보를 찾아 기록 보관소를 헤집듯이 살펴보고 있는데, 울다만에 관한 언급이 모조리 찢겨 있더군요. 그 안에 무슨 비밀이 숨겨져 있다는 언급만 대충 알 수 있을 정도입니다.\n\n흥미롭지 않습니까? 분명 울다만에 다른 비밀도 숨겨놨을 거예요. 동료분들과 같이 가서 찾아봐 주실 수 있을까요? 무엇이든 찾아다 주시면 소중하게 간직하겠습니다.', '', '', '', '', '', '', 47187),
(66864, 'koKR', '유물 복구: 담쟁이가죽 골짜기', '담쟁이가죽 골짜기의 부패족장 격노눈에게서 부패족장의 우상을 입수해야 합니다.', '아! 맡길 일이 있습니다. 담쟁이가죽 골짜기의 놀들이 부패의 힘을 다룬다고 합니다. 적절하게만 다루면 강력한 도구가 되는 힘이지요. 문제가 있다면 놀은 적절하게 다루는 법을 모른다는 겁니다.\n\n이 중요한 문제를 연구하지 않고 넘어가는 건 말도 안 되는 일이죠. 골짜기로 가서 부패 마법이 약간 깃든 물건을 가져다주실 수 있겠습니까? 그럼 제가... 아니, 우리가 놈들이 어떤 힘을 다루는지 알아볼 수 있을 겁니다.\n\n조심하시고, 웬만하면 동료와 같이 가세요. 담쟁이가죽은 뼈 그 자체를 메마르게 할 능력을 갖고 있습니다. \n\n얼마나 비참한 죽음이 되겠어요?', '', '', '', '', '', '', 47187),
(66860, 'koKR', '유물 복구: 티르의 유산', '울다만의 시간의 군주 데이오스에게서 흐르는 모래의 모래시계를 입수해야 합니다.', '케모라가 수호자 티르와 울다만에 관한 참조 문헌을 찾으라고 하더군요. 자료 찾겠다고 책을 하도 헤집어 대서 종이에 베여 생긴 상처가 또 종이에 베일 지경입니다. \n\n한데 관련된 내용이 사실상 전부 다 찢겨졌거나 파괴되어 있었습니다. 나중에... 케모라에게 보여주려고 따로 빼놓은 이걸 제외하면 말이죠. 내용으로 미루어보건대 울다만에 무슨 귀중한 물건이 보관되어 있는 것 같습니다. 그걸 가져다주셨으면 합니다. \n\n당연히 케모라의 연구를 돕는 데 활용할 생각입니다.', '', '', '', '', '', '', 47187),
(66848, 'koKR', '바람에 실려 온 징조', '온 새쉬탱의 의식을 도와야 합니다.', '온아라는 우리처럼 언어를 통해 말하지 않는다네. 그 목소리는 바람을 통해 전해지지. 우리 비술사들은 온아라의 존재를 느끼고 그 부름을 좇아 의미를 해석할 수 있도록 훈련받았다네.\n\n자네가 수집한 재료를 사용해 토템들을 이 부름에 결속했네. 온아라의 목소리를 찾기 위한 의식을 도와주게나. 그러면 내가 그 노래를 해석하겠네.', '', '', '', '', '', '', 47187),
(66847, 'koKR', '현신의 금고: 폭풍포식자의 분노', '현신의 금고에 들어가 라자게스를 처치해야 합니다.', '큰일이구나! 이 세상을 지키려 현신들을 가뒀던 건데, 라자게스가 풀어줄 음모를 꾸미고 있다니!\n\n$n, 라자게스가 성공하게 둬선 안 된다. 아제로스의 모든 생명체가 심각한 위기에 처할지도 모르는 일이다!\n\n나는 위상의 권좌로 돌아가 노즈도르무와 대책을 세우마. 너무 걱정하진 말거라. 너 한 명에게 모든 걸 떠넘길 생각은 추호도 없으니. 칼렉고스와 카드가가 동행할 것이다.\n\n행운을 빈다, 용사여.', '', '', '', '', '', '발드라켄 위상의 권좌에서 칼렉고스와 대화해야 합니다.', 47187),
(66846, 'koKR', '핵심 카드', '원혼을 도와 새로운 카드를 만들어야 합니다.', '용의 섬이 잠들기 시작한 바로 그날이 내 마지막 경기가 있던 날이었소. 피도 눈물도 없는 운명에 출전하기도 전에 가장 강한 카드를 잃고 말았지.\n\n궈희의 카드가 원래는 내 것이었소. 그녀의 선조들이 어떻게 그 카드를 입수했는지는 모르오.\n\n하지만 이미 수백 년 동안 가문에서 전해져 내려오는 카드가 됐는데, 그걸 빼앗을 순 없지. 아무튼 내가 바보 같았던 탓이니.\n\n혹시 함께 카드를 만들지 않겠소? 진정으로 특별한... 그래! 나를 좀 도와주면 좋겠구려.\n\n준비되면 말씀하시오.', '', '', '', '', '', '', 47187),
(66845, 'koKR', '전설 카드', '용기병 유령을 찾아 전설 카드를 회수해야 합니다.', '지난밤 침낭에 누워서 뒤척이고 있었는데 여관에 기괴한 한기가 쫙 끼치더군요. \n\n그러다 갑자기 어디에선가 용기병의 유령이 나타났어요! 유령은 제 짐을 마구 뒤지더니 홀연히 사라져버렸죠! \n\n일어나보니 정말 끔찍한 일이 벌어져 있었어요! 유령이 제가 가장 아끼는 카드를 가져가 버렸던 겁니다!\n\n부디 제 카드를 다시 찾아와 주실 수는 없을까요? 제가 가장 아끼는 물건이라서요.', '', '이유야 어쨌든 도둑질은 절대 능사가 아니랍니다. 더 바람직하고 똑똑한 선택지는 언제나 있죠.', '수수께끼의 원혼', '', '', '', 47187),
(66844, 'koKR', '위대한 쇼카리', '하늘여우 쇼카리를 처치해야 합니다.', '제가 지금껏 수많은 동물을 봐왔지만, 하늘여우 쇼카리의 위엄을 따라갈 녀석은 없습니다.\n\n그런데 그런 친구가 놀 주술사를 잡아먹었으니 안 된 일이죠. 부패에 사로잡혀 이성을 잃고 말았습니다. 쇼카리가 제 새끼를 잡아먹는 모습을 보자마자 뭔가 잘못됐음을 직감했습니다.\n\n그래서 애들은 제가 얼른 여기로 데려왔지만, 쇼카리가 공격하는 바람에 제대로 봉변을 당했지 뭡니까. 자칫하면 죽을 뻔했습니다.\n\n쇼카리를 처치해야 합니다. 부패에 정신이 더 썩어들어갔다가는 우리를 잡아먹으려 들 겁니다.', '', '이 위엄 넘치는 슬라이번은 한때 숲을 지배했습니다. 그러나 부패로 인해 이성을 잃고 말았죠.', '하늘여우 쇼카리', '', '', '', 47187),
(66843, 'koKR', '사라진 루크', '루크의 행방을 알아내야 합니다.', '아! 혹시 내 조수 루크 못 봤나?\n\n이 꼬맹이가 잠깐 주변만 둘러보고 온다더니, 한 시간째 돌아오질 않고 있네! \n\n위험하니 멀리 가지 말라고 그렇게 신신당부를 했건만... 하여간 애들 황소고집은 알아줘야 해.\n\n근데 또 마냥 그 녀석 문제로 보기도 어렵네. 풍경이 정말 아름다운 건 사실이니까. 그 녀석이 또 꽃을 좋아하거든.\n\n혹시 조수 찾는 걸 도와줄 수 있겠나? 세갈래 폭포 망루로 가려면 나나 수레나 녀석이 없으면 안 되거든!', '', '', '', '', '', '', 47187),
(66841, 'koKR', '과거의 파편', '유물을 회수해 타네사 실버블룸에게 가져가야 합니다.', '보니까 바쁘게 야영지를 드나들면서 사람들을 도우시더군요. 그래서 그런데, 이 가나르 좀 도와주시지 않겠습니까?\n\n이 지역을 조사하던 중에 뭔가를 찾았습니다. 저기 남쪽 폭포 가장자리에 일종의 고대 질그릇이나 단지로 추정되는 물건이 있습니다.\n\n제가 수영에는 영 소질이 없어서 말입니다. 보수를 드릴 테니 물건을 찾아 타네사 실버블룸에게 가져다 주십시오.', '', '', '', '', '', '유물을 타네사 실버블룸에게 가져가야 합니다.', 47187),
(66840, 'koKR', '수상 안전 수칙', '물 표본을 매니 리드에게 가져가야 합니다.', '제 가장 큰 책임은 모두에게 안정적으로 식수를 공급하는 겁니다.\n\n동쪽의 부패를 다루는 놀들 때문에라도 야영지의 안전을 확실히 확보해야 합니다.\n\n하지만 개인적으로 표본을 채취해가면서까지 사람들을 불안에 떨게 하고 싶진 않습니다. 근데 그렇다고 해서 시험을 안 하고 넘어갈 수도 없죠.\n\n이 주변 폭포 세 곳에서 표본을 채취해 주십시오. 보상은 아쉽지 않게 챙겨드리겠습니다.', '', '', '', '', '', '', 47187),
(66839, 'koKR', '부어라 마셔라!', '핏빛 열매, 청동뿔 열매, 용잎 꽃을 모아야 합니다.', '휴식 시간도 생겼겠다, 목이 타들어 가는 것 같아서 여관으로 냉큼 달려왔단 말이지.\n\n그런데... 아니! 이게 말이나 돼? 맥주가 없다니! 세상에 그딴 여관이 어딨어? 스톤힌지 남매가 운영하는 여관이 그렇지!\n\n그러니 우리 손으로 직접 문제를 해결할 걸세! 동쪽에 있는 숲에서 달콤한 벌꿀술을 빚는 데 쓸 수 있는 꽃과 약초가 자라더군. 사람 하나 살리는 셈 치고 꽃을 좀 모아다 줄 수 있겠나? 보수는 당연히 챙겨줌세!', '', '', '', '', '', '', 47187),
(66838, 'koKR', '이 위는 추워요', '거친갈기 곰에게서 두꺼운 곰 모피를 입수해야 합니다.', '자고로 훌륭한 여관주인은 손님이 말하지 않아도 필요한 걸 딱딱 챙기는 법이죠. 문제는... 밤이 이렇게 추울 줄은 몰랐어요. 이런.\n\n손님들에게 담요를 드려야 해요. 그것도 두껍고 따뜻한 걸로요. 곰 가죽이면 되려나?\n\n여기 동쪽 숲에 덩치 큰 곰들이 살더군요. 그 녀석들 가죽을 가져오시면 돈으로 살게요! \n\n어떻게 안 될까요? 추위에 오들오들 떨고 있을 모험가들을 생각해서라도 좀...', '', '', '', '', '', '', 47187),
(66837, 'koKR', '조식 미포함', '세갈래 폭포 망루 남쪽에서 보르퀸 성큼걸이와 줄무늬 브루팔론의 고기를 입수해야 합니다.', '물자를 추가로 주문하는 건 원래 제 동생 발도 담당이었단 말이죠. 근데 일주일이나 지났는데 물자는커녕 코빼기도 안 보여요. \n\n새삼 놀랍지도 않아요. 순 게으름뱅이 자식이 주문할 시간에 늘어지게 낮잠이나 잤을 게 빤히 보이거든요! 덕분에 음식이 부족한데 전 허드렛일에 치여서 사냥 나갈 시간도 없어요. 발도 그 자식 뒤치다꺼리도 해야 하고요!\n\n사냥을 좀 부탁드려도 괜찮을까요? 남쪽에 서식하는 보르퀸 성큼걸이하고 줄무늬 브루팔론 고기면 물자를 주문할 때까지 주방에서 충분히 쓸 수 있을 거예요.', '', '', '', '', '', '', 47187),
(66836, 'koKR', '아른햇살 숲 순환로 - 고급', '활공하여 고리를 통과해야 합니다.', '경로의 통과 지점 고리를 통과해야 합니다.', '', '', '', '', '', '', 47187),
(66835, 'koKR', '아른햇살 숲 순환로', '활공하여 고리를 통과해야 합니다.', '경로의 통과 지점 고리를 통과해야 합니다.', '', '', '', '', '', '', 47187),
(66834, 'koKR', '깨달은 자 렐렌', '공물의 굴에서 공물을 바치고 렐렌의 각 가르침을 목격해야 합니다.', '공물을 중앙 굴로 가지고 들어가라. 가서 지금과 같은 켄타우로스의 삶을 있게 해준 깨달은 자 렐렌의 전설을 목격해라.', '', '', '', '', '', '', 47187),
(66833, 'koKR', '위기의 마르모니', '', '', '', '', '', '', '', '', 47187),
(66831, 'koKR', '우리 집엔 개구리가 살아', '생명의 웅덩이에서 케쉬키를 만나 구출한 개구리를 방생해야 합니다.', '개구리를 전부 모았습니다, $n 님! 결국 개구리를 아코라에게 데려가는 셈이 됐네요. 용뿔두꺼비들이 질려서 이동할 때까지 생명의 웅덩이에서 안전하게 지내게 하려고요.\n\n음, 끝까지 아코라의 기운을 북돋아 줄 만한 건 찾지 못했네요. 이해해주면 좋겠는데...', '', '', '', '', '', '', 47187),
(66830, 'koKR', '용뿔두꺼비가 나타났다!', '케쉬키의 반딧불이 단지를 사용해 괴롭힘 당한 개구리 $1oa마리를 안전한 장소로 유인해야 합니다.', '용뿔두꺼비들 때문에 신경질이 다 납니다!\n\n<안경이 삐뚤어질 만큼 세게 발을 구르는 케쉬키>\n\n덩치 크고 욕심만 많은 불한당 같으니라고! 아무리 이곳이 용뿔두꺼비 동굴이라지만 그렇다고 이렇게 정신없이 뛰어다니면서 만만한 것들은 닥치는 대로 잡아먹어서야 되겠습니까!\n\n여기 이 반딧불이 병을 받으십시오. 개구리들을 지켜줄 때 아주 유용한 물건입니다. 이걸 사용하면 개구리들이 차분해지기 때문에 하나씩 모을 수가 있을 겁니다. 그리고 안전한 곳으로 옮겨주는 것이지요.\n\n그리고 용뿔두꺼비가 훼방을 놓거든 주저 말고 맞받아치십시오!', '', '', '', '', '', '', 47187),
(66828, 'koKR', '공동의 난관', '용뿔두꺼비 숲에서 케쉬키를 만나야 합니다.', '아코라가 저토록 침울해하는 것은 처음 봅니다. 아코라는 보통 정원에 핀 꽃만큼이나 밝고 화사합니다만, 그 전설은 이 아이에게 큰 의미가 있었으니까요. 항상 그 얘기를 하곤 했죠. 흠...\n\n<자기 갑옷을 만지작거리는 케쉬키>\n\n저는 식물은 잘 모릅니다. 개구리들도 저한테나 위안을 줄 뿐이겠지요...\n\n하지만 이 북쪽에 용뿔두꺼비 숲이라고 하는 조용한 공간이 있는데 제가 사색을 위해 종종 찾는 곳이기도 합니다. 아마 거기서 아코라의 마음을 보듬어 줄 무언가를 찾을 수 있을지도 모릅니다. 적어도 아코라를 도와줄 계획이라도 떠올려 볼 수 있겠지요.', '', '', '', '', '', '', 47187),
(66827, 'koKR', '꽃피워낸 노력', '정원에서 잘 익은 용과 $1oa개, 향기로운 용꽃 $1oa송이, 푸른 씨앗 깍지 $1oa개를 수집한 후 용의 혼령에게 공물로 바쳐야 합니다.', '전설에 따르면 영혼은 생명에 대한 헌신을 증명한 이들에게만 노래를 불러준다고 하더군요.\n\n전 몇 년 동안 이 정원을 가꾸어 왔으니... 이제 제 식물들도, 저도 준비가 된 것 같습니다.\n\n이곳 웅덩이 근처에서 준비할 테니 용사님은 수확을 도와주세요!\n\n관목 아래에서 씨앗 깍지를, 양지바른 풀밭에서 용꽃을, 높은 나무에서 용과를 따서 가져다주시면 됩니다. 제 낡은 갈퀴를 빌려드릴게요. 조심하세요. 식물이 가끔 깨물 때도 있습니다!', '', '', '', '', '', '', 47187),
(66825, 'koKR', '루비 생명의 부름', '루비 생명의 제단에서 생명의 부름 의식에 참여해야 합니다.', '$p! 여기에 계셔서 다행이네요! 저희가 생명의 부름 의식을 시작할 참인데, 함께해주시면 영광이겠습니다.\n\n용혈족의 소임이란 아주 특별하지요. 누구는 장인 정원사가 되고 또 누구는 특정 야생동물을 돌보고는 합니다.\n\n이 어린 용혈족들은 이제 훈련을 마치고 각자의 첫 소임을 맡으려고 합니다. 함께해 주시면 다들 좋아할 겁니다. 준비되셨다면 각각의 물품을 어린 용혈족들 앞의 탁자에 놓아주십시오.', '', '', '', '', '', '', 47187),
(66805, 'koKR', '충성의 열쇠', '상급 흑요석 열쇠 $1oa개를 수집해야 합니다.', '', '', '', '', '', '', '흑요석 성채에 있는 사벨리안에게 완성된 열쇠를 전달해야 합니다.', 47187),
(66788, 'koKR', '미래의 알', '어머니 엘리온을 도와 지역을 복원해야 합니다.', '정말 믿을 수 없습니다! 검은용군단의 알입니다! 그토록 많은 시간이 지났는데도요!\n\n하지만 주위를 둘러보세요! 이래서 되겠습니까! 여기는 알들에게 최적의 장소는 못 됩니다.\n\n다만 저 두 허풍선이가 생명의 어머니의 은총을 놓고 애들처럼 옥신각신하는 꼴을 보아하니 저들이 우리 생각은 눈곱만큼도 하지 않은 것은 분명합니다! 하지만 당신이라면 이 늙은 알지기를 모른 채 외면하시지는 않겠지요?', '', '', '', '', '', '', 47187),
(66787, 'koKR', '날개쉼터 회전로 - 고급', '활공하여 고리를 통과해야 합니다.', '경로의 통과 지점 고리를 통과해야 합니다.', '', '', '', '', '', '', 47187),
(66786, 'koKR', '날개쉼터 회전로', '활공하여 고리를 통과해야 합니다.', '경로의 통과 지점 고리를 통과해야 합니다.', '', '', '', '', '', '', 47187),
(66785, 'koKR', '최후의 알지기', '어머니 엘리온과 대화해야 합니다.', '$c|1이여;여;, 네 걱정은 충분히 이해한다. 그렇지만 곧 손님이 도착할테니 전부 금방 수습될 일이다.\n\n여기 머무르면서 참관해도 좋다. 속이 제법 후련해지는 광경이 펼쳐질 것이야.\n\n그래도 시간이 나면 우리 알지기와 얘기를 나눠봐라. 분명 도움이 필요할 테니.', '', '', '', '', '', '어머니 엘리온과 대화해야 합니다.', 47187);
INSERT INTO `quest_template_locale` (`ID`, `locale`, `LogTitle`, `LogDescription`, `QuestDescription`, `AreaDescription`, `PortraitGiverText`, `PortraitGiverName`, `PortraitTurnInText`, `PortraitTurnInName`, `QuestCompletionLog`, `VerifiedBuild`) VALUES
(66784, 'koKR', '폭풍 잠재우기', '폭풍 회랑 차원문 근처에 있는 원시술사 폭풍소환사를 처치해야 합니다.', '다리 둘로 겨우 걸어 다니는 것 치고는 제법 잘 싸우는군!\n\n우리가 아무리 훌륭하게 싸워봤자 원시술사들이 지원군을 계속 불러오는 한 아무 의미가 없다. 저 폭풍 회랑 차원문을 차단해야 해!\n\n길을 열어 인근의 동굴로 가서 차원문을 열어두고 있는 원시술사 폭풍소환사들을 처치해라. 가능하다면 내가 도와주겠다.', '', '', '', '', '', '', 47187),
(66783, 'koKR', '서약 갱신', '산소크 칸, 티가리 칸, 카남 마트라 사레스트, 메리스라를 도와 선물을 교환해야 합니다.', '수백 년 전, 나는 최초의 켄타우로스를 만나 우정과 협력의 맹약을 맺었다. 그간 많은 변화가 있었지만 지금은 그 맹약을 새로이 갱신할 때인 것 같구나.\n\n후세의 켄타우로스가 녹색용군단과의 유대를 되새길 수 있도록 만들어진 암송문이 있노라. 칸의 공물로 각 절에 화답하게 되어 있지. 켄타우로스가 암송문의 본래 의미를 기억하고 있으면 좋겠군.\n\n무엇보다 선물을 잘 골라야 한다. 알맞은 공물을 바치면 우리의 동맹은 체결될 것이야.', '', '', '', '', '', '', 47187),
(66781, 'koKR', '취향 차이', '고래잡이의 귀퉁이에서 모르디건 아이언죠가 핥아볼 만한 돌을 찾아야 합니다.', '여기는 참 고약한 곳이군!\n\n냄새나는 골록 몇몇이 우리 장비를 훔쳐 갔다네. 다시는 그럴 생각을 못 하도록 만들어 주어야지. 하! 나는 자네가 젖먹이였던 시절보다 훨씬 전부터 돌을 핥아왔다는 말일세. 노움의 번지르르한 기구 같은 건 필요 없다네.\n\n돌만 가져와 주면 내 증명해 보이지!', '', '', '', '', '', '모르디건 아이언죠에게 가야 합니다.', 47187),
(66780, 'koKR', '왕위 계승자', '래시온의 추종자와 대화해야 합니다.', '내 몇번이고 아제로스를 파멸로부터 구하려 애써왔건만, 저 어리석은 자는 갑자기 불쑥 나타나서 자신이 위상의 칭호를 취할 수 있으리라 생각하는 것인가? 어림없는 짓이지.\n\n우리 종족과 이야기를 나눠봐라, $n. 우리 종족이 나를 어떻게 평하는지, 내가 이 세상을 위해 무엇을 했는지 들어보도록 해라.', '', '', '', '', '', '', 47187),
(66779, 'koKR', '명백한 후계자', '사벨리안의 추종자와 대화해야 합니다.', '넬타리안의 후계자이자 최후의 검은용 군단의 우두머리인 내가 나의 당연한 생득권을 놓고 경쟁을 벌여야 하리라고는 생각지도 못했다. 특히나 저 거만하고 너보다도 어린 새끼용을 상대하게 될 줄이야.\n\n어쨌건 이 자명한 사실들 그 이상을 알고 싶거든 우리 군단원들과 편하게 이야기를 나눠보도록 해라. 내 말을 그대로 믿어달라고 할 생각은 없다.', '', '', '', '', '', '', 47187),
(66778, 'koKR', '우크툴루트 연안로 - 고급', '활공하여 고리를 통과해야 합니다.', '경로의 통과 지점 고리를 통과해야 합니다.', '', '', '', '', '', '', 47187),
(66777, 'koKR', '우크툴루트 연안로', '활공하여 고리를 통과해야 합니다.', '경로의 통과 지점 고리를 통과해야 합니다.', '', '', '', '', '', '', 47187),
(66737, 'koKR', '더 나은 시작', '비옥한 흙 $1oa곳에 씨앗을 심고 자라나게 해야 합니다.', '배로스는 참 성실한 자입니다. 하지만 새끼용은 어떻게든 말썽을 일으키게 되어 있죠. 당연히 제 자식은 아니고요. 어쨌든, 어린 개체를 보살피는 용이라고 해서 전부 본인이 처한 상황의 막중함을 이해하는 것은 아닙니다.\n\n공부는 안 하고 나가 노는 걸 질색하는 쪽이지만... 정원을 보다 효율적으로 지키는 방법을 알려드리죠. 이 씨앗을 근처에 심으세요. 꽃이 피면 곤충들이 싫어하는 향을 발산할 겁니다.\n\n정원사들에게 협조를 구하셔도 괜찮습니다. 다소 버릇없긴 하지만 제 청동용 형제들도 거들어줄 순 있을 거예요.', '', '', '', '', '', '', 47187),
(66735, 'koKR', '조금만 다듬어주세요', '웃자란 덤불 $1oa개를 가지치기합니다.', '새끼용이 벌을 보고 겁에 질리는 것만 문제가 아닙니다. 평소 같았으면 수분 작용이 나쁠 것 하나 없지만, 이번에 나타난 무리는 식생이 걷잡을 수 없이 성장하게 만들고 있어요.\n\n제 조경 가위를 드릴 테니 관목을 좀 쳐주시겠어요? 벌써 위험한 덩굴손을 내뱉기 시작한 것들도 있습니다. 그래도 지금 손을 쓰면 저지할 수 있을 거예요. 치료보단 예방이 백배 효과적인 법이니.\n\n지금 저는... 그 예방을 도와줄 사람이 절실합니다, $n 님.', '', '', '', '', '', '', 47187),
(66734, 'koKR', '벌 좀 내버려 둬', '연기 확산기를 사용해 성가신 벌 $2oa마리를 진정시킨 후 채집하여, 근처 호수에 방생해야 합니다.', '감사합니다, 생명의 어머니! 드디어 도와주실 분이 오셨군요!\n\n이 정원은 보통 저희 새끼용들이 마음껏 뛰어노는 놀이터입니다만, 요즘 꽃이 피기 시작하면서 벌들이 통제 불능으로 불어났습니다. 새끼용들은 겁에 질렸고 용들도 신경이 곤두서있지요. 어제는 새끼용 하나가 벌에 쏘였는데...\n\n<심호흡하며 마음을 가라앉히고 당신을 애원하듯 바라보는 배로스>\n\n벌들을 모아서 호수 주변으로 옮겨주시지 않겠습니까? 이 연기 확산기를 가져가십시오. 벌들을 진정시키는 데 도움이 될 겁니다.', '', '', '', '', '', '', 47187),
(66733, 'koKR', '최정상 거처 강변로 - 고급', '활공하여 고리를 통과해야 합니다.', '경로의 통과 지점 고리를 통과해야 합니다.', '', '', '', '', '', '', 47187),
(66732, 'koKR', '최정상 거처 강변로', '활공하여 고리를 통과해야 합니다.', '경로의 통과 지점 고리를 통과해야 합니다.', '', '', '', '', '', '', 47187),
(66730, 'koKR', '진정한 생존자', '하늘빛 평원의 얼어붙은 호수에서 늙은 음울엄니를 찾아 대화해야 합니다.', '몸도 마음도 만신창이가 됐다고 한들, 여기 온 목적을 잊어선 안 됩니다. 동족이 우리만 보고 있는데 실망시킬 순 없습니다. 우선 이 거친 땅에서 임시로 머물 장소를 찾아야 합니다.\n\n이제 그만 칭얼대고 움직입시다.', '', '', '', '', '', '하늘빛 평원의 얼어붙은 호수에서 늙은 음울엄니를 찾아 대화해야 합니다.', 47187),
(66728, 'koKR', '잿불흐름 비행로 - 고급', '활공하여 고리를 통과해야 합니다.', '경로의 통과 지점 고리를 통과해야 합니다.', '', '', '', '', '', '', 47187),
(66727, 'koKR', '잿불흐름 비행로', '활공하여 고리를 통과해야 합니다.', '경로의 통과 지점 고리를 통과해야 합니다.', '', '', '', '', '', '', 47187),
(66726, 'koKR', '야생의 보존지 순환로 - 고급', '활공하여 고리를 통과해야 합니다.', '경로의 통과 지점 고리를 통과해야 합니다.', '', '', '', '', '', '', 47187),
(66725, 'koKR', '야생의 보존지 순환로', '활공하여 고리를 통과해야 합니다.', '경로의 통과 지점 고리를 통과해야 합니다.', '', '', '', '', '', '', 47187),
(66724, 'koKR', '미명낚시꾼', '미명어 $1oa마리를 모아 공물 바구니에 넣어야 합니다.', '이런 일에 휘말리시게 만들어 죄송합니다, 여행자님. \n\n저희 동생이 간혹... 흥분할 때가 있습니다. 동생의 어리석은 짓은 이번이 처음도 아닙니다. 다만 이번에는 목숨이 위태로워진 상황이지요. \n\n동생은 제 말을 듣지를 않습니다. 당신의 말도 듣지 않을 겁니다. \n\n동생이 가장 집착하는 대상은 저희 조상이신 미명낚시꾼 카우리크입니다. 그분의 말이라면 들을지도 모릅니다.\n\n미명어 몇 마리를 잡아서 가져와 주십시오. 미명어 공물을 통해 이 돌에 머무르고 있는 조상님의 영혼과 교통해보고자 합니다.', '', '', '', '', '', '', 47187),
(66722, 'koKR', '야생의 보존지 활강로 - 고급', '활공하여 고리를 통과해야 합니다.', '경로의 통과 지점 고리를 통과해야 합니다.', '', '', '', '', '', '', 47187),
(66721, 'koKR', '야생의 보존지 활강로', '활공하여 고리를 통과해야 합니다.', '경로의 통과 지점 고리를 통과해야 합니다.', '', '', '', '', '', '', 47187),
(66719, 'koKR', '일 보 후퇴', '부름으로부터 자신을 보호해야 합니다.', '친구여. 참으로 슬픈 얘기지만... 저 폐허에서 당신이 마주한 고난은 저에게도 익숙합니다. 이 이상 깊이 들어갔다간 당신도 저들의 광기에 굴복하고 말 겁니다.\n\n후천적이든 선천적이든 지금 당신이 듣고 있는 부름은 일종의 생리적인 현상입니다. 어떻게든 충족하고 싶은 열망이 있는 것이지요.\n\n다소 부끄럽지만 제게 이 저주를 해소할 수단이 있습니다. 예전과 같은 수준은 아니지만, 어느 정도 거동은 할 수 있을 겁니다... 한동안은.', '', '', '', '', '', '', 47187),
(66718, 'koKR', '놀 척결', '', '', '', '', '', '', '', '', 47187),
(66715, 'koKR', '구출', '하늘빛 평원의 눈가죽 야영지에서 투스카르를 구출해야 합니다.', '지금 가장 중요한 것은 저희 부족을 데려오는 겁니다. 안전하게 데려와야 하겠지요.\n\n이렇게 말씀드리기는 너무 괴롭지만, 저 혼자의 힘으로는 상대할 수 있는 상태가 아닙니다.\n\n도와주실 수 있겠습니까?', '', '', '', '', '', '얼음이빨과 대화하여 투스카르 사냥꾼에 대해 더 알아봐야 합니다.', 47187),
(66712, 'koKR', '섬광서리 고가로 - 고급', '활공하여 고리를 통과해야 합니다.', '경로의 통과 지점 고리를 통과해야 합니다.', '', '', '', '', '', '', 47187),
(66711, 'koKR', '어둠 속의 별미', '강 고둥 $1oa마리를 모아 하다리에게 전달해야 합니다.', '우리 부족의 특성 때문에 일부 자원이 부족한 상태다. 우리에게는 육지의 금속 자원을 차지하러 나설 정도의 여유를 부릴 시간이 없다.\n\n돌아가신 칸께서는 여러 다양한 자들과 거래선을 터 두셨었는데 그 관계를 청산할 이유는 전혀 없지.\n\n인근의 만에는 우리가 고둥을 잡을 때 쓰던 양동이들이 있다. 몇몇 우리 이웃들은 고둥을 아주 별미로 여긴다. 거래를 할 생각이니 몇 마리 잡아와주면 좋겠군.', '', '', '', '', '', '', 47187),
(66710, 'koKR', '섬광서리 고가로', '활공하여 고리를 통과해야 합니다.', '경로의 통과 지점 고리를 통과해야 합니다.', '', '', '', '', '', '', 47187),
(66709, 'koKR', '야전 의무병학 개론', '늙은 음울엄니가 부상을 회복하도록 도와야 합니다.', '<이 부상당한 투스카르가 숲에서 얼마나 오랫동안 혼자 있었는지는 알 길이 없습니다. 하지만 도움의 손길 없이는 얼마 버티지 못할 게 확실합니다.>', '', '', '', '', '', '', 47187),
(66708, 'koKR', '설원의 기수', '하늘빛 평원에서 실종된 투스카르 사냥꾼들을 찾아야 합니다.', '반갑네, $c 친구. 이 마력장은 정말 놀랍지 않나? 이 마력장이 살을 에는 추위와 거친 황야로부터 우리를 지켜주고 있네만, 키린 토에 언제까지나 의지할 수는 없네.\n\n며칠 전 우리의 가장 노련한 사냥꾼들이 식량과 보급품을 찾아 숲을 탐색하러 떠났는데, 아직 돌아오지 않았다네. 사냥꾼 대장인 늙은 음울엄니가 노련한 탐색꾼이자 사냥꾼이라는 것은 잘 알지만, 그와 다른 사냥꾼들을 걱정하지 않을 수가 없네.\n\n사냥꾼들을 찾아봐 주겠나?', '', '', '', '', '', '하늘빛 평원에서 실종된 투스카르 사냥꾼을 찾아야 합니다.', 47187),
(66704, 'koKR', '므오옳옳옳!', '므오옳옳옳아옳아옳!', '므오옳옳옳아옳아옳! 그오옳옳옳아옳아옳!\n\n그오옳옳옳아옳 오옳옳옳아옳 그오옳 그오옳 옳. 므오옳옳옳 그오옳옳옳 므오옳 그오옳옳옳. 므오옳옳옳아옳아옳 그오옳 그오옳옳옳 그오옳옳옳 그오옳옳옳.\n\n므오옳옳옳아옳 그오옳 그옳.\n\n<말을 알아들을 수는 없으나 칼로 찌르는 동작을 여러 차례 반복합니다. 무언가를 해치워달라는 이야기 같습니다.>', '', '', '', '', '', '', 47187),
(66703, 'koKR', '눈덩이 효과', '하늘빛 평원의 눈가죽 주술사로부터 눈가죽 토템 $1oa개를 회수해야 합니다.', '눈가죽 놀은 똑똑하다. 얼음에다 식량을 보관하면 오랫동안 상하지 않는다는 걸 안다. 하지만 아무 얼음이나 되는 것은 아니다. 마법 얼음이 훨씬 좋다! \n\n다 주술사들이 손을 쓴 덕이다. 여기다 얼음이빨을 묶어놓고는 이 맛난 투스카르 고기 옆에서 굶어 죽을 지경이 될 때까지 내버려 두고 있다.\n\n$r 친구, 투스카르 돕고 싶어? 서둘러야 할 거야. \n\n얼음이빨은 주문 해제하는 방법 안다.\n\n얼음이빨이 왜 돕냐고? 얼음이빨도 주술사는 싫거든.', '', '', '', '', '', '', 47187),
(66700, 'koKR', '검은 구심점', '검은 구심점을 이동술사 에이릴린에게 가져가야 합니다.', '꽤 매혹적이지 않습니까? 구심점은 분리된 불길이 갖기엔 너무 귀한 물건입니다. 하지만 제 손에는 딱 맞는다고 할 수 있겠군요. 재밌지 않습니까?\n\n<고개를 젓는 아다네달>\n\n아닐 수도 있지만요. 오늘은 확실히 아닙니다. 앞으로도 그럴 일은 없을 것이고. 가져가십시오. 제가 짊어지기엔 너무나 무거운 부담입니다.\n\n조심히 가십시오, 친구여.', '', '', '', '', '', '', 47187),
(66699, 'koKR', '지역 수소문', '안토니다스 야영지의 투스카르와 대화해야 합니다.', '칼렉고스가 투스카르에게 조언을 구한 것은 현명한 선택이었어요. 투스카르에게는 이 땅에서 여러 세대를 살아오며 누적한 경험이 있거든요.\n\n교각 주변으로 흩어져있는 그네들의 야영지로 가는 길에 투스카르들이 많이들 쉬고 있을 거예요.\n\n한번 물어보세요! 분명히 지역의 지맥을 아는 자가 있을 테니까요.', '', '', '', '', '', '', 47187),
(66698, 'koKR', '큰뿔양 세기', '아일라그 양치기와 대화한 후 잃어버린 양을 부족에 되찾아줘야 합니다.', '우리의 핵심 자원 중 하나는 바로 큰뿔양 무리다. 한 마리 한 마리를 잃을 때마다 우리 부족도 힘을 잃는 것처럼 느껴질 정도지.\n\n몇몇 큰뿔양들이 무리를 벗어나 어딘가로 사라져 버렸다. 잃어버린 녀석들을 찾고 있는 우리 목동들을 네가 도와주도록 해라.', '', '', '', '', '', '', 47187),
(66696, 'koKR', '운명의 시험: 어둠땅의 운명', '', '', '', '', '', '', '', '', 47187),
(66692, 'koKR', '루비 생명의 제단 윤환로 - 고급', '활공하여 고리를 통과해야 합니다.', '경로의 통과 지점 고리를 통과해야 합니다.', '', '', '', '', '', '', 47187),
(66690, 'koKR', '노쿠드 공격대: 최후의 선조', '노쿠드 공격대에서 발라카르 칸을 처치하고 선조의 메달을 모아야 합니다.', '너는 우리 마루크의 미덕과 삶의 방식에 진솔한 관심을 보였고, 우리의 아군임을 똑똑히 증명해 보였다. 그런 의미에서 알려주고 싶은 선조가 한 분 더 있지만, 이번에는 위험할 거다.\n\n노쿠드의 지도자이자 누구의 아들도 아닌 배신자 발라카르를 처단해라. 놈은 시종일관 어떤 귀중한 메달을 걸치고 다니지. 그걸 가져다주면 영원한 은혜로 알고 잊지 않으마.', '', '', '', '', '', '', 47187),
(66689, 'koKR', '돌 그 이상의 가치', '와투에게 폭풍이 깃든 조각을 보여줘야 합니다.', '<매끈하면서도 약간 열기가 느껴지는 조각입니다. 내부에서 번개 같은 것이 일어나며 빛을 내뿜고 있습니다.>\n\n<와투나 올레크라면 이 물건에 대해 아는 게 있을지도 모릅니다.>\n\n<조각과 떨어질 생각이 들기 무섭게 좀 더 가까이에 두고 싶다는 충동이 듭니다. 영원히 간직하고 싶을 정도로...>', '', '', '', '', '', '소나무 초소에 있는 와투에게 돌아가야 합니다.', 47187),
(66688, 'koKR', '바람의 징후', '바람의 징표를 모아 노래하는 돌 주위에 있는 공물 그릇에 바쳐야 합니다.', '이 세계의 진정한 원시라 할 수 있는 정령들이 켄타우로스에게 도전했을 때, 히미아께서는 우리가 받은 선물을 품고 그들을 마주했다. 바로 바람이었지.\n\n노래하는 돌은 이 평야에 굳건하게 서 있다. 그곳에서 바람의 증표를 바치고 히미아 님의 기억을 일깨울 수 있지. 증표는 주변 어디서든 구할 수 있다. 새의 깃털, 식물의 포자, 강의 갈대... 무엇이든 괜찮지.', '', '', '', '', '', '', 47187),
(66687, 'koKR', '최상위 포식자의 땅', '그늘거미의 거미줄 $1oa개, 슬라이번 갈퀴 $2oa개, 천둥가시 비늘 $3oa개를 수집해야 합니다.', '깨달은 자 렐렌 님을 알겠지? 켄타우로스가 험난한 땅에서 살아남을 수 있도록 도구를 베풀어주신 분이다. 그분의 기억을 살피려면 가치 있는 야수를 공물로 바쳐야 한다.\n\n조심해라, 여행자여. 작금의 야수들이 아득히 먼 옛날처럼 위험하진 않지만, 그래도 이 평야에서 최상위 포식자로 군림하는 개체들이다.', '', '', '', '', '', '', 47187),
(66684, 'koKR', '폭풍 추적', '원시술사와 폭풍 마법의 근원을 파괴해야 합니다.', '<조각을 뽑아낸 후 숨을 몰아쉬는 와투>\n\n완전히... 자제력을 잃었었다. 올레크 말이 맞아. 이 끔찍한 마법은 원시술사 놈들 짓이 분명해. 제발 놈들을 막아줘!\n\n난 형을 야영지로 옮길게.', '', '', '', '', '', '', 47187),
(66683, 'koKR', '최후의 수단 분석', '소나무 초소에서 폭풍이 깃든 조각에 관해 수소문해야 합니다.', '<눈을 감은 채 팔짱을 끼고 웅얼거리는 와투.>\n\n하필 사슴에게 꿰여 또 한 명의 부상자 신세가 됐네. 공은 또 형이 전부 차지할 거고, 고향 사람들 모두가 당연하다고 생각하겠지.\n\n<고개를 치켜드는 와투> 뭐야? 너 그거 손에 뭐지? 빛나는 돌멩이? 한번 봐주지. 근데 다른 사람한테도 물어보는 게 좋을 거야. 나는 사냥꾼이지 고고학자가 아니니까. <본인의 다리를 흘기며 콧방귀를 뀌는 와투> 어쩌면 직종을 바꾸라는 하늘의 계시일지도 모르겠군. 아무튼 한번 보자. 네가 나보다 유능하다는 건 이미 증명된 사실이니.', '', '', '', '', '', '', 47187),
(66681, 'koKR', '만연하는 폭풍우', '현자마루 송림에서 폭풍이 깃든 야수 $1oa마리를 처치해야 합니다.', '송림에 들어갈 생각인가? 그렇다면 폭풍이 깃든 동물들을 눈에 띄는 대로 처리해다오. 사실 부탁하는 나로서도 마음이 편하지만은 않아. 하지만 고통에 시달리는 게 확연하고, 도울 방법이 없어. 심지어 공격성은 전염되기까지 하지.\n\n원시술사 놈들의 짓일 거다. 근처에 있는 전초기지가 원인이 분명해. 저번에 이상한 마법 제단을 본 적 있어.\n\n다시 조사를 해봐야겠군. 돌아왔는데 내가 없으면 정찰병 와투에게 다음 할 일을 물어봐라. 도와줘서 고맙다.', '', '', '', '', '', '', 47187),
(66680, 'koKR', '양 세는 일', '음식을 이용해 소망이와 친해진 후, 현자마루 송림에서 소망이의 호루라기를 사용해 길 잃은 큰뿔양 $3oa마리를 구해야 합니다.', '속 터지겠군. 하필 올레크 형님하고 정찰을 나왔을 때 정신 나간 수사슴에게 이런 꼴을 당하다니.\n\n<피로 흥건한 다리를 가리키며 움찔하는 와투>\n\n도우러 온 건가? 원시술사들의 공격이 시작된 이후로 큰뿔양들이 송림으로 뿔뿔이 흩어져 버렸어. 이 야영지가 정상적으로 굴러가려면 큰뿔양의 양모와 젖이 꼭 필요해.\n\n이 호루라기를 받아라. 이걸로 소망이에게 명령을 내려 큰뿔양을 데려올 수 있지. 그리고 도살자 손도에게 소망이가 제일 좋아하는 간식을 받을 수 있을 거다. 그거면 녀석의 의욕을 고취하고도 남지.', '', '', '', '', '', '', 47187),
(66679, 'koKR', '루비 생명의 제단 윤환로', '활공하여 고리를 통과해야 합니다.', '경로의 통과 지점 고리를 통과해야 합니다.', '', '', '', '', '', '', 47187),
(66676, 'koKR', '몰래 들어가기', '온이르 샘에 있는 라디야에게 가야 합니다.', '얘는 리지라고 해... 내 비밀 친구야. 어미에게 버려진 걸 거둔 이후로 쭉 보살피고 있지.\n\n상황이 좋지 않아. 놈들이 리지에게 무슨 수작을 부렸는지 모르겠지만, 내 수준을 뛰어넘은 건 분명하거든. 집으로 데려가야겠어. 돌아가면 온께서 엄한 외출 금지령을 내리시겠지만... 그래도 리지는 치료해야지. $p, 당신에겐 평생동안 고마울 거야. 여러모로 번거롭게 해서 미안해.\n\n마지막으로 한 번만 더 모험을 떠날 생각은 없어? 온께서 단단히 화나셨을 텐데, 혼자서 마주하기 좀 그렇거든. 샘에서 다시 만나!', '', '', '', '', '', '온이르 샘에 있는 라디야에게 가야 합니다.', 47187),
(66675, 'koKR', '위상의 힘', '모체 서약의 돌에서 알렉스트라자를 도와야 합니다.', '모체 서약의 돌은 티탄이 우리 용군단에 부여한 고대의 선물이다. 우리가 아는 내용이 사실이라면, 그 돌을 다시 활성화해서 우리에게 주어진 위상의 힘을 회복할 수 있겠지.\n\n결과가 어찌 될지 확신은 없지만, 조금이라도 효과가 있다면 시도하지 않을 수 없는 일이야.\n\n$n, 나를 도와준다면 정말 고맙겠군.', '', '', '', '', '', '', 47187),
(66671, 'koKR', '두멧골로 통하는 길', '하늘빛 평원의 두멧골 야영지에서 매디 스캐터샷을 만나야 합니다.', '당신은 강건하고 유능한 모험가인 것 같네요! 용비늘 원정대를 도와주시는 건 어떠세요?\n\n이런 멋진 황야 한 가운데에 저희가 아늑한 야영지를 마련했어요.\n\n저쪽으로 가시면 하실 수 있는 일이 아주 많을 거예요.\n\n제 동생 매디에게 말을 걸어보세요. 다 안내해 줄 겁니다.', '', '', '', '', '', '하늘빛 평원의 두멧골 야영지에서 매디 스캐터샷을 만나야 합니다.', 47187),
(66660, 'koKR', '신호에 맞춰... 준비하시고...', '과거에서 안단테노르무와 시아제라텔과 합류해야 합니다.', '<멍한 눈으로 바라보는 노즈도르무>\n\n그들은 더 깊이 추락할수록 더욱 빨리 움직이는군. 저들은 시간의 장막에 구멍을 내어 거대한 파장을 내보내고 있다. 너는 신속히 움직여야 그들을 잡을 수 있을 것이야.\n\n<다시 또렷한 눈빛으로 당신에게 시선을 돌리는 노즈도르무>\n\n내 시간여행단을 보내 네가 시간의 길을 지나서 신속히 나아갈 수 있도록 돕겠다. 시간의 주민들과는 마찰을 피하고 크로미를 찾을 때까지 쉬지 말고 나아가라!\n\n가라. 우리에게는 시간이 얼마 없다.', '', '', '', '', '', '', 47187),
(66658, 'koKR', '노쿠드 공격대: 찾은 사람이 임자', '노쿠드 공격대에 입장해 티라와 마루크를 처치한 후 두 사람의 무기를 티라카이 쿠르간에 안치해야 합니다.', '티라 님과 마루크 님의 무기는 우리가 무덤소환사 아르반을 저지하기 전에 일찌감치 빼돌려진 모양입니다. 가장 위대한 선조들이 이 평야에서... 노쿠드를 위해 다시 싸우게 되겠군요.\n\n노쿠드 공격대로 가세요. 마루크 님과 티라 님을 찾아야 합니다. 두 분을 제압하고 무기를 티라카이 무덤으로 가져와 주세요. 더 쉽게 지켜드릴 수 있는 곳에서, 다시 안식에 들어 마땅한 영예를 누릴 수 있게 하겠습니다.', '', '', '', '', '', '', 47187),
(66657, 'koKR', '그대로 쉬고 계세요!', '중앙 쿠르간에 들어가 무덤소환사 아르반을 처치해야 합니다.', '무덤소환사 아르반은 여전히 가장 큰 쿠르간에 숨어 있습니다. 우리 마루크의 시조들께서 잠들어 계신 곳이죠. 놈이 마루크 님과 티라 님을 되살리기 전에 저지해야 합니다!', '', '', '', '', '', '', 47187),
(66656, 'koKR', '진정한 영면', '각 저명한 켄타우로스 영혼을 쓰러뜨리고 조리그의 안식의 토템을 사용해 해방시켜야 합니다.', '선조들께서 어두운 마법에 의해 붙잡히셨습니다. 정도로 돌아오기 전까지는 싸우려 하실 거예요. 우켈이 우리 역사상 제일 위대했던 전사와 사냥꾼들을 되살린 것 같아, 그분들을 막는 게 쉽진 않을 것 같군요.\n\n제가 최대한 도와드리겠습니다. 어머니의 창을 다시 쓸 날이 온 것 같습니다.\n\n선조들을 쓰러뜨린 후, 제가 만든 이 토템으로 길을 잃은 영혼들을 쿠르간으로 돌려보내 주세요.', '', '', '', '', '', '', 47187),
(66655, 'koKR', '비강령술의 재료', '되살아난 동료에게서 온전한 해골 $1oa개를, 신성한 토양 덩어리 $2oa개를 모아야 합니다.', '영혼들을 우켈의 손아귀에서 해방한다고 한들 무덤으로 돌아가는 길을 찾는 데 어려움을 겪으실 겁니다.\n\n우켈은 살아생전 선조들을 이끌고 지켜주었던 동물 동료들도 살려내고 있습니다. \n\n그 동물의 해골과 적들이 어지럽혀 놓은 신성한 토양을 가져다 주세요. 그 재료들을 활용하면 선조들께 평화를 돌려드릴 수 있을 겁니다.', '', '', '', '', '', '영원한 쿠르간 깊은 곳에서 조리그를 만나야 합니다.', 47187),
(66654, 'koKR', '신성 모독의 파멸자', '노쿠드 모독자와 우켈 무덤훼방꾼을 처치한 후 이들이 훔친 선조의 무기를 회수해야 합니다.', '제 어머니는 영웅이셨습니다. 노예 신세가 아니라... 평화와 안식을 누릴 자격이 있는 분입니다! 우리의 영웅들 중 누구도 그런 꼴을 당해선 안 돼요.\n\n이 모독의 대가를 치르게 해야 합니다. 또, 선조님들이 본인의 무기와 함께 다시 영예롭게 쉬실 수 있게 해드려야 하고요. 일단 무기를 회수하는 것부터 시작하죠.', '', '', '', '', '', '영원한 쿠르간 깊은 곳에서 조리그를 만나야 합니다.', 47187),
(66652, 'koKR', '다시 치유사의 품으로', '주변 언덕에서 우켈 의식을 조사해야 합니다.', '여기서 놈들이 정확히 뭘 하고 있는지는 안 보이지만, 쿠르간을 더럽히고 있는 건 아닌지 걱정입니다.\n\n가장 가까운 무덤으로 가셔서 의식을 저지해 주십시오. \n\n그리고 놈들 꿍꿍이를 파악할 만한 단서가 되는 건 뭐든 가져오세요.', '', '', '', '', '', '조리그에게 창을 돌려줘야 합니다.', 47187),
(66651, 'koKR', '못된 노쿠드', '영원한 쿠르간에서 수습생 조리그를 만나야 합니다.', '노쿠드와 우켈 부족이 영원한 쿠르간을 장악했네. 악의가 있는 건 분명하다. 우리의 가장 존경받는 선조들께서 영면에 든 곳이기 때문이지.\n\n조사차 수습생 조리그를 보냈지만 아직까지 돌아오질 않았어.\n\n능력은 뛰어나지만, 자신감이 부족한 친구라네. 부디 그를 도와 이 부정한 만행을 막아주게나!', '', '', '', '', '', '', 47187),
(66650, 'koKR', '운명의 피날레', '서로 다른 운명의 공격대 우두머리 $1oa명을 처치해야 합니다.', '<당신은 차분해집니다. 이 경험은 여전히 불가사의하지만, 더는 낯설지 않습니다. 당신은 이 시련을 모두 명확히 이해하고 숙달하게 되는 궁극의 보상을 받았습니다.>\n\n<맑은 정신과 확신에 찬 움직임으로 당신은 마지막으로 앞을 향해 나아갑니다. 당신의 운명을 손수 만들고, 그 운명이 당신의 눈 앞에 펼쳐지는 것을 목도하세요.>', '', '', '', '', '', '', 47187),
(66647, 'koKR', '흐트러진 정기', '정기의 집중을 회수해야 합니다.', '칼렉고스와 난 산 위에서 포화를 받고 있소. 원시술사들이 가차없는 건 둘째치고 머릿수가 무한하게 느껴질 정도로 많더구려.\n\n우리 둘 다 놈들 병력에 압도당하는 건 시간문제요.\n\n하지만 계획이 있소.\n\n산기슭에 루빈 스톤그라인더라는 심기 불편한 오크 친구가 하나 있을 거요. 키린 토와 여러 차례 접전을 벌인 전적이 있지.\n\n그녀가 정기를 흡수해 방출 방향을 바꿀 수 있는 장치를 갖고 있다오. \n\n장치를 받아 내게로 오시오.', '', '루빈은 강력한 정기 집중 장치의 소유자입니다.', '루빈 스톤그라인더', '', '', '바크스로스 산맥에 깊이 들어가 카드가의 투영을 만나야 합니다.', 47187),
(66646, 'koKR', '골칫거리 진압', '시간의 정령을 처치해야 합니다.', '저 무한의 용군단 놈들! 시간의 마력을 공격적으로 바꿔버리다니. 이건 좋지 않소.\n\n크로노르무 대사님을 지원하면서 마주치는 시간의 정령들은 모두 처치하시오. 난 여기 남아서 그분이 이터누스를 붙잡아두는 걸 돕겠소.', '', '', '', '', '', '', 47187),
(66633, 'koKR', '표식 남기기', '자라딘 시체 $1oa구에 검은용 깃발을 꽂아야 합니다.', '자라딘은 검은용군단이 끝났다고 믿습니다. 이곳에서 래시온이 지니는 입지나 권력에 대해서도 전혀 두려워하거나 존중하는 기색이 없습니다.\n\n흑요석의 용군단이 그 어느 때보다도 강한 모습으로 돌아왔다는 걸 보여줘야 합니다.\n\n자라딘들을 처치하고 그 시체에 표식을 남기십시오. 이곳의 지도자가 누구인지 똑똑히 기억할 수 있도록 말입니다.', '', '', '', '', '', '', 47187),
(66622, 'koKR', '방황하는 도구', '방황하는 도구 $1oa개를 구출해야 합니다.', '정말 최악입니다! 제가 *딸꾹* 안 보는 사이에 도구들이 도망이라도 갔나 봅니다. 낯선 곳에서 *딸꾹* 의지할 곳도 없이 두려움에 떨고 있을 녀석들을 생각하니 가슴이 찢어집니다!\n\n도구들을 찾아와 주시겠습니까? 인내심을 갖고 *딸꾹* 천천히 녀석들을 진정시키면 분명히 마음을 열어줄 겁니다!', '', '', '', '', '', '', 47187),
(66612, 'koKR', '위기의 게지기', '절벽이슬 야영지에서 골록 $1oa마리를 처치해야 합니다.', '게들이 위험합니다!\n\n이번에 유난히 힘든 시기를 보낸 무리가 있습니다. 원래 살던 서식지가 원시술사들에게 파괴당하는 바람에, 골록만 있는 이곳으로 게들을 데려왔습니다!\n\n이곳이라면 안전할 줄 알았는데, 게를 향한 골록의 적개심만 커져서 아예 싹을 밟아놓으려고 들지 뭡니까!\n\n게들이 피신할 수 있게 골록을 좀 처리해 주셨으면 합니다!', '', '', '', '', '', '', 47187),
(66598, 'koKR', '나이트본의 비결', '하늘빛 평원의 안토니다스 야영지에서 왜곡술사 델란드라를 찾아야 합니다.', '고대 문자는 내 취향이 아니야. 하지만...\n\n<테일린이 소지품을 뒤져 지도 한 장을 꺼냅니다. 지도 상단에 안토니다스라는 이름이 나타납니다. 크고 삐뚤빼뚤한 필체로 쓰여 있습니다.>\n\n아하! 여기 있었구먼!\n\n길이 좀 멀긴 하네만... 여기로 가면 늙은 마법쟁이들을 몇 명 찾을 수 있을 걸세. \n\n<지도의 한 지점을 가리키는 테일린>\n\n그치들이라면 뭔가 말해줄 수 있을지도 모르지.', '', '', '', '', '', '', 47187),
(66597, 'koKR', '오래된 돌', '고대의 새김 기둥을 살펴봐야 합니다.', '우리는 이 섬에서 우연히... 뭐라고 말하면 좋을까. 고대 기술의 편린을 발견했네. 이 돌을 말하는 걸세.\n\n문제는 이게 정확히 무슨 기술인지 알 수가 없다는 거야. 솔직히 말해 이해도 잘 되지 않아.\n\n그래서 몇몇 친구에게 도와줄 수 있는지 연락을 넣어뒀네. 답신을 기다리는 동안 한번 살펴봐주지 않겠나? 자네라면 또 사용법을 알아낼 수 있을지도 모르지.', '', '', '', '', '', '', 47187),
(66596, 'koKR', '바람에 실려 오는 속삭임', '스톰윈드에 있는 대마법사 카드가와 대화해야 합니다.', '반갑소, $p. 오래간만이오. 여유롭게 회포를 풀 시간이 있었으면 좋으련만.\n\n보다시피 새로운 사실을... 아니지. 불길한... 그래, 오랜 친구와 얘기를 나누다 불길한 사실을 접해서 말이외다.\n\n진실이란 때때로 깨달음과 불길함이 뒤섞여 나타나기 마련이라오.\n\n지금까지 알아낸 것들을 말해주리다.', '', '', '', '', '', '', 47187),
(66595, 'koKR', '잠든 발견', '깨어나는 해안의 루비비늘 전초기지에 있는 테일린 다크앤빌에게 전언을 전달해야 합니다.', '<이 이상한 양피지가 어떻게 가방에 들어왔는지는 중요하지 않습니다. 중요한 건 전언의 내용이죠.>\n\n용비늘 원정대원 여러분께.\n\n여러분의 도움이 필요합니다! 지금 바로 루비비늘 전초기지로 보고해 주십시오!\n\n<서명을 확인하려고 시선을 옮기는 바로 그 순간, 쪽지에 새겨진 마법 글씨가 하얗고 푸른빛이 감도는 가루를 구름처럼 흩뿌리며 사라집니다. 결국 텅 빈 백지와 달콤한 꽃향기만이 남아 코를 간지럽힙니다.>', '', '', '', '', '', '', 47187),
(66589, 'koKR', '원정대 조율하기', '스톰윈드에서 탐험가와 장인, 학자를 영입해 용의 섬 원정대를 편성해야 합니다.', '전 토디라고 해요. 용비늘 원정대의 이름으로 활기찬 모험가들을 이끄는 직책을 맡게 됐죠. 아무튼 자세한 설명은 나중에 해드릴게요. 일단은 대원을 모으는 데 집중하자고요.\n\n자고로 제대로 된 원정대는 온갖 배경에서 온 구성원으로 이뤄지기 마련이죠. 학자, 장인, 탐험가가 필요해요.\n\n자, 뭘 가만히 서 있으세요? 얼른 가서 사람들 모으셔야죠!', '', '', '', '', '', '스톰윈드 항구에 있는 토디 위스커스에게 성과를 보고해야 합니다.', 47187),
(66586, 'koKR', '티르의 유산: 과거의 비밀', '황야의 땅에 있는 울다만에 들어가 소란의 원인을 알아내야 합니다.', '라자게스가 다른 현신들을 해방하지 못하게 저지하려면 위상들의 힘을 복원해야 합니다.\n\n하지만 쉬운 일은 아닙니다. 티탄과는 접촉이 불가능하고, 수호자 티르는 한참 전에 세상을 떠났으니 말이지요.\n\n그래서 알렉스트라자 여왕님이 제안한 계획이 있습니다. 황야의 땅에 울다만이란 티탄 시설이 있습니다. 여왕께서는 티르의 동료들이 울다만 깊은 곳에 그의 기억이 담긴 원반을 보관해뒀을 거라 생각하고 계십니다.\n \n동료를 모아 울다만으로 출발하십시오. 원반을 찾아 용의 여왕께 전달해 주셨으면 합니다. 티르의 지식으로 위상에게 힘을 되찾아줄 수 있기를 빌죠.', '', '', '', '', '', '', 47187),
(66582, 'koKR', '힘 조달', '안토니다스 야영지의 왜곡술사 델란드라를 위해 그릇에 마력을 모아야 합니다.', '사실 다른 때 같았으면 마력 수급은 문제도 안 됐을 겁니다. 그런데 지금 필요한 마력은 그 양도 막대하거니와 불안정하기까지 합니다. 이 마력 깃든 그릇 정도면 안전하게 옮길 수 있을 겁니다.\n\n이곳에서 남서쪽으로 가면 마력에 물든 생명체들이 출몰합니다. 그 생명체들 체내에는 기이한 마력이 담겨 있는데, 강력하면서도 불안정하기 이를 데 없지요.\n\n마력을 모아 가져오십시오. 이 여정을 마무리하는 건 그다음입니다.', '', '', '', '', '', '', 47187),
(66578, 'koKR', 'A > B Reward Test (Low Health)', '', '', '', '', '', '', '', '', 47187),
(66577, 'koKR', '위상의 초대', '래시온과 대화하여 의회 회의에 대해 알아봐야 합니다.', '아, $p. 절묘한 등장이야!\n\n지금 막 투랄리온 총사령관을 비롯한 동맹과 얘기를 끝내고 오는 길이다. 다들 위상들의 용의 섬 초대에 응하기로 결정했어. \n\n당연히 따라올 생각이겠지? 네가 없으면 허전할 것 같거든!\n\n그리고 도시에 처음 보는 얼굴들이 나타난 것쯤은 알아차렸겠지. 드랙티르라고 날개 달린 친구들 말이야. 인연을 맺은 지는 얼마 안 됐지만 날 곧잘 따르더군.\n\n아, 내가 너무 생각이 짧았군. 우선 대화부터 나눠보도록 해.', '', '', '', '', '', '', 47187),
(66575, 'koKR', '아이템 퀘스트 NPC: 약병', '길잡이 알비에게 물품을 반납해야 합니다.', '<타라세크 보관함의 잡동사니들 틈새에 묻혀 있던 이 이상한 약병에는 끈적하고 거품이 나는 액체가 들어있습니다.>\n\n<알비에게 이 약병을 보여주는 것이 좋겠습니다.>', '', '', '', '', '', '', 47187),
(66559, 'koKR', '야영지 귀환', '고래잡이의 귀퉁이에 있는 검사관 로우에게 가야 합니다.', '모르디건이 마치 귀신 들린 드워프처럼 저기서 뛰쳐나가는 걸 봤습니다. 제가 얼른 쫓아가서 모르디건이 무사히 돌아올 수 있도록 하겠습니다.\n\n절벽을 따라가다 폭포에서 아래로 뛰어내리면 골록들을 더 자극하는 일도 피할 수 있을 겁니다. \n\n야영지에서 다시 뵙지요.', '', '', '', '', '', '', 47187),
(66558, 'koKR', '로위', '로위를 찾아야 합니다.', '담쟁이가죽에서 복귀한 사람들과 함께 오신 분이시죠? 그럼 카키아타가 어떻게 되었는지 아시겠군요...\n\n브레나와 다른 이들이 카키아타 없이 돌아온 이후로 그 아들 로위가 정말 괴로워하고 있어요. 로위가 돌아올지 모르니 저는 여기서 기다리려 하는데, 혹시 로위를 찾아봐 주시겠어요?\n\n아마 동쪽의 얼음 동굴로 뛰쳐나가지 않았을까 싶네요. 동굴 속 예티와 싸운다는 말을 한 것 같아요!', '', '', '', '', '', '', 47187),
(66557, 'koKR', '학문적 구면', '두멧골 야영지에서 또 다른 펄볼그 언어 전문가를 찾아야 합니다.', '펄볼그 중에서도 겨울가죽 녀석들은 저조차도 정말 비집고 들어가는 게 쉽지 않습니다.\n\n두멧골 야영지에 있는 제 동료들한테 부탁해보면 도움을 받을 수 있을지도 모르겠습니다. 거기는 펄볼그의 다른 부족들도 있다고 하니, 각 방언을 서로 비교해보면 뭔가 단서를 찾을 수 있을 겁니다.', '', '', '', '', '', '', 47187),
(66556, 'koKR', '얼음 동굴이 진짜 있다니까요', '동굴을 조사해야 합니다.', '당신의 억양은 정말 형편없으시군요. 일만 년 동안 고립되어서 언어적 교류도 없었으니 어디 소통이 쉽겠습니까마는, 그래도 최소한 전체적인 의미는 알아들을 수 있겠습니다.\n\n듣자니 계속 반복하시는 문구가 \"사나운 동굴 바람\" 아니면 \"지독한 폭풍 동굴\" 같습니다. 아니면 그자들도 빨래를 목요일에 하느냐는 얘기였습니까?\n\n무슨 노움어를 배우는 것도 아니고, 이러다 먹은 게 체할 것 같습니다. 어쨌든 동굴 이야기는 확실한 듯하니, 거기서부터 출발해 봅시다.', '', '', '', '', '', '', 47187),
(66555, 'koKR', '참을성 있는 기다림', '소노바의 통역을 도와야 합니다.', '저쪽은 아주 난장판입니다. 마치 폭풍이 휩쓸고 지나가며 다 박살을 내놓은 듯합니다. 저들이 왜 무장을 하는지는 이해가 됩니다만 그렇다고 저희를 공격하는 이유는 뭡니까?\n\n대화로 해결해도 됐을 텐데, 겨울가죽들은 입을 꾹 다물고 다른 펄볼그들조차와도 말을 섞지 않는 것으로 유명하다고 합니다. 펄볼그인이라고 해야 하나요? 무슨 말인지 아시겠죠?\n\n겨울가죽의 마을을 확인하실 때도 녀석들과 살갑게 대화할 기회는 아마 없으셨겠지요?', '', '', '', '', '', '', 47187),
(66554, 'koKR', '공격적인 자기 방어', '겨울가죽 펄볼그 $1oa마리를 처치해야 합니다.', '겨울가죽 모두 동요한 상태라 당신이 이곳저곳 들쑤시는 걸 썩 반기지는 않을 겁니다.\n\n녀석들이 수작을 부리기 시작하면 적극적으로 방어하십시오. 따끔한 맛을 보여주면 놈들도 정신을 번쩍 차릴 겁니다.\n\n다만 누구도 해치진 말아 주시길. 모험가적 기질이 있는 분들은 가끔 욱할 때가 있으셔서 말입니다.', '', '', '', '', '', '', 47187),
(66553, 'koKR', '공동', '겨울가죽 공동에서 단서 $1oa개를 밝혀내야 합니다.', '겨울가죽은 펄볼그 중에서도 특별한 사례에 속합니다.\n\n약간은 \"고립주의\" 성향이 있다고나 할까요. 마치 공동에서 살아가는 유령과도 같습니다. 모피의 외형 특성상 눈에 무척이나 잘 녹아들지요.\n\n우세타는 자기들끼리 생활하는 편이었는데, 이젠 대놓고 공격성을 드러내고 있습니다. 별다른 도발도 없었는데 우리 야영지를 공격하기까지 했습니다!\n\n무슨 문제가 생겨 그 정도로 내몰린 게 분명합니다. 제가 물어볼 순 없으니... 아직은. 용사님이 그자들 마을에 가서 단서를 찾아봐 주시겠습니까?', '', '', '', '', '', '', 47187),
(66550, 'koKR', '[PH] More Storms!', '', '', '', '', '', '', '', '', 47187),
(66549, 'koKR', '깨어나는 해안 대경주', '', '경로의 통과 지점 고리를 통과해야 합니다.', '', '', '', '', '', '', 47187),
(66534, 'koKR', '잠깐의 휴가', '오그리마를 둘러봐야 합니다.', '우리가 도착한 걸 모두가 알게 된 것 같군. 어쩌면 이 사람들에게 희망이 있을지 모른다.\n\n난 에비시안 님과 호드 지도자를 따라 매끄럽게 문제를 해결해보겠다. 그대는 정찰에 나서도록.\n\n이곳의 지형을 파악해두란 얘기다. 한동안은 머물게 될 테니까.\n\n일이 다 끝나면 돌아와라. 그때쯤 지루한 일은 다 끝나 있을 거다.', '', '', '', '', '', '', 47187),
(66529, 'koKR', '천 마디 말보다...', '원시용의 뼈 주위에서 더비시안의 사진을 촬영해야 합니다.', '이번에 정말 많은 걸 배웠네요. 그래서 그런가? 빈손으로 떠나면 영 섭섭할 것 같아요. \n\n이 원시용 화석 옆에서 사진을 찍고 싶은데 도와주시겠어요?', '', '', '', '', '', '', 47187),
(66528, 'koKR', '무관의 왕', '원시용의 뼈를 조사해야 합니다.', '이 고대의 원시용은 생전에 아주 멋졌을 거예요. 야생의 보존지 역사상 가장 큰 개체였을지도 모르죠.\n\n하지만 이 정도 정보로는 부족해요. 뼈를 자세히 관찰하면 최후의 순간을 보다 세세하게 알 수 있을지도 모르겠네요.', '', '', '', '', '', '', 47187),
(66527, 'koKR', '전문 촬영술', '수직 고양 장치를 사용해 잠자는 원시용의 사진을 촬영해야 합니다.', '용사님처럼 유능한 사진가를 훈련시키긴 처음이네요... 게다가 아직 목숨도 붙어 있고요. 사진가란 게 참 위험한 업종이랍니다.\n\n위험 얘기가 나와서 그런데, 우리의 마지막 목표는 어떤 덩치 큰 원시용이에요. 이 보존지의 차기 최상위 포식자로 유력하죠. 어디 밀착 사진을 한번 찍어보자고요!', '', '', '', '', '', '', 47187),
(66526, 'koKR', '자연 보존', '사로잡힌 새끼 원시용이나 사로잡힌 원시비룡 5마리를 구출해야 합니다.', '야생의 보존지는 원시용이 자생할 수 있는 몇 안 되는 곳이에요. 그런데 이제는 원시술사들이 실험을 위해 새끼 원시용과 원시비룡들을 잡아가면서, 부화장을 어지럽히고 있어요.\n\n자비는 필요 없어요. 원시술사 병력을 찾아서 소탕해 주세요. 원시용의 멸종을 막으려면 이들을 멈춰야만 해요.', '', '', '', '', '', '', 47187),
(66525, 'koKR', '중급 촬영술', '주입된 원시용 알과 주입된 원시비룡의 사진을 촬영해야 합니다.', '자, 사진의 세계에 입문해서 맛보기는 충분히 하셨으니, 좀 더 매콤한 과제로 넘어가 볼까요?\n\n뒤에 있는 지역에서 근사한 원시비룡이 하늘을 날아다니고 있더군요. 아름다운 뿔에, 전기가 흐르는 비늘까지! 십중팔구 저 원시술사들의 작품이겠지만, 어쨌든 예술은 예술이죠!\n\n그 원시비룡하고 알 사진을 찍어보세요. 좋은 구도로 찍으려면 등반을 좀 해야 할 거예요!', '', '', '', '', '', '', 47187),
(66524, 'koKR', '초보 촬영술', '원시용을 촬영해야 합니다.', '그래, 저처럼 노련한 분류학자가 되고 싶으시다고요? 제대로 찾아오셨네요! \n\n야생의 보존지는 발견하고 분류해야 할 지식이 넘쳐나는 보고죠! 그래서 그걸 어떻게 하냐고요? 바로 이 유용한 분류기 3000 용의 섬 한정판으로 하는 거죠. 이번에는 동작 포착 기능을 개선했어요!\n\n경험을 쌓을 겸 원시용 알, 비행을 배우는 새끼용, 사냥 중인 원시비룡 사진을 촬영해 오세요. 여기서 서쪽으로 가면 거대한 원시용 해골이 하나 나오는데, 거기서 뵙는 걸로 하죠. 사진 평가도 해드릴게요.', '', '', '', '', '', '', 47187),
(66523, 'koKR', '제련소 관리', '안토니다스 야영지 주위에서 용뿔두꺼비 가죽 조각, 휴면 중인 잿불방울, 얼어붙은 핵을 수집해 제련소에 사용할 재료를 모아야 합니다.', '교관을 찾고 계신다면 죄송하지만... 아, 수습생이 아니시군요! 죄송합니다. 제 소개를 하죠. \n\n저는 관리인 베르나고스입니다. 이 폐허를 관리하고 있죠. 정확히는 이 일터에 옛날의 위용을 되찾아주느라 매우 지쳐가고 있는 게 맞겠습니다만... \n\n혹시 도움을 청해도 될까요? 필요한 재료는 다 근처에 있습니다. 얼음 정령 핵, 잿불방울, 뿔두꺼비 가죽...\n\n다 어렵지 않게 구할 수 있는 일반적인 물건입니다. 어떻습니까?', '', '', '', '', '', '안토니다스 야영지에 있는 관리인 베르나고스에게 가야 합니다.', 47187),
(66517, 'koKR', '새로운 무기 조달처', '용의 섬의 분리된 불길에게서 온전한 드랙티르 무기 25개를 입수한 후 마루크 켄타우로스 더렐에게 가져가야 합니다.', '분리된 불길 놈들이 우리 경계에 심각한 위협이 되고 있어. 위협적인 병기들을 가지고 있더군. 병기를 좀 구해다 주게. 연구해서 약점을 알아내는 건 물론이고, 우리 수중에 새로운 무기가 생기기도 할테니.\n\n난 너를 믿는다 이방인. 이 일을 잘 끝내주면 대장기술을 가르쳐주지.', '', '', '', '', '', '', 47187),
(66516, 'koKR', '평범한 보석? 그럴 리 없습니다!', '용의 섬의 자라딘에게서 평범한 보석 25개를 입수한 후, 용비늘 원정대의 노클린 쿼크코일에게 가져가야 합니다.', '이건 낭비라고요. 이 땅의 자라딘은 강력한 보석을 따분한 공예품 장식용으로나 쓰고 있으니! 보석은 쓰임새가 정말 많아요. 망원경, 거울, 집중점을 만들 수 있죠. 또 보석의 마력이야 말해 무엇하겠어요.\n\n이 상황을 바로잡아야 해요, 탐험가 님. 자라딘에게서 보석을 구해 제게 가져다주세요. 제가 아주 요긴하게 쓰겠다고 약속할게요! 하지만 조심하세요, 자라딘들 중에는 사나운 전사가 많아요.', '', '', '', '', '', '', 47187),
(66513, 'koKR', '잠깐의 휴가', '스톰윈드를 탐험해야 합니다.', '이제 우리 보금자리가 될 이 도시를 자세히 알아보는 게 좋겠다. 정찰 임무를 나간다고 생각해라.\n\n가서 이 도시에 뭐가 있는지 살펴봐라. 난 래시온 님을 따라가 최대한 도와드려야겠다.\n\n그렇지만 현지인들을 너무 놀라게 하지는 마라. 그들은 용들이 돌아다니는 모습이 익숙하지 않을 테니.\n\n이 땅을 둘러보고 나면 우리와 다시 합류해라.', '', '', '', '', '', '', 47187),
(66511, 'koKR', '이스카라 투스카르 영예', '이스카라에서 무리크와 대화해야 합니다.', '용사님은 우리 공동체에 없어선 안 될 중요한 인물이라는 걸 몇 번이고 반복해서 증명해주고 계십니다. \n\n우리의 유대를 기념하는 차원에서 몇 가지 보급품을 준비했으니, 이스카라에서 절 찾아주세요.', '', '', '', '', '', '', 47187),
(66509, 'koKR', '피해망상 1', '', '내 불안을 잠재우는 데에 쓸 꽃을 아구라가 따오라고 해서 이곳에 왔는데, 괴물들이 돌아다니는 통에 불안해 죽겠군.', '', '', '', '', '', '', 47187),
(66504, 'koKR', '결정화된 마나 조각', '라토스에게 수정을 가져가야 합니다.', '<작고 파란 수정을 만지자 가볍게 진동하더니, 멀리서 노래와 같은 나지막한 곡조가 흘러나옵니다. 당신에게도 머릿속에서 부드러운 선율처럼 메아리치는 노랫말이 들립니다.>\n\n라토스가 본다면 흥미로워할 것 같습니다.', '', '', '', '', '', '라토스에게 수정을 가져가야 합니다.', 47187),
(66503, 'koKR', '다른 이들을 위하여', '안토니다스 야영지에서 부서진 탑 꼭대기를 조사해야 합니다.', '저희 수습생들이 당신을 꾀어 뭔가 저질렀나 보군요.\n\n<싱긋 웃는 노리코>\n\n수습생 녀석들과 당신이 뭔가를 발견한 것 같습니다. 이 폐허에 숨겨진 목적이 서서히 저희에게 모습을 드러내고 있어요. 이는 단순히 잊힌 그림이나 음악이 아닙니다...\n\n탑의 꼭대기에서 무언가가 저희를 부르고 있습니다.\n\n벌써 눈빛에 호기심이 감도는군요. 자, 허락해 드릴 테니 가서 확인해보셔도 됩니다.\n\n가서 한번 살펴보시지요.', '', '', '', '', '', '안토니다스 야영지에 있는 노리코에게 가야 합니다.', 47187),
(66500, 'koKR', '보는 법', '안토니다스 야영지에서 고대의 그림을 찾아야 합니다.', '저희 아무것도 안 했어요! 진짜 가만히 있었다니까요!\n\n아니, 잠깐만...\n\n왠지 높으신 $r 같은데... 비밀 하나 알려드릴까요?\n\n이 폐허에 마법 예술 작품이 있더라고요!\n\n<자신만만하게 가슴을 쭉 펴는 스크럼피>\n\n작품을 보는 방법을 알려드리죠! 대신... 노리코 님에게는 비밀입니다.', '', '', '', '', '', '', 47187),
(66493, 'koKR', '배달이요!', '안토니다스 야영지에서 키린 토 수습생에게 소포를 던져줘야 합니다.', '<차원문 반대편에서 작게 웅얼거리는 목소리가 들려옵니다.>\n\n저기요! 그래요, 당신! \n\n현장에 나간 수습생들에게 전달할 우편이 있어요. 보급품, 선물... 하여간 마법 급사로 주문한 물품들 말이에요. \n\n요즘 흔히 볼 수 있는 광경이죠.\n\n혹시 저 좀 도와주실 수 있을까요?', '', '', '', '', '', '', 47187),
(66489, 'koKR', '방어 태세 돌입', '안토니다스 야영지에 있는 하늘빛 수호병을 강화해야 합니다.', '원시술사의 공격이 코발트 전당 습격 계획에 무슨 영향이라도 주지 않을까 관리인 시네고스와 논의하던 중 좋은 생각이 떠올랐어요. \n\n<로브 품에서 마법봉을 꺼내는 셀레스트>\n\n이 마법봉을 드릴 테니 저들의 무기를 강화해 주세요!\n\n어떤 계열의 마법이든 괜찮아요.\n\n불이라면 딱 알맞을 것 같네요...', '', '', '', '', '', '', 47187),
(66488, 'koKR', '현상 수배: 프리젤루스', '안토니다스 야영지에서 프리젤루스를 처치해야 합니다.', '<글귀에서 은은한 푸른색 빛이 뿜어져 나옵니다.>\n\n과거 말리고스가 아꼈던 장난감 정령, 프리젤루스가 주인의 방치 속에서 삐뚤어지고 말았습니다. \n\n한때 행복이 넘쳤던 이 서식지가 무너져 내리면서 이 버릇없고 쾌활했던 생명체도 이 땅을 좀먹는 악에 의해 뒤틀렸습니다.\n\n안전을 위해 무력화해 주시기 바랍니다.\n\n성공 시 관리인 시네고스에게 말씀하시면 됩니다.', '', '', '프리젤루스', '', '', '', 47187),
(66473, 'koKR', '깨어나는 대지', '겔리키르 전망대에서 태고의 분노와 태고의 우박을 처치해야 합니다.', '이 동굴에 있는 마귀들은 제가 감당하기에 역부족입니다.\n\n<힘겹게 기침을 내뱉는 샤르낙스>\n\n하지만 전 당신의 실력을 압니다.\n\n정령들이 완전한 잠재력을 개화하기 전에 처리해 주십시오. 티르홀드가 원시술사에게 함락당하는 일은 어떻게든 막아야 합니다!', '', '', '', '', '', '', 47187),
(66472, 'koKR', '원시의 목록', '원시술사 명령서 묶음을 겔리키르 전망대 다리에 있는 사령관 타데지우스에게 전달해야 합니다.', '차원문은 닫았고, 정령은 처리했고, 원시술사 저지도 끝났군요... 일단은 말입니다.\n\n<웃음을 터뜨리는 샤르낙스>\n\n우리가 못 하는 일이 이 세상에 있기나 할까요, $c님? 뭐. 두고 보면 알 수 있겠지요.\n\n계획서를 사령관님께 전해주십시오. 우리가 성과를 올린 걸 알면 기뻐하실 겁니다.', '', '', '', '', '', '겔리키르 전망대 다리에서 사령관 타데지우스와 대화해야 합니다.', 47187),
(66471, 'koKR', '훌륭한 계획', '겔리키르 전망대 상부 단상 주위에 있는 원시술사에게서 원시술사 명령서 $1oa개를 입수해야 합니다.', '사령관께서는 제게 전진 기지를 설치하고 저항 세력을 처리하라는 명령을 내리셨습니다. 그렇게 잡초를 다 뽑고 나니 무언가 이상한 게 눈에 들어오기 시작하더군요.\n\n<긴 한숨을 내쉬는 샤르낙스>\n\n원시술사들이 티르홀드 이야기를 하고 있었습니다.\n\n심문에 특출난 재주라도 있으면 모르겠지만, 놈들의 계획을 알아내 주셨으면 합니다.', '', '', '', '', '', '겔리키르 전망대에 있는 동굴 바깥에서 샤르낙스를 만나야 합니다.', 47187),
(66470, 'koKR', '앞으로 전진', '안개에 닿은 차원석, 대지 차원석, 얼음벼림 차원석을 획득한 후 원소 차원문 $7oa개를 닫아야 합니다.', '<턱을 긁는 샤르낙스>\n\n사령관님이 옳았습니다. 원시술사들이 정령 세계에서 지원군을 불러들이고 있습니다.\n\n<조소를 흘리는 샤르낙스>\n\n저것들 통로에 무슨 일이라도 생기면 참 안타깝지 않겠습니까, $c님?', '', '', '', '', '', '겔리키르 전망대에 있는 동굴 바깥에서 샤르낙스를 만나야 합니다.', 47187),
(66468, 'koKR', '한때 우리의 것', '겔리키르 전망대를 점유한 원시술사를 처치해야 합니다.', '<당신이 다가가자 코웃음을 치는 타데지우스>\n\n나설 게 아니면 얌전히 옆으로 비키시오, $c|1이여;여;.\n\n나는 저 앞 원시술사 놈들에게 훌륭한 병사를 수없이 잃었소.\n\n저들의 계략을 대략 짐작은 하고 있소만, 적을 몰아내고 부하들을 구출하는 게 우선이오.', '', '', '', '', '', '겔리키르 전망대에서 샤르낙스와 대화해야 합니다.', 47187),
(66467, 'koKR', '예술은 곧 인생의 모방', '상급 맹독새싹을 처치해야 합니다.', '지난번에 이 동굴을 찾아왔을 때는 끈적한 독성 수액을 뚝뚝 떨어뜨리는 거대한 꽃의 그림을 그렸습니다. 그림도 워낙 잘 그려졌던 터라 잊으려 해도 잊을 수가 없습니다.\n\n타라세크들의 창에 묻은 독이 바로 그 꽃의 수액일 거라고 저는 확신합니다. 그 독으로 독살 무기를 만들기 시작한 것이 틀림없습니다.\n\n정말 아름다운 꽃인지라... 생명을 거두기에 너무 아까운 것은 사실입니다. 하지만 타라세크들이 독을 모아가도록 내버려 둘 수는 없는 노릇이지요. $n, 그 꽃을 처치해서 이 상황을 종결시켜 주시기 바랍니다.', '', '', '상급 맹독새싹', '', '', '', 47187),
(66465, 'koKR', '은닉처와 개방', '독 묻은 창 보관함 $1oa개를 파괴해야 합니다.', '타라세크들이 우두머리를 잃기는 했지만, 놈들은 좋은 말로 부탁한다고 창끝에 독을 바르지 않을 녀석들이 아니죠. 단 한 명의 무고한 여행자도 이렇게 위험한 무기에 노출되도록 내버려 둘 수는 없습니다.\n\n독 바른 창을 모두 파괴해야 합니다. 잿불이빨들이 웅덩이 근처에 무기를 은닉해 두지 않았다면 아마 독을 얻는 출처 근처에다 보관해 두었을 겁니다.\n\n제 부주의로 인해 더 이상의 희생자가 발생해서는 안 됩니다. 동굴로 가서 숨겨진 무기 보관함을 모두 파괴해 주세요.', '', '', '', '', '', '', 47187),
(66464, 'koKR', '야성의 전장: 사냥의 대가!', '사냥지배자 아마를 쓰러뜨러야 합니다.', '이거야. 자네하고 친구들이 기어코 사고를 치는군. 일인자 사냥지배자 아마와의 대결이라니. 그렇다고 벌써부터 자축하진 말라고. 아마는 피도 눈물도 없는 상대니까. 하여튼 그간 재밌었다고.\n \n자네들이 아마한테 죽으면 유품은 내가 가져도 되지?', '', '', '', '', '', '', 47187),
(66463, 'koKR', '야성의 전장: 정령의 복수혈전!', '원시술사 용사를 쓰러뜨려야 합니다.', '잠깐 출전 선수 좀 교체하려고 해. 웬 원시술사 거물이 자네랑 한판 붙어보고 싶다고 불쑥 참가 신청을 했어. 성난 정령 용이라니, 이걸 퇴짜 놓으면 내가 고블린이 아니지.\n\n자네 실력이면 괜찮을 거라고. 아니면... 뭐, 면책 서류에 서명한 거 기억하지?', '', '', '', '', '', '', 47187),
(66462, 'koKR', '야성의 전장: 꿈속에서 방황하는 자!', '쉬라스와 타레쉬를 쓰러뜨려야 합니다.', '그냥 하는 말인데. 용의 섬치고는 여기 와서 용을 많이 못 본 것 같아. 두 용족이 2인조로 대회 참가 신청을 한 것만 빼면 말이야.\n\n실력을 증명하고 싶어서 안달이 났어들. 아무쪼록 행운을 빈다고!', '', '', '', '', '', '', 47187),
(66461, 'koKR', '야성의 전장: 화산에서 온 적!', '평화강탈자 치카를 쓰러뜨려야 합니다.', '사실 이번 대회 첫 자원자 중 하나는 깨어나는 해안 출신이야. 덩치 큰 자라딘인데, 다른 동족들과 달리 시종일관 열 받아 있진 않더라고.\n\n그냥 싸움 그 자체를 즐기는 것 같아. 뭐, 나야 그럼 좋지.', '', '', '', '', '', '', 47187),
(66460, 'koKR', '야성의 전장: 부패의 군주!', '밤의 부패를 쓰러뜨려야 합니다.', '이번 시련의 장을 위해 지독하기로 둘째가라면 서러울 놀을 영입하려고 했는데 말이야... 협력자 중에 놀 언어를 구사할 줄 아는 친구가 없더라고.\n\n그 대신 녀석들이 만든 기괴한 창조물을 포획했지. 상대로 적당할 거야! 두 번째 경기를 시작하고 싶으면 말하라고!', '', '', '', '', '', '', 47187),
(66459, 'koKR', '야성의 전장: 늪지의 공포!', '마니트를 쓰러뜨려야 합니다.', '야성의 전장에 온 걸 환영한다고!\n\n원래는 전통 행사에 쓰이는 수련장인데, 켄타우로스들이 인심을 써줬지. 당장 사용할 시기가 아니라 한시적으로 무대를 꾸릴 수 있게 해줬거든. 힘을 시험하고 명예를 얻을 수 있다나.\n\n자네도 우승자의 칭호를 거머쥐고 싶지? 그럼 준비하고 말하라고. 첫 경기를 잡아줄 테니까.', '', '', '', '', '', '', 47187),
(66458, 'koKR', '티르의 유산: 과거의 비밀', '황야의 땅에 있는 울다만: 티르의 유산에 들어가 원반을 회수해야 합니다.', '라자게스가 다른 현신들을 해방하지 못하게 하려면 위상들의 힘을 복원해야 한다.\n\n근데 티탄이란 양반들은 다른 데 정신이 팔렸고, 수호자 티르는 한참 전에 세상을 떠났으니 참 공교롭기 짝이 없지.\n\n그래서 알렉스트라자 여왕이 제안한 계획이 있다. 황야의 땅 깊은 곳에 울다만이란 티탄 시설이 있어. 티르의 동료들이 그의 기억이 담긴 원반을 보관해뒀을지도 모른다는군.\n \n들려오는 얘기로는 트로그가 울다만을 점유했다고 한다. 동료를 모아 울다만으로 출발해라. 용의 여왕의 이름으로 원반을 확보하도록.', '', '', '', '', '', '', 47187),
(66457, 'koKR', '푸른 시대의 끝', '푸른비늘을 처치해야 합니다.', '제가 붙인 별명이긴 한데, 모든 잿불이빨은 푸른비늘이라는 덩치 큰 녀석을 따릅니다. 푸른비늘은 항상 호전적이기는 했지만, 지금껏 청소부들을 큰 도로로 내보낸 적은 없었어요. 영역 본능이 강하긴 하지만 대놓고 적대적이진 않았단 말이죠. 이젠 아니지만요.\n\n이렇게 사태가 심각해진 건 분명히 푸른비늘의 지시가 있었던 겁니다. 놈을 찾아서 없애야 해요.', '', '잿불이빨의 지도자입니다. 협상의 여지는 없다시피 합니다.', '푸른비늘', '', '', '', 47187),
(66456, 'koKR', '독의 색깔', '독 바른 창 8개를 모아야 합니다.', '제가 유능한 길잡이는 아닙니다만, 그래도 일을 허투루 하지는 않습니다. 제 몫을 할 줄 아는 길잡이라면 누구든 제대로 된 해독제를 만드는 법을 알죠. 다만 독이 있어야 해독제를 제대로 혼합할 수 있습니다.\n\n언니 말로는 자기를 공격했던 타라세크의 창끝에 독이 묻어 있었다고 합니다. 타라세크들을 찾아서 놈들의 창을 제게 가져다주세요. 제 직감이 맞는다면 창끝에 남아 있는 독의 잔여물로 해독제를 만들 수 있을 겁니다.\n\n아직 시간이 충분히 남았기를 바랄 뿐입니다.', '', '', '', '', '', '', 47187),
(66449, 'koKR', '손 떼놓기 작전', '위기에 처한 새끼용 $1oa마리를 구출하고 연소발톱 불사조 $2oa마리와 잿빛결속사 토르네차를 처치해야 합니다.', '칼라시 먼지결속사가 새끼용들을 사로잡으려 하고 있다. 놈들의 지도자가 극악무도한 어떤 목적을 위해 쓸 곳이 있는 모양이더군. 있어선 안 될 일이지!\n\n하지만 우리의 적은 자라딘만이 아니다. 불사조도 새끼용을 추적해 더 큰 위험이 되고 있다. \n\n새끼용을 지키고 위협하는 적을 섬멸하라. 오소리아가 너를 도와줄 것이다.', '', '재와 검댕을 다루는 데 통달하여 위험한 적입니다.', '잿빛결속사 토르네차', '', '', '', 47187),
(66448, 'koKR', '방황하는 길잡이', '길잡이 알비를 찾아야 합니다.', '길잡이들은 여행자들이 탈드라서스의 길을 안전히 지날 수 있도록 수호해왔습니다. 이는 저희 가문이 대대로 명예를 걸고 자랑스레 수행해 온 책무입니다.\n\n하지만 안타깝게도 제 여동생 알비는 요즘 들어 그 책무에 흥미가 시들한가 봐요. 매일 아침 제게 보고를 해야 하는데 하루가 넘도록 아직 아무런 소식을 듣지 못했습니다. \n\n만약 이곳 동쪽에서 한가로운 공상에 젖은 청동 용기병을 만나시거든 제게 보내주세요. 만나지 못하신다면 제가 직접 찾아도 되겠지만요.', '', '', '', '', '', '', 47187),
(66447, 'koKR', '방벽 저 너머', '생명의 금고 폐허에서 생명의 금고를 조사해야 합니다.', '방벽이 사라졌으니 이제 본격적으로 금고를 탐험해 보죠!', '', '', '', '', '', '', 47187),
(66445, 'koKR', '쓰러진 이들을 예우하며', '자라딘으로부터 아래 아이템을 회수합니다.', '자라딘 놈들은 이 성채의 신성함은 둘째치고 우리 동족의 시신에조차 예의를 갖추지 않는군! 놈들이 전사자의 뼈를 부러뜨려 개인 기념품으로 가져가고 있다.\n\n이 불손한 행각은 모든 긍지 높은 검은용의 가슴에 비수를 꽂는 것과 다름없다. 존중받아 마땅한 이들 아니더냐. \n\n자라딘이 전사자들의 시신에서 빼앗아간 물건을 회수해라.', '', '', '', '', '', '', 47187),
(66442, 'koKR', '이론적인 이야기', '생명의 금고 폐허에서 티탄 방벽에 보주를 시험해야 합니다.', '이제 원소 보주가 4개예요! 어느 가설이 맞을지 확인해 봐요.', '', '', '', '', '', '', 47187),
(66441, 'koKR', '정제된 노력', '생명의 금고 폐허 동쪽의 동굴에서 아세퀴안을 처치해야 합니다.', '원시 돌의 보주를 발견한 건 대단하지만, 아카디아와 태샤라가 방벽을 두고 서로 다른 견해를 보이고 있어요.\n\n저는 또 다른 가설을 세웠어요. 원소 보주를 더 얻으면 정답이 보일지도 몰라요.\n\n탐험가 한 명이 근처 동굴에서 비정상적으로 큰 물의 정령을 봤다고 해요. 정령을 퇴치하면 다른 보주를 찾게 될지도 몰라요.', '', '정찰대 보고에 따르면 급속도로 덩치가 커지고 있다고 합니다.', '아세퀴안', '', '', '', 47187),
(66439, 'koKR', '속사 계획', '용뿔두꺼비 숲에 있는 원시술사 병력으로부터 원시 불꽃 조각을 수집해야 합니다.', '원소의 보주라고요? 대지가 있으니 당연히 불도 있겠죠!\n\n용뿔두꺼비 둥지 근처에 있는 원시술사들이 용암으로 땅을 깎고 있다고 해요. 그들이라면 원시 불꽃의 보주를 알겠죠!\n\n그들을 처리하고 쓸만한 정보를 찾아보세요!', '', '', '', '', '', '', 47187),
(66438, 'koKR', '거창한 목표', '용뿔두꺼비 숲에서 정찰병 리탈을 찾아야 합니다.', '바람은 강력한 원소입니다. 바람은 돌을 깎기도 하고, 돛을 밀어 우리를 여러 곳으로 데려다주기도 합니다.\n\n저는 방벽을 제거하는 데 바람이 제일 효과적이리라 생각합니다. 간단한 이치입니다.\n\n제 정찰대가 원시 바람의 보주를 찾았다고 합니다. 정찰병 리탈이 보주로 가는 길을 압니다. 용뿔두꺼비 숲 근처에서 찾으실 수 있습니다. 가십시오!', '', '', '', '', '', '', 47187),
(66437, 'koKR', '핵심 원소', '생명의 금고 폐허에서 원시 돌의 보주를 정령술사 타이양에게 돌려줘야 합니다.', '<대지 보주에 든 힘이 맥동합니다.>\n\n<정령술사 타이양이라면 어떻게 다뤄야 할지 알 겁니다.>', '', '', '', '', '', '', 47187),
(66436, 'koKR', '드러난 말썽꾼들', '생명의 금고 폐허에서 대지의 정령 $1oa마리를 처치해야 합니다.', '대지의 정령들이 저희를 내쫓으려고 할 뿐만 아니라, 유물과 장비까지도 부수고 있어요. 티탄과 연관된 모든 걸 파괴하도록 설정된 것 같아요...\n\n막고는 있지만 저들이 있으면 현장을 조사할 수가 없어요. 저희가 탐험할 수 있도록 정령들을 몰아내 주세요!', '', '', '', '', '', '', 47187),
(66435, 'koKR', '현장 수습', '생명의 금고 폐허에서 사면초가에 몰린 탐험가 $1oa명을 찾아야 합니다.', '주술사로서 많은 정령을 다뤄보았지만, 이렇게 공격성이 강한 정령은 처음이에요!\n\n원정대가 이곳에서 티탄 금고를 발견했어요. 그런데 방벽이 세워져 있어서 내실로 들어가질 못하고 있었죠. 그래서 방벽을 무효화하려고 했는데, 무슨 보안 체계를 건드린 모양이에요... 갑자기 사방에서 성난 정령이 마구 튀어나온 걸 보면요!\n\n정령들이 공격할 때만 해도 발굴 현장에 많은 탐험가가 작업을 하고 있었어요. 갇힌 탐험가가 한둘이 아닌데, 전투원은 한 명도 없어요.\n\n발굴 현장으로 내려가서 탐험가의 대피를 도와주세요!', '', '', '', '', '', '', 47187),
(66429, 'koKR', '잊지 않으리', '두멧골 야영지 바깥에서 란난을 만나야 합니다.', '잠시... 시간이 필요합니다.\n\n두멧골 야영지로 돌아가십시오, $p 님. 거기서 뵙겠습니다.', '', '', '', '', '', '', 47187),
(66428, 'koKR', '당연한 우정', '진.짜.완.전.개.란.장.판.을 사용해 비전 방벽을 무효화해야 합니다.', '좋습니다! 진.짜.완.전.개.란.장.판. 조정은 끝났고, 준비도 다 됐습니다!\n\n왜 직접 사용하지 않냐는 표정이시군요. 간단합니다!\n\n모든 가능성을 상정해야 합니다. \n\n예를 들어 장치가 폭발한다고 했을 때, 제가 다치거나 의식을 잃거나 죽으면 누가 고치겠습니까? 상상이나 되십니까?\n\n자, 얼른 가십시오. 방벽을 무효화하고 야영지로 돌아갑시다. 라토스 그 양반 치료도 해야 한다고요. 전... 뒤로 빠져 있겠습니다.', '', '', '', '', '', '', 47187),
(66427, 'koKR', '다가오는 위협', '타론을 처치해야 합니다.', '내 몸에 난 비전 상처는 현장에서 치료할 수 없소. 상태도 위중해서 감내하고 싸우기엔 어려울 것 같군. \n\n한 번만 더 부탁하리다, $n.\n\n타론을 찾아 더는 제어장치를 과부하시키지 못하도록 저지해 주시오. \n\n란난에게 란.장.판.을 조정할 소중한 시간을 벌어줄 수 있을 거요. ...아니, 지금은 완.전.개.란.장.판.이랬나? 이젠 이름이 뭔지도 모르겠군. \n\n그럼 분리된 불길의 계략을 막아낼 수 있을지도 모르오.', '', '분리된 불길의 지도자는 카른타르의 폐허가 가진 힘을 휘두르기 위해 무엇이든 마다하지 않을 거요.', '비전조작자 타론', '', '', '', 47187),
(66426, 'koKR', '시간이 부족해', '동쪽 탑에 도달해야 합니다.', '느껴지는군. 지금 이 순간에도 비전 쇄도 현상이 격해지고 있소. \n\n얼마 안 있으면 폐허에서 폭발이 일어날 거요. 란난이 구사하는 방.비.책. 따위는 밤하늘에 뜬 흐릿한 별처럼 보일 정도로 큰 규모겠지. \n\n속히 저지해야 하오.\n\n부디 조심하시오, $p. \n\n일단 동쪽 탑에서 만납시다. 거기서 상황을 살펴보는 게 좋겠소.', '', '', '', '', '', '동쪽 탑에서 란난과 라토스를 만나야 합니다.', 47187),
(66425, 'koKR', '비전 과부하', '란난을 도와 비전 방울을 무효화해야 합니다.', '됐다! 완성입니다!\n\n완.전.개.란.장.판.을 소개합니다!\n\n빰빠밤! \n\n용 제어장치를 둘러싼 마력의 파장에 맞춰 조정하고 무효화 마법 문장을 새겼습니다.\n\n이걸로 비전 마력을 무효화하고 용 제어장치를 정지시킬 수 있을 겁니다. 사용할 때마다 문장의 효과가 점점 약해지겠지만요.\n\n제법 편리한 물건이지 않습니까?\n\n이 근방에서 네 개의 제어장치가 감지되는군요. 전부 정지시켜 주십시오!', '', '', '', '', '', '', 47187),
(66423, 'koKR', '걱정과 입증', '폐허의 기원에 관한 단서를 찾아야 합니다.', '분리된 불길 일당이 죽은 것만 봐도 카른타르의 폐허가 얼마나 위험한지 알 수 있소.\n\n란난은 란.장.판.을 조금만 손보면 이곳의 마력을 다스릴 수 있다고 확신하더군.\n\n하지만 그건 피상적인 문제를 해결하는 거지, 원인을 해결하는 게 아니오.\n\n폐허에서 단서를 찾아주시오. 이곳의 본래 용도를 알 수 있으면 더 좋겠지. 서둘러야 하오, $n. 시간이 얼마 없을지도 모르오.', '', '', '', '', '', '', 47187),
(66422, 'koKR', '원정은 계속된다!', '탑에서 란난과 라토스를 만나야 합니다.', '고대의 현장, 알 수 없는 목적을 지닌 조직, 란난의 란.장.판.과 분석 결과까지... \n\n내 내면의 모험가가 깨어나는 기분이군.\n\n이곳 상황을 자세히 알아보는 게 좋겠소.\n\n남쪽에 탑으로 통하는 계단이 있다오. 계속 전진해 봅시다.', '', '', '', '', '', '', 47187),
(66421, 'koKR', '폭풍의 상흔', '', '', '', '', '', '', '', '', 47187),
(66419, 'koKR', '하나를 향한 충성', '', '', '', '', '', '', '', '', 47187),
(66412, 'koKR', '안녕, 바실턴', '정원에서 바실턴과 대화해야 합니다.', '당신이 떠나기 전에 이 늙은 용기병이 부탁하고픈 것이 하나 더 있습니다.\n\n군주 바실턴을 처음 만난 이후로 저희는 함께 온갖 모험을 했습니다. 그 때문에 바실턴이 자꾸 밖으로 도는 것 같습니다. 탐험을 하던 옛 시절을 그리는 것이지요.\n\n이제 저는 모험이 부담스럽습니다. 하지만 당신은 가능하지 않습니까! 당신이라면 저는 꿈도 꾸지 못할 곳으로 군주 바실턴을 데리고 가줄 수 있을 겁니다.\n\n하지만 우선은 바실턴의 의견부터 한번 물어봅시다.', '', '', '', '', '', '', 47187),
(66391, 'koKR', '폐허를 향하여!', '카른타르의 폐허에서 란난과 라토스를 만나야 합니다.', '제 발명품 란.장.판.에 대해 듣고 싶으십니까? 아, 관심 없다고요?\n\n뭐. 싫다고 하셔도 말씀드릴 겁니다. 란.장.판.에 뭐가 잡혔거든요.\n\n오늘 카른타르 폐허에서 엄청난 비전 마력 쇄도 현상이 감지됐습니다. 라토스는 분리된 불길의 소행일 거라고 추측하더군요. 다시 말해서 란.장.판.의 성능을 시연할 완벽한 기회인 셈이지요!\n\n같이 가주시겠습니까? 돈 주고도 볼 수 없는 구경이 될 겁니다.', '', '', '', '', '', '', 47187),
(66369, 'koKR', '대지의 수호물', '대지의 수호물을 활성화해야 합니다.', '그대가 모은 반지로 수호물을 강화했습니다. 그랬더니 주위에 있는 대지의 돌을 모아 이 영토를 지킬 살아있는 대지 수호병을 만들어 내더군요.\n\n혹시 모르니 대지의 수호물을 시험해 주세요. 정상적으로 기능하는지 알아볼 겸.', '', '', '', '', '', '', 47187),
(66368, 'koKR', '폭풍 속의 섬', '불타는 현신 $1oa마리와 용해자 이그네오스를 처치해야 합니다.', '쉴 시간도 별로 없었는데 정령 공세가 끊임이 없군요!\n\n잠깐 틈을 만들 수 있다면 수호물을 만들어 방어를 강화할 수 있을 겁니다.\n\n주둔지에 들이닥치는 정령들의 수를 줄여주십시오.', '', '', '용해자 이그네오스', '', '', '', 47187),
(66364, 'koKR', '연을 날리는 법', '용의 섬의 원시비룡과 원시용에게서 온기가 남아 있는 원시용 날개 10개를 획득한 후 이스카라 투스카르의 템나유에게 가져가야 합니다.', '일이 하나 있어요.\n\n원시비룡과 원시용은 날개가 아주 넓은 범위까지 움직이는데, 그 날개면은 탄력이 정말 좋아요. 저희는 보통 넓게 편 가죽으로 연을 만드는데, 요즘 원시비룡이 하도 날뛰잖아요? 그래서 혹시 날개를 가져다줄 수 있나요? 용의 날개로 부족의 자랑이 될 연을 만들어보고 싶어요.', '', '', '', '', '', '', 47187),
(66363, 'koKR', '바실리스크 방패', '용의 섬의 바실리스크에게서 단단한 악어 가죽 20개를 모은 후 마루크 켄타우로스 더렐에게 가져가야 합니다.', '화살을 막는 핵심은 연결된 비늘이야. 우리가 만드는 버클러는 이 평원에서 최고인데, 다음 주문량을 처리하기엔 바실리스크 가죽이 모자라.\n\n우리 기술을 배우고 싶어 하는 것 같으니, 용의 섬에서 단단한 바실리스크 가죽을 구해오면 기술을 알려줄게.', '', '', '', '', '', '', 47187),
(66356, 'koKR', '무쇠나무', '', '', '', '', '', '', '', '', 47187),
(66354, 'koKR', '불꽃', '서약의 돌의 손상된 부분을 복구해야 합니다.', '제련소가 준비되었네. 이제 남은 것은 불이야.\n\n제련소에 손상된 서약의 돌 파편을 놓으면 래시온 님이 작업을 시작할 불꽃을 주실 것이네.', '', '', '', '', '', '', 47187),
(66353, 'koKR', '변형물 란.장.판.', '란.장.판.을 사용해 세 개의 비전 변형물을 무효화해야 합니다.', '여긴 비전 마력 농도가 엄청나게 짙습니다...\n\n하지만! 란.장.판.이 출동하면 얘기가 달라지죠! 아주 굉장한 장치랍니다. 이름만 봐도 비범함이 느껴지지 않습니까? \"란난의 장엄한 판독기\"! 비전 마력을 탐지하고 무효화하는 기능이 있습니다.\n\n자... 어떻습니까? 손에 들린 권능이 느껴지십니까? 모르시겠다고요?\n\n흠. 뭐 어쨌든 장치를 드렸으니 가서 변형물을 무효화해 주십시오!', '', '', '', '', '', '', 47187),
(66352, 'koKR', '적의 지식', '분리된 불길 문서를 찾아 라토스에게 전달해야 합니다.', '분리된 불길이 무슨 임무를 받아 이 폐허로 찾아왔고, 비전 쇄도 현상과 어떤 연관이 있는지 알아내는 게 핵심이오.\n\n유서 깊은 방법을 사용해 봅시다. 바로 정찰과 염탐이오.\n\n폐허는 지금 분리된 불길 추종자로 가득하다오. 그들의 목표를 알아내는 데 단서가 될 만한 명령서를 가진 자들이 분명 있을 거요.\n\n수단과 방법을 가리지 말고 자료를 습득하시오.', '', '', '', '', '', '', 47187),
(66351, 'koKR', '산 위로 피어나는 연기', '길잡이 이프스의 비행기를 찾아야 합니다.', '<야영지 너머 산마루를 보고 냄새를 맡는 길잡이 제브>\n\n마음에 들지 않습니다. 길잡이 이프스는 벌써 오래전에 도착했어야 합니다. 저를 도와 새 탐험가 무리한테 안전하게 기둥 오르는 법을 가르치기로 했단 말입니다.\n\n저 멀리 연기가 보이는군요.\n\n정말 마음에 들지 않습니다.', '', '', '', '', '', '', 47187),
(66349, 'koKR', '훈련 바위', '바위 $1oa개를 제거해야 합니다.', '바위를 제거합시다!', '', '', '', '', '', '', 47187),
(66344, 'koKR', '바람을 등에 업고', '게리투스와 메리스라를 따라 이동해야 합니다.', '원시술사들이 노쿠드 부족을 동맹으로 포섭했단 말이구나.\n\n지금까지는 어떻게든 원시술사를 막아낼 수 있었지만, 노쿠드가 신병기를 끌고 난입했다. 용학살자 쇠뇌라는 물건이지. 그 병기에 깃든 부정한 폭풍 마법에 쓰러지는 용이 솔레투스로 끝나지 않을 것 같아 걱정되는구나.\n\n이리 오너라. 그늘진 성역에 있는 용의 안식처로 데려다주마. 카남 마트라가 병력을 모으는 동안 너는 노쿠드에 대해 아는 것을 말해다오. 다음 대책을 준비해야겠다.', '', '', '', '', '', '', 47187),
(66340, 'koKR', '하늘빛 속으로', '갈래지류 교차로에서 현자 마수드를 만나야 합니다.', '녹색용의 역할은 끝났도다. 나는 여기 남아 서약의 돌을 보살피고 녹색용군단을 이끌어야 하지만, 우리의 감사와 신뢰가 너를 환송할 것이다.\n\n키린 토가 하늘빛 서약의 돌을 복구하는 데 도움을 요청하고 있다 들었다. 그들을 도와 서약의 돌을 복구하면 아제로스를 치유하는 데 한 걸음 다가가게 되리라.\n\n키린 토의 파키나와 현자 마수드를 찾거라. 그들이 앞으로 할 일을 알려줄 것이다. 안전한 여정과 편안한 꿈이 되길, $n|1이여;여;.', '', '', '', '', '', '', 47187),
(66339, 'koKR', '노쿠드 공격대: 바람은 하늘의 것', '노쿠드 공격대에서 발라카르 칸을 처치하고 온아라를 구출해야 합니다.', '$n|1이여;여;, 이제 떠날 때가 되었는가? 아니면 한번 더 우리를 돕겠는가?\n\n정찰병의 말에 따르면 발라카르는 온아라 님을 잡아둔 요새로 퇴각했다고 한다. 용납할 수 없다!\n\n한편 노쿠드 약탈병이 평원을 가로질러 혼란을 일으키고 있다고 한다. 우리가 약탈병을 상대하는 동안 네가 노쿠드 요새에 침투해 온아라 님을 구출해주면 좋겠군. 어떤가?', '', '', '', '', '', '', 47187),
(66337, 'koKR', '폭풍파괴자', '코롤레스를 처치해야 합니다.', '$n|1이여;여;, 내 곁에 와라! 승리가 눈앞에 있다!\n\n원시술사 전열이 무너졌으니 전장은 우리 것이다. 이제 저 원시술사의 지도자 코롤레스와의 전투에 지금껏 이룬 모든 것을 걸어야 한다.\n\n너와 내가 함께 마침표를 찍자! 전투에 나서자, 용사여!', '', '녹색용의 성역을 파괴하려고 하는 원시술사 지도자입니다.', '코롤레스', '', '', '', 47187),
(66336, 'koKR', '에메랄드의 섬', '고대의 가지에서 메리스라를 만나야 합니다.', '눈부신 활약을 해주었다, 필멸자여. 네 용기가 있었기에 우리가 원시술사를 무찌를 수 있었노라.\n\n내가 켄타우로스를 고대의 가지로 초대했다. 우리의 터전은 너와 카남 마트라, 그리고 그녀의 동족을 환대할 것이니라.\n\n이 길을 쭉 따라가거라. 홍예길을 지나 물을 건너면 그 너머로 숲이 펼쳐질 것이야. 그곳에서 기다리고 있겠다.', '', '', '', '', '', '', 47187),
(66335, 'koKR', '추가 수정탑 파괴', '마력 깃든 씨앗으로 원시술사 수정탑에 표시해야 합니다.', '그 악독한 무기가 파괴되었으니 녹색용군단도 전력으로 전장에 뛰어들 수 있겠구나.\n\n지상에서 벌어지는 일은 우리가 더 잘 알지. 우리가 표적에 빛을 비추면 메리스라 님과 그분 휘하의 용들이 하늘에서 공격을 퍼부을 것이다.\n\n이 마력 깃든 씨앗은 메리스라 님에게 받은 것이니, 이걸 원시술사 수정탑 근처에 놓거라. 이것이 내는 불빛을 보고 공중에 있는 용들이 공격을 퍼부을 거다.', '', '', '', '', '', '', 47187),
(66333, 'koKR', '솔레투스를 위한 정의', '노쿠드 전투사 $1oa명을 처치하고 용학살자 쇠뇌 $2oa개를 파괴해야 합니다.', '녹색용이 단 하나라도 남아있는 이상 원시술사가 고대의 가지를 쉽게 더럽히진 못할 것이니라.\n\n이 전투에서 우리의 몫을 다하고 싶은 마음은 굴뚝같지만, 저 용학살자 쇠뇌가 야전에 나와 있는 한 우린 접근할 수 없다. 노쿠드에서도 손에 꼽히는 전사들이 지키고 있으니 그자들도 제압해야 할 것이니라.\n\n쇠뇌를 파괴하고 노쿠드 전투사를 처리하거라. 위협을 제거해 주면 녹색용이 싸움의 판도를 바꾸겠노라.', '', '', '', '', '', '', 47187),
(66331, 'koKR', '원시술사 전선', '폭풍의 상흔에서 보쿠, 아리와 벨리카, 온 새쉬탱, 메리스라와 대화해야 합니다.', '카남 마트라가 휘하 병력과 함께 에메랄드 정원에 도달했다는 전갈을 보냈다. 코롤레스와 원시술사 병력을 찾았다더군. 북쪽 해변에 대규모로 결집해서 침공을 꾸미고 있는 모양이다.\n\n카남 마트라는 현명하게도 정찰병을 여럿 보내 전장의 전략적 요충지를 살피게 했다. 나는 병력을 이끌고 최전선으로 가 있을 테니, 보고서를 받아서 가져오너라. 영광스러운 전투가 우리를 기다린다. 계획이 성공한다면 복수까지 이룰 수 있겠지.', '', '', '', '', '', '', 47187),
(66329, 'koKR', '뿔피리를 불어라', '발라카르와 코롤레스의 계획을 목격해야 합니다.', '대체 왜 온아라 님을 이곳으로 끌고 온 거지? 설마...\n\n$n! 발라카르의 목적은 뿔피리를 부수는 게 아니다. 이건 함정이야! 당장 이 바람을 통과할 방법을 찾아야 한다!', '', '', '', '', '', '', 47187),
(66328, 'koKR', '녹색용 추락 사고', '물 좋은 주점에서 카남 마트라를 만나야 합니다.', '녹색용들은 서쪽 평야로 떨어졌다. 노쿠드보다 우리가 먼저 찾아가야 해.\n\n발라카르의 행동 때문에 녹색용이 마루크 모두에게 적개심을 갖는 불상사가 생겼다간 골치 아파질 터.', '', '', '', '', '', '', 47187),
(66327, 'koKR', '바람을 따라서', '정찰병 토물의 보고를 들어야 합니다.', '잠시 전략을 고려하는 시간을 갖지.\n\n드루살의 뿔피리를 불어 녹색용을 부르려면 온아라 님의 축복이 필요하다. 녹색용의 지원 없이는 이 전쟁에서 이길 수 없어. 노쿠드는 원래 다른 부족을 수적으로 압도하고 있었고, 이젠 원시술사까지 등에 업었다. 그런 마당에 코롤레스 놈이 바람의 어머니를 사로잡기까지 했으니! 그러니 노쿠드가 최종 공격에 나서 마루카이를 포위하기 전에, 온아라 님을 구출하는 것을 최우선 과제로 삼도록 한다.\n\n지금 바로 정찰병을 모두 내보내겠다. 부디 늦지 않게 온아라 님을 찾을 수 있기를.', '', '', '', '', '', '', 47187),
(66326, 'koKR', '장사 밑천', '정밀 비늘 망치 $4oa개, 흑요석 양끝 모루 $3oa개, 검은강철 집게 $2oa개, 용발톱 주먹 $1oa개를 수집해야 합니다.', '이렇게 강력한 제련소에는 특별한 도구가 여럿 필요합니다. 막대한 열기를 버틸 수 있는 것들로 말이죠. \n\n문제는 자라딘이 온 사방을 헤집어 작업에 필요한 도구 상당수를 훔쳐 갔다는 겁니다. \n\n우리 아군을 꾸준히 지원할 수 있도록 도구를 회수해 주셨으면 합니다.', '', '', '', '', '', '', 47187),
(66324, 'koKR', '영원히 기억하리', '지원의 요람에서 물품과 생존자를 찾아야 합니다.', '해독제가 준비됐다. 지원의 요람에서 생존자를 찾을 때 사용하도록. 효력이 오래가지 않으니 여러 번 사용해야 할 수도 있다.\n\n내 부하 중 살아있는 자가 있다면 구해다오.\n\n그리고 숨을 거둔 이가 있다면... 그 이름을 추모할 수 있도록 뿔 인장을 회수해줬으면 좋겠군.\n\n요람 안에 이 사태의 자초지종을 파악하는 데 보탬이 되어줄 단서가 있을지도 모른다.', '', '', '', '', '', '', 47187),
(66320, 'koKR', '시간의 흐름', '흐르는 모래로 이동해 크로미와 대화해야 합니다.', '시간의 실타래는 마치 강과도 같이 수많은 굽이와 지류를 뻗으며 흐른다. 때로는 그 흐름이 바뀔 수도 있지. 단, 변칙점을 해결하지 않고 놓아둔다면 우리의 운명이 뒤틀려 잘못된 시간의 길로 빠질 수도 있다.\n\n우리는 지금 그 변칙점 중 하나에 빠르게 가까워지고 있다. 내가 흐르는 모래로 크로노르무를 보낸 것도 진정한 시간의 길이 처한 문제를 조사하고 바로잡기 위함이었다.\n\n장차 네 도움이 아주 중요해질 것이다. \n\n아무쪼록 우리를 도와다오. 크로노르무를 만나보면 될 것이다.', '', '', '', '', '', '', 47187),
(66308, 'koKR', '불을 키우다', '잿더미파편 석탄 $1oa개를 수집해야 합니다.', '대지의 수호자의 제련소에서 새 무기와 방어구를 만들면 결국 자라딘에 맞서 승리할 수 있을 겁니다.\n\n하지만 그러기 위해서는 제련소의 불을 계속 지펴야만 합니다. 잿더미파편 석탄을 태우면 무기를 벼려낼 수 있을 만큼 강력한 화력을 낼 수 있을 겁니다.\n\n잿더미파편 석탄은 잿더미파편 암석층의 광맥이나 정령에게서 입수할 수 있습니다.', '', '', '', '', '', '', 47187),
(66299, 'koKR', '기다리고 기다리던 알폭탄 폭발', '괴성날개 군주를 처치해야 합니다.', '시제품이 잘 작동했네요! 아주 좋아요!\n\n이제 주요리를 내놓을 차례죠. 이번 요리사는 당신이에요!\n\n필요한 조정을 조금 하고 다시 변장을 입혀드릴게요. 그다음 우리의 걸작 알 폭탄을 이 역겨운 스튜에 퐁당 담그고 어미의 굴로 가져가서 잘 대접한 다음 폭발을 뒤로한 채 활공해서 내려오면 된다고요!\n\n계획대로만 되면 어미는 폭발하겠죠? 진짜로요. 노릇노릇 구워져서 죽어서도 미치고 폴짝 뛸 노릇일 거예요!', '', '은둔 중인 괴성날개 하피의 여군주예요! 여군주의 게걸스러운 식탐을 채우는 데는 두 가지 선택지가 있죠. 처프스나이드 폭발물, 아니면 당신의 살점!', '괴성날개 하피의 지도자 여군주 아베스리아', '', '', '', 47187),
(66279, 'koKR', '이 시대의 신인', '정원에 있는 오리즈무에게 회중시계를 가져가야 합니다.', '그래요, 이 회중시계는 정원일을 돕는 급사의 것입니다. \n\n노즈도르무 님의 무리죠. 오리즈무였던가? 요즘 애들 이름을 통 기억할 수가 있어야지요. 평소엔 알렉스트라자 님의 나무 근처에 있는 모래시계 옆에 가만히 서 있습니다. 눈도 안 깜빡이고요.\n\n노즈도르무 님을 따르는 무리가 좀 독특한 구석이 있지요. 그래도 자기 물건을 가져다주면 고마워할 겁니다.', '', '', '', '', '', '정원에 있는 오리즈무에게 회중시계를 가져가야 합니다.', 47187),
(66278, 'koKR', '한 용기병에겐 쓰레기일지 몰라도...', '정원에 있는 그림페크에게 회중시계를 가져가야 합니다.', '<반짝이는 회중시계가 정원 창고에 있는 쓰레기 더미 속에 놓여 있습니다. 그림페크라면 이걸 어떻게 처리할지 알 겁니다.>', '', '', '', '', '', '정원에 있는 그림페크에게 회중시계를 가져가야 합니다.', 47187),
(66270, 'koKR', '놀 때려잡기', '미래의 전쟁군주를 처치해야 합니다.', '아, 빛이시여! 더 오잖아! 어떻게 이럴 수 있지?\n\n내 치밀한 계획이! 더러운 호수에 숨어 지내던 지난날들이! 암살 작전이!\n\n저희 예상으로는 지휘 체계가 혼란에 빠지고 정착지도 무너져야 하는 데 거의 효과가 없었습니다.\n\n아마... 아마 당신 말이 맞을지도 모릅니다, $n 님. 제가 틀렸습니다...\n\n아닙니다! 그럴 리 없습니다! 제가 생각이 너무 많았나 봅니다.\n\n가서... 새로 합류한 놀을 처리하십시오. 그 틈에 저는 마음을 가다듬고 있겠습니다.', '', '', '', '', '', '', 47187),
(66269, 'koKR', '혹시 모르니까', '폭풍송곳니 정령술사 $1oa명을 처치해야 합니다.', '그냥... 마법 체질로 보이는 놈은 다 처치하십시오. 아니면 조직력 있어 보이는 놈이든가. 그냥 야망 있어 보이는 놈도.\n\n당신이 판단하기에 특이한 놈은 다 처치하십시오.\n\n아, \"최선의 판단\"은 나와 그만 얘기하는 거라고요? $c님, 어서요! 놈들은... 분명 나쁜 짓을 할 겁니다!', '', '', '', '', '', '', 47187),
(66268, 'koKR', '삼세판', '피발톱을 처치해야 합니다.', '뭐지? 또 다른 놈이 권력을 잡았나? 지도자가 없어졌는데도 충격이 없나? 최소한 조의의 표시로 적절한 시간을 보내는 정도의 체면은 있어야 하는 거 아닌가?\n\n저놈들은 예의가 전혀 없는 겁니까? 사회적 규범은요? 정교한 계획을 인정하는 여유도 없습니까? 표까지 만들었는데!\n\n저 피발톱이라는 놈을 처리해 주십시오. 잠깐 시간이 필요합니다.\n\n자세한건 묻지 마십시오. 아무튼 맡아주셔서 감사합니다!', '', '자기가 뭐라도 되는 줄 아나 보죠?', '피발톱', '', '', '', 47187),
(66267, 'koKR', 'M.E.T.A.', '학대당한 동물 $1oa마리를 풀어줘야 합니다.', '악독한 것들! 약탈과 살인도 충분히 문젠데, 동물 학대까지 해? 절대 두고 볼 수 없습니다.\n\n놀이 덫을 놓아서 동물을 잡고는 하이에나에게 먹이로 주고 있습니다. 털복숭이 동물 포로들을 구출하고 저 불한당 놈들한테 마법사가 윤리적으로 동물을 어떻게 대우하는지 보여줍시다!\n\n당연히 제 최근 행동에 비추어 볼 때 윤리적으로 타당한 행동입니다. 정확히 무슨 말이 하고 싶으신 거죠?', '', '', '', '', '', '', 47187),
(66266, 'koKR', '추악한 하이에나', '하이에나 어미 $1oa마리, 하이에나 싸움꾼 $2oa마리를 처치해야 합니다.', '놀이 키우는 저 벼룩투성이 하이에나 싸움꾼들을 꼭 처치해야 합니다! 저놈들이 어디서 용변을 보는지 보셨습니까? 정말 예의범절이라고는 눈곱만큼도 없는 놈들이더군요. 게다가 제 정교한 환영이 무색하게 냄새만으로 저를 구별할 놈들입니다.\n\n예절이 필요한 이 세상을 위해 저놈들을 제거해주십시오.', '', '', '', '', '', '', 47187),
(66265, 'koKR', '다음은 누구?', '크랙투스를 처치해야 합니다.', '아하! 보아하니 다른 놀이 나서서 총지휘를 맡았나 봅니다. 예상대로군요.\n\n정부가 무너지지 않도록 신임하는 자를 부군주로 놓는 건 당연한 이치입니다. 체제를 붕괴시키려면 더 세게 몰아붙여야 합니다. \n\n예? 지금 놀들을 너무 성급하게 판단한 건 아닐지 돌아보게 될 거라고요? 재밌는 말씀을 다 하시는군요! 그냥 놀입니다, 저것들!\n\n어서 움직이십시오! 때를 놓치거나 선거를 준비하기 전에 크랙투스를 처치해야 합니다!', '', '근데 놀 하나가 거느릴 수 있는 하이에나는 대체 몇 마리일까요?', '크랙투스', '', '', '', 47187),
(66264, 'koKR', '비무장과 온순함', '뼈갈이 병기 $1oa개를 입수해야 합니다.', '솔직히 저 위에서 흔들어댄 무기 수를 보면 불안해집니다. 저 중에 일부만 없애주셔도 상황이 안정될 겁니다. 최소한 제 마음은 진정될 겁니다.\n\n무기가 없으면 아무것도 못 하지 않겠습니까? 설마 맨손으로 당신을 공격하겠습니까? 하하!', '', '', '', '', '', '', 47187),
(66263, 'koKR', '정밀한 접근', '난타주먹을 처치해야 합니다.', '놀은 정말 끔찍한 생물입니다. 냄새도 지독하죠. 항상 낄낄 웃으면서 긁어댑니다. 지금도 많은데 우려스럽게도 더 모이고 있습니다. 수가 너무 많으니 저희가, 그러니까 당신과 제가 며칠이나 풀 베듯 베어 넘겨도 끝이 없을 겁니다. 이런 식으로는 아무 효과가 없어요.\n\n그러니 대신 문제의 핵심을 타격해야 합니다! 지도자를 제거하면 놈들은 결단력을 잃고 절망에 빠져 마비될 겁니다.\n\n우리가 왜 이렇게까지 해야 하냐고요? 잘 모르시겠다고요? 놀이라고요! 이유가 더 필요한가요?', '', '경애하는 지도자를 잃어버린 저들에게 무슨 승산이 있겠습니까?', '난타주먹', '', '', '', 47187),
(66262, 'koKR', '폐수 청소', '호수에서 썩어가는 더미 $1oa개를 제거해야 합니다.', '중요한 것부터 차근차근 진행합시다. 먼저 작전기지가 필요합니다! 문제가 있다면 이 주변의 정령들이 미친 듯이 날뛰고 있어서 발 디딜 틈도 없다는 겁니다.\n\n물론 다 끔찍한 놀 때문이죠.\n\n놀이 이 호수에 배설물과 찌꺼기는 물론이고, 빛께서만 아실 온갖 잡동사니를 다 버리는 바람에 일대의 정령들이 화가 난 것입니다.\n\n부디 상황이 진정되도록 역겨운 폐기물 덩어리들을 어느 정도 정리해 주십시오. 자칫하면 제 옷에 영원히 더러운 자국이 남겠습니다!', '', '', '', '', '', '', 47187),
(66261, 'koKR', '일보 후퇴', '디트리에게 가야 합니다.', '아, 모험가시군요! 안 그래도 잘 무장한 분이 필요하던 차였습니다.\n\n저는 정말 중요한 키린 토 사업 때문에 말 그대로 이 후미진 곳에 왔습니다. 그런데, 보시다시피 야영을 시작하려는 차에 더럽고 지저분한 놀이 나타나서 쫓기는 신세가 되었습니다.\n\n사실, 평원 전체를 위협할 만큼 상당히 많은 놀이 이 근처에 모이고 있습니다. \n\n그래도 걱정하지 마십시오, 다 계획이 있습니다! 저기 호수에서 다시 만나 설명하겠습니다.', '', '', '', '', '', '', 47187),
(66259, 'koKR', '불길한 징조의 폭풍', '마루카이에 있는 카남 마트라에게 보고를 전달해야 합니다.', '$n, 카남 마트라 님께 전부 보고드려야 합니다. 온아라 님의 납치도요.\n\n최대한 빠르게 마루카이로 가십시오. 용사님 혼자 가셔야 합니다. 저는 떨어지며 부상을 당했으니, 용사님 속도를 늦추기만 할 겁니다.\n\n제 걱정은 하지 않으셔도 됩니다. 곧 뒤따라가겠습니다. 어서 가세요!', '', '', '', '', '', '', 47187),
(66258, 'koKR', '이런, 온아라!', '보쿠가 온아라를 구출할 동안 적을 처치해야 합니다.', '원시술사가 온아라 님을 속박하곤 있지만, 어디까지나 간신히 묶어두는 수준입니다. 우리 기척을 알아차리진 못한 것 같아요.\n\n티가리 칸께서는 \"아무리 약한 산들바람이라도 흔들리는 바위는 넘어뜨릴 수 있다\"라고 종종 말씀하셨죠. 즉, 제가 온아라 님을 속박하는 주문을 아주 조금이라도 흔들면 빠져나오실 수 있을 겁니다.\n\n계속 경비병들의 시선을 끌어 주세요. 제게 좋은 생각이 있습니다.', '', '', '', '', '', '', 47187),
(66257, 'koKR', '새 마술', '보쿠의 바람 토템을 사용해 노쿠드 수레를 파괴해야 합니다.', '전해지는 얘기로는 온아라 님께서 우리의 선조이신 마루크 님의 창에 힘을 주입해 주셨다고 합니다. 발라카르 칸이 그 설화를 원시술사에게 해줬나 봅니다. \n\n놈들은 온아라의 자손에게서 마력을 훔쳐내 폭풍 마법으로 오염시키고, 그걸 쇠뇌 화살에 주입하고 있습니다. 노쿠드가 대체 왜 그런 무기를 필요로 하는 걸까요?\n\n굳이 이유가 드러날 때까지 기다릴 이유는 없겠죠. 지금 폭풍 화살을 수레에 적재하는 작업이 한창이더군요. 어딘가로 옮길 작정인가 봅니다. 제 토템을 드릴 테니 마차 지붕에 올려놓아 주십시오. 바람 마법으로 산산조각을 내버리겠습니다.', '', '', '', '', '', '', 47187),
(66256, 'koKR', '독수리주의자', '바람노래 마루에서 온아라의 자손 $1oa마리를 구출하고 원시술사 $2oa명을 처치해야 합니다.', '노쿠드가 비술사 토템을 원하는 이유를 알아냈군요. 온아라의 자손을 사로잡는 데도 쓸 수 있었을 줄이야. 직접 훔친 것은 노쿠드지만, 이 신성 모독의 배후에는 원시술사가 있습니다.\n\n온아라의 자손은 가장 신성한 오후나입니다. 바람의 어머니께서 직접 축복을 내린 존재들이죠. $n 님, 이렇게 부탁드립니다. 오후나를 눈에 띄는 대로 풀어주세요! 그리고 원시술사를 마주치거든...\n\n<보쿠가 말끝을 흐립니다. 하지만 표정에서 단호한 결의가 묻어 나옵니다.>', '', '', '', '', '', '', 47187),
(66254, 'koKR', '비관적인 비술사', '보쿠 주위에 강화 토템을 놓아야 합니다.', '전쟁이라뇨? 용은 또 무슨 말입니까? 저더러 온아라 님과 교감하라고요?\n\n못 합니다! 전 온아라 님의 목소리가 전혀 들리지 않아요. 일개 수습생일 뿐인 데다, 온아라께서 축복을 다시 거둬가신 것 같습니다. 제 능력이 부족해서일지도 모르죠...\n\n<가방을 뒤지는 보쿠>\n\n이 토템들은 스승님께서 저를 이 부족으로 보내실 때 주신 것들입니다. 저 자신에게 의심이 들 때면 이것들이 힘을 줄 것이라 하셨죠.\n\n토템 놓는 걸 도와주시겠습니까? 한 번 더 온아라 님을 불러보겠습니다.', '', '', '', '', '', '', 47187),
(66252, 'koKR', '보고', '발드라켄으로 가서 대장 드라인에게 보고해야 합니다.', '이제 원시술사의 위협은 사라졌다, $n. 곧 발드라켄의 병력이 와서 잔당을 소탕할 거야.\n\n넌 도시로 돌아가서 여기서 벌어진 일을 대장 드라인에게 보고해라. 에라노그 사령관과 관련된 사건을 알려주면 흥미를 보일 거야.\n\n다시 한번 진심으로 고맙다, $n.', '', '', '', '', '', '', 47187),
(66251, 'koKR', '소방 훈련', '용암갈퀴를 처치해야 합니다.', '에라노그 사령관이 우릴 배신하고 대신 저 괴물을 남겼군.\n\n이미 많이 도와줬으니 염치없지만, 그래도 내 상태로 저 괴물을 상대하긴 힘들군.\n\n마지막 부탁이니 부디 남쪽 요새 관문이 원시술사의 손에 떨어지지 않게 도와주거라.\n\n저들의 지도자를 처치해야 한다!\n\n날 도와줘, $n.', '', '남쪽 요새 관문을 공격 중인 원시술사의 지도자입니다.', '용암갈퀴', '', '', '', 47187),
(66250, 'koKR', '족장은 어디에?', '수호자 벨로미르와 동행하여 남쪽 요새 관문 내의 망루를 조사해야 합니다.', '이 요새에서 아직 안 찾아본 곳은 여기뿐이다, $n. 에라노그 사령관님이 살아있다면 여기 계실 거다.\n\n<근처 문을 쳐다보는 벨로미르>\n\n어디 뭐가 기다리고 있을지 보자.', '', '', '', '', '', '', 47187),
(66249, 'koKR', '하늘 청소', '공성 전갈을 조종해 용암서약 순수혈통을 하늘에서 제거해야 합니다.', '창과 밧줄을 가져온 건 훌륭한 판단이다. 이것들로 저 하늘을 제 안방처럼 쏘다니는 원시술사 놈들을 끌어내릴 수 있을 테니 말이야!\n\n계단을 올라가면 공성 전갈이 여럿 배치된 단상이 나올 거다. 밧줄로 시위를 매기고 창을 화살로 삼는다면, 용암서약이 부리는 용을 꿰뚫어버릴 수 있을 거다!\n\n하늘의 적을 소탕하면 첨탑 위의 길이 열린다. 그 길을 따라가면 에라노그 사령관님을 계속 찾아볼 수 있겠지.', '', '', '', '', '', '남쪽 요새 관문에 있는 망루 탑에서 수호자 벨로미르를 만나야 합니다.', 47187),
(66248, 'koKR', '엮는 솜씨가 대단하군', '무거운 밧줄 똬리 $1oa개를 모아야 합니다.', '<상태가 좋아 보이는 육중한 밧줄입니다.\n\n수호자 벨로미르는 유용한 재료를 찾아봐 달라고 했습니다. 이런 밧줄을 몇 개 더 모으면 그가 유용하게 쓸 수 있을지도 모릅니다.>', '', '', '', '', '', '', 47187),
(66247, 'koKR', '살짝 사용감 있어요', '용암서약 창 $1oa개를 모아야 합니다.', '전 주인의 상태를 봤을 때 상태가 좋은 축에 드는 창입니다.\n\n수호자 벨로미르는 유용한 재료를 찾아봐 달라고 했습니다. 잘하면 용암서약에게서 이런 창을 몇 개 더 얻을 수 있을 것입니다.', '', '', '', '', '', '', 47187),
(66246, 'koKR', '전장의 안개', '남쪽 요새 관문에서 수호자 벨로미르의 부대원을 찾아야 합니다.', '원시술사의 공격은 그 어떤 전조도 없이 갑자기 시작됐다. 우리 부대는 에라노그 사령관님을 찾아 나섰지만, 주둔지 반대편으로 가기도 전에 가로막히고 말았지.\n\n치열한 전투 속에서 우리 부대장이신 타그릭 하사관께서는 혼자서 원시술사 세 명을 상대하셨고, 나와 카오라, 미코르는 그 옆에서 싸웠다.\n\n내가 쓰러지기 전에 마지막으로 들었던 소리는 비명이었지.\n\n부탁한다, $r 친구. 우리 부대의 흔적을 찾거든 무슨 일이 있었는지 알려주길 바란다.', '', '', '', '', '', '', 47187),
(66245, 'koKR', '쓰러진 이들을 기억하라', '남쪽 요새 주둔지 인장 $1oa개를 수집해야 합니다.', '이렇게 많은 동지가 쓰러지다니.\n\n아무쪼록... 그 이름이 잊히지 않게 인식용 인장을 모아라.', '', '', '', '', '', '', 47187),
(66244, 'koKR', '발드라켄을 향하여', '발드라켄으로 이동해 생명의 어머니 알렉스트라자를 만나야 합니다.', '그대 덕분에 간신히 엄청난 재앙을 피했습니다.\n\n다만 다른 위상들을 만나 여기서 벌어진 일을 설명해야겠군요.\n\n발드라켄 위상의 권좌에서 다시 만납시다. 원시술사가 얼마나 큰 위협이 되었는지 알려야 할 때입니다. 라자게스와 원시술사들의 수작을 다른 이들이 분명 꿰뚫어 볼 것입니다.\n\n여기서 북쪽으로 가다가 동쪽으로 살짝 치우친 곳에 탈드라서스로 이어지는 교차로가 있습니다. 용군단이 장관이긴 하지만, 거기까지 가는 데 얼마 걸리지도 않을 겁니다.', '', '', '', '', '', '', 47187),
(66242, 'koKR', '날씨 제어', '폭풍결속 정수 $1oa마리, 폭풍소환사 수습생 $2oa명을 처치해야 합니다.', '이 비정상적인 폭풍에는 강력한 마법이 깃들어 있습니다. 보아하니 노쿠드가 바람노래 마루의 신성한 정수를 조작해 폭풍의 정령을 만들어내는 법을 익히고 있는 것 같습니다. 어느 정도 진전을 보이는 자들이 있는가 하면...\n\n<번개에 맞아 아직도 연기가 피어오르고 있는 주변의 노쿠드 수습생의 시신을 가리키는 보쿠>\n\n$n 님, 이 만행이 계속되도록 놔둬서는 안 됩니다.', '', '', '', '', '', '', 47187),
(66241, 'koKR', '탈드라서스 대경주', '', '경로의 통과 지점 고리를 통과해야 합니다.', '', '', '', '', '', '', 47187),
(66239, 'koKR', '확산하는 부패', '교역소에서 브레나를 만나야 합니다.', '<두꺼운 손으로 카르그포우의 토템을 이리저리 뒤집어 살펴보는 브레나>\n\n카르그포우는 꼭두각시였어요. 이 부패의 원흉은 따로 있습니다. 더 확산하기 전에 반드시 찾아야 해요.\n\n이곳에서 가장 가까운 투스카르 영역으로 교역소가 하나 있습니다. 이스카라로 통하는 다리 건너편에 있죠.\n\n그곳도 확인해보죠... 서두르는 게 좋겠습니다.', '', '', '', '', '', '', 47187),
(66237, 'koKR', '영혼의 아군', '고위층과 대화해야 합니다.', '저들도 우리의 도착을 알아챘을 겁니다.\n\n들어서기 전에 저들과 대화를 하고 싶습니다. 제가 의회와 과거가 있어서 말입니다.\n\n그 다음에도 서로를 소개할 시간은 있을 겁니다.', '', '', '', '', '', '', 47187),
(66236, 'koKR', '바람을 붙잡다', '바람노래 마루에서 보쿠를 만나야 합니다.', '노쿠드 녀석들은 토템을 모으고 있고, 원시술사들은 오후나를 잡아들이고 있어. 그런데 온아라 님께선 아무 말씀 없으시군.\n\n노쿠드가 무엇을 꾸미고 있던 간에 반드시 수포로 돌려야 하네. 보쿠와 함께 바람노래 마루로 가게. 아마 적들은 이미 도착해 있을 걸세.\n\n그곳에서 온아라 님을 찾게. 자손들이 위험에 처한 걸 알면 분명히 움직이실 테지. 그때 우리가 도와야 하네. 바람의 어머니는 강대하시지만, 저 원시술사라는 녀석들이 무슨 수를 숨기고 있을지 모르지 않는가.', '', '', '', '', '', '바람노래 마루에서 보쿠를 만나야 합니다.', 47187),
(66232, 'koKR', '웃는 얼굴에 소금 뿌리랴', '골록 해안에서 수정 조각 $1oa개를 모아야 합니다.', '당신이나 당신 친구들이 우리 작은 마을에 머무르는 걸 뭐라 하진 않겠습니다. 어차피 허락을 구한 것도 아니니 말입니다. 그래도 샘터로 가는 길이라면 이웃을 위해 수정 조각을 좀 모아다 주시겠습니까? 우린 그걸로 온갖 것을 보존합니다. 식량을 보존하는 아주 중요한 수단이지요.\n\n큰 골록이 몸에 아주 두르고 있을 겁니다. 조금 긁어와주실 수 있으실까요?', '', '', '', '', '', '', 47187),
(66230, 'koKR', '수상쩍은 부탁', '알비의 \"장부\"를 회수한 후 길잡이 알비에게 돌려줘야 합니다.', '타라세크가 그 발에 잡히는 모든 걸 가져갔습니다. 그중엔 제 정찰 장부도 있었습니다.\n\n그 거대한 도마뱀들은 장신구나 전리품을 잔뜩 모아둡니다. 아마 제 장부도 어딘가에 같이 뒀겠죠. 길을 따라가시는 동안 장부가 있는지 봐주신다면 감사하겠습니다.\n\n아, $n 님? 혹시 찾으신다면 장부 내용은 보지 말아주시길 부탁드립니다. 조금... 사적인 사항이라서요.', '', '', '', '', '', '', 47187),
(66228, 'koKR', '안토니다스 야영지', '안토니다스 야영지에서 만물의 암기자 노리코를 만나야 합니다.', '키린 토의 주 야영지, 안토니다스 야영지는 이곳 남쪽에 있습니다.\n\n노리코와 카드가 님은 지금쯤 칼렉고스 님을 도와 하늘빛 서약의 돌을 수복한 모험가들을 모으고 계실 겁니다.\n\n도우러 오셨다면 야영지로 향하시길.', '', '', '', '', '', '안토니다스 야영지에서 만물의 암기자 노리코를 만나야 합니다.', 47187),
(66227, 'koKR', '낚시의 즐거움', '쿠리의 낚시터에서 푸른꼬리 송사리 $3oa마리를 잡아야 합니다.', '아, 일손을 빌려주러 오셨나 보군요! 집에 가져가 먹을 물고기를 잡는 데 도움이 필요하던 참이었습니다.\n\n저 키린 토란 양반들은 이 지역에 있는 마법 변형물이라는 걸 찾는 데 관심이 있나 보더군요. 그게 뭔지는 모르겠지만요.\n\n도와만 주신다면 얼마든지 머무르셔도 좋습니다.\n\n저기 낚싯대를 챙겨 시작하십시오. 손이 많을수록 일은 쉬워집니다!', '', '', '', '', '', '', 47187),
(66226, 'koKR', '정서적인 버팀목', '물마루 은신처에 있는 노쿠드로부터 무고한 생명체를 구출해야 합니다.', '제발 목숨만은... \n\n뭐라고요? 도우러 오셨다고요? 그렇다면 동물들을 구해주세요!\n\n노쿠드가 느닷없이 들이닥쳤어요. 우리 모두 어떻게든 살아보려고 도망쳤죠! 저도 호수에 뛰어들어서 간신히 목숨만 건졌습니다.\n\n동물들... 그 아이들만 남겨졌어요. 부탁드립니다. 빌라면 빌게요. 동물들을 구해주세요. 노쿠드가 무슨 끔찍한 짓을 저지를지 누가 알겠어요?', '', '', '', '', '', '', 47187),
(66225, 'koKR', '토템은 누가 치우나', '물마루 은신처에 있는 노쿠드에게서 토템 꾸러미 $1oa개를 모아야 합니다.', '보쿠가 나더러 왜 모든 비술사를 물마루 은신처로 불러들었냐고 묻더군.\n\n나는 그런 지시를 내린 적이 없네. 발라카르가 온이르 부족을 약화시키고자 내 비술사들을 함정으로 유인한 걸세.\n\n어쩌면 다른 이유가 있을지도 모르겠군. 노쿠드 부족은 비술사 토템을 있는 대로 긁어모으고 있다네. 온아라 님의 축복을 받은 토템을 말이야.\n\n왜 그런 행동을 하는지는 알 수 없지만, 녀석들이 온아라 님의 선물을 훔쳐 가도록 놔둘 수는 없지. 토템을 최대한 많이 회수해오게.', '', '', '', '', '', '', 47187),
(66224, 'koKR', '비술의 신비', '보쿠를 만나 물마루 은신처로 가야 합니다.', '죄송합니다. 온아라 님과 교감하는 데 실패했습니다. 카남 마트라님의 요청을 이행하시려면 다른 이를 찾으셔야 할 겁니다.\n\n며칠 전에 동료 비술사들이 티가리 칸의 긴급한 요청을 받고 물마루 은신처로 불려갔습니다. 다들 아직 거기에 있을 겁니다.\n\n마을 바깥에서 만나도록 하죠. 길이라도 알려드려야 마음이 조금이나마 편해질 것 같군요.', '', '', '', '', '', '', 47187),
(66223, 'koKR', '우리가 키우면 안 돼요?', '혹한어 $1oa마리를 이스카라의 상인에게 구매하거나 용의 섬 바다에서 낚아 닐로에게 전달해야 합니다.', '얘가 우릴 먹으려고 하는 것도 배가 고파서 그런 거예요! \n\n생선! 시원하고 맛있는 날생선을 싫어하는 사람은 없죠!\n\n특히 혹한어가 최고로 맛있어요. 바다 어디서든 잡히는 녀석들이죠! 근데 용사님은 잡는 법을 모르니까 이스카라의 진쿠투크 아주머니한테 사면 될 거예요.\n\n얘가 더 굶지 않게 엄청나게 많이 가져다주세요!', '', '', '', '', '', '', 47187),
(66222, 'koKR', '폭풍 전의 고요', '제보타이의 명령을 티라카이 주민에게 전달해야 합니다.', '노쿠드는 강대하고 수많은 동맹을 보유한 세력이지. 그들을 막아내려면 우리도 전력을 쏟아내야 하네.\n\n$n, 자네는 카남 마트라님의 신뢰를 얻었네. 그분의 명령에 따라 동료들을 집결시키고 사람들을 준비시켜야 하네.\n\n아무쪼록 자네의 도움이 필요하네. 우선 호진을 찾아가 잔류한 칸수호병을 동원하게. 정찰병 켄유그에게는 노쿠드의 침략이 있을 수 있음을 경고하고, 아구라에게는 부상자 치료를 준비하라고 전해야 하네. 겐사이에게는 보급품 준비를 부탁해야겠군.\n\n비술사들은 이미 출발했을 걸세. 티라카이에 남은 사람들이 있는지 내가 알아보겠네.', '', '', '', '', '', '', 47187),
(66221, 'koKR', '다음 여정으로', '발드라켄 위상의 권좌에서 알렉스트라자와 대화해야 합니다.', '청동 서약의 돌이 복구되었으니 알렉스트라자도 계획을 진행할 수 있겠구나.\n\n발드라켄으로 가거라, $n|1이여;여;. 알렉스트라자는 네가 좋은 소식을 가져오길 기다리고 있을 것이다.', '', '', '', '', '', '', 47187),
(66218, 'koKR', '날쌘 개구쟁이들', '닐로와 나우를 찾아야 합니다.', '또 보는군.\n\n나랑 노루크를 도와주지 않겠나? 우리 아이들인 닐로와 나우가 놀러 나갔는데 아직도 돌아오지 않고 있네. \n\n지금 내가 다른 할 일이 있다 보니 대신 찾아줬으면 해. 위험하거나 그러진 않을 걸세. 우리 아이들이 자기 몸 하나 챙길 줄은 알거든.', '', '', '', '', '', '', 47187),
(66217, 'koKR', '현상 수배: 해안배회자 크로젝', '해안배회자 크로젝을 처치해야 합니다.', '저희는 크로젝이라 불리는 커다란 상어를 잡기 위해 오랜 세월 최적의 시간을 기다려왔어요. \n\n여기저기서 확인된 놈의 사냥터가 점점 해안에 가까워지고 있었죠. 이제 저희가 기다리던 그 시간이 왔어요. 사냥단을 꾸려서 놈을 처치하세요!', '', '해안배회자는 본래 지역 생태계에 꼭 필요한 존재였습니다. 하지만 이스카라와 너무 가까운 곳으로 사냥터를 옮기고 말았죠.', '해안배회자 크로젝', '', '', '', 47187),
(66213, 'koKR', '이야기를 엮다', '장로 포아에게 수상쩍은 이야기를 들려줘야 합니다.', '내 사랑하는 아내 포아는 훌륭한 이야기꾼입니다. \n\n하지만 벌써 30년 넘게 같은 이야기들을 반복하고 있답니다! 그러니 $c님, 포아한테 가서 새 이야기를 들려주십시오.\n\n뭐라고요? 당신 모험 이야기를 하시겠다고요? 무슨 말도 안 되는... 그런 건 관심 없습니다! 최고의 이야기는 항상 물고기에 대한 것이어야 합니다. 물고기 이야기를 해주십시오. 지어내도 괜찮습니다!', '', '', '', '', '', '', 47187),
(66212, 'koKR', '낚시: 날개돋이 해마', '용의 섬 인근 바다에서 날개돋이 해마 $1oa마리를 낚아야 합니다.', '요리를 제대로 할 줄 아는 사람이 이리 없을 수 있나?\n\n<분노에 차 콧수염을 푸들푸들 떠는 루코투루크>\n\n이봐요. 거기 당신. 가서 생선 좀 구해와요. 좋은 걸로. 먼지야금이 말고요!', '', '', '', '', '', '', 47187),
(66211, 'koKR', '담쟁이가죽 골짜기: 근원을 향하여', '담쟁이가죽 골짜기에 들어가 부패족장 격노눈을 대면해야 합니다.', '함께 담쟁이가죽 놀을 몰아내 주셔서 정말 감사합니다. \n\n하지만 놈들은 담쟁이가죽 골짜기 깊은 곳 어딘가에 있는 원천에서 나오는 부정한 부패 마법으로 계속 세를 불리고 있습니다. 그 지역에 있는 투스카르들과 소식이 끊긴 지 벌써 몇 주나 지났습니다!\n\n무슨 끔찍한 일이 벌어진 건 아닌지 두렵습니다. 고향 땅을 지켜야 합니다. 부디 병력을 모아 사람들을 찾아 주세요. 그리고 이 부패를 막아주셨으면 합니다!', '', '', '', '', '', '', 47187),
(66210, 'koKR', '가족 모임', '이스카라에서 $1oa개의 장례 공물을 수집해 장례선 안에 두어야 합니다.', '칼렉고스 님께서 지맥선에 대해 이야기하고 싶어하시지만, 장례를 준비해야 합니다.\n\n제가 그분과 이야기를 나누는 동안, 이스카라 곳곳에 있는 공물을 구해 장례선 안에 포노리악 족장님 곁에 놔주시겠어요?\n\n마을 경치를 둘러보실 시간도 되셨으면 좋겠습니다! 담쟁이가죽 일로 모두가 용사님을 따뜻하게 환대할 거예요.', '', '', '', '', '', '', 47187),
(66201, 'koKR', '전쟁의 발굽', '카남 마트라의 전언을 티라카이에 있는 칸수호병 제보타이에게 전달해야 합니다.', '발라카르가 군대를 일으키겠다면 나도 같은 수로 맞서야겠지. 하지만 우린 수적 열세에 있다.\n\n이전에 용들이 우리에게 도움을 요청한 바 있지. 우리도 그들에게 도움을 받으면 승산을 맞출 수 있을 터. 용의 동맹 요청에 화답하려면 내가 드루살의 뿔피리를 불어야 한다. 하나 그러기 위해선 온아라 님의 축복이 필요해. 도와줄 수 있겠느냐?\n\n티라카이로 가서 부관 제보타이에게 나의 전쟁 선포를 전하거라. 그 친구가 병력을 집결시키고 온아라 님을 찾을 수 있는 비술사에게 안내해줄 것이야.', '', '', '', '', '', '카남 마트라의 전언을 티라카이에 있는 칸수호병 제보타이에게 전달해야 합니다.', 47187),
(66196, 'koKR', '구원의 꽥꽥', '기포에 갇힌 새끼 오리를 생태학자 야영지로 데려가야 합니다.', '<기포 안에 든 새끼 오리가 열심히 퍼덕이면서 두려움에 차 꽥꽥댑니다.>\n\n<생태학자라면 도울 방법을 알지 않을까요?>', '', '', '', '', '', '기포에 갇힌 새끼 오리를 생태학자 야영지로 데려가야 합니다.', 47187),
(66187, 'koKR', '미치광이 모르디건과 수정왕', '골록 해안에서 모르디건 아이언죠의 결정화를 해제해야 합니다.', '이 일대를 둘러봤습니다. 모르디건이 있을 곳은 이 동굴밖에 없습니다.\n\n<동굴 입구에 울리는 작은 욕지거리 소리>\n\n이 동굴 안에 있군요.\n\nLOU-C 말을 듣자 하니 수정이 위험할 정도로 수분을 빨아들인다고 합니다. 모르디건과 그... 지질학적 발견물을 서로 떨어뜨려 주십시오. 너무 다치게 하지는 마시고요.\n\n저래 봬도 자기 분야에서 대단한 사람입니다.', '', '', '', '', '', '앨나라와 대화해야 합니다.', 47187),
(66177, 'koKR', '어떤 드워프도 포기하지 마라', '골록 해안에서 모르디건 아이언죠의 뒤를 쫓아야 합니다.', '여기의 염분 농도가 하늘을 뚫어요! 모르디건이 위험할 정도의 탈수 증세를 보이고 있을 거예요. 빨리 찾아서 데려와야 해요.\n\n아직 없어진 지 몇 시간밖에 안 됐으니 그 툴툴대는 늙은이 드워프가 어느 길로 갔을지 찾아보세요!', '', '', '', '', '', '골록 해안에서 앨나라를 찾아야 합니다.', 47187),
(66176, 'koKR', '정령 실험', '골록 해안에서 정령 실험을 $1oa번 진행해야 합니다.', '골록을 괴롭히는 물의 정령에 실험하십시오!', '', '', '', '', '', '잘하셨습니다!', 47187),
(66175, 'koKR', '현장 실험', '고래잡이의 귀퉁이에서 LOU-C의 실험을 도와야 합니다.', '당신 덕분에 이제 지질학 조사가 96% 효율로 진행되고 있어요! \n\n<눈살을 찌푸리는 LOU-C>\n\n그래요, 별로 높지 않죠.\n\n저랑 함께 당신이 모은 표본을 지질탐색기 289-07에 돌려봐요. 고원에 무슨 일이 일어나고 있는지 알 수 있는 기준선을 얻게 될 거예요.', '', '', '', '', '', '고래잡이의 귀퉁이에서 LOU-C 피츠코그와 대화해야 합니다.', 47187),
(66169, 'koKR', '따끈따끈한 복수', '남쪽 요새 관문에 있는 용암서약 원시술사 병력 $1oa명을 처치해야 합니다.', '원시술사 놈들. 제대로 허를 찔렀군.\n\n<넌더리가 난다는 듯 침을 뱉는 벨로미르>\n\n그 괴물들이 내 수호자 동지들을 조각냈다. 네가 나타나지 않았다면 나도 같은 신세가 됐겠지.\n\n저 멀리 아직 싸우는 소리가 들린다. 살아있는 자가 있을지도 모르겠군. 에라노그 사령관님이 계실 가능성도 배제할 수 없다.\n\n네 도움이 필요하다. 놈들의 시선을 끌어라. 내가 그 틈을 헤집고 잠입하겠다.\n\n저 \"용암서약\"이라는 것들을 몇 놈 처치하면 바로 효과가 있을 거다.', '', '', '', '', '', '', 47187),
(66167, 'koKR', '남쪽의 기습', '남쪽 요새 주둔지로 이동해야 합니다.', '당신이 알아낸 정보를 토대로 생각해봤을 때... 원시술사들은 남쪽 요새에 있는 에라노그 사령관의 주둔군을 공격하고 있을 거요. 하지만 내 비늘신도는 도시를 떠나지 못한다오. 그게 바로 원시술사들이 바라는 거니까.\n\n$n, 당신의 손을 한 번 더 빌려야 할 것 같구려. \n\n남쪽 요새로 가서 우리가 어떤 병력을 상대해야 하는지 알아보시오. 주둔 중인 수호자들과 접촉할 수 있으면 더욱더 좋소.', '', '', '', '', '', '', 47187),
(66166, 'koKR', '눈과 귀', '발드라켄에서 단서를 찾아야 합니다.', '원시술사들이 감히 발드라켄의 시민을 선동하고 있소. \n\n적은 비늘신도가 있으면 말을 아끼지만, 당신이라면 대화를 엿들을 만큼 다가가서 정보를 알아낼 수도 있을 것이오.\n\n조사를 진행할 지점 몇 곳을 지도에 표시했소. \n\n그리고 이 마력 깃든 돌을 가져가시오. 이게 있는 한 우리는 서로 대화할 수 있소.\n\n준비는 되셨소?', '', '', '', '', '', '', 47187),
(66164, 'koKR', '고약한 손버릇', '골록 해안에서 도둑맞은 부품 $1oa개를 회수해야 합니다.', '모르디건이 돌을 핥으러 갔으니 이제 문제의 핵심을 말할 수 있겠군요.\n\n저 비열한 물고기 인간들이 제 부품들을 훔쳐 갔어요!\n\n요놈의 깜찍한 마을에 한 시간도 채 안 있었는데 짜잔! 사방이 골록 천지가 되더라고요. 로우는 소리 지르지, 앨나라는 비명 지르지. 저는 정신 나간 노움처럼 스패너를 휘둘러댔고요! \n\n상황을 수습하고 제 부품을 되찾아주실 수 없나 봐주세요!', '', '', '', '', '', '', 47187),
(66163, 'koKR', '숨을 곳은 없다', '발드라켄에서 원시술사 침투자 $2oa명을 처치해야 합니다.', '발드라켄에 온 것을 환영하오, $r 친구. \n요즘 도시가 꽤 뜨거워졌소. 당연히 날씨 이야기는 아니오.\n\n원시술사들이 몰래 숨어들어 시민들 사이에서 분란을 조장하고 있소.\n\n우리의 적은 교활하오. 시민으로 위장해 비늘신도의 눈을 피해 왔소. 경비병들은 피할 수 있을지 모르나, 외부인을 의심하진 않을 것이오.\n\n이 용의 눈 보석을 받으시오. 그걸로 원시술사의 위장을 간파할 수 있을 거요.\n\n가서 침입자들의 정체를 만천하에 드러내고 처단하시오!', '', '', '', '', '', '', 47187),
(66159, 'koKR', '암담한 전언', '발드라켄의 위상의 권좌에서 알렉스트라자와 대화해야 합니다.', '칼렉고스는 네가 도착하면 하늘빛 평원에서 일어나는 일을 말해 주겠다고 하더구나.\n\n대체 뭘 알려 주려는 것인지는 모르겠으나, 끔찍하리만치 불길한 예감이 든다, $n|1이여;여;.', '', '', '', '', '', '', 47187),
(66156, 'koKR', '용비늘 원정대의 영예로운 자', '용비늘 기지에 있는 분류학자 제이크스와 대화해야 합니다.', '당신의 업적은 분명히 인정받고 있어요. 계속해서 저명한 탐험가의 반열에 오를 만한 인물이라는 걸 보여주시고 있기도 하고요!\n\n용비늘 기지를 찾아주세요. 앞으로의 활동에 든든한 힘이 되어줄 보급품을 준비해뒀어요.', '', '', '', '', '', '', 47187),
(66155, 'koKR', '루리크의 급류 주파', '폭포 소금쟁이호를 타고 강을 따라 이동해야 합니다.', '형님의 허락을 받을 줄은 몰랐습니다. 예상 못 한 일이지만, 역시 반갑군요. \n\n때가 됐습니다! 우리의 노고가 빛을 발할지 봅시다!\n\n$n 님, 함께 폭포 소금쟁이호에 올라 강을 따라갑시다. 가는 길에 이스카라를 위해 낚시를 하는 겁니다!', '', '', '', '', '', '', 47187),
(66154, 'koKR', '타액 표본', '골록 해안에서 타액 표본 $1oa개를 채취해야 합니다.', '<콧등을 주무르며 큰 한숨을 쉬는 수척한 언데드>\n\n이력에 정말 안 좋게 남겠군. 어쩌다 보니 단 하루 만에 인근 골록 무리를 자극하고, 장비는 반절 정도 사라진 데다, 드워프 한 명까지 사라지고 말았네.\n\n이런 상황에 대한 행동 수칙은 최대한 효율적으로 행동하는 것이지. 가서 저 이빨투성이 악당들 수를 줄이고 겸사겸사 그 타액 표본도 가져오게.\n\n꼭 품질 좋은 걸로 가져오게나.', '', '', '', '', '', '', 47187),
(66152, 'koKR', '오갈 데 없는 신세', '두멧골 야영지에서 가르즈를 만나야 합니다.', '여기 머무를 수는 없다.\n\n뭘 해야 할지 모르겠다... 어디로 가야 할지도...\n\n네가 있던 두멧골 야영지로 돌아가겠다. 녹소나무가 겪은 일을 투스카르들에게 알려야 해.\n\n우리의 이야기를 전하고 보존하면... 이런 일은 두 번 다시 일어나지 않을지도.', '', '', '', '', '', '', 47187),
(66151, 'koKR', '돌 같은 심장', '돌심장을 처치해야 합니다.', '우리가 족장의 죽음을 추모한다고는 하나, 엄밀히 말하자면 그는 살아있습니다.\n\n바로 저 앞에 돌심장의 껍데기가 있죠. 수많은 이가 설득을 시도해봤습니다.\n\n그리고 다들 죽음을 당했지요. 나른 역시 목숨을 잃을 뻔했고요.\n\n그자는 이제 괴물입니다! 이게 원시술사의 목표입니다. 우리를 돌과 화염으로 바꿔 복속시키는 것이죠.\n\n그자의 내면에 녹소나무는 이제 없습니다. 다른 이들이 같은 운명을 맞이하기 전에 처단해야 합니다.', '', '녹소나무 족장은 원시술사의 선물을 받아 몸이 돌로 변했습니다.', '돌심장', '', '', '', 47187),
(66150, 'koKR', '라자 구출', '라자 썬더클로를 구출해야 합니다.', '라자 썬더클로 님은 영혼수호자이시다. 우리 부족의 전통과 역사를 지키는 분이지.\n\n원시술사의 신앙은 우리가 진실하게 여기는 모든 것과 반대된다. 영혼수호자님이라면 돌심장에게 협력하지 않을 줄 알았다! \n\n돌심장은 수단과 방법을 가리지 않고 그분을 굴복시키려 들 거다. 라자 님의 축복 없이는 누구도 족장으로 인정받지 못하니까!\n\n나른 말로는 족장의 경호원인 카르갈 파이브팽스가 라자 님의 의지를 꺾으려 하고 있다고 한다. 그분이 세상을 떠나기라도 했다간 우리 부족도 같이 죽는 셈이다.\n\n가서 그분을 도와줘라, $n. 단단히 준비해야 할 거다. 카르갈 그 자식이 순순히 물러나진 않을 테니까.', '', '', '', '', '', '녹소나무 소굴에서 라자 썬더클로를 만나야 합니다.', 47187),
(66149, 'koKR', '정기의 영향', '원시술사 속박의 토템 $1oa개를 파괴하고, 녹소나무 소굴 안에서 나른을 만나야 합니다.', '나른 말로는 녹소나무 부족 모두가 돌심장이나 원시술사를 따른 건 아니라고 한다.\n\n저항한 몇몇은 억지로 붙잡혀 있다고 했다. 바위와 진흙을 내뿜는 토템에 속박당한 채... 복종을 강요당하고 있는 거다.\n\n토템을 부숴서 그들을 풀어다오!', '', '', '', '', '', '녹소나무 소굴에서 나른을 만나야 합니다.', 47187),
(66148, 'koKR', '옛 펄볼그 가족', '녹소나무 펄볼그와 정령 $1oa마리를 처치하고 녹소나무 소굴 깊은 곳에서 나른을 만나야 합니다.', '원시술사가 와서 말했다. 새 힘을 주겠다고 했지. 정기를 지배하는 힘이었다.\n\n난 돌심장이 그들의 선물을 받지 않을 줄 알았다. 우리 부족은 힘 같은 건 없어도 괜찮았으니까. 근데 그는 대가까지 생각할 머리가 없었던 거다.\n\n이제 와서 돌심장의 형편없는 결정을 돌이킬 순 없다. 질병이 뿌리를 썩게 하듯 우리 부족은 마법에 타락하고 말았다.\n\n가슴이 찢어질 것 같지만... 타락한 이들을 없애는 게 유일한 방법이다.', '', '', '', '', '', '녹소나무 소굴에서 나른을 만나야 합니다.', 47187),
(66147, 'koKR', '물속의 수정', '골록 해안에서 수정 표본 $1oa개를 채취해야 합니다.', '그렇게 보일지 않을지도 모르겠지만, 저희는 전문가입니다. 원정대에서 이 지역에 있는 희귀한 수정 한 움큼을 찾으라는 임무를 받고 왔습니다. 지질 조사라고 할 수 있겠죠.\n\n골록 공격 때문에 아직 정신이 없군요. 저 대신 수정을 찾아주실 수 있겠습니까? 가능하면 표본을 가져다주십시오.', '', '', '', '', '', '', 47187),
(66141, 'koKR', '무너진 전통과 육신', '녹소나무 소굴로 가는 길에 가르즈와 나른을 만나야 합니다.', '내 펄볼그 동족은 더 이상 제정신이 아니다. 그들은... 나쁜 짓을 저질렀다. 지금은 끔찍한 존재가 됐지.\n\n펄볼그가 펄보그와 싸운 적은 지금껏 없었다.\n\n나와 내 형제는 도망쳐 나왔다. 여기까지 온 것도 도움을 청하기 위해서지. 형제는 우리 부족의 굴에 남아 있다.\n\n부족을 구할 수 없게 되기 전에 도와다오!', '', '', '', '', '', '', 47187),
(66139, 'koKR', '최후의 불꽃', '정원에서 집중된 물의 정수를 사용해 이글거리는 지옥불을 처치해야 합니다.', '자, 젊은 친구! 모든 물의 정령 정수가 이 단지에 들어있습니다. \n\n이대로 큰 놈한테 던지면 될 겁니다. 불에 물이 통하지 않을 때가 있나요? 실패할 수가 없습니다.\n\n그래도 이놈의 관절에 열기를 쬐면 좋지 않으니 저는 여기 있겠습니다. 혼자서도 충분할 겁니다.\n \n행운을 빌어요, 젊은 친구!', '', '', '', '', '', '', 47187),
(66138, 'koKR', '모래시계 속 흐르는 모래처럼', '정원에서 바람에 휩쓸린 시간의 모래 더미 $1oa개를 수집해야 합니다.', '노즈도르무 님의 모래시계도 정원의 다른 부분처럼 정령의 습격을 피하지 못했습니다. 사나운 바람의 정령이 와서 저 안에 있던 마법의 모래를 흩뿌렸습니다.\n\n모래가 없으면 이곳에 대한 노즈도르무 님의 영향력도 크게 줄어듭니다.\n\n이 모래시계를 상시 관리하는 역할은 수습 급사인 제가 맡고 있습니다. 저 대신 모래를 모아주신다면 영원한 감사를 드리겠습니다.', '', '', '', '', '', '', 47187),
(66137, 'koKR', '잡초 몰아내기', '정원에서 급성 죽음꽃 및 덩굴손 포들링 $1oa마리를 처치해야 합니다.', '난동을 부리는 식생이 포들링만은 아닐 겁니다.\n\n알렉스트라자 님의 나무는 항상 골칫거리였죠. 온갖 종류의 식물과 동물이 그분의 생명 마력에 이끌려 찾아옵니다. 그중에는 선한 것도 있고 악한 것도 있는데, 악한 것은 누가 처리해야 할까요? 바로 이 늙은이 그림페크죠!\n\n위상이시여, 이 일을 계속하기엔 너무 늙은 것 같습니다.\n\n급사들은 전투 훈련을 받지 않았으니, 생명의 어머니의 잡초 문제는 당신이 해결해 주세요.', '', '', '', '', '', '', 47187),
(66136, 'koKR', '정수 추출', '정원에서 물의 정수 $1a개를 수집해야 합니다.', '며칠 전에 커다란 불의 정령이 웅덩이를 파괴했습니다. 이 소동의 원인으로 보이지만 싸우기에는 너무 큽니다. 어떻게든 약화할 방법을 찾아야 해요.\n\n그래도 이 늙은이 그림페크한테 계획이 있습니다!\n\n물의 정령 몇 마리가 말리고스 전망대에 살림을 차렸습니다. 그 정수만 충분히 모으면 놈들의 마력을 고스란히 돌려줄 수 있겠죠.\n\n맞불 작전인 겁니다. 아, 물이니까 맞불은 아닌가?\n\n아무튼 시작해 주세요.', '', '', '', '', '', '', 47187),
(66135, 'koKR', '정원사의 수습생', '정원 창고에서 쓰레기 더미를 치워 군주 바실턴을 찾아야 합니다.', '바실턴! 바실턴 군주, 어디 있니?\n\n제 수행 비서이자 제자인 군주 바실턴이 사라졌습니다! 모험을 좋아하는 아이지만 저보다도 제 한 몸 지키기 힘들어하니 걱정입니다. 전사도 아니고 정원사인 저보다도 더 그럽니다!\n\n그 게으름뱅이를 찾아주시겠어요? 제 옆에 놔둬야 편하게 생각할 수 있겠습니다. 보통은 창고 쓰레기 더미를 뒤지고 있습니다.\n\n처음엔 까칠할 수 있으니 조심하세요.', '', '', '', '', '', '', 47187),
(66134, 'koKR', '아제로스 해충 박멸', '정원에서 동요한 묘목 $1oa마리를 처치해야 합니다.', '거기 젊은이!\n\n조금 도와주시겠어요? 포들링 때문에 애써 가꾼 식물이 다 죽게 생겼습니다!\n\n정원에 들어온 온갖 정령이 여기 야생동물들에게 어떤... 영향을 주고 있습니다. 그 마력 때문인지 포들링이 사나워졌습니다! 평소보다 훨씬 더 심해요!\n\n저는 이 셋 상대하기도 벅찹니다. 꽃밭이 다 사라지기 전에 도와주세요!', '', '', '', '', '', '', 47187),
(66133, 'koKR', '충성의 열쇠', '상급 흑요석 열쇠 $1oa개를 수집해야 합니다.', '', '', '', '', '', '', '흑요석 성채에 완성한 열쇠를 반납해야 합니다.', 47187),
(66131, 'koKR', '과거의 열쇠', '완성한 열쇠 $1oa개를 입수해야 합니다.', '완성한 열쇠를 가져와라.', '', '', '', '', '', '흑요석 성채에 있는 어느 한 진영에 완성한 열쇠를 반납해야 합니다.', 47187),
(66130, 'koKR', '과거의 열쇠', '완성한 열쇠 $1oa개를 입수해야 합니다.', '완성한 열쇠를 가져오거라.', '', '', '', '', '', '흑요석 성채에 있는 어느 한 진영에 완성한 열쇠를 반납해야 합니다.', 47187),
(66129, 'koKR', '과거의 열쇠', '완성한 열쇠 $1oa개를 입수해야 합니다.', '완성한 열쇠를 가져오거라.', '', '', '', '', '', '흑요석 성채의 어느 한 진영에 완성한 열쇠를 반납해야 합니다.', 47187),
(66126, 'koKR', '과거의 열쇠', '완성한 열쇠 $1oa개를 입수해야 합니다.', '완성한 열쇠를 가져와 주게.', '', '', '', '', '', '흑요석 성채에 있는 어느 한 진영에 완성한 열쇠를 반납해야 합니다.', 47187),
(66124, 'koKR', '승리의 퇴장', '청지기 셀리스트라와 함께 섬광서리 거주지를 탈출해야 합니다.', '보아하니 여왕님께선 야생의 부화장으로 퇴각하신 듯하오. 이 일대 원시비룡을 감시하기 위해 세운 전초기지인데... 방어 병력이 충분했으면 좋겠군.\n\n즉시 이동해야 하오!', '', '', '', '', '', '', 47187),
(66123, 'koKR', '머리를 쳐라', '섬광서리 거주지에서 자드지게스를 처치해야 합니다.', '라자게스의 사악한 부관 중 하나인 자드지게스가 위풍당당하게 원시술사를 이끌고 오고 있소.\n\n우리에게 도전한다면 어떻게 되는지 보여주겠소.', '', '라자게스의 부관입니다. 저지하지 않으면 온갖 말썽을 일으킬 것입니다.', '자드지게스', '', '', '', 47187),
(66122, 'koKR', '원시의 전투', '섬광서리 거주지에서 원시용 $2oa마리를 처치해야 합니다.', '원시용은 우리를 혐오합니다. 그들에게 우린 티탄의 손에 조종받고 속박당해버린, 뒤틀린 용족으로 비칠 뿐이죠. 이해를 하지 못하는 겁니다.\n\n그러니 병력을 보내 우리 성벽을 두드리게 하면서도 속 편하게 지내는 거 아니겠습니까.\n\n착각을 해도 유분수지.\n\n이 창을 받으십시오, $p 님. 적을 처단해야 합니다.', '', '', '', '', '', '섬광서리 거주지에서 청지기 셀리스트라를 만나야 합니다.', 47187),
(66121, 'koKR', '알 구출', '섬광서리 거주지에서 알 4개를 구출해야 합니다.', '원시술사들이 우리 알을 훔쳐 갔소! 추악한 의식에 이용할 속셈이겠지! 반드시 저지해야 하오.\n\n너무 늦기 전에 알을 회수할 수 있도록 도와주시오. 알을 찾을 때마다 표시를 남겨주면 될 거요, $p. 그럼 내가 반드시 안전하게 빼내도록 하겠소.', '', '', '', '', '', '섬광서리 거주지에서 청지기 셀리스트라를 만나야 합니다.', 47187),
(66119, 'koKR', '루비 생명의 웅덩이: 원시술사의 침공', '루비 생명의 웅덩이에 들어가 원시술사의 공격을 저지해야 합니다.', '원시술사들이 우리 보금자리에 침입했습니다. 그런 강력한 공격에 대비가 되어있지 않았던 지라... 몇 놈을 놓쳤습니다.\n\n용기병 하나가 뒤쫓아서 들어갔는데, 아직도 보고를 하지 않고 있습니다. 무슨 일이라도 생긴 건 아닌지 걱정됩니다.\n\n전 경계를 서고 있겠습니다. 목숨을 걸고 더 이상의 침입을 허용하지 않겠습니다. 용사님은 꼭 안에 들어간 놈들을 저지해 주십시오.\n\n서두르셔야 합니다!', '', '', '', '', '', '', 47187),
(66118, 'koKR', '화산암 습격', '섬광서리 강습지에서 분노한 절벽 정령 $1oa마리를 소멸시켜야 합니다.', '라자게스와 원시술사들이 거대한 대지의 정령을 소환해 장벽을 부수려 합니다. 막아야 합니다!', '', '', '', '', '', '', 47187),
(66117, 'koKR', '전장 정리', '', '', '', '', '', '', '', '', 47187);
INSERT INTO `quest_template_locale` (`ID`, `locale`, `LogTitle`, `LogDescription`, `QuestDescription`, `AreaDescription`, `PortraitGiverText`, `PortraitGiverName`, `PortraitTurnInText`, `PortraitTurnInName`, `QuestCompletionLog`, `VerifiedBuild`) VALUES
(66116, 'koKR', '주된 위협', '섬광서리 강습지에서 사령관 레타나크를 찾아야 합니다.', '지켜야 할 연약한 알이 너무 많소. 적이 침입이라도 하는 순간 모두 잃게 될 것이오!\n\n지금쯤 경비병들이 결집해 적군을 막아내고 있을 거요. 레타나크 사령관과 얘기해 보시오. 그라면 당신의 힘을 적재적소에 활용할 수 있을 테지.', '', '', '', '', '', '', 47187),
(66115, 'koKR', '붉은용의 사명', '루비 생명의 제단에 있는 지기들과 대화해야 합니다.', '우리의 소명은 연민과 보살핌이다. 우리가 다른 용군단을 돕는 것은 그들만이 아니라 용족 전체를 돕기 위함이니라.\n\n이곳 루비 생명의 제단에 있는 용혈족과 이야기를 나눠보거라. 우리를 이해하는 데 도움이 될 것이니.', '', '', '', '', '', '', 47187),
(66114, 'koKR', '여왕 폐하의 안위를 위하여', '청지기 셀리스트라와 함께 루비 생명의 제단으로 이동해야 합니다.', '우린 소중한 알을 보호함으로써 온 용군단의 미래를 지킨다오. 그러니 원시술사들은 그저 고통이나 슬픔을 꾀하는 것이 아니오.\n\n우리의 멸종을 획책하는 것이지.\n\n당장 여왕님께 알려야겠소.', '', '', '', '', '', '', 47187),
(66112, 'koKR', '제작을 멈추지 마세요', '원시 대지 핵과 원시 용암 핵을 수집해야 합니다.', '세상에, 그렇게나 강력한 정령을 본 적 있으십니까?!\n\n<환호하는 그룬>\n\n아까 들어보니 경비병들은 무슨 전투가 쉴 새 없이 이어진다고 불평하던데, 그 양반들이 큰 그림을 못 보는 겁니다... 덩치 큰 정령은 커다란 제작 재료의 동음이의어란 말이죠!\n\n우리를 위해서든, 뭘 위해서든 아무튼 정령을 처리하실 때 가능한 한 가장 큰 조각을 가져다주십시오. 제작에 이용할 겁니다!', '', '', '', '', '', '', 47187),
(66111, 'koKR', '엄습하는 정령들', '날개쉼터 대사관에서 원시 정령 $1oa마리를 처치해야 합니다.', '용비늘 원정대 소속 제작자나 장인, 탐험가는 전장과 어울리지 않는 이들이네.\n\n하지만 $p 자네와 나는 다르지.\n\n이곳 용의 섬에서는 우리의 그 강점을 살려 자기 자신을 지킬 힘이 없는 이들을 보호할 걸세.\n\n북쪽에서 접근하는 정령 무리를 정리하게나. 원정대가 고결한 사명에 충실할 수 있도록.', '', '', '', '', '', '', 47187),
(66110, 'koKR', '평화의 기회', '얼라이언스 대표들에게 자신을 소개해야 합니다.', '아카마고쉬, $p|1이여;여;.\n\n이 원정대는 호드와 얼라이언스 모두의 보호를 받고 있다네. 우리는 용비늘 원정대 인원이라면 진영 상관없이 누구든 지원하라고 명령받았네.\n\n야영지 반대편은 얼라이언스의 대표자인 개릭 대장과 그 아들 헨리가 지키고 있지.\n\n전에 개릭 대장과 한 편이 되어 스컬지와 싸운 적이 있다네. 명예로운 자이니, 원정대에 좋은 전력이 될 걸세.\n\n개릭 대장한테 도움을 제의해보게. 호드가 협정을 따른다는 사실을 보여주게나.', '', '', '', '', '', '날개쉼터 대사관에서 대장 개릭과 대화해야 합니다.', 47187),
(66108, 'koKR', '망치라는 이름의 해결책', '흠뻑아귀의 왕 소그모옳과 바람지느러미의 왕 휘옳옳이를 처치해야 합니다.', '타루가 이제 제 관점을 이해해줘서 다행이지만, 한편으론 제가 늑장 부리는 동안 타루가 당신을 시켜 야생동물을 구해 다행이라고 생각합니다.\n\n상황이 제가 생각한 것보다 심각해서 행동에 나선 게 정답이었습니다. 알아낸 바로는 골록을 처리하지 않으면 이 원소 폭격도 멈추지 않을 걸로 보입니다.\n\n제가 행동파인 타루라면 그 우두머리들을 먼저 노릴 겁니다. 모일 중심이 없으면 저습지를 위협하는 싸움도 끝날 겁니다.', '', '', '', '', '', '', 47187),
(66107, 'koKR', '야생동물 구출', '안식 없는 저습지의 야생동물을 구출해야 합니다.', '저습지에 큰일이 벌어진 건 생태학자가 아니어도 알 수 있을 겁니다.\n\n그런데도 제가 여기 가만히 앉아 시신이나 부검하고 있는 건 이스카 때문입니다. 아니, 저기 생물들이 처음부터 안 죽게 막아야 했다고요. 붉은용군단은 생명을 해체하는 게 아니라 보존해야 하는 것 아닙니까?\n\n저는 이스카를 아끼고, 일을 잘 한다는 것도 알지만, 이렇게 꾸물대다간 구할 저습지가 하나도 안 남을지도 모르겠습니다. \n\n생각만 하는 이스카는 제가 상대할 테니 당신은 발로 뛰면서 야생동물을 구하세요.', '', '', '', '', '', '', 47187),
(66106, 'koKR', '껍데기는 가라', '흠뻑아귀 및 바람지느러미 골록에게서 물 주입 껍질 $1oa개, 바람 주입 껍질 $1oa개를 수집해야 합니다.', '이스카가 보이는 게 다가 아니라 했을 때 의심하지 말 걸 그랬습니다. 처음 친해질 때부터 저보다 두 발은 앞서 있는 친구였는데 말이에요.\n\n이제라도 뉘우친다는 마음을 행동으로 보여야겠습니다. 껍질이 정기의 혼돈을 유발하는 거라면 녀석들 야영지로 밀고 들어가서 껍데기를 빼앗으면 그만이지 않겠어요?\n\n바람과 물의 껍질을 넉넉하게 모아다 주세요. 이스카가 만족스럽게 연구하고도 남을 만큼.', '', '', '', '', '', '', 47187),
(66105, 'koKR', '칼이라는 이름의 해결책', '광포한 물의 정령 $1oa마리, 광포한 바람의 정령 $1oa마리를 처치해야 합니다.', '이곳에서 안전하게 자료를 수집하고 있긴 하지만... \n\n타루는 뛰어난 생태학자예요. 그리고 우린 행동을 선호하는 편이죠. 문제는 이 생태계가 몹시 섬세해서, 조심하지 않으면 훼손될 수도 있다는 겁니다. 그런데 시간이 없는 것도 사실이에요. \n\n타루의 생각을 따르는 게 좋을지도 모릅니다. 조금은요.\n\n폭주하는 정령을 제거하면 연구를 더 지체하는 일 없이 시간을 벌 수 있을 겁니다. 동일한 수만큼 제거해 주세요. 여기서 균형을 더 깨뜨리고 싶진 않아요.', '', '', '', '', '', '', 47187),
(66104, 'koKR', '법의생태학', '골록 시체를 해부해야 합니다.', '더는 못 참겠습니다, $n 님. 타루와 저는 거의 모든 시체를 조사해놓고 고작 접근 방법에 의견이 갈려서 막히고 말았습니다. 제 말을 전혀 안 듣더군요!\n\n<한숨을 내쉬는 생태학자 이스카>\n\n저희 둘 다 지금 상황에 진절머리가 납니다. 저는 확실한 가설조차 못 세우겠습니다.\n\n당신은 비위가 강해 보이시는군요. 마지막 골록 두 마리를 담당해보시지 않겠습니까? 제 메스를 빌려드리겠습니다.', '', '', '', '', '', '', 47187),
(66103, 'koKR', '비위 맞춰주기', '흑요석 보루에서 검은갈퀴 암살자와 검은갈퀴 응징자 $1oa명의 실력을 시험해야 합니다.', '흑요석 성채를 지킬 병력이 더 필요합니다. 교두보를 확보했으니 이제는 새로운 인력을 투입할 차례입니다.\n\n흑요석 보루에 주둔 중인 예비군이 있으니, 그들의 지원을 받으면 될 겁니다.\n\n훈련 상태는 준수하지만 용사님처럼 우수하고 경험이 풍부한 상대와 실전 대비를 하면 큰 도움이 될 겁니다. 준비되면 말씀하십시오.', '', '', '', '', '', '흑요석 보루에서 가혹한 자 파오를 만나야 합니다.', 47187),
(66101, 'koKR', '아찔한 높이', '측량사의 원반을 사용해 하늘로 튀어 올라 지역을 정찰해야 합니다.', '토디와 날레디아가 지금 바로 주변 지역에 대한 측량 보고서를 보내달라고 요청했소.\n\n다행히 마법을 부여한 망원경과 측량사의 원반을 마련해뒀지. 이 두 가지면 하늘에서 안전하게 주변 지역을 정찰할 수 있을 거요.\n\n여기서 문제는 내가 지독한 고소공포증 환자라는 사실이지. 도저히 저 장치에 올라갈 엄두가 나지 않는군.\n\n그대는 높은 곳을 두려워하지 않는 걸로 아는데, 그렇지 않소?', '', '', '', '', '', '', 47187),
(66100, 'koKR', '귀중한 보급', '길잡이 보급품 가방 $1oa개를 수집해야 합니다.', '정말 큰 실수를 저질렀습니다. 잠깐 야영지를 떠났을 뿐인데, 돌아와 보니 타라세크가 제가 묶어놓지 않은 물건들을 전부 채가고 있지 뭡니까.\n\n값이 나가는 보급품들이라 더 달라고 요청하기도 힘듭니다! 제 언니인 노리는 이미 저를 부주의한 사람이라 생각하고요.\n\n계곡을 통과하실 계획이시면 흩어진 보급품 가방도 찾아봐 주시지 않겠습니까?', '', '', '', '', '', '', 47187),
(66087, 'koKR', '정리할 시간', '흐르는 모래에서 잃어버린 시간의 적 처치, 청동용 아군 강화, 잃어버린 유물 반납, 시간의 균열 닫기와 같은 활동을 통해 시간여행단을 지원해야 합니다.', '침공으로 시간의 길의 내구성이 한계에 도달했습니다. 숙련된 시간여행단이 모두 모였다면 달랐을 텐데!\n\n당신은 아직 지팡이만 있는 수습생이면서도 큰 도움이 되었다고 하더군요. 조금만 더 힘을 내면 우리의 대의에 보다 큰 도움을 줄 수 있을지도 모릅니다.\n\n평소 같으면 정식 훈련이라도 진행했겠지만... 요즘 시대가 워낙 특이해야죠. 심화 지식이 담긴 두루마리를 드리겠습니다. 이걸 사용해 놈들을 물리치십시오! 다만 효과는 일시적이니 서두르셔야 할 겁니다.', '', '', '', '', '', '', 47187),
(66085, 'koKR', '시간을 되돌릴 수 있다면', '시아제라텔과 함께 흐르는 모래에 있는 시간의 균열을 닫아야 합니다.', '진정한 시간여행단은 절대 위기를 대충 해결하고 넘어가지 않아요. 이미 필요한 도구가 있는데 엉덩이 깔고 앉아서 조사나 할 이유가 어디 있죠?\n\n당신에겐 내 지팡이가 있고, 저도 따로 쓸 여분을 구했잖아요. 어차피 달리 누구도 이걸 찾지 않을 거예요. 자, 힘을 합쳐서 균열을 처리하고 오늘의 구세주로 등극하는 건 어때요? 따지고 보면 영원한 구세주가 되는 셈이겠네요. 제가 아직 시간여행단식 화법에 적응이 안 돼서 좀 어설퍼요. \n\n어때요? 일 자체는 간단할 거예요.', '', '', '', '', '', '', 47187),
(66084, 'koKR', '요즘 같은 시간', '흐르는 모래에 있는 잃어버린 시간의 적에게서 시간의 잔류물 $1oa개를 모아야 합니다.', '훈련 중에 작은 소동이 일긴 했지만, 그대는 우릴 도울 능력을 충분히 갖췄다고 믿소.\n\n계곡에서 시간 왜곡 현상이 발생하면서 온갖 시간대가 우리의 것과 얽히고 있다오. 시간대가 연결된 원인은 아직 모르오. 다시 말해 정보가 더 필요하단 얘기요.\n\n다른 시간대에서 도착한 방문자들에 대한 정보를 캐내 보시오. 지나온 길에는 분명 잔류물이 남아있을 거요. 그걸 연구하면 이 사태를 극복할 방법을 알아낼 수도 있소.', '', '', '', '', '', '', 47187),
(66083, 'koKR', '마치 처음처럼', '안단테노르무와 대화하여 시간여행단 훈련에 참여해야 합니다.', '시간의 길을 관리하는 임무는 매우 위험하다오. \n\n그대는 비록 시간여행단이 아니지만, 크로노르무 대사께선 그대가 큰 힘이 되리라고 믿으시더군. 다만 안전을 위해서는 우선 제대로 된 훈련부터 거칠 필요가 있겠소.\n\n안타깝게도 지도에 재능이 있는 이들은 아직도 실종된 상태라오. 내가 최선을 다하는 수밖에. 얼마나 좋은 결과가 나오는지 어디 같이 지켜봅시다. 크로노르무 대사께서 우리에게 많은 기대를 걸고 계신다오.', '', '', '', '', '', '', 47187),
(66082, 'koKR', '병 속의 시간', '탈드라서스의 흐르는 숲에서 시간으로 충만해진 야생동물을 처치해 시간의 마력을 모아야 합니다.', '잘했어요! 시간여행단 지팡이는 멀쩡해요! 근데 완전히 소진된 상태네요.\n\n괜찮아요! 숲 야생동물들에게 축적된 시간 마력으로 충전할 수 있으니까요. 안타깝지만, 영향을 받은 생물의 목숨을 거둬야 한다는 얘기예요. 마력 때문에 그 아이들이 위험하고 불안정한 존재가 되기도 했고, 어쨌든 수는 좀 줄여야 할 필요도 있었고... \n\n대의에는 가끔 희생이 따르는 법이죠. 도와줄 수 있을까요? 전 아직 시간이 더 필요해서요.', '', '', '', '', '', '', 47187),
(66081, 'koKR', '촉박한 시간', '탈드라서스의 흐르는 숲에서 시간의 수집기 $1oa개를 모아야 합니다.', '청동 사원이 공격을 받은 탓에, 시간 마력이 골짜기 온 사방에 스며들고 있어요.\n\n잘못된 마법을 전부 수습하려고 시간여행단이 숲 전체에 수집기를 설치해뒀죠. 수집한 마력은 여분의 전력으로 활용할 수도 있고요! 그나마 이 사태가 자원을 전부 빨아들이고 있다는 게 다행이네요.\n\n수집기를 회수하는 게 제 임무인데, 아직 숨 돌릴 시간이 필요해요.\n\n대신 도와주실 수 있을까요?', '', '', '', '', '', '', 47187),
(66080, 'koKR', '시간 문제', '탈드라서스의 흐르는 숲에서 실종된 신병을 찾아야 합니다.', '반갑소, $c|1이여;여;. 딱 맞춰 왔군!\n\n사원에 소란이 일어나는 바람에 시간의 길이 불안정해졌소. 심지어 계곡에까지 그 여파가 미치고 있다오. 또, 시간여행단원조차 적잖이 실종된 상황이지.\n\n추가 지원을 요청했는데 아직 도착하지 않은 신입이 하나 있다오.\n\n한번 찾아봐 줄 수 있겠소? 다만 조심하시오. 계곡 안쪽 시간의 흐름이 크게 어지러운지라 무슨 위험이 도사리고 있을지 종잡기 어렵소.', '', '', '', '', '', '', 47187),
(66079, 'koKR', '래시온의 기다림', '흑요석 보루에서 래시온을 만나야 합니다.', '이 알들은 새로운 용 세대의 상징이로다. 이 아이들은 보호와 보살핌을 받아 마땅하다. 하지만... 마음이 아프구나. 래시온이 걱정된다. 그 굴하지 않는 결의가 우행으로 이어질 것만 같구나. \n\n$n|1이여;여;, 너는 오랜 세월 신뢰할 만한 친우였으니 나 대신 가서 그를 도와다오. \n\n흑요석 보루 인근에서 그를 찾아 지켜주거라. 그의 용군단은 이제 수가 많지 않으니.', '', '', '', '', '', '흑요석 보루에서 래시온을 만나야 합니다.', 47187),
(66078, 'koKR', '날카로운 시험', '검은갈퀴 암살자와 검은갈퀴 응징자 $1oa명의 실력을 시험해야 합니다.', '난 오랜 시간 검은갈퀴를 돌보면서 이들이 너와 같은 수준에 오르도록 가르치고 자극했다.\n\n물론 너라는 엄청난 목표에 다다르지는 못했지만, 그래도 나름의 수준은 달성했지. 이들은 내 자랑이다.\n\n네가 실력을 검증해주면 다들 영광이라 생각할 것이다. 아마 너도 감회가 새로울지도 모르지.', '', '', '', '', '', '', 47187),
(66076, 'koKR', '고대 용뿔두꺼비', '', '', '', '', '', '', '', '', 47187),
(66074, 'koKR', '원시 사이시드 여왕', '', '', '', '', '', '', '', '', 47187),
(66071, 'koKR', '하늘을 나는 로크', '부상당한 푸른깃 로크 $1oa마리를 치료해야 합니다.', '저는 할린 처프스나이드 교수라고 해요. 실력 좋기로 악명 높은 조류학자죠! 이 용의 섬에 산다는 전설 속의 푸른깃 로크를 연구하러 왔는데 아무래도 더 큰 새를 요리하게 생겼군요.\n\n장담컨대 이 하피는 용의 섬이 열렸을 때 유입된 녀석들일 거예요. 침해성이 매우 강한 데다, 꼭 빌지워터 도박장 뷔페에 온 오우거 무리처럼 마구잡이로 먹어 치우고 있죠.\n\n토착 로크들에게 반격의 기회를 주자고요. 이 의료 도구를 받으세요. 부상당한 친구들이 다시 일어날 수 있게 치료해 주세요.', '', '', '', '', '', '', 47187),
(66070, 'koKR', '브라이트블레이드의 뼈', '', '', '', '', '', '', '', '', 47187),
(66057, 'koKR', '믿음의 복원', '흑요석 서약의 돌을 수리해야 합니다.', '깨진 파편이 다시 합쳐졌네. 이로써 서약의 돌을 고칠 준비는 끝났군.\n\n가서 래시온 님을 도와 수리를 마무리하게.', '', '', '', '', '', '흑요석 왕좌에서 래시온을 만나야 합니다.', 47187),
(66056, 'koKR', '새로운 미래 개척하기', '대지의 수호자의 제련소를 준비해야 합니다.', '대지의 수호자의 제련소는 현존하는 그 어떤 용의 제련소보다도 강력하네. 우리 선조들께서는 그곳에서 사상 최강의 무기와 방어구를 만들어 아제로스를 수호하셨지.\n\n그 제련소의 화덕에 조각난 서약의 돌 파편을 복구하는 데 필요한 힘이 깃들어 있네.\n\n가서 작업을 진행할 수 있게끔 제련소를 준비해 놓으세나.', '', '', '', '', '', '제련장인 바젠투스에게 잿더미파편 석탄을 전달해야 합니다.', 47187),
(66055, 'koKR', '산산이 조각난 과거', '서약의 돌 파편 $2oa개를 회수해야 합니다.', '서약의 돌이 손상됐네. 조각 몇 개가 사라졌어.\n\n파편을 최대한 많이 찾아주게... 돌을 복원할 방법이 있을지도 모르네!', '', '', '', '', '', '', 47187),
(66049, 'koKR', '흑요석 서약의 돌', '흑요석 서약의 돌을 찾아야 합니다.', '$n|1이여;여;, 넬타리온은 대지의 수호자가 되었을 때 이 세상을 지키겠다고 맹세했다. 대지 깊은 곳을 지키고, 그의 용군단과 함께 아제로스의 수호자가 되겠다고 했지. 그 약속의 증거가 바로 흑요석 서약의 돌이다. \n\n돌을 활성화해서 온 용의 섬에 검은용군단의 귀환을 알리자!\n\n따라와라, $n.', '', '', '', '', '', '', 47187),
(66048, 'koKR', '최고의 계획과 의도', '래시온의 병력을 이루는 여러 구성원과 계획을 검토해야 합니다.', '흑요석 성채를 차지한 자라딘을 공격하기란 쉬운 일이 아니다. 래시온 님과 검은갈퀴 병력이 있어도 힘든 싸움이 될 거다. 래시온 님은 자신 있어 하시지만, 난... 확신이 안 선다.\n\n전략을 짤 수 있게 도와주는 이들과 말해보면 개선할 점을 찾을지도 모른다.', '', '', '', '', '', '흑요석 보루에 있는 래시온에게 알아낸 정보를 보고해야 합니다.', 47187),
(66044, 'koKR', '성벽 장악', '공성 석궁 세 대와 용사 초루크를 처치해야 합니다.', '지금 사벨리안과 다른 용들이 자라딘을 막고 있다. 어서 첨탑들을 점령해서 승리를 거머쥐어야 해.\n\n너와 나는 저 위에서 사격하는 공성 석궁을 처리하러 가자.\n\n준비가 끝나면 말해라.', '', '', '', '', '', '래시온을 만나야 합니다.', 47187),
(66040, 'koKR', '다시 미래로', '시간의 차원문이 생성될 때까지 검은 제국에 맞서 아군을 보호해야 합니다.', '시간 속으로 더 떨어지지는 않겠지만 벌써 먼 과거까지 와버렸네요. 정말 먼 과거예요. \"아직 티탄이 아제로스에 오지도 않았어\"급 과거요. 집에 가려면... 좀 힘들겠어요.\n\n하지만 저희 용이 있으니 할 수 있어요!\n\n그러려면 당신이 저 검은 제국의 하수인들을 막아주셔야 해요. 그렇게 오래 걸리진 않을 거예요! \n\n아마도요.\n\n네.\n\n걱정하지 마세요! 그냥 저 으스스한 괴물들만 물리쳐주시면 나머지는 저희가 알아서 할게요! 쉽죠?', '', '', '', '', '', '', 47187),
(66039, 'koKR', '크로미의 시간', '크로미를 찾아 시간 안정화 의식을 완료해야 합니다.', '여긴... 검은 제국이로군. 정말 먼 과거까지 오게 되었소.\n\n저기! 크로노르무 대사님과 이터누스요! 서둘러서 의식을 완성해야 하오. \n\n내 호기심조차도 다음은 어디로 가실지 보고 싶게 하진 못하오.', '', '', '', '', '', '', 47187),
(66038, 'koKR', '시간 추격전!', '크로미와 이터누스의 길을 따라 시간을 넘나들어야 합니다.', '$n|1이여;여;, 크로노르무 대사님을 따라잡으려면 빠르게 움직여야 하오. 말 그대로 말이오.\n\n제라와 내가 어떻게든 과정을 빠르게 만들겠지만, 이 시대와는 최대한 엮이지 말아야 하오. 엮여서 속도가 느려지는 바람에 대사님이 노즈도르무 님의 마법마저 닿지 않는 곳으로 가면 영영 따라잡지 못할 수도 있소.\n\n한순간도 지체할 수 없소!\n\n|cFF0000FF(퀘스트를 수락하면 타이머가 시작됩니다)|r', '', '', '', '', '', '', 47187),
(66037, 'koKR', '다시 현실로', '현재에 있는 노즈도르무에게 가야 합니다.', '우리 시간과 크로노르무 대사님의 연결을 강화할 수 있었소. 다음에 그분을 또 찾으면 의식을 완성할 수 있을 것이오.\n\n지금은 우리의... 덜 멀록스러운 현재 세계로 돌아가는 게 좋겠소.', '', '', '', '', '', '', 47187),
(66036, 'koKR', '므오옳옳옳!', '므오옳옳옳아옳아옳!', '므오옳옳옳아옳아옳! 그오옳옳옳아옳아옳!\n\n그오옳옳옳아옳 오옳옳옳아옳 그오옳 그오옳 옳. 므오옳옳옳 그오옳옳옳 므오옳 그오옳옳옳. 므오옳옳옳아옳아옳 그오옳 그오옳옳옳 그오옳옳옳 그오옳옳옳.\n\n므오옳옳옳아옳 그오옳 그옳.\n\n<말을 알아들을 수는 없으나 칼로 찌르는 동작을 여러 차례 반복합니다. 멀록이 무언가를 해치워달라는 이야기 같습니다.>', '', '', '', '', '', '', 47187),
(66035, 'koKR', '멀록 티끌', '시간 티끌 $1oa개를 흡수해야 합니다.', '멀록에 의해 발생한 또 다른 시간의 길이라니?!\n\n이기적인 부탁을 해서 미안하오만, 혹시 크로노르무 대사님을 찾는 동안 시간 마력 티끌도 몇 개 모아줄 수 있겠소? \n\n티끌 안으로 걸어 들어가기만 하면 지팡이가 알아서 모아줄 거요. 자료는 내가 나중에 분석해 보리다. 아제로스의 온갖 현실을 헤집는 일이 끝나면 말이오.', '', '', '', '', '', '', 47187),
(66033, 'koKR', '과거를... 향하여?', '차원문을 사용해 아즈메로스에서 안단테노르무를 만나야 합니다.', '크로노르무를 안정시키지 못한 것은 통탄할 일이나, 아직 다른 지점이 하나 남아 있다. 그곳을 통하면 시간 속으로 추락하는 크로노르무를 붙잡을 수 있을 것이야. \n\n<미간이 골이 패이는 노즈도르무>\n\n언뜻 봤을 뿐인데도 이 시간의 길의 과거는... 기묘하구나. 내 살아오면서 목격한 환영 중에서도 독보적이군.\n\n각오 단단히 하려무나, $n. 네가 무엇을 마주할지는 모른다. 하지만 강력하고... 희한하게 친숙한 느낌이 든다.', '', '', '', '', '', '차원문을 사용해 아즈메로스에서 안단테노르무를 만나야 합니다.', 47187),
(66032, 'koKR', '현재로 귀환', '현재에 있는 노즈도르무에게 가야 합니다.', '이 시간의 길은 어둡고 혼란스럽군요. 심각한 왜곡이 일어났어요. 저는 여기 조금 더 남아서 나타날 여파를 막아보겠어요. \n\n노즈도르무 님께 돌아가세요. 반절의 성공이지만, 그래도 우리 성과를 알려드리는 게 좋겠어요.', '', '', '', '', '', '', 47187),
(66031, 'koKR', '시간 창출', '정기의 정수를 수집해 생존자 야영지로 가져가야 합니다.', '이런 곳에서 날 만날 줄이야. 하긴, 그리 놀랄 일도 아니지.\n\n이건 내가 바랐던 아제로스의 모습이 아니야. 그렇지만 엄연한 현실이지. 우린 남은 것을 지키고 세상을 되찾기 위해 싸우고 있었다. 너희가 나타난 탓에 일이 꼬여버린 거지. \n\n우린 정령의 정수를 원동력 삼아 안전을 영위한다. 저기 저 보호막 보이지? 저게 우리의 파멸을 막는 유일한 수단인데 너희가 오면서 자원이 바닥나 버렸다. 하지만 정수를 모아오면 우리가 며칠 더 목숨을 부지할 수 있을지도 모르지.', '', '', '', '', '', '', 47187),
(66030, 'koKR', '무의미하지 않은 저항', '원시술사 평행세계에서 저항군 투사를 치유해야 합니다.', '시간의 물결 때문에 이곳 사람들이 난처해졌어요. 적이 있으면 안 될 곳이 나타나거나, 훨씬 강력한 모습으로 출현하고 있죠. 이런 작은 변화조차도 재앙같은 일이죠.\n\n용사님은 이곳의 저항군을 도와주세요. 상처를 치유해 다시 싸울 수 있게 돕는 거예요. 애초에 우리하고 아무 일도 없었던 것처럼 시간의 길을 바로잡는 거죠. 눈부신 도움은 못 돼도 그게 우리가 해줄 수 있는 일이에요.', '', '', '', '', '', '', 47187),
(66029, 'koKR', '시간 조율', '원시술사 평행세계에서 이터누스와 크로미에게 시간 수정을 사용해 시간 속으로 빠져들지 않도록 방지해야 합니다.', '크로노르무와 이터누스는 시간 속으로 끊임없이 빠져들고 있다. 하지만 중간에 한 번씩 멈추는 게 느껴지더구나. 이 찰나의 순간을 비집고 들어가 둘을 찾아야 한다.\n\n<작은 시간 수정을 만들어내는 노즈도르무>\n\n이 수정에 힘과 내 시간의 공명을 주입해 두었다. 둘이 꽤 골치아픈... 미래로 갔을 수도 있다. 찾거든 이걸 사용하거라. 다시 사라지기 전에 시간 내에서의 위치를 바로잡을 수 있을 거다.', '', '', '', '', '', '현재에 있는 노즈도르무에게 가야 합니다.', 47187),
(66028, 'koKR', '미래를 향해!', '원시술사 평행세계로 이동해야 합니다.', '크로노르무와 이터누스를 추적한 끝에 어떤 한 미래를 발견했다. 그곳에 무엇이 있는지는 나도 모른다. 단지 암울하고 혼란스럽다는 것만 알 뿐.\n\n이 시간과의 안정적인 연결을 유지하는 차원에서 소리도르미가 시간여행단 몇몇을 데리고 그 미래로 출발했다. 소리도르미는 차원문을 유지하는 데만 상당한 힘을 쏟아야 할 테니, 네 도움이 필요할 것이야.\n\n자세한 설명은 소리도르미가 직접 해 줄 것이다.\n\n서둘러라, $n. 크로노르무를 찾아다오.', '', '', '', '', '', '원시술사 평행세계에서 소리도르미와 대화해야 합니다.', 47187),
(66027, 'koKR', '푸른용 소집', '칼렉고스가 푸른용군단을 불러들이는 모습을 목격해야 합니다.', '더 이상 푸른용을 규합하는 데 망설이지 않을 겁니다, $n 님. 옛 모습의 자취만 남은 파편으로 살아가는 것보단... 하나의 가족으로 뭉치는 편이 훨씬 낫겠지요.\n\n서약의 돌을 수복하지 못해도 그 힘으로 모든 푸른용에게 전언을 보낼 순 있을 겁니다. \n\n위상의... 목소리를 들려줄 때가 되었습니다.', '', '', '', '', '', '', 47187),
(66026, 'koKR', '시급한 대처 필요', '담쟁이가죽에서 브레나를 만나야 합니다.', '이번 공격은 십중팔구 담쟁이가죽 놀들 소행이에요.\n\n사실 우리 부족과 수 세대에 걸쳐 싸우긴 했지만, 오늘 전까지만 해도 조금 성가신 수준의 상대였단 말이죠.\n\n이렇게 된 이상 놀을 상대로 특단의 조처를 취하는 수밖에 없겠습니다. 놈들의 부정한 부패는 결국 하늘빛 평원을 파멸로 몰아넣을 거예요. 당신이 찾는 목표라고 무사할 순 없겠죠.\n\n담쟁이가죽 소굴 바깥에서 만나요. 지원이란 지원은 전부 끌어모아야 합니다.', '', '', '', '', '', '', 47187),
(66025, 'koKR', '노쿠드의 위협', '다음 행보를 논의해야 합니다.', '노쿠드 부족의 군대가 마루카이를 장악하고 있다. \n\n칸의 방에서 다음 계획을 논의하도록 하지. 마루크를 지켜야 한다.', '', '', '', '', '', '', 47187),
(66024, 'koKR', '흔적 은폐', '경비병 바히르를 처치해야 합니다.', '노쿠드가 우리 종족이 먼 옛날 치렀던 전쟁 이야기에 정신 못 차릴 정도로 매료된 모양이지. 그래봤자 놈들의 현실은 소꿉놀이나 하는 나약한 애송이들일 뿐이다. 번개 한 방에 온아라 님과의 유대를 끊어버렸지.\n\n뭐, 좋다! 타락의 길을 걸어가며 전쟁을 치르겠다면 소원을 들어줘야지.\n\n바히르가 뒷수습을 지휘하고 있더군. 곧 흙을 피로 물들이게 되리라.', '', '발라카르의 명으로 지휘를 맡은 바히르는 이 순간을 오래도록 기다려왔습니다.', '경비병 바히르', '', '', '카남 마트라 사레스트에게 가야 합니다.', 47187),
(66023, 'koKR', '휴전 파기', '노쿠드 병력 $1oa명을 처치해야 합니다.', '발라카르는 제 부족에 먹칠을 하고 있다. 힘을 탐하다 못해 눈이 멀어 자기 부족을 폭풍 속으로 끌고 가고 있지.\n\n이번 배신은 놈들이 얼마나 나약한지 보여주는 증거다. 모조리 해치워라.', '', '', '', '', '', '', 47187),
(66022, 'koKR', '카남 마트라', '칸수호병 아카토에게 보고하여 제미사스와 함께 카남 마트라를 알현해야 합니다.', '언제까지고 켄타우로스의 땅에 머무를 순 없습니다. 가능한 한 빨리 일을 마치고 정원으로 돌아가야 해요.\n\n카남 마트라가 우리의 지원 요청을 듣기로 해줬습니다. 마루카이 중앙 건물인 크루탈 정상에서 제가 도착하기를 기다리고 있죠.\n\n처음에는 독대를 해야겠지만, 그래도 용사님이 동행해 주신다면 대환영입니다.', '', '', '', '', '', '', 47187),
(66021, 'koKR', '불청객', '노쿠드 켄타우로스 $1oa명을 쓰러뜨려야 합니다.', '하! 그 꼴을 봐라. 나약하기 짝이 없어. 네놈을 데려온 약골 사냥꾼 잡것들하고 다를 바 없군.\n\n노쿠드를 알고 싶다고 했나? 우린 말 대신 전투로 증명한다. \n\n우리의 전투 의식은 \"타바르\"라고 한다. 훈련과 대련은 우릴 더욱더 단단하게 만들지. 지금의 우리 부족에 약점은 없다.\n\n떠드는 건 여기까지. 가서 대련을 시작해라.', '', '', '', '', '', '정찰병 토물에게 가야 합니다.', 47187),
(66020, 'koKR', '징조와 향', '달곰꽃 $1oa송이를 채집한 뒤, 갈아서 달콤덩쿨 향을 만들어 온 새쉬탱의 의식을 도와야 합니다.', '마루카이에 들어오기 전에 티가리 칸께 우리가 받은 징조를 알려드렸네. 칸께서도 바람에 한기가 서려 있다고 말씀하시면서 우려를 표하시더군.\n\n우리가 이곳에서 특별히 기르는 꽃이 있네. 꽃잎을 갈아 태우면 꿈꾸는 듯한 효과를 일으키지. 징조와의 유대를 강화할 때 쓰인다네. \n\n그 꽃 몇 송이를 가져오게나. 향을 만들어 피울 걸세. 우리 칸께서 도와주신다면 온아라 님이 어떤 고난을 치르고 계신지 자세히 할 수 있을 것이야.', '', '', '', '', '', '', 47187),
(66019, 'koKR', '선조를 기리며', '카린 도투르를 도와 선조에게 바칠 음식을 조리해야 합니다.', '선조들께서는 온아라의 바람에 몸을 싣고 우리의 길을 인도하고, 보호해 주시지. 쿠랄에서는 생사를 떠나 모든 마루크가 모이게 되어 있어.\n\n그리고 이 식사의 향이 선조들을 우리의 불가로 불러들이는 원동력이야. 그분들이 도착하시면 쿠랄이 시작되지.', '', '', '', '', '', '', 47187),
(66018, 'koKR', '노쿠드 부족', '토물을 따라 경비병 바히르에게 가야 합니다.', '<산소크 칸의 신호에 따라 입을 여는 오키르>\n\n노쿠드 부족은 최근 강자로 떠오른 이들이다. 전대 칸 자칸이 강력한 군대를 길러 다른 부족으로부터 영토를 빼앗았지. 그게 우리 켄타우로스의 법도니 말이다.\n\n다만 자칸은 존경받았지만 그 아들은 그러지 못했다. 발라카르는 아버지를 살해하고 부족을 장악했거든. 그 사건 이후로 노쿠드의 배타적인 경향이 훨씬 심해졌지. 하지만 마루크를 알려면 노쿠드 역시 알아야 한다.', '', '', '', '', '', '노쿠드 야영지 주변에서 정찰병 토물을 만나야 합니다.', 47187),
(66017, 'koKR', '온이르 부족', '비술사 웅덩이에서 온 새쉬탱을 만나야 합니다.', '<산소크 칸의 신호에 따라 입을 여는 오키르>\n\n온 새쉬탱 같은 우리네 대지의 비술사는 온이르 부족에 속한다. 온이르 부족은 혈연으로 이뤄져 있지 않아. 온아라 님과의 유대를 타고난 평야의 켄타우로스들로 구성되어 있지. 이들은 그 유대를 더욱더 탄탄하게 쌓아 올리며 능력을 갈고닦는다. 그러다 때가 되면 여러 부족에 조언을 제공하고 우리의 터전을 지키는 임무를 받지.\n\n온 새쉬탱은 계시받은 징조에 관한 얘기를 하러 온이르의 칸에게 갔다. 가서 온이르에 대해 자세히 알아보도록.', '', '', '', '', '', '비술사 웅덩이에서 온 새쉬탱을 만나야 합니다.', 47187),
(66016, 'koKR', '티라이 부족', '카린 도투르에게 보고해야 합니다.', '<산소크 칸의 신호에 따라 입을 여는 오키르>\n\n티라이 부족은 우리의 카남 마트라가 속한 부족이자 마루크 선조의 직계 후손이다. 우리네 전통은 물론이요, 이야기꾼이 그 부족에서 비롯되었다고 할 수 있지.\n\n마루크를 이해하려면 티라이 부족을 이해해야 한다. 카남 마트라의 딸 중 하나인 카린 도투르가 지금 선조들에게 바칠 식사를 준비하고 있다. 그녀를 도와라. 우리 종족의 방식을 알려줄 거다.', '', '', '', '', '', '카린 도투르에게 보고해야 합니다.', 47187),
(66015, 'koKR', '푸른용 서약의 돌', '칼렉고스를 따라 푸른용 서약의 돌을 확보해야 합니다.', '하늘빛 평원은 안정됐고, 푸른용도 제때... 도착하고 있습니다.\n\n하늘빛 기록 보관소로 돌아가 서약의 돌을 수복할 때입니다.\n\n$n 님도 함께해 주셨으면 해요. 이번 역경을 헤쳐나오는 데 결정적인 역할을 해주셨으니.', '', '', '', '', '', '', 47187),
(66011, 'koKR', '이세라를 추억하며', '다시 테라무스를 찾아야 합니다.', '아, 이런! 이제야 알 것 같아요. 테라무스 님은... 이세라 님을 그리워하시는 거예요. 돌아오지 못하는 분을요.\n\n따라오세요! 어디로 가셨는지 알겠어요. 그분을 더 번거롭게 할 건 아니고, 죄송하다는 말씀을 드리고 자리를 비켜드리도록 하죠.\n\n우린 자연을 벗 삼아 서로를 보듬기 위해 이곳에 있는 것이니까요.', '', '', '', '', '', '', 47187),
(66009, 'koKR', '바크스로스 방어전', '파괴자 코르스록스를 처치해야 합니다.', '때가 됐습니다, $n 님. 지상을 정리해주신 덕택에 상공의 원시술사 병력이 줄어들고 있습니다.\n\n힘 써주신 덕분에 라자게스가 부관을 불러들여 원시술사 병력을 강화하려 합니다.\n\n제가 앞에서 라자게스를 상대하며 카드가를 도울 동안 그 괴물을 처리해 주십시오.\n\n전투 도중에 제 마법을 찾아보세요. 기회가 닿는 대로 돕겠습니다.\n\n라자게스에게 마법의 위상의 분노를 맛보여줍시다!', '', '라자게스의 부관 중 하나로, 푸른용을 파멸시키는 데 혈안이 되어 있습니다.', '파괴자 코르스록스', '', '', '바크스로스 상부에서 카드가와 대화해야 합니다.', 47187),
(66007, 'koKR', '자유로운 바람', '용암 봉화 $1oa개를 파괴해야 합니다.', '원시술사들이 저 거대한 보주를 이용해 칼렉고스의 접근을 차단하고 있소. \n\n이대로 가다간 칼렉고스가 더는 싸울 수 없을 정도로 심각한 부상을 당하고 말 거요. 그가 당하면 라자게스를 저지할 수도 없겠지.\n\n그 강화된 보석을 사용하면 정령으로 변장해 돌아다닐 수 있을 것이오.\n\n그런 다음 보석으로 보주를 파괴하시오. 숨통을 터주면 칼렉고스가 힘을 발휘할 수 있을 테니.\n\n나는 탑에 보호막을 쳐 라자게스를 막아내는 데 집중하겠소.', '', '', '', '', '', '바크스로스 정상 내 동굴에서 칼렉고스를 만나야 합니다.', 47187),
(66006, 'koKR', '로샤에게 가기', '제철공 로샤에게 보급품을 반납해야 합니다.', '바바는 휴식을 취했고 로샤의 보급품도 되찾았다. 로샤의 화를 걱정 않고도 돌아갈 수 있겠군. \n\n갈 때 상자 몇 개를 가져가라. 나머지는 전사들을 보내 회수하도록 하겠다.', '', '', '', '', '', '', 47187),
(66005, 'koKR', '쓰러진 친구의 메달', '카사르에게 쓰러진 친구의 메달을 돌려줘야 합니다.', '<이 반쯤 먹힌 쇳덩이는 한때 아름다운 장신구였으며, 시카르 켄타우로스에게 중요한 물건이었습니다. \n\n카사르가 그 주인을 알지도 모릅니다.>', '', '', '', '', '', '카사르에게 쓰러진 친구의 메달을 돌려줘야 합니다.', 47187),
(66004, 'koKR', '갈그레쉬', '', '', '', '', '', '', '', '', 47187),
(66003, 'koKR', '속박의 고리', '타오르는 결속 고리 $1oa개를 모아야 합니다.', '이 지역 자라딘이 한층 더 대범해졌습니다. 불의 정령을 구속해 날뛰게 만들고 있죠. 야생동물들은 달아난 지 오래고, 야영지 바로 앞까지 정령들이 들이닥친 상황입니다.\n\n다행인 건 제가 자라딘이 풀어놓은 불의 파도를 막아낼 돌의 보루를 작게나마 만들어 두었다는 것이지요... 순순히 굴복할 생각은 추호도 없습니다!\n\n불의 정령을 구속하는 마법의 고리를 모아다 주세요. 불의 정령을 막는 방어선을 강화하는 데 사용할 생각입니다.', '', '', '', '', '', '', 47187),
(66001, 'koKR', '최후의 희망', '마지막 주입된 용의 알을 구출해야 합니다.', '온 새끼용 세대가... 모두...\n\n<허리를 세우고 고개를 드는 센드락스>\n\n아직 확인하지 않은 장소가 한 군데 있습니다. 그 원시용이 알을 뒀을 거대한 의식 장소입니다.\n\n저 무자비한 것들이 세운 방어를 뚫읍시다, $p 님. 아직 구할 수 있는 것을 구합시다.', '', '', '', '', '', '', 47187),
(66000, 'koKR', '알렉스트라자의 도서관', '역사적 의미가 있는 물건 $1oa개를 회수해야 합니다.', '<책장이 까맣게 타 있습니다.\n\n원시술사들이 용군단의 역사를 없애기 위해 고서들을 닥치는 대로 찾아 태워버리고 있는 것 같습니다. 마치 용군단의 존재 자체를 역사에서 지워버리려는 듯합니다.\n\n남은 것들이라도 회수해야 합니다.>', '', '', '', '', '', '', 47187),
(65999, 'koKR', '붉은 이빨과 발톱', '원시술사 침략자 $1oa명을 처치해야 합니다.', '레타나크 사령관님께서 폭풍포식자 라자게스가 감옥을 탈출했다는 보고를 받으셨다고 저희 신병들에게 경고하셨습니다. 라자게스의 하수인들이 주인을 따라 움직이면서 우리의 소중한 것 전부를 위협하고 있는 모양이더군요.\n\n움직이는 속도가 제법 빠릅니다. 이 폐허는 지난번 순찰 때만 해도 아무 인적이 없다는 보고가 있었거든요.\n\n이곳의 원시술사들을 반드시 막아내야 해요.\n\n생명의 어머니를 위하여, 그리고 모든 용군단을 위하여!', '', '', '', '', '', '', 47187),
(65998, 'koKR', '용군단의 미래', '루비용 알을 구출해야 합니다.', '교육을 끝낸 용기병에게 목숨을 걸고 용의 알을 지키는 것보다 숭고한 책무는 없습니다.\n\n용의 알은 우리가 훈련하는 이유이고, 존재하는 이유입니다.\n\n전 이제 숨어서 지켜보지 않을 겁니다, $p 님. 원시술사 놈들은 알을 훔쳐 주입에 이용함으로써 용군단 전체의 미래를 위협하고 있습니다!\n\n압도적인 수적 열세에 놓여있긴 하지만... 함께 싸워주시겠습니까? 용군단을 지키기 위한 싸움에 말입니다.', '', '', '', '', '', '', 47187),
(65997, 'koKR', '센드락스 추적', '생명의 어머니의 정원 폐허에서 센드락스를 찾아야 합니다.', '센드락스 생도라면 얼마 전에 이곳을 지나갔습니다.\n\n모든 용기병은 생명의 웅덩이로 집결하라는 레타나크 사령관님의 명령을 전달했죠. 그래서 저희 수비 연대는 조금 전에 그쪽으로 출발했습니다.\n\n문제는 정찰대가 옛 폐허에 있는지라... 명령을 전달하러 그곳으로 향했습니다.', '', '', '', '', '', '생명의 어머니의 정원에서 센드락스를 만나야 합니다.', 47187),
(65996, 'koKR', '역전용사 지원군', '부상당한 경비병을 돕고 센드락스를 찾아야 합니다.', '레타나크 사령관이 여느 때와 다름없이 훌륭한 혜안을 발휘했소. 위협을 막으려면 누구보다 노련한 경비병들의 도움이 필요하오. 그런 이들을 집결시키는 건 센드락스 같은 젊은 생도에게 완벽한 임무지만, 지원이 필요하긴 할 거요.\n\n센드락스가 가야 할 목적지는 서쪽에 있소. 부상하는 위협에 길이 삼켜졌을지도 모르오. 그쪽에 있는 사람들도 지원이 필요할 터. 이 혼합물을 줄 테니 그들을 도와주시오.', '', '', '', '', '', '관측소 전초기지에서 센드락스를 만나야 합니다.', 47187),
(65995, 'koKR', '흑요석 성채', '칼라시 계획서를 래시온에게 전달해야 합니다.', '<살펴보니 자라딘 야영지가 서로 주고받은 내부 전갈로 보입니다.\n\n특히 \'흑요석 성채\'라는 단어가 눈에 밟힙니다.\n\n래시온에게 보여주면 관심을 표할지도 모릅니다.>', '', '', '', '', '', '', 47187),
(65994, 'koKR', '자라딘 심판', '', '', '', '', '', '', '', '', 47187),
(65993, 'koKR', '판 엎기', '비늘파괴자 성채에서 고기분쇄자 소톡을 처치해야 합니다.', '아! 그래.\n\n막 도착했을 때 거인들의 우두머리가 습격을 마치고 돌아가는 걸 봤지. 야영지 어딘가에서 승리를 기념하고 있을 거다. \n\n누가 연회에 끼어든다면 참 안타깝겠어, 안 그런가?', '', '용심장 전초기지 공격을 이끈 우두머리입니다.', '고기분쇄자 소톡', '', '', '비늘파괴자 성채 안에서 래시온을 만나야 합니다.', 47187),
(65992, 'koKR', '검은갈퀴 첩보', '비늘파괴자 성채에 숨어 있는 래시온의 첩자들과 대화해야 합니다.', '내가 셀리스트라와 하늘에서 시선을 끌 동안, 그림자들이 적 방어선에 침투했다.\n\n내 검은갈퀴 요원들이 요새 상황을 안팎으로 파악하고 있단 얘기지. 검은갈퀴를 찾아 아군임을 밝혀라. 적에 대해 귀중한 정보를 알려줄 거다.', '', '', '', '', '', '비늘파괴자 성채 안에서 래시온을 만나야 합니다.', 47187),
(65991, 'koKR', '심판의 시간', '비늘파괴자 성채에서 래시온과 청지기 셀리스트라를 만나야 합니다.', '청지기님의 계획은 센드락스 생도에게 전해들었습니다. 지원을 확보해서 얼마나 다행인지 모르겠군요. 그들이 개입해준 덕분에 부상자를 생명의 웅덩이로 호송해 치료할 틈을 벌었습니다.\n\n마음만 같아선 경비병을 이끌고 셀리스트라 님을 지원하러 가고 싶지만, 지금은 부상자들을 보호해야 합니다. 용사님이 적의 요새로 가서 합류해 주십시오. \n\n자라딘 문제를 처리할 다른 방법이 있었더라면 저도 그렇게 부탁했을 겁니다. 하지만 상황이 허락하질 않으니...\n\n할 일을 하는 수밖에요.', '', '', '', '', '', '', 47187),
(65990, 'koKR', '다만 악에서 새끼용을 구원하소서', '용심장 전초기지에서 칭얼거리는 새끼용 $1oa마리를 구해야 합니다.', '놈들이 워낙 순식간에 나타난 탓에 제대로 대응할 겨를이 없었습니다. 어린이들과 무력한 이들을 대피시킬 동안 경비병들이 최대한 버텨주긴 했지만, 아직 빠져나오지 못한 사람들이 있는 것 같습니다.\n\n다리를 건너 생존자들이 더 있는지 살펴주십시오.', '', '', '', '', '', '', 47187),
(65989, 'koKR', '침략자 자라딘', '용심장 전초기지에서 자라딘 $1oa명을 처치해야 합니다.', '전초기지를 탈환할 전력은 없어도 무력하게 항복하진 않을 겁니다.\n\n우리에겐 이빨이 남아 있다는 걸 보여줘야 합니다.', '', '', '', '', '', '', 47187),
(65977, 'koKR', '키린 토 구출', '죽어가는 마법사 $1oa명을 구출해야 합니다.', '원정대가 원시술사들에게 공격받았을 때 마법사 상당수를 잃은 줄 알았소.\n\n그런데 원시술사에게 끌려가 고문을 당하는 것 같더군!\n\n부디 이곳에 남은 마법사들을 구해주시오. 이번 싸움에서 도움이 안 될지는 몰라도 그냥 버릴 순 없소.', '', '', '', '', '', '바크스로스 산맥에 더 깊이 들어가 카드가의 투영을 만나야 합니다.', 47187),
(65962, 'koKR', '영원히 끝나지 않는 초읽기', '준비되면 크로미와 대화해야 합니다.', '설마 사원을 지키려고 만든 보안 설비를 분해해서 사원을 지키게 되리라곤 꿈에도 몰랐네요. 뭐, 방법이야 어쨌든 목적을 이뤘으면 그만이죠!\n\n시간의 정령을 처리한 덕에 시간여행단 동료들도 풀려났고, 감시관들 준비도 끝났겠다... 이제 마지막 정지장 방울을 해제하고 이터누스를 처리할 수 있겠군요.\n\n준비되면 말씀하세요. 당신만 곁에 있다면 전부 잘 풀릴 거예요.', '', '', '', '', '', '', 47187),
(65958, 'koKR', '원시의 힘', '정기의 집중을 사용해 사망한 원시술사와 정령에게서 정기를 흡수해야 합니다.', '점점 환영 복제를 유지하기 어려워지는군요. 원시술사들이 절 하늘에서 떨어뜨리려고 혈안이 됐습니다.\n\n걱정 마세요... 다 계획이 있으니.\n\n회수한 보주를 챙겨 원시술사의 시체에서 정기를 모아 주셨으면 합니다.\n\n저 앞에서 놈들의 병력을 분산시키려면 그 정기가 필요해요.', '', '', '', '', '', '바크스로스 산맥에 더 깊이 들어가 카드가의 투영을 만나야 합니다.', 47187),
(65957, 'koKR', '영웅을 기다릴 수 없을 때', '불길구토자 모닥, 꿰뚫는 자 기그라, 융해된 자 올피스를 처치해야 합니다.', '우리가 관찰한 바에 따르면, 자라딘의 사회는 힘의 논리를 따른다. 가장 강한 존재가 모범이 되어 다른 이들의 투지를 북돋는 역할을 하지. \n\n저 아래 병력 중에는 그 모범의 역할을 하는 강력한 자라딘이 셋 있다... 바꿔 말하자면 네가 처리할 표적이란 얘기지.\n\n$n, 네가 직접 나서서 숨통을 끊어버려라. 놈들의 사기를 확실하게 꺾어놓을 수 있을 거다.', '', '', '', '', '', '', 47187),
(65956, 'koKR', '갈퀴발톱 일격', '자라딘 방어 병력을 교란해야 합니다.', '네가 도와주기만 하면 내 검은갈퀴 암살자들이 외부 경계를 지키는 자라딘을 처리할 거다. 작은 기절 폭탄으로 표적을 표시하면 널 도우러 나타날 테니 그리 알도록.\n\n신속히 움직여라. 우리의 진군을 방해하는 건 모조리 치워버려.', '', '', '', '', '', '', 47187),
(65955, 'koKR', '켄타우로스의 가장 친한 친구', '카사르를 구출하고 동굴에서 만나야 합니다.', '이곳은 노출되어 있어서 위험하다, $p|1이여;여;.\n\n골록들이 내 사냥 동료 바바를 동쪽 동굴에 몰아넣었다.\n\n날 풀어주고 함께 바바를 구출하러 가자. 가는 길이 열리면 동굴에서 만나지.', '', '', '', '', '', '', 47187),
(65954, 'koKR', '사냥개 풀기', '시카르 바카르를 구출해야 합니다.', '익숙한 울음과 짖는 소리를 들었다. 야영지에서 사라진 바카르들이다.\n\n저... 저\'것\'들이 우리 사랑하는 개들을 우리에 가둬놓고 하나하나 죽이려 든다.\n\n친구들을 도와줘야만 한다. 저들을 풀어주고 시카르 바카르의 진짜 힘을 보여주자!', '', '', '', '', '', '', 47187),
(65953, 'koKR', '예언의 도태', '골록 주술사에게서 토템 $1oa개를 입수해야 합니다.', '골록 마을에 벌어진 온갖 난리를 통틀어도 골록 주술사만큼 큰 문제는 없다.\n\n저들은 특히 사나운 데다 뒷일은 생각하지 않고 위험하게 폭풍 마법을 가지고 논다. \n\n멈춰야만 해. 저들을 처치하고 토템을 가져와라. 우리 비술사들이 관심을 보일 거야.', '', '', '', '', '', '', 47187),
(65952, 'koKR', '전설의 족장', '족장 그옳메쉬를 처치해야 합니다.', '늪지 골록은 원래 단순한 족속이지. 성가시긴 해도 약탈과 도둑질을 일삼는 개 사냥꾼은 아니었어. \n\n저들의 족장인 그옳메쉬 때문에 그 본질에서 벗어난 거야.\n\n그를 끝장내면 골록도 우리를 위협하지 않을 거다.', '', '골록 중에서도 가장 강력한 그옳메쉬에게 남은 정복의 대상은 단 하나, 바로 본인의 절망뿐입니다.', '족장 그옳메쉬', '', '', '', 47187),
(65951, 'koKR', '유일한 공급자', '숲에서 카사르를 찾아야 합니다.', '가엾은 로샤! 짐마차를 준비하려고 끝도 없이 일했는데 성가신 골록 놈들이 물자를 훔쳐 갔으니 그럴 만도 하죠. \n\n이미 엄청난 손해를 봤을 테니... 저라도 옆에서 최대한 돕고 있습니다. \n\n카사르는 아마 말도 없이 혼자 보급품을 찾으러 갔을 거예요. 항상 그러니까요. 하지만 사라진 지 너무 오래됐습니다. 사라진 개도 많고요. \n\n$p 님, 카사르랑 개가 어떻게 됐는지 봐주시겠어요?', '', '', '', '', '', '흙지느러미 마을에서 카사르와 대화해야 합니다.', 47187),
(65950, 'koKR', '도둑 골록', '흙지느러미 마을에 있는 도난당한 보급품을 반환해야 합니다.', '제철공 로샤는 짐마차 일행인가? 아니지! 그런데 일행의 편자는 누가 만든다? 제철공 로샤가! 그리고 흙지느러미는 누구 물건을 훔친다? 당연히 제철공 로샤 것이지! 쳇.\n\n웬만하면 카사르를 보내고 싶지만, 이번엔 또 어디로 사라졌는지 알 수가 없으니 원... \n\n보급품을 찾고, 도둑놈들한테 이 제철공 로샤의 물건을 훔치면 어떻게 되는지 톡톡히 알려줘라.\n\n어서!', '', '', '', '', '', '흙지느러미 마을에서 카사르와 대화해야 합니다.', 47187),
(65949, 'koKR', '가슴에 박힌 편자', '제철공 로샤에게 메달을 돌려줘야 합니다.', '우리는 바람 속에서 온아라 님과 함께하게 될 때 이 메달을 뒤에 남긴다.\n\n이 메달은 내가 함께 만든 것이다. 하지만 내 메달은 아니야.\n\n이건 로샤의 약혼자가 남긴 것이니 그녀에게 전해줘야 해.\n\n그녀가 애도하고 마음을 가라앉힐 수 있게 전해줘라.', '', '', '', '', '', '', 47187),
(65948, 'koKR', '시간의 균열', '동쪽 및 서쪽 수정으로 시간여행단 지팡이를 더욱 강화해야 합니다.', '사원이 봉쇄됐을 때 감시관들이 안쪽에 갇혔어요. 봉쇄를 풀려면 정지장 방울을 터뜨려야 하는데, 그러려면 시간여행단 지팡이를 최대한 강화해야 해요...\n\n그렇지! 이 단상에 있는 수정의 힘을 흡수하세요! 그 정도면 지팡이를 충분히 강화할 수 있을 거예요.\n\n저마다 정지장 안에 있으니 그냥 지팡이로 끌어내 마력을 흡수하면 돼요.\n\n깨져도 괜찮으니까 걱정 마세요. 조각난다고 해서 마력이 흩어지는 것도 아니니까요!', '', '', '', '', '', '', 47187),
(65947, 'koKR', '시간에 갇힌 시간여행단', '시간여행단 $1oa명을 시간 방울에서 구출해야 합니다.', '이렇게 보니 정말 기쁘네요! 제가 단테, 제라와 함께 무한용 친구를 잡아둘 테니 용사님은 이 단상의 상황을 수습해 주세요.\n\n이터누스는 서약의 돌을 장악하려다 사원의 보안 장치를 건드려서 그대로 정지장 방울 안에 갇혔어요. 문제는 나머지 시간여행단 친구들까지 그 보안 장치에 걸렸다는 거죠.\n\n시간여행단 지팡이를 쓰면 풀어줄 수 있을 거예요. 다만 어린 시간의 정령들이 분명 열받아서 튀어나올 테니 조심하시고요!', '', '', '', '', '', '', 47187),
(65944, 'koKR', '용암 폭발', '용암 보주 $1oa개를 파괴해야 합니다.', '원시술사들이 산을 갈라 바크스로스로 병력을 보내고 있소!\n\n저 앞 회랑을 살짝 보니 용암 보주를 이용해 정기의 혼돈을 퍼뜨리고 있더구려.\n\n보주를 파괴하면 진군을 늦출 수 있을 거요. 나는 이 위에서 칼렉고스를 도울 방안을 모색하리다.', '', '', '', '', '', '바크스로스 산맥에 깊이 들어가 카드가의 투영을 만나야 합니다.', 47187),
(65943, 'koKR', '원시의 공세', '바크스로스에서 원시술사 $1oa명을 처치해야 합니다.', '카드가와 제가 안간힘을 다해 공중에서 몰려드는 원시술사를 막아내곤 있지만, 이 이상 탑으로 밀고 들어가기도 어려운 상황입니다.\n\n용사님이 저들의 지상 병력을 약화시켜 주십시오. 그래야 늦기 전에 라자게스를 막을 수 있습니다.\n\n전방의 원시술사를 돌파해야 합니다. 제가 어떻게든 집중만 유지할 수 있으면 환영 복제를 하나 더 만들어낼 수 있을 거예요.', '', '', '', '', '', '바크스로스 산맥에 깊이 들어가 칼렉고스의 환영 복제를 만나야 합니다.', 47187),
(65940, 'koKR', '부서진 길', '시카르 짐마차와 함께 강을 건너야 합니다.', '다음 여정은 강 두 개를 건너야 하니 발 젖는 것쯤은 상관하지 않길 바란다.\n\n온 새쉬탱 님께서 네게 축복받은 감시자 온아라 님에 대한 이야기를 들려주고 싶어 하신다. 널 온 새쉬탱 님께 맡기겠다.', '', '', '', '', '', '', 47187),
(65939, 'koKR', '신념의 용기', '흑요석 성채를 장악해야 합니다.', '다음 전투는 틀림없이 격전이 될 거다. 하지만 우리의 용기와 결의라면 놈들의 머릿수 따위 극복할 수 있지.\n\n네가 특출난 능력으로 군대를 승리로 이끌어주리라 믿는다.\n\n네가 준비되는 대로 공격을 시작하지.', '', '', '', '', '', '', 47187),
(65938, 'koKR', '과거와 미래의 일행', '시간여행단 지팡이를 사용해 사원 문의 정지장 방울을 터뜨려야 합니다.', '좋아요! 사원 문쪽에 있는 정지장 방울을 해제해 감시관들을 구출하죠! 시간 그 자체와 한바탕 줄다리기를 벌일 각오는 되셨나요?\n\n수정을 처리할 때처럼 문에 있는 방울을 확 끌어내면 돼요. 그 순간 방출되는 시간 마력이 응결되어 공격할 테니 조심하시고요. 구체적으로 어떤 일을 겪게 될지는 저도 몰라요. 단지 무슨 일이 있어도 감시관을 구출할 거란 사실만 알죠.\n\n행운을 빌어요, $n 님!', '', '', '', '', '', '', 47187),
(65937, 'koKR', '태만의 증거', '라일락 산책로의 피해 상황을 나타내는 증거를 찾아 테라무스에게 보여줘야 합니다.', '포기해서는 안 돼요. 밖에 무슨 일이 벌어지고 있는지 그분도 알아야 해요! 동굴에서 나오지 않겠다면 직접 보여드리는 수밖에요.\n\n뭐라도 괜찮을 거예요. 타락한 식물부터 고통받는 야생동물까지 골칫거리가 어디 한두 개인가요!', '', '', '', '', '', '', 47187),
(65935, 'koKR', '크로미 따라잡기', '시간의 합일점 단상에서 크로미를 만나야 합니다.', '덕택에 모래는 탈환했지만 사원 단상에서 더 거대한 일이 벌어지고 있다는 게 느껴지오. 하늘로 날아올라 저 위에 있는 크로노르무 대사에게 합류하는 게 좋겠구려.\n\n늘 그렇지만 일분일초가 중요하오.', '', '', '', '', '', '', 47187),
(65930, 'koKR', '바람과 물과 대결', '카우리크 미명만 주변에서 바람의 영혼 크라우노트를 대면해야 합니다.', '영혼들을 대면할 준비는 끝났습니다.\n\n혹시 루리크가 말 안 해주던가요? 부족의 전통에 따라 영혼의 은혜를 받으려면 먼저 싸워야 합니다. 얼마나 강렬한 인상을 남기느냐에 따라 축복의 강도가 달라집니다.\n\n미명낚시꾼께서 협동을 강조하신 이유일지도 모르겠군요.\n\n당신이 바람의 영혼 크라우노트를 상대할 동안 저와 루리크는 물의 영혼 오투로크에 맞서겠습니다.\n\n영혼들은 이 근방 폭포 뒤에 있는 동굴에 삽니다. 가서 뵙겠습니다, 모험가님.', '', '카우리크 미명만 일대를 주름잡는 변덕스러운 바람의 정령입니다. 실력을 증명하고자 하는 젊은 투스카르의 도전을 즐기는 것으로 유명합니다.', '크라우노트', '', '', '', 47187),
(65929, 'koKR', '분위기 녹이기', '카우리크 미명만 주변에 있는 빙판에서 얼어붙은 물을 녹여야 합니다.', '역시 선조들께서 허락하실 줄 알았습니다!\n\n전 정령에 관해 잘 알지는 못합니다. 주술사는 카우즈 형님이니까요. 하지만 위대한 바람과 물의 정령이 모습을 드러내게 하려면 그 존재들을 만족시켜야 합니다.\n\n저 산에 있는 물의 정령들이 점점 얼어붙고 있다는 건 모두가 아는 사실입니다. 자연적인 빙결 현상이 아니지요. 요즘 들어 산맥에서 내려오는 냉기가 평소보다 더 심해졌습니다. 그냥 두면 강 전체가 얼어붙을 겁니다.\n\n강물을 얼음 감옥에서 해방시켜 주십시오!', '', '', '', '', '', '', 47187),
(65928, 'koKR', '방황하는 바람', '카우리크 미명만 주변에 있는 잠 못 드는 바람정령에게서 잠 못 드는 바람 티끌 $1oa개를 수집해야 합니다.', '쯧! 힘을 합쳐라 이말이군요?\n\n미명낚시꾼께서... 다른 부족들을 도울 수 있다고 믿으신다니... 시도라도 해봐야겠지요. \n\n바람의 정령 크라우노트의 주목을 받으려면 그의 원소를 살펴야 합니다. 대지가 깨어나기 시작한 이후로 이 주변 바람의 정령들이 동요하고 있습니다.\n\n저는 이 배를 검사할 테니 당신은 가서 잠 못 드는 바람의 정령을 처치하고 그 티끌을 가져오십시오. 그렇게 하면 이 일대가 좀 진정될 겁니다.', '', '', '', '', '', '', 47187),
(65926, 'koKR', '폭포에 도전하기', '루리크를 도와 폭포 소금쟁이호를 만들어야 합니다.', '미명낚시꾼의 이야기를 아십니까? \n\n강의 폭포를 타고 내려갈 수 있는 멋진 배를 만들었다고 전해지지요! \n\n나바 장로가 이야기를 들려줄 수 있답니다.\n\n어쨌든 고결한 온투크 매머드 영혼들도 그들의 유해로 다시 한번 멋진 배를 만들면 만족할 겁니다.\n\n형님이 반대하는 일이긴 하지만... 성공만 하면 힘들어하는 자매 부족들에 물고기를 전달할 수 있습니다. \n\n당신의 실력과 열정은 저번에 확실히 알았습니다! 우리가 힘을 합치면 걸작을 만들 수 있을 겁니다.', '', '', '', '', '', '', 47187),
(65925, 'koKR', '선별가의 선별', '카우리크 미명만 주변에서 얼음뱀과 얼음 구멍뚫이를 처치해야 합니다.', '이 지룡은 여기 서식하는 놈들이 아닙니다. 무슨 일이 있기에 지하 소굴에서 나왔는지는 모르겠지만, 그렇다고 지금 우리가 도울 방도가 있는 것도 아닙니다.\n\n이곳의 토착 생물을 해치게 둘 수도 없습니다. \n\n지룡을 처치해 주십시오, $n 님. 원하신다면 전리품을 가지셔도 됩니다. 다 끝내시면 미명만에서 뵙겠습니다.', '', '', '', '', '', '카우리크 미명만에서 루리크를 만나야 합니다.', 47187),
(65921, 'koKR', '레프티의 복수', '티르홀드 저수지에서 원시술사를 처치하고 레프티를 구출해야 합니다.', '도저히 떨쳐내질 못하겠습니다, $p 님. 수많은 자매가 학살당했습니다! 그렇게 생명을 희생당했는데... 절대 그냥 넘어가선 안 됩니다!\n\n제 병사들이 원시술사들을 추적했습니다. 아직 살아있는 자매들이 몇몇 있다고 하더군요.\n\n꼭 구출해야 합니다. 그리고 모든 원시술사에게 제 분노를 각인시켜줄 겁니다!', '', '', '', '', '', '', 47187),
(65920, 'koKR', '수호물을 위하여!', '잃어버린 쐐기돌을 사용해 저수지 수호물을 수리하고 제어장치를 활성화해야 합니다.', '드디어 수호물을 복원할 수 있겠군요. 막심한 손실을 겪었지만 그래도 과업은 끝났습니다.\n\n$p 님, 마지막으로 한 번만 더 도와주셨으면 합니다. 각 쐐기돌을 알맞은 장소로 가져가 수호물을 완전하게 복구해 주시면 됩니다. \n\n그런 다음 이곳으로 돌아와 제어장치를 활성화하면 저수지의 질서가 복구될 거예요.', '', '', '', '', '', '', 47187),
(65918, 'koKR', '예방을 위한 점검', '티르홀드 저수지에서 풀려난 물의 정령 $1oa마리를 처치해야 합니다.', '원시 정령들이 막무가내로 증식하고 있습니다. 다른 때 같았으면 제가 자매들하고 움직여 처리했겠지만, 문제는 지금 싸울 수 있는 몸 상태가 아닙니다. 병사들이 너무나 많이 전사했어요. \n\n게다가 그나마 남아 있는 소수는 다른 문제를 해결해야 합니다.\n \n<고통에 얼굴을 구기는 주티키>\n\n그래서 $p 님께 부탁드리고 싶습니다. 정령들을 처리해주실 수 있을까요?', '', '', '', '', '', '', 47187),
(65916, 'koKR', '원시술사와 협상은 없다', '티르홀드 저수지에서 원시술사 지도자 코조를 처치하고 사라진 쐐기돌을 회수해야 합니다.', '원시술사 놈들이 티르 님의 힘을 얕잡아보고 달려든 것 같습니다. 틀려도 단단히 틀린 발상이죠. \n\n레프티들이 놈들을 추적해 보니 이곳에서 멀지 않은 동굴로 갔다더군요. 역시나 사라진 쐐기돌은 놈들에게 있었습니다.\n\n용사님. 저수지를 복구하려면 반드시 쐐기돌을 되찾아야 합니다.\n\n그리고 재차 공격을 감행하지 못하게 우두머리도 처리해야 할 겁니다.', '', '', '', '', '', '', 47187),
(65914, 'koKR', '매머드 문제', '카우리크 미명만 주위에 있는 온투크 매머드 사체에서 온투크 가죽 조각과 온투크 엄니를 수집해야 합니다.', '우리 부족은 지난 수백 년 동안 온투크 매머드를 자랑스럽게 길러왔습니다. 하지만 지금은... 다 사라졌습니다. \n\n이토록 끔찍한 학살에 희생됐으니... 매머드들의 영혼이 격분하고 있을 겁니다. 유해를 적절히 활용해 저들의 생애를 기려야 합니다. \n\n혼자 모으기엔 수도 많습니다. 새끼들와 어미의 유해를 가능한 한 모아 카우리크 미명만으로 가져와 주십시오.', '', '', '', '', '', '카우리크 미명만에서 루리크를 만나야 합니다.', 47187),
(65913, 'koKR', '감시자는 누가 감시하나', '티르홀드 저수지에서 원시술사로부터 감시자 마라를 구출해야 합니다.', '다행이다! $C님의 도움이 필요합니다! \n\n방금 전 원시술사들이 밀어닥쳤습니다. 자매들과 함께 맞서 싸웠지만 심각한 피해를 입었습니다...\n\n하지만 애도는 미뤄야 합니다. 감시자님을 구하는 게 우선이죠! 아까 싸우던 중 한 원시술사 무리가 방어선을 뚫고 들어갔습니다. 감시자님이 놈들 손에 어디 다치기라도 하면...\n\n늦기 전에 그분을 도와주십시오!', '', '', '', '', '', '', 47187),
(65911, 'koKR', '하늘빛 정렬', '하늘빛 기록 보관소에 있는 칼렉고스에게 가야 합니다.', '유대가 참 투철한 공동체로군요... 우정과 가족애로 이어진 게 보입니다. \n\n전... 그런 걸 누려보지 못했습니다. 푸른용군단에 유대 같은 건 없었죠. 한편으로는 우리에게 기회가 없었던 건 아닐까, 하는 생각도 듭니다. \n\n지금이 바로 그 시기겠죠. 동족을 불러 모아야겠습니다. \n\n하늘빛 기록 보관소에서 뵙겠습니다. 할 일이 많습니다.', '', '', '', '', '', '하늘빛 기록 보관소에 있는 칼렉고스에게 가야 합니다.', 47187),
(65907, 'koKR', '좋아하는 과일', '온이르 간헐천에서 야생 관목열매를 채집해 어슬렁거리는 진흙킁킁이 $1oa마리에게 먹여야 합니다.', '비술사 수련은 진짜 지루해. 하루의 반 정도는 물은 축축하구나 하면서 보고만 있다니까. 형제들은 다 비룡과 원시술사 사냥하면서 세상을 바꾸고 있는데 말이야.\n\n아무튼, 내가 멋진 거 보여주겠다고 했었잖아. 진흙쿵쿵이들이 관목열매 좋아하는 거 알고 있었어? 근처에 보면 간헐천 쪽에서 열려. 따오면 먹이로 줘 보자.', '', '', '', '', '', '', 47187),
(65906, 'koKR', '불만 많은 수습생', '온아라 평야의 온이르 샘에서 수습생 라디야와 대화해야 합니다.', '온이르 샘에서 재밌는 편지가 한 통 도착했어.\n\n편지 내용을 구체적으로 말해주자면... 끔찍한 감금 환경, 사사건건 통제하려 드는 스승들, 죽을 정도로 지독한 지루함 타령이 대부분이었지. 서명인은 수습생 라디야로 되어 있고 말이야. 그림도 있네. 독수리가... 메룬이라는 켄타우로스를 절벽 밑으로 걷어차는 그림이야.\n\n뭐, 일종의 구조 요청으로 봐야겠지. 직접 확인할지 말지는 너 좋을 대로 해. 솔직히 말할게. 수습생 라디야는 멀쩡할 거야. 내가 이런 편지 받는 게 하루 이틀 일이 아니거든.', '', '', '', '', '', '온아라 평야의 온이르 샘에서 수습생 라디야와 대화해야 합니다.', 47187),
(65905, 'koKR', '잡초 그 이상', '라일락 산책로의 과성장물과 괴물을 정리해야 합니다.', '테라무스 님께 잠시 혼자 있을 시간을 드리는 게 좋을지도 모르죠. \n\n하지만 숲이 엄청난 속도로 스스로를 파괴하고 있는데 손만 놓고 있을 수도 없는 노릇이잖아요. 제발 저희를 도와주세요.', '', '', '', '', '', '', 47187),
(65904, 'koKR', '뭐든지 적당히', '라일락 산책로의 피해 상황을 나타내는 증거를 테라무스에게 가져가야 합니다.', '기분이 안 좋으셔도 테라무스 님이 할 일은 아직 남아있어요. 저 안에 숨어계셔도 그분이 없어서 벌어진 일에서 눈을 돌리실 수는 없어요.\n\n같이 가서 증거를 보여드려요.', '', '', '', '', '', '', 47187),
(65903, 'koKR', '폭신한 건 못 참지', '숲 깡충이 $1oa마리를 포획해야 합니다.', '불쌍한 테라무스 님... 그분의 기운을 북돋울 방법이 있어요!\n\n이 그물로 근처 깡충이를 잡으세요. 순하지만 빠른 아이들인데, 해안 근처에 꽤 많이 살고 있어요.\n\n잡으면 테라무스 님께 가져다드려요. 마음까지 폭신폭신해지셔서 금방 일어나실 거예요!', '', '', '', '', '', '', 47187),
(65902, 'koKR', '식량과 복슬복슬함 사이에서', '약초를 바른 거북이 고기와 숲 깡충이를 테라무스에게 가져가야 합니다.', '육즙 가득하고 약초를 곁들인 게 맛있어 보이는 거북이 고기네요! 객관적으로 사실만 말씀드린 거예요. 전 채식주의자니까요.\n\n얼른 가보세요! 온종일 아무것도 못 드셨을 테니.', '', '', '', '', '', '', 47187),
(65901, 'koKR', '몰래 빠져나가기', '온이르 샘에 바람의 토템을 놓고 라디야에게 알려야 합니다.', '나 무기한 외출 금지 걸렸어! 나도 내년이면 이제 16살인데! 나가고 싶을 때 나갈 수는 있어야지!\n\n당신이라면 도와줄 수 있을 거야. 그래서 탈출 계획은 있냐는 눈빛인데, 아무렴 당연히 있고말고요. 이 토템에 마력을 집중하면 바람을 응축해서 돌풍을 일으킬 수 있거든! 근데 내가 돌아다니면서 여기저기 놓고 다닐 순 없어. 바람의 감시를 최대로 받는 처지라. 토고도 협조 안 할걸.\n\n하지만 당신이라면... 부탁할게! 도와주면 아주 멋진 걸 보여줄 테니까. 약속해.', '', '', '', '', '', '하늘의 거울에서 라디야를 만나야 합니다.', 47187),
(65900, 'koKR', '수상한 양념 스테이크', '완벽하게 부드러운 거북 고기 $1oa개, 파충류 알껍데기 $2oa개, 산미꽃 $3oa개를 수집해야 합니다.', '자매의 생각도 마음에 들지만, 지금은 테라무스 님의 기운을 북돋을 것이 필요해요.\n\n산미꽃 한 아름이면 충분할걸요. 그걸 양념 반죽으로 만들어서 그분이 가장 좋아하는 음식인 거북이 고기에 바르죠!\n\n재료 수집을 도와주시겠어요?', '', '', '', '', '', '', 47187),
(65899, 'koKR', '테라무스 찾기', '주위 동굴을 수색해 테라무스를 찾아야 합니다.', '$R 친구! 아름다운 라일락 산책로를 방문하러 오셨나요? 어지럽혀진 상태인 점은 사과드릴게요. 진짜 평소에는 절대 이렇지 않아요!\n\n오늘 정원의 수호자이신 테라무스 님을 만나 문제를 해결하기로 했어요. 요즘 유지 작업에 어려움을 겪고 계셔서 펠리나와 제가 일손을 보태고 있었는데, 우리가 다 감당하기엔 역부족이네요.\n\n이 근처에서 테라무스 님을 찾아봐주시겠어요? 약속을 깜빡하신 걸지도 몰라요.', '', '', '', '', '', '셀리나 크런치리브즈에게 가야 합니다.', 47187),
(65898, 'koKR', '원시적인 문제', '구심점을 입수한 후, 구심점을 지키는 원시비룡을 처치해야 합니다.', '애초에 분리된 불길에 무슨 애정이 있지도 않았지만, 이런 식으로 난동을 부리는 작태를 보니 가만히 있질 못하겠군요. 너무 낯이 익은 풍경인지라. \n\n그 구심점이 무슨 물건인지는 몰라도 저들 손아귀보단 우리가 보관하는 게 안전할 겁니다. 저기 널브러진 시신을 따라가면 찾을 수 있겠죠.\n\n조심하십시오, $p 님. 둥지가 겉보기와 달리 버려진 상태는 아닌 듯합니다.', '', '', '', '', '', '', 47187),
(65896, 'koKR', '치유를 시작합니다', '스톰윈드 주민들의 회복을 도와야 합니다.', '나 모르게 이 도시에 들어올 수 있을 줄 알았나? 어림도 없다!\n\n네놈들 본색은 처음부터 꿰뚫고 있었어. 또다시 용들이 내 고향을 파괴하게 두진 않겠다.\n\n이곳은 원래 즐거움과 평화가 가득한 공원이었다. 근데 너희 창조주인 데스윙이 나타났지. 그래, 그놈에 관해서도 다 안다. \n\n데스윙이 남긴 파괴의 유산을 두눈으로 직접 봐라. 이 길거리에는 아직 고통이 생생하게 남아 있으니까.', '', '', '', '', '', '', 47187),
(65895, 'koKR', '경쟁하는 동료', '분리된 불길에 관한 정보를 수집해야 합니다.', '쯧! 허구한 날 일꾼들이나 처리해봤자 아무것도 못 알아냅니다.\n\n우두머리 역할을 하는 자들을 찾으십시오. 그중 한 명쯤은 우리에게 필요한 정보를 알고 있을 겁니다.\n\n아, $n 님? 이번에는 숨을 끊기 전에 심문이란 걸 좀 해보십시오. 유용한 정보를 얻을 수 있을지도 모르니.', '', '', '', '', '', '폐허 꼭대기 주변에서 아다네달을 만나야 합니다.', 47187),
(65893, 'koKR', '유물 탐구', '넬타잔 유물 조각 $1oa개를 모아야 합니다.', '분리된 불길이 나타났습니다. 한데 분리된 같은 이름을 쓰는 자들에게 소중한 유물을 맡기고 싶습니까?\n\n전 아닙니다. 어쨌거나 일을 계속 진행하려면 그자들이 이곳을 찾은 이유를 알아내야 합니다. 회수할 건 회수하고 정보를 알아내 보고해 주십시오.\n\n아직 이 땅에서 찾아내야 할 수수께끼 조각이 많이 남아 있습니다.', '', '', '', '', '', '', 47187),
(65892, 'koKR', '산산이 조각난 불길', '', '', '', '', '', '', '', '', 47187),
(65891, 'koKR', '작업용 도구', '돌무더기 $1oa개에 마력 깃든 도구를 배치해야 합니다.', '좋습니다. 그러잖아도 당신 같은 모험가가 필요한 참이었습니다. 강하고, 튼튼하고, 푼돈만 받고 일해줄 사람 말입니다.\n\n꼭 상상 속에서 그리던 인물이 현실로 튀어나온 기분이군요. 확실히 제가 난놈이긴 한가 봅니다. 어쨌든, 다른 자들이 이 폐허에 주목하기 시작한 것 같습니다. 그 작자들이 발굴을 제대로 할 수 있을 리 없지요. 표본을 다 엉망으로 만들 겁니다!\n\n받으십시오. 폐허에 있는 유물 주변에 설치하면 됩니다. 부여된 마법이 할 일을 해줄 겁니다.', '', '', '', '', '', '', 47187),
(65890, 'koKR', '넬타잔 폐허', '넬타잔 폐허에서 천공 서기관 아다네달을 만나야 합니다.', '용비늘 원정대에 당신의 도움이 필요합니다.\n\n정보 수집차 천공 서기관을 폐허로 보냈습니다. 보고대로면 비어 있어야 하는데, 그 사람 소리 지르는 목소리가 여기까지 들리더군요.\n\n이 먼 거리까지 들릴 정도면 무슨 심각한 위험을 맞닥뜨린 게 분명해요.\n\n우리 원정대는 누구 하나 버리지 않고 챙깁니다. 아무리 상대하기 피곤한 사람이라도 말이죠. 부탁드릴게요. 천공 서기관을 찾아 위험에서 지켜주세요.', '', '', '', '', '', '', 47187),
(65887, 'koKR', '산으로', '바크스로스 산맥 기슭에서 카드가와 칼렉고스의 환영 복제를 만나야 합니다.', '참 멋진 광경이지 않나요? 카드가와 칼렉고스가 공중에서 원시술사와 전투를 벌이고 있으니!\n\n두 사람이 환영 복제를 여럿 만들어 두었더군요. 원시술사들이 만든 거대한 구멍을 통과할 때 도움이 되어줄 겁니다.\n\n한 쌍은 지금 산기슭에 있더군요. \n\n혹여나 상황이 나빠지면... 하늘빛 평원에 있는 다른 이들에게 소식을 알리겠습니다.', '', '', '', '', '', '바크스로스 산맥 기슭에서 카드가와 칼렉고스의 환영 복제를 만나야 합니다.', 47187),
(65886, 'koKR', '로닌의 방패로', '탑 전망대에서 두루마리 자객 드록을 만나야 합니다.', '라자게스와 원시술사들이 바크스로스 탑에 전면 공세를 개시했습니다. 성공하게 두어서는 안 됩니다!\n\n카드가와 저는 먼저 출발해 하늘에서 대처하겠습니다.\n\n그동안 용사님은 로닌의 방패로 향하십시오. 이 일대에 남아 있는 마지막 키린 토 야영지 중 하나입니다.\n\n보관소 위에서 비룡을 타면 더 빠르게 도착하실 수 있을 겁니다.\n\n그곳의 키린 토 사람들이 무사한지 확인하고 바크스로스로 향하세요.\n\n지상에서 지원 부탁드리겠습니다.', '', '', '', '', '', '로닌의 방패에서 두루마리 자객 드록을 만나야 합니다.', 47187),
(65875, 'koKR', '용의 휴가', '바잘리아를 위해 음료를 찾아야 합니다.', '아웃랜드 생활은... 끊임없는 싸움으로 점철되어 있었습니다. 쉴 틈이라곤 조금도 없었지요!\n\n용이라도 가끔은 차가운 음료를 마시며 바다에서 하루쯤은 쉬어줘야 하는데 말입니다.\n\n이왕 여기까지 오셨으니, 잠깐 쉴 수 있도록 좀 도와주셨으면 합니다! 이 음료를 더 조달할 수 있는지 한번 알아봐 주십시오.', '', '', '', '', '', '', 47187),
(65873, 'koKR', '그늘발 무리의 지도자', '카르그포우를 처치하고 토템을 회수해야 합니다.', '이 숲 놀의 진정한 우두머리는 카르그포우예요. 예전에 우리와... 몇 번 불쾌한 충돌이 있긴 했습니다.\n\n이번엔 달랐어요. 이상한 토템을 갖고 있었는데, 그거에 정수 그 자체가 뒤틀린 듯했습니다.\n\n카르그포우를 저지하고 문제의 토템을 회수해야 해요. 놀이 우리 생각 이상으로 심각한 어둠에 손을 댄 건 아닌지 걱정이 앞섭니다.', '', '카르그포우는 항상 악의에 차 있었지만. 부정한 토템을 얻은 이후 이전보다도 더 공격젹으로 변했습니다.', '악취 나는 카르그포우', '', '', '', 47187),
(65872, 'koKR', '사악한 놀의 사악한 꿍꿍이', '카르그포우의 소굴에서 그늘발 놀 $1oa마리를 처치해야 합니다.', '바람에서 무슨 이상한 냄새가 납니다. 어딘가 이상한데...\n\n하누 말로는 동굴 안에 있던 놀이 기괴하고... 병에 걸린 것 같다고 했어요. 원인을 자세히 알아보는 편이 좋겠습니다. \n\n방심은 절대 금물입니다. 겉보기엔 병에 걸린 것 같아도 간악하고 위험한 놈들이에요.', '', '', '', '', '', '', 47187),
(65871, 'koKR', '놀치지 않아!', '노루크와 다른 투스카르 포로 $1oa명을 구출해야 합니다.', '내 남편 노루크를 포함해 사로잡힌 투스카르의 흔적을 밟아보니 이 동굴이 나오더군. \n\n노루크는 제 목숨 귀한 줄 모르는 양반이라 내가 챙겨야 하네. 그렇다고 해서 괜히 자존심 세워 가며 도움의 손길을 거부할 생각은 없지.\n\n제발 사람들을 구출해 주게나!', '', '', '', '', '', '', 47187),
(65870, 'koKR', '보급품!', '사냥 보급품 상자를 회수해야 합니다.', '큰나무 언덕에는 도둑맞은 사냥 보급품의 흔적이 없었네. 그 동굴에 있겠지 그럼.\n\n보급품 보관함은 없는지 잘 살펴봐 주게. 뭐가 튀어나올지 모르니 단단히 대비하는 게 좋을 게야.\n\n그리고 놀이 물건을 지키는 사람 없이 두지도 않았을 걸세.', '', '', '', '', '', '', 47187),
(65869, 'koKR', '또 다시 습격', '아키운과 대화하고 주위에 있는 시신 $2oa구를 조사해야 합니다.', '참담한 비극이군요. 앞으로 이런 일이 수없이 일어나겠죠.\n\n아키운이 뭘 알고 있는지 파악하고 공격을 받아 희생된 이들을 살펴야 합니다. \n\n무슨 일이 있었는지 대강 짚이는 구석이 있어서 그래요. 단서가 제 이론을 뒷받침할지 한번 알아보죠.\n\n그동안 전 놀란 사람들 좀 진정시키고 있을게요.', '', '', '', '', '', '', 47187),
(65868, 'koKR', '씹으라고 있는 게 아닌데', '장례 공물 $1oa개를 회수해야 합니다.', '포노리악 족장님의 장례 공물을 하나 찾았네만... 그늘발 놀들이 멋대로 악용하곤 내팽개쳐놨더군. 이빨 자국으로 뒤덮인 수준이네.\n\n이 공물도 그렇고, 다른 것들도 얼마 전에 세상을 떠난 이스카라 족장님의 추모식에 사용할 물건일세.\n\n신성한 물건을 고작 씹을거리로 사용했다는 사실 자체가 지독한 모욕이지. 다른 공물을 찾아봐 주게.', '', '', '', '', '', '큰나무 언덕의 카르그포우의 소굴 입구에서 하누를 만나야 합니다.', 47187),
(65867, 'koKR', '큰나무 언덕의 울음소리', '두르건, 케르왈, 바크라를 처치해야 합니다.', '우리 짐마차를 습격한 놀은 세 부관의 지휘를 받았습니다.\n\n두르건은 십수 마리의 하이에나를 대동하고 있었죠.\n\n케르왈은 우리 동포가 강철 덫에 걸릴 때마다 광기 어린 웃음을 터뜨렸고요.\n\n바크라는 우릴 무자비하게 도발했습니다.\n\n도둑맞은 물건을 되찾으려면 그 부관들부터 처치해야 합니다.', '', '', '', '', '', '큰나무 언덕의 카르그포우의 소굴 입구에서 하누를 만나야 합니다.', 47187),
(65866, 'koKR', '덫 해체하기', '칼날턱 덫 $1oa개를 발동시켜야 합니다.', '저 앞 언덕에는 온갖 악랄한 덫이 깔려 있습니다.\n\n눈썰미가 좋은 분이시니 손쉽게 찾아내실 수 있을 거예요. 오래된 투스카르 방식으로 조심히 덫을 해체하세요. 참, 밟는 것도 해체의 한 방법이긴 하지만... 그리 권장하고 싶지는 않네요.\n\n덫을 충분히 제거한 다음에는 하누에게 가보세요. 포아 장로님과 저는 부지런하게 따라가겠습니다.', '', '', '', '', '', '큰나무 언덕의 카르그포우의 소굴 입구에서 하누를 만나야 합니다.', 47187),
(65864, 'koKR', '짐마차 따라잡기', '큰나무 언덕 주위에 있는 브레나를 따라잡아야 합니다.', '브레나 님을 따라가 보시는 게 좋겠습니다. 당장 몇 시간 전에 짐마차를 이끌고 이곳을 거쳐 가셨습니다.\n\n돌아가신 선대 족장님의 장례식을 위해 그분께 가장 소중했던 물건을 수집하고 있으셨지요.\n\n짐마차에 짐이 제법 무겁게 실려 있었으니 멀리 가진 못했을 겁니다.', '', '', '', '', '', '', 47187),
(65855, 'koKR', '하늘빛 평원 지원', '안토니다스 야영지에 있는 만물의 암기자 노리코에게 가야 합니다.', '하늘빛 평원의 지맥을 복구하기 전까지 서약의 돌의 마력을 수복하는 건 불가능하다.\n\n몇몇 지맥이야 칼렉고스의 능력으로만 접근할 수 있겠지만... 그래도 네가 도움이 될 부분은 있지.\n\n아직 살아있을지는 모르겠지만 투스카르를 찾아가 보거라. 내 생전에도 이곳에 살았던 종족인 만큼 땅에 대한 지식이 해박하지.\n\n비전 조수와 얘기하면 동료에게 갈 수 있을 것이야.', '', '', '', '', '', '안토니다스 야영지에 있는 만물의 암기자 노리코와 대화해야 합니다.', 47187),
(65854, 'koKR', '서약의 돌 수복', '칼렉고스가 하늘빛 서약의 돌을 복원하는 모습을 목격해야 합니다.', '수고 많았습니다, 친구. 일단 하늘빛 기록 보관소 내부의 지맥은 고쳐진 듯합니다.\n\n푸른용군단이 하나였던 시절에는 형제자매들에게 필멸자의 힘을 얕보지 말라고 신신당부하곤 했죠.\n\n남쪽으로 가면 서약의 돌이 있습니다. 거기서 뵙죠. 돌을 수복하고 탈드라서스로 출발할 겁니다.', '', '', '', '', '', '신드라고사와 대화해야 합니다.', 47187),
(65852, 'koKR', '정상으로 직행', '요긴한 물품 가방을 살펴 비전 디딤돌을 찾아낸 후, 비전 집중점에 사용하여 하늘빛 기록 보관소 꼭대기까지 가야 합니다.', '무언가가 탑 꼭대기에서 비전 마력을 흡수하고 있습니다. \n\n이곳 마력은 안정됐으니, 이제 용사님도 비전 마법에 \"탑승\"하실 수 있을 거예요.\n\n가방에서 비전 디딤돌이란 물건을 찾아보세요. 그걸 사용해서 꼭대기에서 뵙죠.', '', '', '', '', '', '하늘빛 기록 보관소 꼭대기에서 칼렉고스를 만나야 합니다.', 47187),
(65850, 'koKR', '바다의 순환', '브레나와 대화하여 장례식을 목격해야 합니다.', '감사합니다, $n 님. 새로 사귄 친구들 덕분에 지금 제게 무엇이 필요한지 깨달았습니다. \n\n선대 족장 장례식이 곧 시작될 겁니다. 지금까지 이스카라 부족민들에게 받은 융성한 환대를 생각해 보면 기록 보관소로 돌아가기 전에 참석하는 것이 마땅한 도리겠지요. \n\n브레나에게는 준비됐다고 말씀해 주시길.', '', '', '', '', '', '', 47187),
(65849, 'koKR', '이스카라를 향하여', '이스카라에서 브레나를 만나야 합니다.', '감사합니다, $n 님. 도와주셔서 정말 감사해요. 덕분에 가족이 무사할 수 있었습니다.\n\n드디어 이스카라로 돌아가 포노리악 족장님을 바다로 돌려보낼 수 있겠군요. 훌륭한 족장이자 스승님이셨습니다. \n\n용사님도 참석해 주시면 좋겠습니다. 바다의 순환을 축복하는 일은 누구나 참석해도 좋은 행사니까요.', '', '', '', '', '', '이스카라에서 브레나를 만나야 합니다.', 47187),
(65848, 'koKR', '고서 결속', '칼렉고스와 대화하여 차원문을 연 다음, 그가 소환하는 것을 이용해 담쟁이가죽 부패자를 처치하고 뒤틀린 고대정령을 파괴해야 합니다.', '저 나무를 막아야 합니다! 지맥 수정이 있으니 드디어 도움을 드릴 수 있겠습니다.\n\n준비가 끝나면 제게 말씀하십시오. 하늘빛 기록 보관소로 통하는 차원문을 열어 쓸만한 것을 꺼내 보겠습니다. \n\n불안정할 수도 있으니 물러서시는 게 좋을 겁니다.', '', '', '', '', '', '지맥 수정 동굴 안에서 칼렉고스와 대화해야 합니다.', 47187),
(65847, 'koKR', '재정비', '지맥 수정에 집중해 부패 감염물 3개를 파괴해야 합니다.', '이제 이 지맥을 해결할 차례입니다. 우려가 현실이 되었군요. 부패가 지맥 그 자체에 퍼진 상태입니다.\n\n부패를 정화하고 회복 과정을 촉진시켜야 합니다. 그런데 이 환영 복제만으로는 마력을 집중하기 어렵습니다. \n\n이 지맥 수정에 정신을 집중하세요. 우리 둘의 연결을 이용해 제 육체를 물리적으로 순간이동시킬 겁니다. 그럼 힘이 충만해질 거예요!', '', '', '', '', '', '담쟁이가죽 바깥에서 칼렉고스를 찾아야 합니다.', 47187),
(65846, 'koKR', '나뒹구는 지맥 수정', '담쟁이가죽 외곽에서 지맥 수정 $1oa개를 수집해야 합니다.', '지맥은 여기 있습니다. 확실히 느껴져요! \n\n하지만 놀을 막는 게 우선이겠죠. 저들이 가진 가장 강력한 무기라면 저 고대정령일 겁니다.\n\n보아하니 놀이 지맥 수정을 모아뒀더군요. 다행히도 수정에 담긴 힘을 이해하지는 못한 듯합니다. \n\n제 환영을 강화할 수 있게 최대한 많이 가져와 주십시오. 저 괴물을 쓰러뜨릴 기록 보관소에서 물건을 소환하는 데 보탬이 될 겁니다!', '', '', '', '', '', '', 47187),
(65845, 'koKR', '쓰러진 자의 메아리', '투스카르 시신 $1oa구 주위에 브레나의 토템을 놓고 영혼과 교감해야 합니다.', '여기 투스카르들 좀 보세요! 제 친구들, 가족들입니다. 채 일주일도 전에 사냥을 떠난 일행인데...\n\n이미 수습할 수 없을 정도로 부패가 진행됐군요. \n\n하지만 영혼은 아직 이곳에 남아 있어요. 분노와 회한에 차 있죠. 카키아타, 루톡, 투유키...\n\n$n 님, 제발 이 토템을 유해 주변에 놓아 주세요. 영혼에 접촉해... 일말의 안식을 찾도록 도와줄 겁니다.', '', '', '', '', '', '', 47187),
(65844, 'koKR', '썩은 부분 도려내기', '부패하는 나무정령 $1oa마리, 담쟁이가죽 부패술사 $2oa명을 처치해야 합니다.', '부패가 놀의 몸을 좀먹다가 머리까지 썩게 만들었나 보군! \n\n놀이 흉포하긴 해도 근본은 우리처럼 이 땅에서 나고 자란 존재일세.\n\n한데 큰나무 부족에까지 부패를 퍼뜨리다니... 이대로면 평원을 다 잡아먹고 자신들까지 망칠 걸세. \n\n이대로 둘 수 없네. 안 된 일이지만... 저들을 처단해주게.', '', '', '', '', '', '', 47187),
(65842, 'koKR', '무장 해제', '무기달인 보르닥을 처치하고 세계파괴자 무기 $1oa개를 수집해야 합니다.', '전 세계파괴자 용족에 무슨 애정이 있진 않습니다. 데스윙이 언젠가 돌아올 거라는 어긋난 믿음을 붙들고는 흑요석 왕좌 쟁탈전에 힘을 보탤 생각은 조금도 하지 않고 있지요.\n\n무기달인 보르닥은 검은 왕자께 충성을 맹세해놓고는 이곳 성채에서 만들어진 수많은 무기를 빼돌려 세계파괴자에 넘겼습니다. 전 도둑질도, 배신도 그냥 넘어가 줄 생각은 추호도 없습니다.\n\n불길을 품은 봉우리로 가서 무기를 회수하십시오... 무력을 쓰는 한이 있어도.', '', '', '무기달인 보르닥', '', '', '', 47187),
(65841, 'koKR', '확산 저지', '', '', '', '', '', '', '', '', 47187),
(65838, 'koKR', '담쟁이가죽 돌입', '담쟁이가죽 외곽을 조사해야 합니다.', '이곳 놀이 부패 마법을 발견했다면 지맥은 물론이고 대지 그 자체가 심각한 위험에 처해있다는 뜻입니다.\n\n지금 제가 환영 복제를 너무 많이 유지하고 있는지라 이만한 규모의 정기 붕괴를 견디긴 어렵습니다. 그러니 용사님이 숲에 들어가 부패를 조사해 주셨으면 합니다. \n\n저는 새 투스카르 친구들과 함께 제 환영을 유지할 장소를 찾은 다음, 숲 깊은 곳에서 합류하겠습니다.\n\n어떻게든 이 사태를 해결해야 합니다!', '', '', '', '', '', '담쟁이가죽 덤불숲에 있는 칼렉고스와 대화해야 합니다.', 47187),
(65837, 'koKR', '바람 잘 날 없는 소나무 숲', '온아라 평야의 소나무 초소에서 파수꾼 올레크와 대화해야 합니다.', '원시술사들이 시카르 고원을 공격했어.\n\n정보가 있거나 돕고 싶으면 소나무 초소로 가서 올레크를 찾아. 내가 보냈다고 하면 돼. <키득거리는 티렌> 아무리 머리 안 돌아가는 녀석이라지만 날 잊진 않았겠지.\n\n도로를 벗어나지 마, $p. 변화를 맞이한 이후로 평야는 예전처럼 평화로운 곳이 아니게 됐으니.', '', '', '', '', '', '온아라 평야의 소나무 초소에서 파수꾼 올레크와 대화해야 합니다.', 47187),
(65836, 'koKR', '폭풍의 발현', '현자마루 송림에서 와투와 재집결해야 합니다.', '<부상이 말끔하게 사라진 듯 가볍게 일어서는 와투>\n\n조, 조각을 내 몸에 꽂아 넣었는데... 고통이 말끔하게 가셨어. 몸 상태가 그냥 좋아진 정도가 아냐. 엄청나. 훨훨 날아갈 것 같아.\n\n올레크가 아직도 돌아오지 않았다. 무슨 일이 생긴 거야. 애초에 나만 두고 가면 안 됐어!', '', '', '', '', '', '', 47187),
(65834, 'koKR', '여왕 시해', '오한그물 여왕을 처치해야 합니다.', '됐습니다! 정규 교육으로 배운 지식 한 움큼, 지레짐작 한 움큼, 새로 새긴 룬을 때려 넣으면 바로 이 반주입기가 만들어진다, 이 말씀이지요! 주입 역행기가 더 나은가? 주입 해제기?\n\n이름이야 뭐 어쨌든! 여왕에게는 아주 고약한 경험이 될 겁니다. 그건 확실합니다. 위협을 저지하려면 반드시 여왕을 처치해야 합니다. 새끼 거미들은 밟아봤자 시간 끌기밖에 안 되죠. 문제의 싹을 뽑아버려야지.', '', '거미 여왕이 존재해선 안 됩니다.', '오한그물 여왕', '', '', '', 47187),
(65833, 'koKR', '원시술사의 간섭', '서리소환사 룬석 3개를 회수해야 합니다.', '원시술사는 거미에 얼음의 정기를 주입하고 있습니다. 그것들을 선봉대로 내세워서 하늘빛 평원에 있는 용의 방어선을 제압하려는 심산이지요. 그냥 두고 넘어가면 안 될 일입니다.\n\n냉기가 줄줄 흐르는 세 놈이 이곳 책임자입니다. 녀석들을 처치하고 원시 마법을 집중하는 데 쓰는 룬석을 가져다주십시오. 흐름을 막을 방법을 알아봅시다.', '', '', '', '', '', '', 47187),
(65832, 'koKR', '드워프 해동제', '드워프제 부동액이 든 병 $1oa개를 찾아야 합니다.', '제가 조금 곤란한 상황에 처해서 말입니다, 친구. 아니 얼음에 환장하는 원시술사 놈들이 절 이 얼음덩어리에 가두더군요. 사실 아직 완전히 얼어붙지 않은 것도 제가 숨겨뒀던 비장의 무기 덕분입니다. 근데 하필이면 웬 도둑 녀석이 그 비장의 무기를 가져갔습니다! 이젠 얼마 남지도 않았는데!\n\n이러다 뼛속까지 얼어붙기 전에 병을 되찾아 이 드워프에게 은혜를 베풀어 주시지 않겠습니까?\n\n아, 참. 혹시 그 거미의... 입에 담기 거북한 부위에서 찾게 되면 별말 하지 말고 주십시오. 세세한 부분까진 알고 싶지 않습니다.', '', '', '', '', '', '', 47187),
(65806, 'koKR', '마루카이', '마루카이로 이동해야 합니다.', '<산소크 칸의 신호에 맞춰 말하는 오키르>\n\n마루카이는 이 숲 근처 산에 있다. 이 여정도 끝이 얼마 안 남았다는 소리지. \n\n쿠랄이 진행되는 동안은 휴전 기간으로 여겨지지만, 온 새쉬탱의 예언이 불안하게 느껴지는군. 경계를 늦추지 않는 게 좋겠다.', '', '', '', '', '', '', 47187),
(65805, 'koKR', '온아라와의 유대', '강둑에서 강 갈대 $1oa개, 새 꼬리깃털 $2oa개, 도롱뇽 심장을 수집해야 합니다.', '바람이 멈추지 않는군, $n. 온아라께서 부르시니 응당 답해야지 않겠나.\n\n의식에 쓸 재료가 필요하네. 강둑에서 자라는 갈대, 오리의 꼬리깃털, 도롱뇽의 심장이 필요해. 그분의 목소리를 들을 수 있도록 강에서 재료를 모아오게나.', '', '', '', '', '', '', 47187),
(65804, 'koKR', '식량과 경쟁', '방랑자의 평원에 있는 야생동물로부터 신선한 사냥감 고기 $1oa개를 채집해야 합니다.', '마루크는 평야를 가로질러 쿠랄에 참석하고, 며칠 내내 회합을 즐긴다.\n\n그 많은 켄타우로스의 식사를 책임지기란 결코 쉬운 일이 아니지. 식사에 고기를 공급하는 일은 시카르 부족이 전담으로 하고 있다. 마루카이로 가는 길에 사냥을 하는 것이 전통이지. \n\n너도 네 몫을 다해라.', '', '', '', '', '', '', 47187),
(65803, 'koKR', '도시를 향하여', '시카르 짐마차와 함께 방랑자의 평원으로 이동해야 합니다.', '쿠랄은 부족간의 토의가 이루어지는 때다. 많은 이야기를 나누기도 하지. 이 평원에 켄타우로스 부족은 많지만, 우리는 모두 마루크다.\n\n짐마차가 움직일 준비가 되었다. 마루카이가 아직 멀기 때문에 중간에 몇 번 정차할 것이다.\n\n떠날 준비가 되면 행렬로 와 나를 찾아라. 기다리게 하지 마라.', '', '', '', '', '', '', 47187),
(65802, 'koKR', '여정을 위한 보급품', '나무계단 전초 기지에서 야영지 보급품 $2oa개, 주변 숲에서 야성꽃 깍지 $1oa개를 수집해야 합니다.', '<산소크 칸의 신호에 따라 입을 여는 오키르>\n\n우리와 함께하겠다면 마땅히 한 사람 몫을 해야지. 최근 버릇없는 골록 녀석들이 의약품을 도둑질하고 있는지라 보충이 필요한 상황이다. 전초기지 주위에 피어 있는 주황색 꽃을 모아 와라. 그걸로 찜질약을 만들 수 있지.\n\n그리고 전초기지 주변을 살피다 보면 짐마차에 실을 물자도 찾을 수 있을 거다. 이왕 나가는 김에 같이 챙겨주면 좋겠군.\n\n물자를 모두 확보하거든 토물에게 가져가라.', '', '', '', '', '', '정찰병 토물에게 보고해야 합니다.', 47187),
(65801, 'koKR', '친구 소개', '시카르 부족 구성원에게 자기소개를 해야 합니다.', '<산소크 칸의 신호에 따라 입을 여는 오키르>\n\n너와 같은 이방인이 마지막으로 우리 땅에 발을 들인 이후로 헤아릴 수 없는 세월이 흘렀다. 저 원시술사라는 자들이 우리의 땅에서 금지된 마법을 퍼트리고 있으니 동족들이 경계하는 것도 당연하지.\n\n그러니 이름도 모르는 자를 받아들일 수는 없다. 우리와 함께 움직이고 싶다면 부족원들에게 직접 자기소개를 하도록.', '', '', '', '', '', '정찰병 토물에게 보고해야 합니다.', 47187),
(65798, 'koKR', '기회주의적 접근법', '노쿠드 진입로에서 무기를 회수하고 노쿠드 병력을 처치해야 합니다.', '시카르가 북쪽 노쿠드에 맞서 전선을 형성했다. 시체를 살펴 물품을 수거하는 청소부 일을 그리 좋아하진 않지만, 보급품이 아쉬운 상황인 만큼 필요악이지. 전장을 돌아다니면서 무기를 모아와라. 보상은 챙겨주겠다.\n\n노쿠드 진영을 중심으로 모으면 나중에 선조들께 눈칫밥은 덜 먹을 수 있을지도 모르겠군그래.', '', '', '', '', '', '', 47187),
(65796, 'koKR', '최선의 방어는...', '송곳니파괴자 시레나를 처치해야 합니다.', '다음으로 지날 길은 노쿠드의 영토에 있다. 대대로 저들 부족과 잠정적인 평화 관계를 이어왔지만... 이젠 시대가 변했지. \n\n우리가 먼저 행동하지 않으면 취약한 상태로 개활지에 노출될 뿐이야. 정찰대의 보고에 따르면 노쿠드 전쟁 지도자 중 하나가 용의 회합지 근처에서 포착됐다고 한다. 그자를 직접 공격해라. 병력을 모을 틈을 줘서 이동 중에 공격받을 여지를 남겨선 안 돼.', '', '', '', '', '', '', 47187),
(65795, 'koKR', '다음 단계', '루비비늘 전초기지에서 대사 타우라자를 만나야 합니다.', '영웅이여, 녹색용군단에 네 도움이 필요하다. 내 자매의 딸과 그 용군단이 그들의 서약의 돌을 강화하러 에메랄드의 꿈에 들어갔는데, 잠이 시작된 후로 소식을 들은 바가 없구나.\n\n온아라 평야를 통치하는 켄타우로스를 찾거라. 녹색용을 깨워야 하니 그 땅과 정령에 깊은 유대를 쌓은 그들의 도움이 필요할 것이다.\n\n긍지가 높고 영역을 소중히 하는 일족이니 결례를 가벼이 여기지 않을 것이다. 사전 준비는 내 대사와 논해보거라.', '', '', '', '', '', '루비비늘 전초기지에서 대사 타우라자를 만나야 합니다.', 47187),
(65794, 'koKR', '보살핌의 책임', '검은용 알의 생명의 웅덩이 재합류를 목격해야 합니다.', '그리도 오랜 시간 그 둘을 상대했다니, $c 네게 고마움과 위로를 표해야겠구나.\n\n붉은용군단은 용 모두를 보존하고 돌봐줄 의무가 있도다. 가끔 대하기 힘든 자라도 예외 없이 말이다.\n\n검은용군단의 알이 돌아왔으니 용족은 수천 년만에 제일로 하나가 되었다. 우리는 목적을 이뤘다. 이제 루비 서약의 돌을 복구할 수 있을 거다.\n\n준비가 되면 내게 말하거라. 흑요석 생명의 웅덩이로 알을 가져와야 한다.', '', '', '', '', '', '', 47187),
(65793, 'koKR', '검은용 수송 비행', '알을 생명의 웅덩이로 호위해야 합니다.', '서약의 돌이 다시 강화되었으니, 이제 우리의 미래를 생명의 웅덩이로 데려가야겠다. 진정한 용군단은 모두 그 물의 보살핌을 받을 권리가 있다.\n\n허나 불행히도 적이 우리를 알게 됐으니 하늘길이 감시받고 있을 것이다. 놈들의 눈을 피하려면 여정의 마지막은 걸어서 이동해야겠다.\n\n흑요석 보루 근처에서 만나자꾸나, $c|1이여;여;. 생명의 어머니의 용사와는 기꺼이 함께하겠다.', '', '', '', '', '', '루비 생명의 제단 꼭대기에서 사벨리안과 대화해야 합니다.', 47187),
(65792, 'koKR', '이에는 이', '톨루진과 함께 돌송곳니 $1oa마리를 처치해야 합니다.', '톨리퀴가 남의 손을 빌리지 않고 돌송곳니를 잡았단 얘기를 하더군. 우리는 영혼이 연결되어 있으니 거짓말쟁이라고 매도하고 싶진 않아. 그러니... \n\n내가 훨씬 뛰어나다는 걸 톨리퀴와 다른 모두에게 증명할 거다! 이곳에서 가장 가까운 돌송곳니는 북동쪽에 있다. 가서 만나지!', '', '', '', '', '', '', 47187),
(65791, 'koKR', '생명의 어머니의 책무', '루비 서약의 돌 주변에서 알렉스트라자를 만나야 합니다.', '머잖아 생명의 웅덩이는 다시 알로 가득 찰 겁니다.\n\n$n 님, 정말 큰 일을 해주셨습니다. 말로는 이 감사한 마음을 다 표현할 수 없을 정도입니다.\n\n서약의 돌에 계신 생명의 어머니께 가보세요. 알을 맞이할 준비가 됐다고 전해 주시길.', '', '', '', '', '', '루비 서약의 돌 주변에서 알렉스트라자를 만나야 합니다.', 47187),
(65789, 'koKR', '강이 잠드는 곳', '수렁나무 늪지대에서 재료를 수집해야 합니다.', '수렁나무 늪지대는 선조와 교감하는 데 필요한 핵심 재료가 나는 곳일세. 하지만 흙지느러미 부족이 들끓어 채집이 쉽지 않은 곳이지.\n\n그 늪지대에 들어가 꽃과 흙지느러미의 자원을 챙겨온다면 감사히 생각하겠네.', '', '', '', '', '', '', 47187),
(65783, 'koKR', '환영의 불길', '나무계단 전초 기지에서 정찰병 토물을 만나야 합니다.', '우리 사냥꾼들과 힘을 합쳐 싸웠으니, 불가에서 함께할 자격이 있다.\n\n칸께서는 늪지의 사냥 초소에 계신다. 짐마차가 도착할 때가 얼마 안 남았으니 미리 준비 중이시지. 네가 어떤 목적으로 왔는지 전달해드리마.\n\n길은 알아서 잘 찾아올 거라 믿는다.', '', '', '', '', '', '나무계단 전초 기지에서 정찰병 토물을 만나야 합니다.', 47187),
(65782, 'koKR', '단단히 걸린 자물쇠', '세계파괴자 감방 열쇠를 입수해 아야산스를 풀어줘야 합니다.', '데스윙 교단 소문을 들었을 때, 청지기 셀리스트라께서는 이전의 비늘살이를 다시 포섭하라고 명하셨다. 그때만 해도 단순한 착오가 있는 줄 알았지.\n\n말할 것도 없이 우리의 판단 착오였어.\n\n저들 지도자를 처리해야 하는 건 당연하고, 우선 이 우리를 나갈 방법을 알아내야 해. 열쇠를 찾아서 가져와다오.', '', '', '', '', '', '', 47187),
(65780, 'koKR', '능력의 증명', '불타는 원시용을 처치해야 합니다.', '용의 선물에 감탄하는 켄타우로스도 있기야 하겠지. 하지만 시카르 부족은 사냥 실력을 판단의 척도로 삼는다.\n\n방금 우리 사냥대가 불의 힘이 주입된 원시용 한 마리를 끌어내렸다. 함께 놈들을 처치해 실력을 증명해봐라.', '', '젊은 켄타우로스가 성년에 이르면, 관례적으로 첫 원시비룡 사냥에 참여해야 합니다.', '불타는 원시용', '', '', '', 47187),
(65779, 'koKR', '평야 속으로', '온아라 평야에서 시카르 정찰병을 만나야 합니다.', '녹색용군단은 근처 평야에 있는 정원으로 돌아갔습니다. 알렉스트라자 여왕님은 용사님이 꿈의 메리스라 님과 만나보기를 바라고 계십니다.\n\n저 평야에 거주하는 켄타우로스는 대단히 흉포한 사냥꾼들입니다. 에메랄드 정원까지 가려면 우선 그들과 안면을 터야 합니다.\n\n예우를 갖추되, 약하게 보이지 마십시오.', '', '', '', '', '', '온아라 평야에서 시카르 정찰병을 만나야 합니다.', 47187),
(65778, 'koKR', '괴성날개 잔치', '변장을 착용하고 여군주의 전속 요리사에게 시험용 \"알\"을 사용해야 합니다.', '$n 님, 연기 실력을 뽐낼 준비는 되셨나요?\n\n뭐라고요? 그런 실력은 없다고요? 그렇다면 당신이 모은 재료로 만든 이 \'짹\' 소리도 못 하게 훌륭한 괴성날개 변장이 필요하시겠군요!\n\n어미를 해치우는 데 쓸 \"알\"은 저랑 세갈리아가 아직 열심히 만들고 있어요. 그래도 요리사한테 써볼 작은 시제품은 완성했죠.\n\n걱정하지 마세요! 깃털로 몸을 감쌌으니 폭발에서 12퍼센트는 더 안전할 거예요!', '', '', '', '', '', '', 47187),
(65777, 'koKR', '진흙투성이 목걸이', '평원사냥과 수공예 유물에 관해 해박한 사람을 찾아야 합니다.', '<목걸이에 새겨진 고대의 표식은 다소 알아보기 어렵지만 소재는 동물 가죽과 조각된 뼛조각으로 추정됩니다.\n\n박학다식한 사냥꾼에게 보여주면 이 물건의 가치를 알 수 있을지도 모릅니다.>', '', '', '', '', '', '', 47187),
(65770, 'koKR', '약속은 약속', '수습생 라디야에게 비밀을 지켜주겠다고 약속해야 합니다.', '동물들이 당신을 편안하게 여기는군. 영혼이 건전하다는 방증이지.\n\n사실... 이 얘기는 비밀인데, 지켜줄 수 있지? 내 친구를 소개해 주고 싶은데. 다른 누구도 알지 못하는 이야.\n\n일단 비밀 지켜주기로 약속해. 들켰다간 온께서 날 평야에서 추방할 테니까.', '', '', '', '', '', '오후나 고돌로토와 대화해야 합니다.', 47187),
(65769, 'koKR', '얼음 거미줄', '오한그물 골짜기에서 고치에 갇힌 생존자 $1oa명을 구출해야 합니다.', '거미와 원시술사 주인들이 공격했을 때 제 친구와 동료들이 여럿 잡혀갔습니다.\n\n얼어붙은 거미줄로 묶여 끌려가는 것까진 봤는데, 무슨 수모를 당하고 있을지 감히 상상할 엄두도 나질 않습니다. \n\n제발 동료들을 구출해 주십시오!', '', '', '', '', '', '', 47187),
(65761, 'koKR', '정말 뜻밖의 여정', '고돌로토와 함께 라디아를 찾아 구출해야 합니다.', '<고돌로토가 질타하는 듯한 맹렬한 시선을 보내더니 숨을 몰아쉽니다.>\n\n<이 오후나의 도움을 받으면 라디야를 찾아 구출할 수 있을지도 모릅니다.>', '', '', '', '', '', '', 47187),
(65760, 'koKR', '임무 보고', '센드락스를 따라 용심장 전초기지로 가야 합니다.', '저로서도 자라딘은 책에서나 보던 존재들이었습니다.\n\n이 강력한 거인들은 예로부터 용과 숙적이었는데, 대지와 용암을 다스릴 줄 알고... 용을 사냥해 멸종시키는 데 전력을 다한다고 합니다.\n\n<멀리 떨어진 화산을 보며 인상을 찌푸리는 센드락스>\n\n절 가르친 교관님은 용들이 섬을 떠난 이후로 자라딘도 자취를 감췄다고 말씀하셨습니다. 대지 깊은 곳에서 잠들었다고 들었죠.\n\n그들이 깨어난 거라면 이 섬에 있는 새끼용 모두가 위험합니다!\n\n따라오시죠. 용심장 전초기지에 있는 레타나크 사령관님께 안내해드리겠습니다.', '', '', '', '', '', '용심장 전초기지에서 사령관 레타나크와 대화해야 합니다.', 47187),
(65758, 'koKR', '탐험가 그룬기르', '그룬기르 아이언스파우트를 찾아야 합니다.', '$N 님! 구출자 중에 그룬기르 아이언스파우트가 보이지 않더군요. 탐험가 연맹 소속으로 저와 공동 단장을 맡은 사람입니다. 실은 처음에 그 사람 혼자서 빠져나왔는데, 도망쳐 나온 원정대원이 몇 없는 걸 보곤 그대로 돌아서서 다시 들어가더군요! 그것도 혼자서요!\n\n미련할 정도로 충동적이긴 해도 용감한 인물입니다. 어떤 식으로든 좋지 않은 최후를 맞아도 될 사람은 아니에요.\n\n제발... 그를 찾아주십시오.', '', '', '', '', '', '', 47187),
(65752, 'koKR', '비전 방해', '포식하는 지룡 $1oa마리를 처치해야 합니다.', '대량의 마나 지룡이 보관소에서 흘러나오는 맹렬한 비전 마력을 흡수하고 있습니다.\n\n흡수 속도가 상당해 지맥의 균형이 무너지고 있을 정도죠... 그 탓에 하늘빛 서약의 돌을 수복할 수 없는 상태입니다.\n\n용사님이 회수해주신 불안정한 비전력으로 일종의 갈고리를 만들어 드리겠습니다.\n\n그걸로 지룡을 처리해 주세요. 잠깐만 시간을 끌어 주시면 제가 밑에서 마력을 조정하겠습니다.', '', '', '', '', '', '', 47187),
(65751, 'koKR', '단상 조정', '하늘빛 기록 보관소 꼭대기에서 불안정한 비전 마력 $1oa개를 무효화해야 합니다.', '마지막 비전 붕괴 현상은 여기 있는 것 같습니다. \n\n전 계속 지맥 마력을 조정하겠습니다. 일전에 회수한 비전력으로 붕괴 현상을 무효화 해주세요.', '', '', '', '', '', '', 47187),
(65750, 'koKR', '다리 여덟 달린 위협', '오한그물 골짜기에서 오한그물 소름거미 또는 오한그물 포복자 $1oa마리, 원시술사 관리인 $2oa명을 처치해야 합니다.', '$C님!\n\n도움을 청하고 싶은데, 시간 괜찮으신지...\n\n사실 이번 합동 원정은 이 일대에 서식하는 독특한 거미를 연구하는 게 목적이었습니다. 하지만 보시다시피... 계획이 틀어졌습니다.\n\n처음엔 거미들이 진화의 일종으로 적응한 줄 알았습니다. 그런데 알고 보니 원시술사가 입맛대로 자연의 섭리를 비틀어 놓은 결과였던 겁니다!\n\n환경 보호가로서 막중한 책임감을 느끼고 있지만, 살아 있는 표본을 연구할 시간은 이미 지나갔다고 봐야겠지요. 원시술사들이 자연을 어지럽히게 둬선 안 됩니다. 연구는 나중에 사체로 하면 됩니다.\n\n도와주실 수 있겠습니까?', '', '', '', '', '', '', 47187),
(65711, 'koKR', '천둥 도둑', '카이간 야영지에서 폭풍 추출자를 처치하고 천둥가시 리지를 구출해야 합니다.', '왔구나! 다행이야. 또 웬 덩치가 접근하길래 다친 척하고 있었거든. 으, 망할 놈들이 무슨 속박 주문을 걸어놨어. 좀 살펴봐야 할 것 같아.\n\n리지는 동굴에 잡혀 있어. 제발 녀석을 구해줘. 나는 알아서 잘 빠져나갈 테니까.\n\n해야만 하는 일을 해줘.', '', '', '', '', '', '', 47187),
(65709, 'koKR', '비전 가지치기', '요긴한 물품 가방을 살펴 지맥 홀을 찾아낸 후, 단상 2개를 수리해야 합니다.', '이 일대의 통제를 벗어난 지맥 마력 문제를 해결하기 전까지는 하늘빛 기록 보관소에 있는 서약의 돌을 활성화할 수 없습니다.\n\n지맥 마력을 통제하는 역할을 하는 용족 룬이 총 세 개 존재하는데, 그중 두 개가 불안정한 비전력에 막혀 작용을 못 하고 있더군요.\n\n송구하게도 이 일은 용사님께 맡겨야 할 것 같습니다. 카드가는 할 일이 있는 데다, 제 동포들이 모습을 드러내고 있지도 않으니까요.\n\n요긴한 물품 가방에 지맥 홀이 들어 있을 겁니다.\n\n그걸로 주변 룬을 복구하시면 됩니다.', '', '', '', '', '', '', 47187),
(65702, 'koKR', '광기에 사로잡히다', '불안정한 비전 마력 $1oa개를 회수해야 합니다.', '하늘빛 기록 보관소는 본래 푸른용들이 모여 마법을 논하던 장소였습니다.\n\n지금 있는 푸른용이라곤 저 하나밖에 없지만요.\n\n하늘빛 평원 땅속에 뻗은 지맥을 관리하는 장소이기도 한데, 문제는 기록 보관소와 시설을 관리하는 종복들이 통제를 벗어났다는 겁니다.\n\n추측컨대 기록 보관소를 정상화하면 하늘빛 서약의 돌을 수복할 수 있을 거예요.\n\n바꿔 말하자면 온갖 피조물과 원소에 흐르는 불안정한 비전 마력의 방향을 바꿔야 한다는 얘기입니다.\n\n될 수 있는 대로 파괴하고 마력을 모아 주시길.', '', '', '', '', '', '', 47187),
(65701, 'koKR', '보존 또는 황폐', '전문화를 선택해야 합니다.', '저 용들 말이 사실이라면 머잖아 큰 싸움이 일어날 거다. 기원사여, 이런 때일수록 그대가 정신 차리고 강인하게 버텨야 한다.\n\n전투 전문화를 고를 때가 되었군. 아군을 보존하는 길을 택하겠나, 적진을 황폐하게 만드는 길을 택하겠나? \n\n전투 기술을 극한까지 갈고닦겠다면 황폐를 선택해라.\n\n치유 능력을 극대화하겠다면 보존이 알맞은 진로가 되겠지.\n\n두 전문화 모두 그대와 잘 어울려. 나중에 변경하여 적응할 수 있다는 걸 명심하도록.', '', '', '', '', '', '', 47187),
(65691, 'koKR', '그의 날개의 그림자', '넬타리온의 목소리 사이제노스를 대면해야 합니다.', '넬타리온의 목소리는 저 아래에 머무르며 추종자들에게 거짓을 퍼뜨리고 있다. \n\n겉모습은 나랑 같은 용혈족인데, 용언이 어설픈 게 아무리 봐도 다른 종족 같단 말이지.\n\n일종의 기만이나 환영이 아닐까 싶군. 놈을 제압하면 분명 진상이 드러날 거다.', '', '넬타리온의 목소리를 자칭하며 세계파괴자의 지도자로 등극한 자입니다.', '사이제노스', '', '', '', 47187),
(65690, 'koKR', '이교도의 의구심', '타들어가는 봉우리에서 아야산스를 찾아야 합니다.', '어제 웬 이방인이 또 도착했습니다. 자기가 붉은용군단에서 온 \"사절\"이라면서 지도자이신 넬타리온의 목소리께 알현을 요청하셨죠.\n\n근데 목소리께서 펄쩍 뛰면서 화를 내셨습니다. 대지의 수호자께서 우리를 시험하는 것이라면서 당장 그 여자를 처형해야 한다고 하셨죠!\n\n이방인을 믿어서는 안 된다는 거 압니다. 하지만 죽일 것까지는 없잖아요! 부디 사절을 구하는 걸 도와주셨으면 합니다.', '', '', '', '', '', '타들어가는 봉우리에서 아야산스와 대화해야 합니다.', 47187),
(65689, 'koKR', '칼렉고스의 수많은 환영', '수정탑을 사용해 하늘빛 기록 보관소에 도달해야 합니다.', '정식으로 인사 올립니다, $n 님. 전 키린 토의 대마법사이자 푸른용군단의 위상인 칼렉고스입니다.\n\n하늘빛 서약의 돌을 수복을 위해 하늘빛 기록 보관소를 수리하고 있는데, 보통 어려운 일이 아니더군요. 물리적으로 일손을 보태줄 사람이 필요합니다.\n\n지금 전 기록 보관소 상부에 있습니다. 바깥 수정탑을 다시 활성화해 두었으니 그걸 이용해 올라와 주세요.', '', '', '', '', '', '하늘빛 기록 보관소 안에서 칼렉고스와 대화해야 합니다.', 47187),
(65688, 'koKR', '칼렉고스 만나기', '요긴한 물품 가방을 획득한 후 하늘빛 기록 보관소 하부에서 칼렉고스를 만나야 합니다.', '아무래도 이렇게 된 이상 전력을 나눠야 할 듯하오. 동쪽의 원시술사들도 처리를 해야 하니.\n\n용사 당신은 날 대신해 하늘빛 기록 보관소로 가서 칼렉고스를 도와 하늘빛 서약의 돌을 수복하시오.\n\n무슨 일이 일어날지 모르니 보급품을 몇 가지 챙겨가는 게 좋을 거요.\n\n우리 차원문 병참장교에게 말하면 여정을 도와줄 물품을 건네줄 것이외다.\n\n행운을 빌겠소, $n. 칼렉고스는 도움이 꼭 필요하오.', '', '', '', '', '', '하늘빛 기록 보관소 하부에서 칼렉고스를 만나야 합니다.', 47187),
(65687, 'koKR', '주먹다짐', '세계파괴자 용족 $1oa명을 처치해야 합니다.', '다른 사도들 중에는... 아주 악랄한 자들도 있습니다.\n\n<코에 새로 생긴 상처를 문지르는 잉곳>\n\n예전에는 이러지 않았는데, 사이제노스가 나타나서는 \"힘이 그 무엇보다 중요한 가치\"라고 말했죠. 이제 모두들 언제나 싸우고만 있습니다.\n\n당연히 저도 맞고만 있진 않았습니다! 근데 놈들 가죽이 워낙 두꺼운 데다... 저는 덩치도 왜소해서요.\n\n하지만 당신은 다르죠! 저런 불한당 자식들과 하루가 멀다고 싸우잖아요. 어떻게 도와주실 수 있을까요?', '', '', '', '', '', '', 47187),
(65686, 'koKR', '하늘빛 평원을 향하여', '하늘빛 평원에서 축복받은 자들의 글라니아를 만나야 합니다.', '반갑습니다, $n 님! \n\n파키나와 저는 키린 토를 대표하여 도움을 청하고자 이렇게 찾아뵈었습니다. \n\n키린 토는 현재 하늘빛 평원 전역에서 관측되고 있는 비전 마력 폭주 현상을 진압하려고 애쓰고 있습니다.\n\n푸른용군단의 위상이신 칼렉고스 님을 비롯해 다른 지도자분들께서 하늘빛 서약의 돌을 수복하는 데 도움이 필요하신 상황이기도 합니다.\n\n용사님, 도와주실 생각이 있으시다면 길을 쭉 따라가 축복받은 자들의 글라니아를 만나 보십시오.\n\n가장 도움이 필요한 장소를 알려줄 것입니다.', '', '', '', '', '', '하늘빛 평원에서 축복받은 자들의 글라니아를 만나야 합니다.', 47187),
(65615, 'koKR', '비전 침입', '신호기를 조사해야 합니다.', '저 앞에 신호기는 우리가 갇힐 때만 해도 없었던 물건이다.\n\n주문술이 내 전문 분야는 아니지만 그래도 척 보면 알 수 있지. 요람에서 그 푸른용이 쓴 마법과 결이 같아.\n\n그 녀석이 분명... 말리고스라는 이름을 언급했었지. 분명히 낯이 익은데, 대지의 수호자 님의 가르침은 조각난, 아득한 기억처럼 느껴지는군.\n\n그 말리고스란 자가 우리를 정지시킨 거라면 저 마력이 충만한 신호기도 그자가 설치하라 명했을 거다.\n\n지역을 조사한 다음 보고하도록. 저 신호기가 적 지원군을 호출하는 데 쓰여서는 안 된다.', '', '', '', '', '', '', 47187),
(65613, 'koKR', '상징적인 용족의 모습', '인간 형상을 취해야 합니다.', '오그리마 시민들도 처음 나타난 그대들을 눈여겨보고 있을 겁니다. 당연한 얘기지만 반기지 않는 이들도 있겠지요.\n\n지금 그대 눈앞의 제 필멸자 형상은 어린 용이었던 시절에 취한 것입니다. 이 모습 덕택에 높은산 타우렌의 우군으로서 함께 살 수 있었지요.\n\n걷는 길은 다르지만 $p 님의 몸속에도 용족의 정수가 흐르고 있습니다. 그대만의 형상을 취하는 것도 가능할 거라고 생각합니다.\n\n잠깐 걷죠.', '', '', '', '', '', '', 47187),
(65606, 'koKR', '마루크 영예', '마루카이에서 아가리와 대화해야 합니다.', '네가 부족의 이름으로 수많은 공로를 세운 건 아주 잘 알고 있다.\n\n언제 한번 거주지에 들렸으면 좋겠군. 앞으로도 우리와 협력하는 데 도움이 되어줄 보급품을 준비해 두겠다.', '', '', '', '', '', '', 47187),
(65595, 'koKR', '미꾸라지 한 마리가 물을 흐린다', '부패의 뿌리를 처치해야 합니다.', '부패은 놀 굶긴다.\n\n부패은 친구들 아프게 한다.\n\n지금 당장 부패 해치운다. 그게 군주가 할 일이다.', '', '바로 이 고약한 나무정령이 놀에게 부패 마법을 가르친 장본인입니다. 위생 상태도 최악이죠.', '부패의 뿌리', '', '', '', 47187),
(65594, 'koKR', '놀 언덕으로 산 만들기', '부패 토템 $2oa개를 파괴해야 합니다.', '멍청한 부패. 주도권이 자기한테 있는 줄 안다. 틀렸다. 주도권은 나한테 있다. 당장 부패 없애버릴 거다. 내가 수액 친구로 만들었다.', '', '', '', '', '', '', 47187),
(65490, 'koKR', '폭발적인 배설물', '교수 처프스나이드의 자동 배설물 수집기를 채워야 합니다.', '하피도 뜻밖의 수확이긴 하지만, 제가 여기 온 이유는 딱 하나예요. 배설물 때문이죠!\n\n정확히 말하자면 벌레가 먹어서 소화된 푸른깃 로크 배설물이에요. 딱정벌레 소화액은 폭발성 질소 혼합물 비율을 10배는 늘려주거든요! 그것도 최소 10배로요!\n\n이 처프스나이드 자동 배설물 수집기를 가져가세요. 동굴 바닥에 기어 다니는 딱정벌레를 밟아서 나온 것을 수집기로 수집하세요.\n\n다 채워서 가져오면 진짜 재미를 느껴보자고요. 네, 폭발 말이에요!', '', '', '', '', '', '', 47187),
(65486, 'koKR', '완벽한 사진', '프렌과 함께 분류학자의 뗏목을 타고 현지 야생동물 사진을 촬영해야 합니다.', '기다리게 했다면 죄송합니다. 망원경을 보다 보면 시간 가는 줄 모를 때가 있어요.\n\n세상이란 게 멀리 떨어져서 보면 한결 쉽게 이해할 수 있죠. 아무 개입 없이 그저 순리대로 돌아가는 자연의 모습이란...\n\n<한숨을 내쉬는 분류학자 아쿤다>\n\n코랄리에게 카메라를 받으셨군요. 좋습니다.\n\n프렌과 함께 강 하류로 향하세요. 자연 서식지에서 살아가는 야생동물 사진을 찍어 주시면 연구에 잘 활용하겠습니다.', '', '', '', '', '', '야영지에 있는 분류학자 아쿤다에게 가야 합니다.', 47187),
(65475, 'koKR', '괴성에 파묻혀', '푸른깃 절벽에 있는 할린 처프스나이드에게 괴성날개 두루마리를 가져가야 합니다.', '<로크 포식자의 찐득한 피가 묻은 가방에서 양피지 조각을 하나 꺼냅니다. 이해할 수 있는 것은 하피가 큰 알을 먹어 치우는 그림뿐입니다.\n\n경험 많은 조류학자 할린 처프스나이드라면 이 정체불명의 긁힌 자국이 어떤 의미인지 확실하게 알아볼 겁니다.>', '', '', '', '', '', '푸른깃 절벽에 있는 할린 처프스나이드에게 괴성날개 두루마리를 가져가야 합니다.', 47187),
(65453, 'koKR', '원시 해충', '야생의 해안에서 원시 새끼 비룡 $1oa마리를 처치해야 합니다.', '<뒤쪽 능선에서 꾸물거리는 원시용들을 미심쩍은 시선으로 흘기는 신드레스레쉬>\n\n내가 등을 보일 때마다 저 원시용들이 조금씩 야영지로 접근하는 것 같은데...\n\n우릴 초대한 에비시안이 소개해 주려는 용은 절대 아니지 싶군.\n\n원시용은 일말의 타협조차 통하지 않는 무정한 포식자들이다. 그러니 우리도 인정사정 봐줄 것 없어.\n\n쓸데없이 설치지 못하도록 개체수를 좀 줄여두는 게 좋겠군. 그냥 뒀다간 원정이 시작하기도 전에 끝나게 생겼어.', '', '', '', '', '', '날개쉼터 대사관에서 비늘사령관 신드레스레쉬를 만나야 합니다.', 47187),
(65452, 'koKR', '위기의 탐험가들', '야생의 해안에서 용비늘 원정대원 3명을 구출해야 합니다.', '원정대가 학술 목적으로 왔다고 해서 소극적일 거라 넘겨짚진 마십시오, $p 님.\n\n저희는 어디 산골 탑에 틀어박혀 사는 책상물림이 아니랍니다.\n\n아제로스 구석구석을 누비며 누구보다 먼저 지식을 찾는 모험가들이지요!\n\n하지만 모험을 향한 열정 때문에 위기에 처할 때도 적지 않습니다. 더군다나 본인 한계 이상으로 무리한 사람들이 몇 있는지라...', '', '', '', '', '', '날개쉼터 대사관에서 날레디아를 만나야 합니다.', 47187),
(65451, 'koKR', '연습 재료', '태고의 원시 새끼용 비늘 $1oa 개를 모아야 합니다.', '이 원시비룡이란 존재들은 지금껏 아제로스에서 봐온 녀석들과는 다르네.\n\n비늘이 선천적으로 화염에 저항력이 있고, 강철보다 단단하며, 그 과정에서 탄력을 잃지도 않는 것 같더군. 실로 경이로워. \n\n오죽하면 장인들이 하나같이 그 비늘로 작업해보고 싶다고 아우성일세.\n\n새끼용부터 시작하세. 작은 비늘이면 그만큼 가공하기 쉬울 것이고, 우리가 소재를 다루는 방법을 통달할 때까지 활용할 수 있겠지.', '', '', '', '', '', '날개쉼터 대사관에서 대장 마고르를 만나야 합니다.', 47187),
(65444, 'koKR', '용의 섬으로!', '오그리마 바깥의 비행선 탑승장에서 저항의 용비늘호를 타고 용의 섬으로 이동해야 합니다.', '초기의 탐험은 무사히 성공으로 끝났군요.\n\n용감한 용비늘 원정대원들의 활약 덕분에 용의 섬에 안전한 상륙지를 확보하고, 용군단의 대사관과 접선할 수 있었습니다.\n\n자, 그럼 함께 용의 섬으로 다음 모험을 떠날 준비는 되셨습니까?', '', '', '', '', '', '용의 섬 해안에서 날레디아 리버글림을 만나야 합니다.', 47187),
(65443, 'koKR', '원정대 조율하기', '오그리마에서 탐험가와 장인, 학자를 영입해 용의 섬 원정대를 편성해야 합니다.', '만나 뵈어 영광입니다. 전 날레디아 리버글림이라고 합니다.\n\n용의 섬에서 날아온 초대장이라, 생각만 해도 가슴이 두근거리지 않습니까?\n\n성물회에서 체계적인 활동을 지원하고자 원정대와 협력하기로 결정했습니다. 용비늘 원정대의 일원으로서 용사님을 맞이하게 되다니, 황송하기 이를 데 없습니다.\n\n먼저 할 일은 여정에 함께할 대원을 좀 더 모으는 겁니다. 자, 그럼 시작해 볼까요?', '', '', '', '', '', '오그리마 바깥 비행선 승강장에서 날레디아를 만나야 합니다.', 47187),
(65439, 'koKR', '바람에 실려 오는 속삭임', '오그리마 바깥에서 대마법사 카드가와 대화해야 합니다.', '반갑소, $p. 오래간만이오. 여유롭게 회포를 풀 시간이 있었으면 좋으련만.\n\n보다시피 새로운 사실을... 아니지. 불길한... 그래, 오랜 친구와 얘기를 나누다 불길한 사실을 접해서 말이외다.\n\n진실이란 때때로 깨달음과 불길함이 뒤섞여 나타나기 마련이라오.\n\n지금까지 알아낸 것들을 말해주리다.', '', '', '', '', '', '', 47187),
(65437, 'koKR', '위상의 초대', '에비시안과 대화해야 합니다.', '절묘하게 잘 맞춰 오셨습니다, $p 님.\n\n방금 막 호드 의회를 만나고 오는 길입니다. 의회는 위상들께서 보내신 용의 섬 초대에 응하기로 했습니다.\n\n물론 용사님도 초대하셨지요.\n\n오그리마 곳곳에서 낯선 얼굴이 좀 보일 겁니다. 곧 드랙티르에 대해 자세히 설명해드리겠습니다.\n\n가시죠. 드릴 말씀이 있습니다.', '', '', '', '', '', '', 47187),
(65436, 'koKR', '용의 섬이 기다린다', '스톰윈드에서 래시온을 만나야 합니다.', '친구여, 멋진 소식을 전해주지! 용의 섬이 깨어나고 있다!\n\n세계의 분리로 섬이 휴면에 들면서 우린 보금자리를 뒤로 하고 떠났다. 하지만 오랜 세월을 뛰어넘어 고향의 부름이 들려오는군.\n\n용의 섬은 수많은 경이로 가득하지만 위험도 그에 못지 않게 산적한 곳이다. 유산을 되찾는 데 필멸자 동맹의 지원이 필요하다.\n\n얼라이언스에 위상들의 초대장을 전할 계획이니, 스톰윈드에서 만나도록 하지.', '', '', '', '', '', '', 47187),
(65435, 'koKR', '용의 섬이 기다린다', '오그리마에서 에비시안을 만나야 합니다.', '호드의 영웅들이여, 전해드릴 소식이 있습니다. 용의 섬이 깨어나고 있습니다!\n\n용의 섬은 세계의 분리의 여파로 잠들어 있었습니다. 오랜 기다림 끝에 우리 용족을 고향으로 부른 것이지요.\n\n용의 섬은 수많은 경이로 가득하지만 위험도 그에 못지않게 산적해 있습니다. 우리 용들이 유산을 되찾는 데 필멸자 동료분들의 도움이 필요합니다.\n\n전 오그리마 호드 의회로 가 위상들의 초대장을 전하려고 합니다. 의견을 묻는 자리에 동행해 주십시오.', '', '', '', '', '', '', 47187),
(65422, 'koKR', '보물 사냥은 아무나 하나', '바위 등반 장비를 획득한 후, 디딤돌을 찾아 손을 놓치지 않고 산꼭대기까지 올라가야 합니다.', '눈빛만 봐도 알겠군. 이 산을 타고 올라 꼭대기에 무엇이 있는지 보고 싶은 열망이 내 눈에는 보이네!\n\n자고로 등반가는 끼리끼리 알아보는 법. 우린 그 어떤 산 앞에서도 위축되지 않지.\n\n운 좋은 줄 알게. 내가 마침 등반 장비를 잔뜩 가져왔거든. 배낭 하나 챙겨서 정상까지 등정하게나!', '', '', '', '', '', '산 정상에 있는 트위츠 라이트스프로켓과 대화해야 합니다.', 47187),
(65421, 'koKR', '산이 있기에 오른다', '등반 장비를 획득한 후, 디딤돌을 찾아 절벽을 등반해 길잡이 이프스를 구출해야 합니다!', '설명이 어떻든 어련히 찰떡같이 알아듣게, $c 친구. 하나하나 가르치고 앉아 있을 시간 없으니! \n\n배낭을 챙겨서 저 봉우리 정상으로 올라가는 경로를 찾게나.\n\n그리고 정상에 오르면 이프스에게 이 낙하산을 건네주게. 바람의 정령에게 비행기를 격추당할 때 그 불쌍한 친구만 웬 덩굴에 걸렸거든!\n\n우리도 얼른 빠져나가고 싶으니 서두르게!', '', '', '', '', '', '', 47187),
(65417, 'koKR', '만물의 연결', '', '', '', '', '', '', '', '', 47187),
(65402, 'koKR', '패턴 인식', '', '', '', '', '', '', '', '', 47187),
(65374, 'koKR', '뽑기의 달인', '새끼의 깃털 $1oa개를 뽑아야 합니다.', '할린 교수님이 당신한테 줄 변장을 만들고 계신다고 하셨어요! 재밌겠어요! 하지만 새끼 로크의 깃털이 조금 필요하다고 하시더라고요.\n\n다행히 제가 방금 깃털 뽑개 3300 수리를 끝냈어요!\n\n괴성날개가 절벽 아래에 새끼 로크들을 가둬놓고 기르고 있어요. 깃털 뽑개를 쓰면 새끼들을 꺼낼 수 있을 거예요. 꺼내면서 깃털도 몇 개 뽑을 수 있고요.\n\n뽑개 한 번에 두 일을 같이 하는데, 안 할 이유가 없죠!', '', '', '', '', '', '', 47187),
(65373, 'koKR', '부품 뽑기', '깃털 뽑개 3300 부품 4개를 회수해야 합니다.', '어떡하지? 큰 실수를 저질렀어요.\n\n교수님께서 혁신적인 발명품인 깃털 뽑개 3300을 맡기셨는데, 그만 부서져 버렸어요!\n\n저기 남쪽에 있는 동굴에 로크 깃털을 뽑으러 갔다가 하피의 기습에 당하는 바람에... 두고 도망칠 수밖에 없었어요.\n\n부품을 회수해주세요! 동굴 바닥에 벗겨진 비늘처럼 흩어져있을 거예요.\n\n다시 조립할 수 있을 거예요. 해야 해요... 할 수 있겠죠? 음, 아마도...', '', '', '', '', '', '', 47187),
(65371, 'koKR', '우리만의 둥지', '괴성날개 갈퀴발톱 $1oa개, 괴성날개 지팡이 $2oa개, 개울살이 핵 $3oa개를 수집해야 합니다.', '당신이 찾은 두루마리에 모든 푸른깃 알을 하피 요리사 프라이에어리에게 전달하라는 명령이 적혀 있었어요. 괴성날개 어미는 제대로 조리해서 간이 된 것만 먹나 보군요.\n\n저희도 특별한 알을 하나 준비하죠. 미각이 폭발할 정도의 알로요! 아, 당연히 진짜 터져야겠죠.\n\n어떻게 먹이냐고요? 변장해서 직접 주는 게 좋을 거예요.\n\n깃털 의상을 만들어야 할 텐데, 재료는 절벽 아래쪽에 있는 하피한테서 모아주세요. 필요한 재료를 적어드릴게요.', '', '', '', '', '', '', 47187),
(65313, 'koKR', '로크 미식가', '로크 포식자 화시아를 처치해야 합니다.', '타르제라는 재능도 있고 장비도 잘 다루는 아이지만, 쉽게 당황해요.\n\n예를 들면 여기서 바로 남쪽에 있는 동굴에 들어갔다가 비정상적으로 큰 하피한테 곧장 쫓겨나는 일도 있었죠. 다른 개체에 명령을 내리는 것처럼 보이더군요.\n\n설마 무리의 어미일까요? 지휘관이라던가? 가서 확인해주세요, $n 님.\n\n조금은 부산하게 깃털을 날려도 괜찮아요. 무슨 말인지 아시죠?', '', '유난히 덩치가 큰 괴성날개 하피입니다. 푸른깃 뼈를 즐기는 섬뜩한 식성을 갖고 있습니다.', '로크 포식자 화시아', '', '', '', 47187),
(65307, 'koKR', '자비가 우선', '부상당한 드랙티르와 용기병을 치유해야 합니다.', '하마터면 독소에 요람에 있는 모두가 비명횡사할 뻔했군. 해독제를 준비할 동안 그대는 부상자를 찾아 치유하도록. \n\n그래, 푸른용기병도 치료해주란 얘기다. 치유의 날개는 고통받는 이를 그냥 지켜보지 않아.', '', '', '', '', '', '', 47187),
(65306, 'koKR', '부패의 사육사', '썩어가는 부식물에서 냄새나는 수액 $1oa개를 채취해야 합니다.', '부패 징그럽다. 냄새나고 아프다. 좋은 생각 있지만 수액 필요하다. 수액 가져와라!', '', '', '', '', '', '', 47187),
(65302, 'koKR', '왕국의 열쇠', '열쇠를 획득해 무기 보관함을 열어야 합니다.', '계획 실행하려면 무기 필요하다. 좋은 무기 있지만 잠겨 있다. 놀이 무기 보관함 지키려고 야영지에 열쇠 뒀다.\n\n가장 뾰족한 막대기 가져와라. 피 가장 많이 묻어있을 거다.', '', '', '', '', '', '', 47187),
(65287, 'koKR', '노른자 빼돌리기', '푸른깃 알 $1oa개를 수집해야 합니다.', '두루마리를 해독했어요. 역시 나쁜 소식이에요!\n\n괴성날개가 푸른깃을 먹는 이유는 배고파서만이 아니에요. 로크를 먹어서 그 타고난 힘을 흡수하는 주문을 한두 개 알아냈더라고요. 특히 알을 먹으면 효과가 좋대요!\n\n로크 알을 최대한 많이 구해주세요. 계획이 성공할 때 까지 하피들을 잡아놓을 수 있을 거예요.\n\n그리고 떠도는 원소 정령을 조심하세요. 저주배필의 주문 때문에 화가 많이 났을 거예요!', '', '', '', '', '', '', 47187),
(65286, 'koKR', '용의 인맥', '스톰윈드에 입장해야 합니다.', '그 정도 거리를 날아오려면 시간이 훨씬 더 걸려야 정상이지. 하지만 청동의 위상 본인이 여정을 앞당겨줬다면, 확실히... \n\n<에헴> ...기록적인 시간 안에 오고도 남지.\n\n아, 저기 저 뾰족한 무기를 든 병사들 말인가? 걱정 말게. 형식상 세워둔 것이니.\n\n자네와 아주라텔이 적응할 동안 총사령관과의 알현 자리를 마련해 보겠네.\n\n다행히도 내가 이 도시에서 상당히 영향력 있거든.', '', '', '', '', '', '아주라텔과 대화해야 합니다.', 47187),
(65279, 'koKR', '왕의 칙령', '개울이빨 소굴에서 담쟁이가죽 전사 $1oa명과 담쟁이가죽 주술사 $2oa명을 처치해야 합니다.', '멍청한 놀 녀석들 왕관 이해 못 한다. 폭력만 이해한다. 놈들을 흠씬 두들겨 패주지 않으면 나한테 잡아먹힐 줄 알아라.', '', '', '', '', '', '', 47187),
(65267, 'koKR', '비오는 날 깃털 날리도록', '괴성날개 쇠퇴자 $1oa마리, 괴성날개 사술발톱 $2oa마리를 처치해야 합니다.', '저 특이한 날개 달린 생명체를 보고 호기심이 동해서 인사라도 나누려고 했어요. 처프스나이드 교수님과 그분의 거대한 기계 새가 없었더라면 산 채로 잡아먹혔겠죠!\n\n\"괴성날개\"를 상대하는 걸 도와주시겠어요? 토착 푸른깃 로크가 괴성날개로부터 둥지를 지켜내는 데 어려움을 겪고 있어요.\n\n그리고 또 인사 나누다 일이 꼬이는 건 피하고 싶어서요...', '', '', '', '', '', '', 47187),
(65133, 'koKR', '용과 속도 높히기', '강하하여 고리를 통과한 후 대상 지역에 착지해야 합니다.', '자, 경로에 장애물이 나타나면 어떻게 대처해야 할까요?\n\n제대로 비행하고 있다는 전제하에 가속은 어느 정도 유지됩니다. 그리고 강하 후에는 일정한 수준의 고도를 상승하게 되어 있죠.\n\n이번에 강하하는 경로는 착륙 지점보다 아래로 내려갑니다. 그래도 내려가며 얻은 가속도를 사용하면 다시 목표 지점까지 올라올 수 있습니다.\n\n혹시 움직일 수 없게 된다면 청동 계시기를 사용하세요. 셀로르무가 되돌려 줄 겁니다.', '', '', '', '', '', '', 47187),
(65120, 'koKR', '용과 강하하기', '강하 직후 활공하여 고리를 통과한 후 대상 지역에 착지해야 합니다.', '활공을 통해 어디든 가고 싶은 곳으로 갈 수 있죠. 그런데 더 빨리 가고 싶을 때는 어떻게 해야 할까요?\n\n높은 곳에서 도약한 직후 강하하면 이동 속도가 폭발적으로 증가합니다.\n\n날아서 고리를 통과한 후 대상 지역에 착지해 보세요.\n\n난관에 부딪치면 청동 계시기를 사용하세요. 그럼 셀로르무가 초기화해 드릴 겁니다.', '', '', '', '', '', '', 47187),
(65118, 'koKR', '용과 활공하기', '활공하여 고리를 통과한 후 대상 지역에 착지해야 합니다.', '자, 그럼 기초부터 배워보죠.\n\n그냥 직선으로 나는 건 체력 낭비의 지름길입니다. 그러니 중력의 도움을 받을 겁니다. 방향을 살짝 밑으로 향하게 하면 먼 거리를 날 수 있죠. 고리를 통해 기초 활공 시 사용하게 될 각도를 익히실 수 있을 겁니다.\n\n먼저, 비룡을 불러보세요.\n\n그 다음, 날아서 고리를 통과한 후 대상 지역에 착지해 보세요.\n\n난관에 부딪치면 청동 계시기를 사용하세요. 그럼 셀로르무가 초기화해 드리겠습니다.', '', '', '', '', '', '', 47187),
(65101, 'koKR', '상징적인 용족의 모습', '필멸자 형상을 취해야 합니다.', '$p, 너희는 스톰윈드에 도착할 때 주민의 이목이란 이목은 전부 끌었지. 분명 다른 사람들보단... 고분고분하게 나오는 시민들도 있기야 할 거다.\n\n우리 용들은 다른 종족과의 원활한 교류를 위해 필멸자의 형상을 취한다. 지금 네 바로 앞에 보이는 이 얼굴처럼 말이야. 동맹이 편안함을 느낄 뿐만 아니라, 문을 지날 때 거추장스러운 일이 확 줄어들지.\n\n용족의 정수가 드랙티르의 몸에도 흐르는 건 분명한 사실이다. 마음만 먹으면 우리처럼 형상을 취할 수 있을 거다.\n\n잠시 함께 걷지.', '', '', '', '', '', '래시온에게 형상을 보여줘야 합니다.', 47187),
(65100, 'koKR', '마지막 명령', '금지된 해안 대피를 지휘해야 합니다.', '라자게스가 너무 강한 폭풍을 풀었어. 이렇게 된 이상 우리의 유일한 고향에서 대피해야 할 것 같군.\n\n우리를 이끌어 주시던 대지의 수호자께선 이제 존재하지 않는다. 태어나서 처음으로 주체적인 결정을, 스스로 운명을 찾을 기회가 주어진 셈이지.\n\n이 새로운 시대에서 그대가 어디로 가든... 훌륭한 동료를 찾길 기원하마. 우리의 이야기를 전해다오.\n\n나는 여기 남아 생존자를 찾겠다. 겸사겸사 우리 과거에 대한 해답도 찾아볼 생각이야.\n\n행운이 우리 모두에게 미소 짓기를 빌지, $p.', '', '', '', '', '', '비늘사령관에게 보고해야 합니다.', 47187),
(65098, 'koKR', '용기의 대가', '에비시안을 찾아야 합니다.', '치료해줘서 고맙다, $n. 이렇게 차근차근 신뢰를 쌓아나갈 수 있으면 좋겠군.\n\n<어깨를 으쓱하는 래시온>\n\n폭풍포식자라. 그토록 강력한 정기를 지닌 용은 처음 봤다. 한데 비슷한 용들이 더 있다면...\n\n잠깐, 에비시안은 어딨지? 에비시안도 살아있나? 당장 찾아야 해!', '', '', '', '', '', '엠버탈과 대화해야 합니다.', 47187),
(65097, 'koKR', '도망쳐라!', '후퇴해야 합니다!', '곧 폭풍이 우리까지 집어삼킬 거다! 대피해야 해!\n\n구할 수 있는 모두를 구해라. 검은용도 찾아!', '', '', '', '', '', '래시온과 대화해야 합니다.', 47187),
(65087, 'koKR', '안에 든 상품', '금고를 방어해야 합니다.', '그래, 원시술사들의 목표가 금고 안에 있단 말이지?\n\n<미간을 구기는 사카레스>\n\n오게 두어라.\n\n드랙티르의 진가를 보여줄 테니!', '', '', '', '', '', '', 47187),
(65084, 'koKR', '서리석 금고', '서리석 금고로 집결해야 합니다.', '저기 해안 반대편을 봐! 원시술사 병력이 서리석 금고로 운집하고 있군.\n\n저 안에 놈들이 해방하겠다는 폭풍이 갇혀 있는 게 분명하다.\n\n<부서진 기억을 떠올리느라 인상을 찌푸리는 엠버탈>\n\n예전에도 싸워서 이긴 적이다. 넬타리온 님께서 반드시 금고를 지켜야 한다고 명령하셨는데, 이유가 기억이 나지 않는군...\n\n사색에 빠져 있을 때가 아니지. 사카레스와 칠흑의 비늘에 합류해라. 적이 금고를 돌파하지 못하게 막아야 한다!', '', '', '', '', '', '서리석 금고에 있는 비늘사령관 사카레스에게 보고해야 합니다.', 47187),
(65075, 'koKR', '치유의 날개', '엠버탈과 대화해야 합니다.', '기원사여, 절체절명의 위기에서 내 웨이른을 구해준 것에 감사를 표한다.\n\n치유의 날개는 힘을 회복하는 대로 나머지 병력과 합류하겠다.\n\n신드레 말로는 엠버탈이 휘하 웨이른 부대를 모두 잃었다고 하더군. 애석하게도... 나는 그런 상처를 아물게 할 만한 마법은 모른다.\n\n엠버탈이 겉으로는 냉정함을 유지하고 있지만 속으로는 깊은 상실감을 느끼고 있을 거다, $n. 내가 가고 있다고 전해다오.', '', '', '', '', '', '엠버탈과 대화해야 합니다.', 47187),
(65074, 'koKR', '쉬운 사냥감', '사이시드 $1oa마리를 처치해야 합니다.', '이 요람을 에워싼 자연 환경은 사이시드의 자생지다. 식탐이 많고 영역 의식과 공격성이 강한 곤충이지. \n\n놈들 관점에서 이곳 부상자들은 잘 차려진 진수성찬으로 보일 거다. 한창 회복 중인 치유사들이 공격당하게 방치할 순 없지.\n\n비리디아는 내가 챙길 테니 그대가 놈들을 처리하도록.\n\n비리디아 그 친구... 보통 용감한 게 아니거든.', '', '', '', '', '', '', 47187),
(65073, 'koKR', '독한 문제', '독 분비선 $1oa개를 채취해야 합니다.', '회복 속도가 제법 빠르군, $n. 다행이야.\n\n요람을 벗어난 이들은 회복 중이다. 문제는 아직 안에 갇혀 있는 이들이지. 구하겠답시고 막무가내로 들어가봤자 지금처럼 내 손에 들려 나오는 신세가 될 것이야.\n\n이 함몰지를 둘러보면 딱정벌레 둥지가 있을 거다. 놈들 독 분비선으로 독의 효과에 저항할 수단을 마련할 수 있다.\n\n내가 직접 가지러 갈 만한 상태는 아니니... 기원사, 그대의 실력을 빌려야 할 것 같군.', '', '', '', '', '', '', 47187),
(65071, 'koKR', '도와줘요!', '꼬마 코를 구출해야 합니다.', '저 좀 도와주세요.\n\n전 토노라고 하고, 탐험을 하고 있었어요. 제가 탐험을 좀 잘하는데, 여동생 코가 따라오고 있는지 몰랐어요. 무슨 일이 생긴 것 같아서 찾는 것 좀 도와주세요. 제발요 네? 제발요.\n\n코는 이 동굴로 들어갔는데, 저처럼 숨기를 잘하는 것도 아니고 부모님도 너무 멀리 계셔서 도우러 오시기엔 힘들 것 같아요. \n\n괴물들보다 먼저 코를 찾아주세요.', '', '', '', '', '', '어린이를 부모의 품으로 돌려보내야 합니다.', 47187),
(65063, 'koKR', '군락 속으로', '신드레스레쉬를 따라가 비리디아를 찾아야 합니다.', '요람에 퍼진 독소가 뭔지는 모르겠지만... 드랙티르 최정예 치유사를 쓰러뜨릴 정도란 말이지.\n\n우리에겐 불안하기 짝이 없는 상황이다, $n.\n\n뭐 상관없다. 저 안에 드랙티르가 갇혀 있지 않나. 무슨 위험이 뒤따르든 진입한다.\n\n숨을 깊이 들이마시고 따라오도록!', '', '', '', '', '', '비리디아와 대화해야 합니다.', 47187),
(65060, 'koKR', '치유사의 함몰지', '치유사의 함몰지에서 신드레스레쉬를 만나야 합니다.', '그대가 마력 신호기를 통해 본 바에 따르면 아직 요람에 갇혀 빠져나오지 못한 드랙티르가 있다. 더는 동포를 잃을 수 없어.\n\n<잠시 미간을 찡그리고 생각에 잠기는 엠버탈>\n\n치유의 날개는 드랙티르 중에서도 가장 우수한 의무병들이지. 치유사의 함몰지에 그들의 요람이 있다. 신드레스레쉬가 길을 알 터.\n\n그 누구도 버리고 가지 않겠어.', '', '', '', '', '', '치유사의 함몰지에서 신드레스레쉬와 대화해야 합니다.', 47187),
(65057, 'koKR', '엠버탈에게로 집결', '엠버탈에게 보고해야 합니다.', '싸움이 끝난 건 좋아. 그런데 아주라텔하고 와서 한다는 얘기가 엠버탈에게 보고하라? 누가 보면 엠버탈이 총사령관이라도 되는 줄 알겠어.\n\n내 생각은 다른데 말이다.\n\n칠흑의 비늘은 오직 대지의 수호자님에게만 복종한다. 지금까지 넬타리온 님의 명령은 단 하나도 없었다.\n\n<도끼눈을 치켜뜨는 사카레스>\n\n그러나... 내가 원시술사의 위협도 알아보지 못할 만큼 꽉 막힌 것은 아니다. 분명 상대해본 적이 있는 건 맞는데, 어떻게 된 일인지...\n\n부하들이 심신을 추스르는 대로 합류하겠다. 이만 가보도록, 기원사여.', '', '', '', '', '', '', 47187),
(65052, 'koKR', '칠흑의 비늘', '비늘사령관 사카레스에게 가야 합니다.', '원시술사의 침략은 어느 정도 일단락됐군. 이제 요람으로 가야 한다.\n\n비늘사령관 사카레스는 누구 못지않게 강인한 인물이고, 휘하 웨이른이 든든하게 전선을 사수하고 있다. 하지만 웬 용이 칠흑의 비늘을 궁지로 몰아넣은 모양이더군. \n\n우리도 가세한다!\n\n선두는 그대에게 맡기겠다. 용이 사정권에 들어오면 신호해라. 그 순간 모든 화력을 투사하겠다.\n\n매복을 조심해. 좋지 않은 예감이 드는군.', '', '칠흑의 비늘을 가두고 있는 고대의 야수입니다.', '에크라자탈', '', '', '비늘사령관 사카레스와 대화해야 합니다.', 47187),
(65050, 'koKR', '창조된 군대', '창조된 정령 $1oa마리를 처치해야 합니다.', '저 원시술사란 놈들이 정령을 소환해대더군. 드랙티르의 대항마로 준비한 거겠지.\n\n우리 눈에 흙이 들어가기 전까지는 어림도 없다.\n\n불의 비를 퍼부어줘라, 기원사여! 이 해안을 침범한 정령을 모조리 불태우고 더 불러내기 전에 소환사들을 처리하도록.', '', '', '', '', '', '폭풍분리 분화구에서 아주라텔을 만나야 합니다.', 47187),
(65049, 'koKR', '타라세크와의 악연', '타라세크 $1oa명을 처치해야 합니다.', '타라세크는 종잡을 수 없고 난폭하지. 어떻게 보면 원시 상태의 용기병을 닮았다고도 할 수 있겠군.\n\n넬타리온 님은 타라세크를 화살받이나 우리를 위한 훈련용 허수아비 정도로 여기셨지. 하나 저들은 교활한 사냥꾼이고, 무리로 접하게 되면 매우 치명적이다.\n\n원시술사로부터 정기의 힘을 받는다면 훨씬 위험해질 거다.\n\n그렇게 둘 순 없지. $n, 놈들의 수를 줄여라.', '', '', '', '', '', '폭풍분리 분화구에서 아주라텔을 만나야 합니다.', 47187),
(65046, 'koKR', '원시술사들', '원시술사의 기원과 목적에 관한 단서를 찾아야 합니다.', '동면의 영향인지 아직 기억이 모호하긴 하지만, 아무튼 우리가 원시술사란 녀석들을 예전에도 상대해본 적 있는 건 분명해요.\n\n<송곳니를 악무는 더비시안>\n\n별 소용은 없네요. 기억을 떠올리려고 해봤자 꿈의 파편을 붙잡으려고 헤매는 기분이니.\n\n당신이라면 운이 더 좋을지도 모르겠군요. 저 침략자들의 동기가 될 만한 물건이나 인물에 관한 단서를 찾아보세요.', '', '', '', '', '', '폭풍분리 분화구에서 더비시안을 만나야 합니다.', 47187),
(65045, 'koKR', '폭풍분리 분화구', '폭풍분리 분화구에서 아주라텔을 만나야 합니다.', '더비시안의 보고가 심히 마음에 걸리는군. 원시술사라는 녀석들이 폭풍분리 분화구를 침략해 칠흑의 비늘을 공성의 요람에서 꼼짝도 못 하게 만들고 있다고 한다.\n\n침략자란 놈들이 난폭한 정령을 소환하는 것도 모자라 미개한 타라세크까지 포섭한 모양이야. \n\n분화구에서 아주라텔이 도움을 기다리고 있을거다. 적과 맞서 싸워라. 날개와 갈퀴발톱으로 우리의 동포를 구해라.\n\n칠흑의 비늘이 안전해지면 사령관들에게 나를 만나러 오라 전해라. 조심해야 한다. 사카레스는... 호락호락하지 않을 거다.', '', '', '', '', '', '폭풍분리 분화구에서 아주라텔과 대화해야 합니다.', 47187),
(65036, 'koKR', '훈련은 실전이다', '비상을 연습해야 합니다.', '고리 통과하기는 적응에 도움이 되는 방식이지만, 우린 피도 눈물도 없이 실전처럼 훈련하죠.\n\n주변 지역에서 비상을 사용해 보세요. 몸에 완전히 익을 때까지요. 당연한 얘기지만 주변 야생동물을 신경 쓰고, 잠재적인 위협을 조심하세요. 우리가 훈련하는 이유가 달리 있는 것도 아니잖아요?\n\n준비됐다고 생각이 들면 엠버탈 님에게 보고하세요. 행운을 빕니다!', '', '', '', '', '', '계속할 준비가 되면 비늘사령관 엠버탈과 대화해야 합니다.', 47187),
(64873, 'koKR', '날개를 펼치고', '활공 시전을 연습해야 합니다.', '많은 동포가 전쟁의 요람을 탈출한 것을 보니 마음이 놓이는군. 내 웨이른은... 그리 운이 좋지 않았지만 말이야.\n\n<잠시 침묵을 지키는 엠버탈>\n\n해안에는 다른 요람들도 있다. 위기에 처한 드랙티르가 한둘이 아니지. 그들을 구하려면 강인한 날개가 뒷받침되어야 할 거다.\n\n집중해라. 훈련을 떠올리도록 해. 다시 날개의 감각을 떠올리는 거다. 힘을 되찾아 다른 요람으로 날아가는 거야.\n\n휴식은 끝났다.', '', '', '', '', '', '', 47187);
INSERT INTO `quest_template_locale` (`ID`, `locale`, `LogTitle`, `LogDescription`, `QuestDescription`, `AreaDescription`, `PortraitGiverText`, `PortraitGiverName`, `PortraitTurnInText`, `PortraitTurnInName`, `QuestCompletionLog`, `VerifiedBuild`) VALUES
(64872, 'koKR', '내면의 불꽃', '불의 숨결을 배우고 강화 공격을 연습해야 합니다.', '$n, 그대는 기원사다. 최고 중의 최고라고 할 수 있지. 우리 모든 웨이른의 방식에 통달한 정예병 아닌가.\n\n그대에 대한 기대가 크다.\n\n비록 동면의 여파로 기억이 조각났다고는 하나, 그대의 몸속에는 용의 힘이 흐르고 있다. 그걸 움켜쥐어라.\n\n기원사의 가장 강력한 무기 중 하나는 바로 숨결이다. 숨을 오래 머금을수록 내면의 불꽃은 더욱더 강력해지지.\n\n훈련장에 들끓는 벌레들 정도면 연습용 과녁으로 적절할 것이야.', '', '', '', '', '', '', 47187),
(64871, 'koKR', '문 앞의 용', '라피사고스를 처치하고 전쟁의 요람을 탈출해야 합니다.', '그 푸른용 놈, 요람을 무너뜨려 우릴 안에 가둘 속셈이로군!\n\n제 입으로 말리고스란 자를 섬긴다고 했지. 낯익은 이름이군. 그런데... 용이 우릴 붙잡아둘 이유가 세상 어디에 있단 말인가?\n\n잘 들어라, $p. 우린 용과 함께 싸우도록 훈련받았지, 적대하도록 길러지진 않았다. 하지만 선택의 여지가 없구나.\n\n용단을 내릴 때다, 기원사여.', '', '당신의 탈출로를 가로막고 있습니다.', '라피사고스', '', '', '', 47187),
(64866, 'koKR', '도가니 속으로', '요람을 떠날 준비를 해야 합니다.', '기원사여, 그대의 능력이 필요하다.\n\n요람은 무너지고 있고, 보급품은 얼마 없는 상황이다. 무슨 수를 써서라도 출구로 빠져나가야 해. 문제는 이 비전 방벽이 길을 막고 있지.\n\n저 너머 방에 도움이 필요한 드랙티르들이 있다. 저들의 상처를 치유하도록. 방해꾼은 모조리 처단해도 좋다.\n\n이번이 이 전당을 누비는 마지막일지도 모른다, $n|1이여;여;. 실수하지 말도록.', '', '', '', '', '', '', 47187),
(64865, 'koKR', '장비 착용', '무기와 방어구, 보급품을 입수해야 합니다.', '적의 침략에, 마법 정지장에 갇히질 않나, 심지어 요람은 붕괴할 기미를 보이고 있으니...\n\n이래서 훈련을 하는 것이다, $n. 확실하지 않을 때는 배운 대로 움직이는 게 상책이지.\n\n급선무부터 해결하도록 하지. 무기, 방어구, 보급품을 확보해야 한다. 내가 전력을 추스를 동안 그대는 주변을 살펴 장비를 갖추도록.\n\n그다음에 할 일은 대지의 수호자님을 찾는 거다. 넬타리온 님이라면 이 상황을 명쾌하게 설명해주실 수 있겠지.', '', '', '', '', '', '', 47187),
(64864, 'koKR', '드랙티르의 각성', '다른 드랙티르들을 깨워야 합니다.', '<끝없이 이어졌던 것만 같은 잠기운을 떨쳐내자 희미한 찰나의 기억만이 남습니다.\n\n눈앞에 보이는 드랙티르는 알 수 없는 마법으로 제자리에 얼어붙은 채, 미동도 하지 않습니다. 당신은 내면에서 아군을 해방할 힘이 있다는 걸 느꼈습니다.\n\n이처럼 정지 상태인 자들이 요람에 또 있을지도 모릅니다. \n\n이들을 깨우는 것은 당신의 임무입니다.>', '', '', '', '', '', '비늘사령관 아주라텔과 대화해야 합니다.', 47187),
(64863, 'koKR', '비전의 수호자', '수호자 또는 피조물 $1oa마리를 처치해야 합니다.', '요람을 순찰하는 자동화된 피조물과 수호자들은 대지의 수호자 마법으로 움직이는 것 같지 않아요.\n\n<눈을 가늘게 뜨는 더비시안>\n\n적을 내부에 둘 수는 없습니다.\n\n저것들을 파괴해 우리의 앞길을 열어주세요.', '', '', '', '', '', '', 47187),
(63948, 'koKR', 'Seeking the Seeker\'s Staff [PH]', '조각난 지팡이의 파편 세 개를 회수해야 합니다.', '우리는 조각난 지팡이라는 별명을 붙인 유물의 성질을 연구하고 있었습니다.\n\n하나로 조립되어 있을 땐 지나치게 불안정한지라 세 개의 조각으로 나눠 뒀죠.\n\n침략자들이 지팡이를 찾거나 그 성질을 알고 있었던 것 같진 않고, 그냥 조각을 찾아내기만 한 모양입니다. 서로 다른 나락살이 구성원이 조각을 맡고 있더군요.\n\n빨리 조각을 회수해야 합니다.\n\n조각들이 실은 훨씬 위험한 유물의 일부라는 사실이 들통나는 건 시간 문제나 다름없어요.', '', '', '', '', '', '', 47187),
(63947, 'koKR', 'Raiders in the Ruins [PH]', '나락살이 침략자 $1oa명을 처치해야 합니다.', '전 폭력을 혐오합니다. 이성적인 대응으로 갈등을 해결하는 것을 선호하죠. 한데 지금은 대안이 없군요.\n\n무사히 대피하려면 공격자들을 흩뜨려놔야 합니다. 로도뭄을 침공한 나락살이에게 결정적인 타격을 입혀야 할 거예요.\n\n저들 병력을 처리해 주시길.', '', '', '', '', '', '', 47187),
(62265, 'koKR', '새로운 모험이 기다린다', '오그리마로 가서 새로운 모험을 떠나야 합니다. 60 레벨을 달성하면 크로미의 마법이 소진되고 오그리마로 귀환합니다.', '$n 님! 현재로 돌아와 주세요. 여기 상황이... 아니지. 돌아와서 직접 보시는 게 좋겠어요.\n\n얼른 일을 마무리하고 돌아오세요. 더는 용사님을 과거에 둘 수가 없게 됐으니까요!', '', '', '', '', '', '오그리마로 가서 새로운 모험을 떠나야 합니다.', 47187),
(62250, 'koKR', '새로운 모험이 기다린다', '스톰윈드로 가서 새로운 모험을 떠나야 합니다. 60 레벨을 달성하면 크로미의 마법이 소진되고 스톰윈드로 귀환합니다.', '$n 님, 현재로 돌아와 주세요. 여기 상황이... 아니지. 돌아와서 직접 보시는 게 좋겠어요.\n\n얼른 일을 마무리하고 돌아오세요. 더는 용사님을 과거에 둘 수가 없게 됐으니까요!', '', '', '', '', '', '스톰윈드로 가서 새로운 모험을 떠나야 합니다.', 47187),
