(53211, 'koKR', '아라시 기부: 해안 치유 물약', '보랄러스 항구에 있는 첼시 스트랜드를 위해 해안 치유 물약 $1oa개를 모아야 합니다.', '다가올 전쟁에 대비해 아군이 보급품을 비축하는 중이라고 들었어요. 혹시 해안 치유 물약을 발견하게 된다면, 우리 창고로 보내주시면 정말 감사하겠어요.', '', '', '', '', '', '', 47187),
(53159, 'koKR', '아라시 기부: 거친 가죽', '보랄러스 항구에 있는 찰레인에게 거친 가죽 $1oa개를 기부해야 합니다.', '이제 전쟁을 끝낼 때라고 생각하지 않소? 그대가 도와준다면 아군이 다가올 전투에 대비할 수 있도록 필요한 물자와 장비를 받을 수 있을 것이오.\n\n우리 아군이 만전의 준비를 할 수 있도록 도와주시오.', '', '', '', '', '', '', 47187),
(52164, 'koKR', '코가 비뚤어지게!', '', '', '', '', '', '', '', '', 47187),
(43609, 'koKR', '현상 수배: 파멸의 군주 카즈로크', '', '', '', '', '', '', '', '', 47187),
(43091, 'koKR', '위험: 일급 비전골렘', '', '', '', '', '', '', '', '', 47187),
(42820, 'koKR', '위험: 아이기르 파도파괴자', '', '', '', '', '', '', '', '', 47187),
(42757, 'koKR', '영혼의 아귀: 심해의 위협', '', '', '', '', '', '', '', '', 47187),
(37924, 'koKR', '바다의 회수 작업', '보급품 더미 $1oa개에 깃발로 표시를 남겨야 합니다.', '자네가 저 못된 녀석들을 처리하는 동안, 쓸 만한 자원이 쌓여 있으면 표시를 남겨 주게. 그러면 우리 일이 무척 편해질 테니까.$b$b이 깃발을 내려 놓기만 하면, 누군가 찾아갈 거야!', '', '', '', '', '', '', 47187),
(37484, 'koKR', '대장의 호루라기', '장군 우셰트 울프바저에게 유물 조각 100개를 가져가 대장의 호루라기를 받아야 합니다.', '', '', '', '', '', '', '', 47187),
(37483, 'koKR', '대장의 호루라기', '앤 던월디에게 유물 조각 100개를 가져가 대장의 호루라기를 받아야 합니다.', '', '', '', '', '', '', '', 47187),
(37114, 'koKR', '초루나', '', '', '', '', '', '', '', '', 47187),
(37113, 'koKR', '티살리 크로우', '', '', '', '', '', '', '', '', 47187),
(34213, 'koKR', '납치된 아들', '코르키의 우리 열쇠를 찾아 코르키를 구출해야 합니다.', '$p 님, 절 좀 도와주십시오! 강철 호드의 한 사악하고 무지막지한 오크로부터 몸값을 요구하는 쪽지를 받았습니다.$b$b이놈이 제 아들을 데리고 있습니다.$b$B몸값을 내지 않을 경우 아들에게 할 짓을 아주 생생하게 묘사했더군요. 우리 종족이 황천에서 황금을 만들어 낼 수 있다고 생각하는 게 틀림없습니다. 제가 아들을 직접 구하러 나서면 둘 다 죽고 말 겁니다.$b$b그롬마르에 가서 제 아들을 구해주시겠습니까?$b$b아들 이름은 코르키입니다.', '', '', '', '', '', '', 47187),
(31756, 'koKR', '비 올 확률 99.9%', '폭풍소환기를 파괴해야 합니다.', '모구가 황금 계단으로 불길한 폭풍을 불러들이고 있어. 모구와 번개는 썩 기분 좋은 조합은 아니란 말야. 모구를 막아야 해.$B$B놈들의 폭풍몰이 지팡이를 찾는 건 어렵지 않을 거야. 지팡이에서 번개가 커다란 호를 그리며 뻗어 나오고 있을 테니 말이야. 지팡이를 넘어뜨리거나 파괴해 주겠어? 그러면 발 뻗고 잘 수 있을 것 같아.', '', '', '', '', '', '', 47187),
(31685, 'koKR', '네 바람의 계곡', '네 바람의 계곡으로 순간이동하여 병사 팀 P. 오래리와 대화해야 합니다.', '아이고, 비취 숲에서는 지금 전면적인 개편 작업이 이루어지고 있어. 하지만 네 바람의 계곡은 탐험할 만하지. 떠날 준비가 되면 나한테 말만 하라고. 필요한 데까지 데려다 줄 테니까. 여행에 필요한 장비를 구하려면 그곳에 가서 내 친구한테 이야기해 봐.', '', '', '', '', '', '', 47187),
(31644, 'koKR', '붉은십자군 수도원 도전 모드 - 은 추가 (N번째)', '', '', '', '', '', '', '', '', 47187),
(30312, 'koKR', '또 한 번의 기회', '부상당한 파수병 6명을 치유해야 합니다.', '한 분대가 무모하게 동쪽 길을 통해서 황금 계단을 공격하려 하다가 포탄 세례를 받았어요. 살아 온 사람도 상태가 안 좋고, 전장에도 아직 부상자가 흩어져 있지요.$B$B자, 여기 붕대를 받으세요. 이 붕대를 쓰거나, 치유 능력이 있다면 그 능력을 이용해서 부상당한 파수병을 치유해 주세요.$B$B서둘러 주세요. 시간이 없으니까요.', '', '', '', '', '', '', 47187),
(27637, 'koKR', '마티아스와 단둘이', '황혼의 고원의 황혼 성채에서 단장 마티아스 쇼를 찾아야 합니다.', '지금까지의 노력이 모두 무용지물이 되었군. 망할 초갈 자식!$B$B마티아스가 어디 있는지 분대 지휘관이 미리 알려 줘서 그나마 다행이오.', '', '', '', '', '', '', 47187),
(27608, 'koKR', '더러워도 없는 것보단 낫다', '자브록스와 비블포드의 머리카락 네 타래를 모아야 합니다.', '곧 황혼 관문 공격을 시작할 거요. 하지만 그 전에 매듭지을 일이 딱 하나 더 있소. 초갈의 사도, 자브록스와 비블포드를 없애는 것이지.$B$B정찰 요원들이 이 두 오우거가 사도의 동굴 안에 있다고 보고했소. 황혼 관문 남서쪽 구석에 있는 조그만 오우거 동굴이지.$B$B동굴에 들어가서 두 오우거를 없애 주겠소?', '', '', '', '', '', '', 47187),
(27588, 'koKR', '공격 신호 보내기', '황혼 관문에 있는 탑 중 하나에 올라가 공격 신호를 보내야 합니다.', '태산 해골분쇄자를 황혼 관문에서 꾀어내는 데 성공했군. 이제 우리 병력에 공격 신호를 보내 주게!', '', '', '', '', '', '', 47187),
(27308, 'koKR', 'The Elements Cry Out', 'Speak to Earthmender Norsala in Orgrimmar.', 'Do you feel it, $c?  The elements are uneasy. We members of the Earthen Ring have struggled to find the cause of the unrest.  Thus far we have been unsuccessful and now turn to others that may aid us.  Speak with Earthmender Norsala in Orgrimmar and see what tasks she may have for you.', '', '', '', '', '', 'Speak to Earthmender Norsala in Orgrimmar.', 47187),
(26903, 'koKR', '수입업자 윌릭스', '수입업자 윌릭스를 호위해 가시덩굴 우리에서 나가야 합니다.', '아, 드디어 구세주가 왔군!$B$B내가 이곳에 얼마나 오래 갇혀 있었는지 모를걸. 마지막으로 바깥세상 구경한 게 언제인지 기억도 나질 않으니...$B$B보다시피, 나는 사업가야. 사람들은 돈벌레라고도 부르지. 그러다 우연히 시장에서 돼지주둥이가 비싼 가격에 팔린다는 소문을 듣고 왔어. 쉽게 들어왔다 빠져나갈 수 있을 줄 알았는데, 보다시피 잘못 생각했던 모양이야.$B$B어쨌든, 여기서 나갈 수 있게 도와준다면 후하게 보상할게.', '수입업자 윌릭스가 가시덩굴 우리에서 탈출하도록 호위', '', '', '', '', '가시덩굴 우리 출구에 있는 수입업자 윌릭스와 대화해야 합니다.', 47187),
(25295, 'koKR', '속사포 시험', '가까운 표적에 공격형 기계보행전차의 속사포를 시험해야 합니다.', '안전 시스템, 작동 중!, 모터 기능, 이상 없음! 이제 속사포 발사 시험만 남았군.$b$b아주 어려운 건 아닐세, $n. 뒤쪽 언덕에 있는 기계보행전차에 인체에 무해한 탄알을 장전했으니까 주변 표적에 몇 발 쏘고 난 뒤 다시 이리로 오게.', '', '', '', '', '', '', 47187),
(25289, 'koKR', '일보 앞으로...', '기동형 기계보행전차의 기동성을 시험해야 합니다.', '사출 좌석이 잘 작동하니까, 이제 기동에 관한 시험을 해봐야겠군. 이 전차는 아주 특별한 기능을 가지고 있네. 바로 교묘한 회피 기능이지!$b$b왼쪽과 오른쪽 다리 제어장치 작동 여부와 교묘한 회피 기능을 시험해 주게.$b$b쉬운 일이니까 그렇게 오래 걸리지는 않을 것이네.', '', '', '', '', '', '', 47187),
(24662, 'koKR', '왕관사 무너뜨리기', '먼지진흙 습지대의 테라모어 밖에 있는 왕관 폭도 5명을 처치하고 스내글볼트의 코륨 폭탄으로 화학약품 수레 하나를 파괴한 후 스톰윈드에 있는 수사반장 스닙 스내글볼트에게 돌아가야 합니다', '이 장부엔 위치가 가득 표시되어 있군. 이봐, 자네가 이 기록을 조사하고 조치를 해줬으면 해. 더는 이 일을 질질 끌 수 없어.$b$b내가 말한 곳을 조사해줘. 먼지진흙 습지대의 테라모어에 있는 감시초소 근처야. 얼른 가서 놈들에게 본보기를 보여줘.$b$b아, 그리고 만약 크고 위험해 보여서 파괴해야 할 것 같은 무언가를 발견하면 이 폭탄을 던지라고.', '', '', '', '', '', '', 47187),
(24659, 'koKR', '왕관사 무너뜨리기', '어둠해안에 있는 고대정령의 숲 남쪽의 왕관 폭력배 5명을 처치하고 스내글볼트의 코륨 폭탄으로 화학약품 수레 하나를 파괴한 후 스톰윈드에 있는 수사반장 스닙 스내글볼트에게 가야 합니다.', '이 장부엔 위치가 가득 표시되어 있군. 이봐, 자네가 이 기록을 조사하고 조치를 해줬으면 해. 더는 이 일을 질질 끌 순 없어.$b$b내가 말한 곳을 조사해줘. 어둠해안에 있는 고대정령의 숲 남쪽이야. 녀석들이 좋은 일을 꾸미고 있을 리 없지. 얼른 가서 놈들에게 본보기를 보여줘.$b$b아, 그리고 만약 크고 위험해 보여서 파괴해야 할 것 같은 무언가를 발견하면 이 폭탄을 던지라고.', '', '', '', '', '', '', 47187),
(24658, 'koKR', '왕관사 무너뜨리기', '엘윈 숲의 외곽 서쪽시내 주둔지의 북동쪽에 있는 왕관 하수인 5명을 처치하고 스내글볼트의 코륨 폭탄으로 화학약품 수레 하나에 피해를 입힌 후 스톰윈드에 있는 수사반장 스닙 스내글볼트에게 가야 합니다.', '이 장부엔 위치가 가득 표시되어 있군. 이봐, 자네가 이 기록을 조사하고 조치를 해줬으면 해. 더는 이 일을 질질 끌 순 없어.$b$b먼저 이곳을 조사해줘. 엘윈 숲의 바로 외곽 서쪽시내 주둔지의 북동쪽으로 보이는군! 녀석들이 좋은 일을 꾸미고 있을 리 없지. 얼른 가서 놈들에게 본보기를 보여줘.$b$b아, 그리고 만약 크고 위험해 보여서 파괴해야 할 것 같은 무언가를 발견하면 이 폭탄을 던지라고.', '', '', '', '', '', '', 47187),
(14276, 'koKR', '고정 사격', '3 레벨에 도달하여 고정 사격 기술을 습득하고, 붉은송곳니 늑대인간에게 고정 사격을 2번 사용해야 합니다.', '자, 좋은 소식과 나쁜 소식이 있다.$B$B일단 나쁜 소식은, 숲 속에는 이곳보다 더 많은 늑대인간이 있다는 건데... 그래서 결국 안전한 곳은 어디에도 없다는 거다.$B$B좋은 소식은 네가 새 기술을 사용하는 방법을 알아가고 있다는 것이다. 경험을 계속 쌓다 보면, 새 기술을 사용하는 방법을 배우게 될 거야.$B$B새 기술을 배우고 나면 이곳 서쪽에 있는 붉은송곳니 늑대인간에게 한번 직접 연습해 봐.', '', '', '', '', '', '', 47187),
(14086, 'koKR', '오그리마에서 타는 법 배우기', '오그리마의 명예의 골짜기에 있는 킬다르에게 이 전단지를 가져가야 합니다.', '타기 훈련과 탈것을 광고하는 이 전단지는 킬다르가 발송한 것입니다.$B$B킬다르는 오그리마에 있는 명예의 골짜기에서 만날 수 있습니다.', '', '', '', '', '', '', 47187),
(13914, 'koKR', '불타는 로크 깃털', '새끼 맹독가죽에게 불타는 로크 깃털 5개를 가져가야 합니다.', '당신이 이해해 줄지 궁금하다는 눈길로 새끼 맹독가죽이 당신을 잠깐 쳐다봅니다. 맹독가죽은 땅바닥에 깃털을 한 쌍 그리더니, 발톱을 내밀어 자기 팔꿈치와 무릎에 감긴 띠를 가리킵니다.$B$B배가 고픈 것 같지는 않은데, 대체 왜 깃털을 원하는 걸까요?$B$B아마도 당신이 본 다른 랩터들처럼 깃털로 몸을 치장하고 싶은가 봅니다. 덤불나무 골짜기 북동쪽, 타나리스 서부에 있는 커다란 생명체의 주변에 불타는 로크가 모여 있습니다. 불타는 로크의 커다란 깃털을 가져다주어야겠습니다.', '', '', '', '', '', '', 47187),
(13247, 'koKR', '죽음의 증거: 지맥 수호자 에레고스', '달라란의 대마법사 랜달록이 지맥 동조기를 하나 가져다 달라고 했습니다.$B$B이 퀘스트는 던전 난이도를 영웅으로 설정한 후 수행해야 합니다.', '마력의 탑을 둘러싼 전쟁의 화염이 거세지고 있습니다. 우리는 전세를 바꾸어 놓을 무언가가 필요합니다! $n|1이여;여;, 전투의 심장부로 침투해 주시겠습니까?$B$B말리고스가 아제로스 지맥의 마력을 옮길 목적으로 사용하고 있는 수송관이 있는데, 지맥 수호자 에레고스가 지금 이 관을 지키고 있습니다. 만약 에레고스를 해치운다면 적에게 큰 타격을 입힐 수 있을 것입니다.$B$B연구 목적으로 필요할 수도 있으니 에레고스의 지맥 동조기를 하나 가지고 오십시오.', '', '', '', '', '', '', 47187),
(13244, 'koKR', '티미어의 예언: 티타늄 선봉대원!', '달라란의 대마법사 티미어의 예언에 따라 티타늄 선봉대원 7명을 처치해야 합니다.', '아제로스의 운명이 위험에 처해 있습니다. 광기의 신 로켄이 우리 모두를 파멸시킬 수 있는 힘을 수중에 얻었습니다!$B$B번개의 전당에 위치한 현세의 감시탑 안에서 티타늄 선봉대원들이 로켄의 무시무시한 음모를 실행에 옮길 준비를 하고 있습니다. 셀 수 없이 많은 무고한 희생자들이 생길 것입니다.$B$B미래를 봤습니다, $n|1이여;여;. 당신이 바로 이 음모를 막을 인물입니다.', '', '', '', '', '', '', 47187),
(12776, 'koKR', '엑소다르로', '주교 라자릴이 엑소다르에 있는 벨렌에게 빛이 깃든 유물을 가져가 달라고 했습니다.', '우리 기도자들이 대답을 얻었습니다! 샤트라스에 있는 나루들에게서 나온 빛에 관한 전념과 믿음으로부터 비롯된 공동의 축복을 바탕으로 심력의 성스러운 유물을 만들었답니다. 이 유물들은 리치 왕의 음모에 맞선 무기가 될 겁니다.$B$B이 유물을 받으세요. 만반의 태세로 지켜내 엑소다르로 안전하게 운반하세요. 빛의 전당에 계시는 예언자 벨렌 님께 전해 그분께서 북쪽에서부터 내려오는 부정한 군대에 대항하여 이 유물의 힘을 사용하실 수 있도록 하세요.', '', '', '', '', '', '', 47187),
(10902, 'koKR', '비약의 대가', '시간의 동굴의 검은늪에 가서 균열의 군주와 균열의 문지기를 처치하고 무한의 정수 10개를 획득해야 합니다. 무한의 정수와 함께 일급 방어의 비약, 정통의 비약, 일급 민첩의 비약을 5개씩 만들어서 샤트라스, 고난의 거리에 있는 로로킴에게 가져가십시오.$B$B*경고!* 연금술 전문화는 하나만 선택할 수 있습니다.', '최고의 비약을 만들기 위해 제 일생을 바쳤습니다. 하지만, 아직 영생의 비약 제조에는 성공하지 못했습니다.$B$B빠뜨린 재료가 뭔지 알 것 같아요. 아제로스에 시간의 동굴이라는 곳이 있는데 균열의 군주와 균열의 문지기라고 하는 놈들이 시간을 멈췄다 풀었다 한다고 들었습니다.$B$B놈들은 시간 자체를 찢고 무한히 왜곡해서 결정화된 정수로 만들고 있습니다. 정수와 함께 몇 가지 비약을 만들어서 가져오십시오. 그러면 제 지식을 전수해 드리겠습니다.', '', '', '', '', '', '', 47187),
(9673, 'koKR', '야수 길들이기', '실버문에 있는 할데니스와 대화해야 합니다.', '그대가 선택한 야수와 결속을 맺는 일 말고도 야수를 돌보고 훈련시키는 복잡한 과정이 남아 있습니다. 이번 일은 실버문의 야수 조련사 할데니스가 알려줄 것입니다.$b$b그는 내 제자들을 최고로 존중하지요. 단, 제자들이 똑같은 존경심을 보여줄 때만 말입니다. 날 실망시키지 마십시오.', '', '', '', '', '', '', 47187),
(3784, 'koKR', '대드루이드 룬토템 돕기', '썬더 블러프에 있는 대드루이드 하뮬 룬토템과 대화해야 합니다.', '손님, 괜찮으시다면 잠시만 시간을 내주시겠습니까?$B$B썬더 블러프의 세나리온 의회에서는 아주 중요한 연구 작업에 당신처럼 노련한 모험가들을 찾고 있다고 합니다. 자세한 내용은 모르지만 이 연구 조사를 다름 아닌 하뮬 룬토템 님께서 직접 지휘하고 있다는 것만은 말씀드릴 수 있습니다.$B$B혹시 관심이 있으시다면 썬더 블러프에 있는 장로의 봉우리에서 그분과 직접 얘기를 나눠 보십시오.', '', '', '', '', '', '', 47187),
(1359, 'koKR', '진게의 소포', '언더시티에 있는 연금술사 진게에게 늑대 심장 견본을 가져가야 합니다.', '자네가 가져온 이 늑대 심장들은 다른 비슷한 견본들에서는 보지 못한 성질을 갖고 있네. 이 심장에는 심장이 뛰고 있는 늑대 자신에게 치명적인 영향을 미치는 독성이 있어!$B$B정말 놀라운 일이야. 반드시 더 연구해 봐야겠어. 자네가 가져온 심장 중 몇 개는 내가 견본으로 갖고 있네. 그것들을 내 동료인 연금술사 진게에게 가져다주게. 언더시티에 있는 우리 본부에서 진게를 만날 수 있을 걸세.', '', '', '', '', '', '', 47187),
(1183, 'koKR', '고블린 후원', '소금 평원에 있는 포직에게 연료조절장치 설계도를 전해야 합니다.', '자, 준비가 다 됐으니 어서 떠날 채비를 하게. 포직에게 날 대신해 안부를 전하고 필요한 게 있으면 망설이지 말고 얘기하라고 전해 주라고. 머지않아 그가 경주 기록을 경신했다는 소식을 들을 수 있기를 기대하지.', '', '', '', '', '', '', 47187),
(828, 'koKR', '마르고즈', '마르고즈와 대화해야 합니다.', '우리 주술사 마르고즈가 불타는 칼날단의 음모에 대한 새로운 사실을 하나 알고 있네. 그가 오그리마 외곽의 산 속에 있는 해골 바위굴에 대해 알려 주었지. 그곳에는 수많은 불타는 칼날단 이교도들이 숨어 있다고 하네.$B$B해골 바위굴로 가기 전에 마르고즈를 만나 얘기해 보도록 하게. 그는 현명한 자이니까 분명 도움이 될만한 조언을 얻을 수 있을 거야.$B$B지금 북쪽에 있는 모래바람 협곡과 해안가 사이에서 야영을 하고 있네.$B$B그의 조언을 따르게, 하지만 그가 뭐라고 하든 자네가 그 숭배자 놈들을 처치해야 한다는 사실은 변함이 없네!', '', '', '', '', '', '', 47187),
(804, 'koKR', '사르코스', '동굴 막사에 있는 고르넥에게 하나주아의 현재 상황을 전해야 합니다.', '당신이 저를 위해 해준 용감한 행동에 크게 감명 받았습니다. 제가 이렇게 쉽게 죽을 수는 없지 않겠습니까? 전 반드시 이겨 낼 것입니다!$b$b하지만 다른 이의 도움 없이는 동굴 막사로 돌아갈 수 없다는 게 문제입니다. 동굴 막사로 돌아가 고르넥에게 제 상황을 좀 전해 주십시오. 아마 그는 절 도와 줄 수 있을 겁니다.', '', '', '', '', '', '', 47187);
